INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('00230645-15ec-4da9-93d7-2f3d64d39f85', 'Nike', 'Nike Dunk', 'White/Black-White', 'New', 'CN', 'The Nike Dunk Low Retro White Black PS features an entirely white leather upper with black overlays. The touches of black continue to the Swoosh branding, and the vintage basketball shoe is finished off with a padded collar and nylon mesh tongue, a white midsole, and a black outsole and treading. <br><br>The Nike Dunk Low Retro White Black PS was released in March 2021 and originally retailed for $65.', 'child', 'https://images.stockx.com/images/Nike-Dunk-Low-Retro-White-Black-PS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1624468188', 'White Black Panda (2021) (PS)', 1, '2021-03-10', 65, 'Nike Dunk Low Retro', 'Nike-Dunk-Low-Retro-White-Black-PS', 'Nike Dunk Low Retro White Black Panda (2021) (PS)', 'sneakers+nike+nike+dunk+low+white/black-white+2021-03-10+65+cw1588-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('0042f5c5-8be4-4a40-982b-1b31dacec04b', 'Nike', 'Nike Basketball Dunk', 'Midnight Navy/Marine Minuit', 'New', 'VN', 'Drawing inspiration from passports and government documentation, the Nike Dunk Low Union Passport Pack Pistachio features a light green and navy leather upper that is shrouded in a semi-translucent ripstop nylon. A Walter Lee Young-inspired emblem at the heel and a yellow Union LA tab on the quarter panel adds a touch of customization. At the base, a semi-translucent sole completes the design.<br><br>The Nike Dunk Low Union Passport Pack Pistachio released in February of 2022 and retailed for $150.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Union-Midnight-Navy-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1646233505', 'Union Passport Pack Pistachio', 1, '2022-02-11', 150, 'Nike Dunk Low', 'Nike-Dunk-Low-Union-Midnight-Navy', 'Nike Dunk Low Union Passport Pack Pistachio', 'sneakers+nike+nike basketball+dunk+low+midnight navy/marine minuit+2022-02-11+150+dj9649-401');
