INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('0226dad3-f1d3-4769-ad3f-c5b08170e70f', 'Nike', 'Nike Dunk', 'Sail/Black/Chile Red/Black', 'New', 'VN', 'The Nike Dunk Low EMB NBA 75th Anniversary Chicago GS shoe commemorates the 75th anniversary of the National Basketball Association with a Chicago Bulls inspired colorway.<br><br>The Nike Dunk Low EMB NBA 75th Anniversary Chicago GS features a velvety and supple leather construction. The shoe offers a base of white with black and chile red overlays that make these shoes pop when you wear them. Another nice feature added to these shoes are the diamond-etched lace dubraes that are sure to make a statement.<br><br>These great shoes had their release in October of 2021 and have a retail price of $85.', 'child', 'https://images.stockx.com/images/Nike-Dunk-Low-EMB-NBA-75th-Anniversary-Chicago-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1656421723', 'NBA 75th Anniversary Chicago (GS)', 1, '2022-03-01', 85, 'Nike Dunk Low EMB', 'Nike-Dunk-Low-EMB-NBA-75th-Anniversary-Chicago-GS', 'Nike Dunk Low EMB NBA 75th Anniversary Chicago (GS)', 'sneakers+nike+nike+dunk+low+sail/black/chile red/black+2022-03-01+85+do6288-100');
