INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('02a1f163-4072-4297-9f68-a24e397da290', 'Jordan', 'Air Jordan Five', 'Sail/Fire Red-Muslin-Black', 'New', 'CN', 'Virgil Abloh added a second colorway to his Jordan 5 collaboration with the Jordan 5 Retro High Off-White Sail, now available on StockX. This release pays homage to the first Jordan that Virgil ever owned, the Air Jordan 5. In signature fashion, Virgil has reimagined this classic silhouette in a way that embraces the importance of Nike Air technology. This Jordan 5 is comprised of a sail textile mesh upper with translucent netted panels and circular window inserts throughout the shoe. 3M reflective tongues, fire red Jordan branding, and an aged translucent outsole completes the design. These sneakers released in 2020 and retailed for $225.', 'men', 'https://images.stockx.com/images/Air-Jordan-5-Retro-Off-White-Sail-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1609357048', 'Off-White Sail', 1, '2020-10-29', 225, 'Jordan 5 Retro', 'Air-Jordan-5-Retro-Off-White-Sail', 'Jordan 5 Retro Off-White Sail', 'sneakers+jordan+air jordan+five+virgil abloh+collections-filter+nike-off-white+jordan off white+sail/fire red-muslin-black+2020-10-29+225+dh8565-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('02e85dd2-c260-45d8-8318-b12833dbcc79', 'Nike', 'Nike Dunk', 'Dark Marina Blue/White-Dutch Blue', 'New', 'VN', 'Drawing comparison to the 2001 Japanese-exclusive Nike Dunk Low Argon, the Nike Dunk Low Dark Marina Blue features a tonal blue smooth leather upper with contrasting white leather Swooshes. From there, woven Nike tongue labels and white Air soles complete the design.<br><br>The Nike Dunk Low Marina Blue released in March of 2022 and retailed for $100.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Dark-Marina-Blue-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1644311937', 'Dark Marina Blue', 1, '2021-12-01', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Dark-Marina-Blue', 'Nike Dunk Low Dark Marina Blue', 'sneakers+nike+nike+dunk+low+dark marina blue/white-dutch blue+2021-12-01+100+dj6188-400');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('03b02fb4-149c-4b15-8720-75515a57fe74', 'Jordan', 'Air Jordan One', 'Black/Gym Red-Particle Grey', 'New', 'ID', 'The Air Jordan 1 Mid Shadow Red (GS) for grade schoolers has black laces that lay on top of a black tongue, with the Air Jordan logo appearing in red at the very top of the tongue.<br><br>The Air Jordan 1 Mid Shadow Red (GS) for grade schoolers top model has a white sole, with its upper body featuring several different colors, including black, grey, and red. The famous Nike swoosh symbol appears on the side of the shoe in black, with the shoe logo appearing in red just above it.<br><br>The Air Jordan 1 Mid Shadow Red (GS) for grade schoolers for grade schoolers was first released in October of 2021. It had an initial retail price of $120.', 'child', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Shadow-Red-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1649427512', 'Shadow Red (GS)', 1, '2021-10-06', 95, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Shadow-Red-GS', 'Jordan 1 Mid Shadow Red (GS)', 'sneakers+jordan+air jordan+one+black/gym red-particle grey+2021-10-06+95+554725-096');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('03c9162b-8d97-4838-b9a1-c40374ced74a', 'New Balance', 'New Balance 550', 'White/Red', 'New', 'CN', 'With a similar look as the New Balance 550 Aimé Leon Dore Red, the New Balance 550 White Red features a white leather upper with red mesh collars and accents. At the quarter panel, a puffed New Balance logo nods to designs from New Balance''s early basketball collections. From there, a woven New Balance tongue label completes the design.<br><br>The New Balance 550 White Red released in 2021 and retailed for $110.', 'men', 'https://images.stockx.com/images/New-Balance-550-White-Red-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1630617711', 'White Red', 1, '2022-02-15', 110, 'New Balance 550', 'New-Balance-550-White-Red', 'New Balance 550 White Red', 'sneakers+new balance+new balance+550+550+white/red+2022-02-15+110+bb550se1');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('041e36e7-6cc9-4178-b769-5e0c8d5f2d14', 'Converse', 'Converse Chuck Taylor', 'White/Red/Egret', 'New', 'VN', 'The women''s Converse Chuck Taylor All-Star Lift Hi White Red (W) features a cream canvas upper with red embroidered heart detailing adjacent to the eyestay. From there, a signature rubber toe cap and matching sole complete the design.<br><br>The women''s Converse Chuck Taylor All-Star Lift Hi White Red (W) released in February of 2022 and retailed for $100.', 'women', 'https://images.stockx.com/images/Converse-Chuck-Taylor-All-Star-Lift-Hi-White-Red-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1647013407', 'White Red (W)', 1, '2022-02-21', 100, 'Converse Chuck Taylor All-Star Lift Hi', 'Converse-Chuck-Taylor-All-Star-Lift-Hi-White-Red-W', 'Converse Chuck Taylor All-Star Lift Hi White Red (W)', 'sneakers+converse+converse+chuck taylor+white/red/egret+2022-02-21+100+a01599c');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('045ae5b2-b79e-47c2-8f71-f82ab57df7a5', 'adidas', 'adidas Yeezy', 'Onyx/Onyx/Onyx', 'New', 'CN', 'The adidas Yeezy Foam RNR Onyx arrives with an Onyx, oval-cut foam construction made of part EVA and algae. At the base, a cushioned footbed offers comfort and support, while a sculptural sole with deep treads provides traction.<br><br>The adidas Yeezy Foam RNR Onyx released in June of 2022 and retailed for $80.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Foam-RNNR-Onyx-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1654264132', 'Onyx', 1, '2022-06-08', 80, 'adidas Yeezy Foam RNR', 'adidas-Yeezy-Foam-RNNR-Onyx', 'adidas Yeezy Foam RNR Onyx', 'sneakers+adidas+adidas+yeezy+foam rnnr+onyx/onyx/onyx+2022-06-08+80+hp8739');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('0462df5d-9cd1-4a8d-a4f8-1f2daab4982b', 'Nike', 'Air Max VaporMax', 'Black/Black-Anthracite-Black', 'New', 'VN', 'The Nike Air VaporMax 2021 FK Black Anthracite (GS) for grade schoolers was designed with both utility and sustainability in mind. <br><br>The uppers are made out of stretchy and breathable Flyknit fabric, and they are adorned by the brand’s iconic Swoosh symbol. There is also a classic Nike symbol that is featured on the insoles. The Nike Air VaporMax 2021 FK Black Anthracite is made out of 40% recycled content by weight. The Nike Air VaporMax 2021 FK Black Anthracite (GS) for grade schoolers has two cushioning units that are sizable yet sleek. These units sit across recycled rubber outsoles and are bolstered by recycled TPU clips.<br><br>First released in June of 2021 at a starting price of $200.', 'men', 'https://images.stockx.com/images/Nike-Air-VaporMax-2021-FK-Black-Anthracite-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1629383692', 'Black Anthracite', 1, '2022-06-01', 200, 'Nike Air VaporMax 2021 FK', 'Nike-Air-VaporMax-2021-FK-Black-Anthracite', 'Nike Air VaporMax 2021 FK Black Anthracite', 'sneakers+nike+air max+vapormax+black/black-anthracite-black+2022-06-01+200+dh4084-001');
