INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('058c4efb-6891-4655-af3c-ce44328d1904', 'Jordan', 'Air Jordan Two', 'Sail/Black-Burgundy Crush', 'New', 'CN', 'Jordan Brand and A Ma Maniére utilized a similar aesthetic from their 2021 Air Jordan 1 collaboration for the Air Jordan 2 A Ma Maniére.<br><br>Constructed of a chalky, cream leather with a cracked finish and dark brown detailing, the Air Jordan 2 A Ma Maniére nods to the 2021 Air Jordan 1 A Ma Maniére and its luxe, vintage-inspired look. At the heel, TPU heel caps are featured in their original shape, but with a semi-translucent styling. From there, a snakeskin-patterned midsole references the Swooshes found on the two companies'' collaborative AJ1.<br><br>The Air Jordan 2 A Ma Maniére released in June of 2022 and retailed for $225.', 'men', 'https://images.stockx.com/images/Air-Jordan-2-Retro-A-Ma-Maniere_V2-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1655237326', 'A Ma Maniére Airness', 1, '2022-06-04', 225, 'Jordan 2 Retro', 'Air-Jordan-2-Retro-A-Ma-Maniere', 'Jordan 2 Retro A Ma Maniére Airness', 'sneakers+jordan+air jordan+two+sail/black-burgundy crush+2022-06-04+225+do7216-100');
