INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('06438148-4265-4f27-9107-68ab187f3b0d', 'Nike', 'Nike Dunk', 'White/Pink Prime', 'New', 'VN', 'The women''s Nike Dunk High Pink Prime (W) features a smooth white leather upper with Pink Prime overlays and Swooshes. From there, a woven Nike tongue label and matching sole complete the design.<br><br>The women''s Nike Dunk High Pink Prime (W) releases in May of 2022 and retails for $115.', 'women', 'https://images.stockx.com/images/Nike-Dunk-High-Pink-Prime-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1641573308', 'Pink Prime (W)', 1, '2022-05-05', 115, 'Nike Dunk High', 'Nike-Dunk-High-Pink-Prime-W', 'Nike Dunk High Pink Prime (W)', 'sneakers+nike+nike+dunk+high+white/pink prime+2022-05-05+115+dd1869-110');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('064da274-0a52-4447-8322-f476c6f617c9', 'Jordan', 'Air Jordan One', 'White/Black-Volt-University Gold', 'New', 'CN', 'Jordan Brand started 2021 on a high note with the Jordan 1 High Volt Gold. The Volt Gold offers a new take on the renowned Black Toe theme by implementing new materials and features that contribute to a reconstructed design aesthetic.<br><br>In familiar Black Toe color blocking, the upper of the Jordan 1 Volt Gold is composed of white, black, and yellow leather. A Volt yellow-tinted panel donning the Jordan Wings logo wraps the ankle. Unlike OG Jordan 1 designs that feature double stitch reinforcement, the Volt Gold utilizes single stitch reinforcement on its overlays, creating dimensionality with exposed edges. A nylon tongue with exposed foam edges and reverse transparent tongue label emphasize Jordan’s reconstructed design approach. A yellowed midsole and black outsole offer an aged look.<br><br>The Jordan 1 High Volt Gold released in January of 2021 and retailed for $170.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-White-Black-Volt-University-Gold-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1611079703', 'White Black Volt University Gold', 1, '2021-01-09', 170, 'Jordan 1 Retro High', 'Air-Jordan-1-Retro-High-White-Black-Volt-University-Gold', 'Jordan 1 Retro High White Black Volt University Gold', 'sneakers+jordan+air jordan+one+white/black-volt-university gold+2021-01-09+170+555088-118');
