INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('07989d96-5cbf-4faf-b845-8c457a78d121', 'Jordan', 'Air Jordan Twelve', 'White/Black-University Red', 'New', 'CN', 'The Air Jordan 12 Twist features a white tumbled leather paneled upper with a pebbled leather mudguard. From there, red metallic Jumpman side tabs and eyelets, black woven heel tabs, and a sculptural sole completes the design. <br><br>The Air Jordan 12 Twist released in July of 2021 and retailed for $190.', 'men', 'https://images.stockx.com/images/Air-Jordan-12-Retro-Twist-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1626802580', 'Twist', 1, '2021-07-24', 190, 'Jordan 12 Retro', 'Air-Jordan-12-Retro-Twist', 'Jordan 12 Retro Twist', 'sneakers+jordan+air jordan+twelve+white/black-university red+2021-07-24+190+ct8013-106');
