INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('08243ccb-3e4c-4aa3-9b27-245d77cbd8e6', 'Jordan', 'Air Jordan Four', 'White/Black-Metallic Gold-Bordeaux', 'New', 'CN', 'Jordan Brand and French professional football club Paris Saint Germain expanded their collaboration into 2020 with the Jordan 4 PSG. The two entities have collaborated on the Jordan 5, Jordan 6, and Jordan 1 silhouettes in the past. <br><br>The Jordan 4 PSG features traditional color-blocking that is reminiscent of the classic Fire Red 4. White leather comprises the upper while grey nubuck paneling encompasses the toe wrap. Bordeaux purple and black coat the signature rubber wings, lace cages, and midsole. Finishing details include a "PANAME" text label on the lateral forefoot concluded with a "PSG" badge on the rubber heel tab.<br><br>The Jordan 4 PSG released in October of 2020 and retailed for $225.', 'men', 'https://images.stockx.com/images/Air-Jordan-4-Retro-PSG-Paris-Saint-Germain-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1607050018', 'PSG Paris Saint-Germain', 1, '2020-10-10', 225, 'Jordan 4 Retro', 'Air-Jordan-4-Retro-PSG-Paris-Saint-Germain', 'Jordan 4 Retro PSG Paris Saint-Germain', 'sneakers+jordan+air jordan+four+white/black-metallic gold-bordeaux+2020-10-10+225+cz5624-100');
