INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('08ee1694-0d97-4206-8d2e-af3d5df6a447', 'New Balance', 'New Balance 550', 'Black/Marblehead', 'New', 'CN', 'The New Balance 550 Shadow features a black and grey leather upper with mesh paneling around the collars. A puffed New Balance logo and "550" branding on the quarter panels nods to the origins of New Balance''s basketball line. At the base, a white midsole with a black and grey outsole completes the design.<br><br>The New Balance 550 Shadow released in 2021 and retailed for $110.', 'men', 'https://images.stockx.com/images/New-Balance-550-Shadow-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1613412534', 'Shadow', 1, '2022-01-12', 110, 'New Balance 550', 'New-Balance-550-Shadow', 'New Balance 550 Shadow', 'sneakers+new balance+new balance+550+550+black/marblehead+2022-01-12+110+bb550sr1');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('09af5901-eb52-4ac7-9e98-a6780db0ea2d', 'Puma', 'Puma Puma', 'Elektro Blue/Green Gecko', 'New', 'VN', 'The Puma LaMelo Ball MB.01 Galaxy arrives with a galaxy-patterned mesh upper with reinforced purple overlays and sharp orange detailing. On the tongue, LaMelo''s signature "One of One" graphic boasts neon colors, contrasting its dark, spacey background. At the base, a neon green sole offers enhanced court grip and durability.<br><br>The Puma LaMelo Ball MB.01 Galaxy released in April of 2022 and retailed for $125.', 'men', 'https://images.stockx.com/images/Puma-MB01-LaMelo-Ball-Galaxy-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1651610682', 'Galaxy', 1, '2022-04-29', 125, 'Puma LaMelo Ball MB.01', 'Puma-MB01-LaMelo-Ball-Galaxy', 'Puma LaMelo Ball MB.01 Galaxy', 'sneakers+puma+puma+puma+lamelo ball+elektro blue/green gecko+2022-04-29+125+376677-07');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('09c9e254-4a29-44ec-93ea-8fcb3de674ae', 'Nike', 'Air Force One', 'White/Black-Metallic Gold', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Nike-Air-Force-1-Low-Anniversary-Edition-Bronx-Origins.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1656402986', '40th Anniversary Edition Bronx Origins', 1, '2022-10-14', 150, 'Nike Air Force 1 Low', 'Nike-Air-Force-1-Low-Anniversary-Edition-Bronx-Origins', 'Nike Air Force 1 Low 40th Anniversary Edition Bronx Origins', 'sneakers+nike+air force+one+white/black-metallic gold+2022-10-14+150+dx2305-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('0a0b8f65-4ddf-4e7c-9814-2d832152aa32', 'Jordan', 'Air Jordan One', 'Light Smoke Grey/Anthracite/White', 'New', 'ID', 'The Air Jordan 1 Mid Light Smoke Grey 2022 (Preschool) spots a winter colorway with white and smoke grey dominating the silhouette and only touches of black. <br><br>The Air Jordan 1 Mid Light Smoke Grey 2022 (PS) is constructed on a white leather base with smoke grey overlays that extend to the toe cap, eye stays, collar flaps, and heel counter. A black Swoosh introduces some contrast to the white mid-quarter panel, and the black continues to the collar, tongue, and sock liner. Underfoot, a white midsole and smoke grey outsole give the pair an overall greyscale look.<br><br>The Air Jordan 1 Mid Light Smoke Grey 2022 (PS) was released in January 2022 and retailed for $65.', 'preschool', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Light-Smoke-Grey-2022-PS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1652209621', 'Light Smoke Grey (2022) (PS)', 1, '2022-01-03', 65, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Light-Smoke-Grey-2022-PS', 'Jordan 1 Mid Light Smoke Grey (2022) (PS)', 'sneakers+jordan+air jordan+one+light smoke grey/anthracite/white+2022-01-03+65+640734-078');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('0a2fcf61-b503-42bb-8c78-df6308b03e9c', 'Nike', 'Nike Dunk', 'Black/Off Noir/White', 'New', 'VN', 'The Nike Dunk Low Black features a black tumbled leather upper with smooth leather overlays and white Swooshes. From there, matching woven tongue labels and EVA foam soles complete the design.<br><br>The Nike Dunk Low Black released in May of 2022 and retailed for $100.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Black-White-2022-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1654800213', 'Black White (2022)', 1, '2022-05-01', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Black-White-2022', 'Nike Dunk Low Black White (2022)', 'sneakers+nike+nike+dunk+low+black/off noir/white+2022-05-01+100+dj6188-002');
