INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('0a57fd91-bb67-481d-870e-5dc00d073f04', 'New Balance', 'New Balance 2002R', 'Rain Cloud/Grey', 'New', 'CN', 'The New Balance 2002R Protection Pack Rain Cloud features a grey mesh upper with tonal jagged suede overlays and a reflective New Balance logo. From there, a cream Nrgy midsole and grey outsole complete the design.<br><br>The New Balance 2002R Protection Pack Rain Cloud released in August of 2021 and retailed for $150.', 'men', 'https://images.stockx.com/images/New-Balance-M2002-Protection-Pack-Rain-Cloud-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1638287519', 'Protection Pack Rain Cloud', 1, '2021-08-20', 150, 'New Balance 2002R', 'New-Balance-M2002-Protection-Pack-Rain-Cloud', 'New Balance 2002R Protection Pack Rain Cloud', 'sneakers+new balance+new balance+2002r+2002r+rain cloud/grey+2021-08-20+150+m2002rda');
