INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('0b039475-17bf-4fe6-92b9-d9b8eb00b55c', 'Nike', 'Dunk Low', 'Shimmer/Mars Stone/Sanddrift', 'New', 'ID', null, 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Terry-Swoosh-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1667976756', 'Terry Swoosh (W)', 1, '2022-12-01', 110, 'Nike Dunk Low', 'Nike-Dunk-Low-Terry-Swoosh-W', 'Nike Dunk Low Terry Swoosh (W)', 'sneakers+nike+dunk+low+shimmer/mars stone/sanddrift+2022-12-01+110+dz4706-200');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('0b349543-aba7-4568-9fa3-4cb120e75621', 'Jordan', 'Air Jordan One', 'Noble Green/Pollen-White', 'New', 'ID', 'The Air Jordan 1 Mid Sonics 2021 is back in a Seattle Supersonics themed colorway: noble green, pollen, and white.<br><br>The Air Jordan 1 Mid Sonics 2021 comes constructed in a leather build featuring a white base with green overlays, laces, tongue labels, liner, and rubber outsole. Highlighting the shoe are pollen hits on the ankle collar and Jumpman branding, while white continues on the tongues, insoles, and midsole. The Swoosh appears on the lateral side in green, and the ball and Win(GS) for grade schoolers logo appears in white. <br><br>The Air Jordan 1 Mid Sonics 2021 in November 2021 and retailed for $115.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Sonics-2021-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1646934930', 'Sonics (2021)', 1, '2021-11-01', 115, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Sonics-2021', 'Jordan 1 Mid Sonics (2021)', 'sneakers+jordan+air jordan+one+noble green/pollen-white+2021-11-01+115+554724-371');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('0b598b77-4ae2-414b-9e10-580e6b8f6bce', 'Nike', 'Nike Dunk', 'Light Bone/Tumbled Grey-Coconut Milk-Alpha Orange', 'New', 'VN', 'Nike Dunk High Vintage Light Bone is a retro-release by Nike as it approaches its 40th anniversary. The high top shoe has dark grey/light grey/orange colorway.<br><br>The Nike Dunk High has an upper constructed in full light grey leather. The shoe also features a perforated toe box and padded collar made of synthetic fabric. It has dark grey overlays, side Swooshes, laces, and treaded outsole. The rubber midsole is slightly-yellowed. There is also some orange flair branding on the light grey tongue and insole.<br><br>Nike Dunk High Vintage Light Bone was released on 7th July 2022. At this time, it retailed at $110.', 'men', 'https://images.stockx.com/images/Nike-Dunk-High-Vintage-Light-Bone.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1652351734', 'Vintage Light Bone Grey', 1, '2022-07-07', 110, 'Nike Dunk High', 'Nike-Dunk-High-Vintage-Light-Bone', 'Nike Dunk High Vintage Light Bone Grey', 'sneakers+nike+nike+dunk+high+light bone/tumbled grey-coconut milk-alpha orange+2022-07-07+110+dm0582-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('0b8a6d84-639c-47ce-957a-ed9f86079c06', 'Jordan', 'Air Jordan One', 'White/Dark Powder Blue-Cone', 'New', 'CN', 'Time for some Tobacco Road vibes with these Jordan 1 Retro Off-Whites. Also known as the "UNC" editions, these Jordan 1s are the third colorway designed by Virgil Abloh and made in collaboration with his Off-White label. The sneakers come in a white, dark powder blue and cone colorway, with a white and blue deconstructed leather upper and Off-White detailing throughout. If you’re a fan of Virgil Abloh’s work and want to rep Off-White, this pair is another must-have.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-Off-White-University-Blue-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606321054', 'Off-White University Blue', 1, '2018-06-23', 190, 'Jordan 1 Retro High', 'Air-Jordan-1-Retro-High-Off-White-University-Blue', 'Jordan 1 Retro High Off-White University Blue', 'sneakers+jordan+air jordan+one+virgil abloh+collections-filter+nike-off-white+jordan off white+white/dark powder blue-cone+2018-06-23+190+aq0818-148');
