INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('0cbeeb7f-f5dd-4712-a6ca-29b5717b8c35', 'Nike', 'Air Max 90', 'Black/Lime Ice/Anthracite/Dark Grey', 'New', 'VN', 'The Nike Air Max 90 Terrascape Black Lime Ice has a unique sole that features cloudy plastic. The upper part of the shoe is primarily black and made out of different types of material and fabrics, such as mesh, which is included for its breathability. Black laces are sandwiched between two panels of transparent plastic.<br><br>Initially released in October of 2021, the Nike Air Max 90 Terrascape Black Lime Ice had a starting retail price of $140 in men’s sizes.', 'men', 'https://images.stockx.com/images/Nike-Air-Max-90-Terrascape-Black-Lime-Ice-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1646080685', 'Black Lime Ice', 1, '2021-10-28', 140, 'Nike Air Max 90 Terrascape', 'Nike-Air-Max-90-Terrascape-Black-Lime-Ice', 'Nike Air Max 90 Terrascape Black Lime Ice', 'sneakers+nike+air max+90+black/lime ice/anthracite/dark grey+2021-10-28+140+dh2973-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('0d6972be-05c6-49f2-9068-1738b3dadec8', 'Nike', 'Nike Dunk', 'Phantom/Fossil Rose-Aura-Summit White', 'New', 'VN', 'The Nike Dunk Low Fossil Rose features a Fossil grey premium suede upper with Rose suede Swooshes and heel wraps. A woven Nike tongue label and contrasting white and rose Air sole add the finishing touch.<br><br>The Nike Dunk Low Fossil Rose released in May of 2022 and retailed for $110.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Fossil-Rose-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1649428473', 'Fossil Rose', 1, '2022-05-04', 110, 'Nike Dunk Low', 'Nike-Dunk-Low-Fossil-Rose', 'Nike Dunk Low Fossil Rose', 'sneakers+nike+nike+dunk+low+phantom/fossil rose-aura-summit white+2022-05-04+110+dh7577-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('0e0a7334-fdf9-43e9-b9d8-22279d5bff59', 'Jordan', 'Air Jordan One', 'Gym Red/White-Black', 'New', 'VN', 'The Jordan 1 Low Bred Toe takes cues from the 2018 Air Jordan 1 High Bred Toe with its signature black and red color blocking. The upper is composed of white, black, and red leather, with black and red leather smothering the vamp, Swoosh, and heel while white leather is prominent on the quarter panel. From there, an embroidered Wing logo on the heel and a Jumpman tongue label complete the design.<br><br>The Jordan 1 Low Bred Toe released in December of 2021 and retailed for $100.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Low-Bred-Toe-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1637253420', 'Bred Toe', 1, '2021-12-08', 100, 'Jordan 1 Low', 'Air-Jordan-1-Low-Bred-Toe', 'Jordan 1 Low Bred Toe', 'sneakers+jordan+air jordan+one+gym red/white-black+2021-12-08+100+553558-612');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('0e3d5939-8bf8-49eb-bdbc-da7ff6dc3a8c', 'Jordan', 'Air Jordan One', 'White/Multicolor/Black', 'New', 'CN', 'Jordan Brand released the Jordan 1 Mid SE Diamond to honor the NBA’s 75th anniversary. The PS stands for Preschool, meaning they are produced for younger children and are smaller than GS.<br><br>The Jordan 1 Mid SE Diamond has a two-tone finish upper body made of crisp white leather and smooth black velvet overlays. It has a white Jumpman’s iconic logo on its black tongue with black lace. There’s a black Wings logo on its white collar. It also pairs a white rubber midsole, overlaying a translucent rubber outsole.<br><br>The Jordan 1 Mid SE Diamond debuted on 9th February 2022, at a retail price of $80.', 'preschool', 'https://images.stockx.com/images/Air-Jordan-1-Mid-SE-Diamond-PS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1654198803', 'Diamond (PS)', 1, '2022-02-09', 80, 'Jordan 1 Mid SE', 'Air-Jordan-1-Mid-SE-Diamond-PS', 'Jordan 1 Mid SE Diamond (PS)', 'sneakers+jordan+air jordan+one+white/multicolor/black+2022-02-09+80+dn4323-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('0e5356bd-64f9-4a55-83ce-c5ad9f531f2f', 'Nike', 'Nike Dunk', 'Light Iron Ore/White/Game Royal/University Red', 'New', 'ID', 'The Nike Dunk Low Light Iron Ore Red Blue features a white tumbled leather upper with Light Iron Ore suede overlays and red tumbled leather Swooshes. A golden yellow embroidered mini Swoosh at the toe and a  bright green heel patch adds a subtle flair. At the base, a white and light blue sole completes the design.<br><br>The Nike Dunk Low Light Iron Ore Red Blue released in 2022 and retailed for $110.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Light-Iron-Ore-Red-Blue-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1654154887', 'Light Iron Ore Red Blue', 1, '2022-05-23', 110, 'Nike Dunk Low', 'Nike-Dunk-Low-Light-Iron-Ore-Red-Blue', 'Nike Dunk Low Light Iron Ore Red Blue', 'sneakers+nike+nike+dunk+low+light iron ore/white/game royal/university red+2022-05-23+110+dv3497-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('0e5c6c88-509f-4edc-9714-88f7d24b44bb', 'Nike', 'Nike Dunk', 'White/Black', 'New', 'CN', 'The women''s Nike Dunk Low Next Nature White Black is constructed of 50% recycled materials. Two-tone black and white Flyleather composes the upper in a simple, color blocked look similar to some of the most popular Dunks to release. From there, matching soles and woven tongue labels add a finishing touch.<br><br>The women''s Nike Dunk Low Next Nature White Black released in November of 2021 and retailed for $100.', 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Next-Nature-White-Black-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1643118805', 'Next Nature White Black Panda (W)', 1, '2021-11-03', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Next-Nature-White-Black-W', 'Nike Dunk Low Next Nature White Black Panda (W)', 'sneakers+nike+nike+dunk+low+white/black+2021-11-03+100+dd1873-102');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('0e805c34-c2fb-4a9a-9a2f-16d89a7ac161', 'Nike', 'Nike Basketball Dunk', 'White/Court Purple', 'New', 'VN', 'The Nike Dunk Low Championship Purple features a white leather upper with Championship Purple overlays and Swooshes. Nike embroidery at the heel pays tribute to the original 1985 design. At the base, a white and purple sole adds the finishing touch.<br><br>The Nike Dunk Low Championship Purple releases in May of 2022 and retails for $100.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Court-Purple-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1648131848', 'Championship Court Purple', 1, '2022-05-05', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Court-Purple', 'Nike Dunk Low Championship Court Purple', 'sneakers+nike+nike basketball+dunk+low+white/court purple+2022-05-05+100+dd1391-104');
