INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('0f26d510-c9a4-471c-bff3-8e1651dd9f5f', 'Nike', 'Nike Dunk', 'Valerian Blue/White/University Red/Valerian Blue', 'New', 'VN', 'The Nike Dunk Low Valerian Blue arrives in a smooth white leather construction with deep Valerian Blue overlays and Swooshes. Hits of red on the woven tongue label and heel embroidery add a subtle contrast. At the base, a matching white and blue Air sole completes the design.<br><br>The Nike Dunk Low Valerian Blue released in May of 2022 and retailed for $100.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Valerian-Blue-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1652712361', 'Valerian Blue', 1, '2022-05-01', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Valerian-Blue', 'Nike Dunk Low Valerian Blue', 'sneakers+nike+nike+dunk+low+valerian blue/white/university red/valerian blue+2022-05-01+100+dd1391-400');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('0f86f282-e0c1-4d47-a166-6cb0b91e6889', 'Jordan', 'Air Jordan Three', 'Dark Hazel/Multi-Color', 'New', 'CN', 'Taking inspiration from vintage surplus stores and fabrics, the Air Jordan 3 features a mixed camo patchwork upper consisting of waxed canvas, ripstop nylon, herringbone, wool, and twill materials. Adding more customization opportunities, heel tabs are backed with velcro material so that you can interchange Nike Air and Jumpman logo patches.<br><br>The Air Jordan 3 Patchwork released in November of 2021 and retailed for $200.', 'men', 'https://images.stockx.com/images/Air-Jordan-3-Retro-Low-Multi-Camo-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1638389116', 'Patchwork Camo', 1, '2021-11-29', 200, 'Jordan 3 Retro', 'Air-Jordan-3-Retro-Low-Multi-Camo', 'Jordan 3 Retro Patchwork Camo', 'sneakers+jordan+air jordan+three+dark hazel/multi-color+2021-11-29+200+do1830-200');
