INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('10a48aef-0d0b-4b61-a9e0-0215fc9460cd', 'Jordan', 'Air Jordan One', 'Crimson Bliss/Rush Orange/Black/Sail', 'New', 'VN', 'The Air Jordan 1 Mid Orange Black (Women) falls under Nike’s Sports sneakers category for women. The sneaker is dressed in various color schemes, such as rush orange, crimson bliss, sail, and black.<br><br>The Air Jordan 1 Mid Orange Black (Women) is made from leather with most of its upper in orange. It has black panels on its sides and a Wings logo. This sneaker features nylon tongues, and its toe box is made of a lighter tone. The sneaker’s rubber outsole and the Swooshes are orange in color, while the midsole comes in white.<br><br>The Air Jordan 1 Mid Orange Black (Women) was released on June 1st, 2022, and retailed at $135.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Orange-Black-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1659591555', 'Rush Orange Crimson Bliss (W)', 1, '2022-06-01', 135, 'Jordan 1 Mid SE', 'Air-Jordan-1-Mid-Orange-Black-W', 'Jordan 1 Mid SE Rush Orange Crimson Bliss (W)', 'sneakers+jordan+air jordan+one+crimson bliss/rush orange/black/sail+2022-06-01+135+dm3381-600');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('110fdafe-96bb-45cb-94a6-29383d3a8058', 'Nike', 'Nike Other Other', 'Brown/Light Brown-Pink', 'New', 'VN', 'French designer Simon Porte Jacquemus teamed up with Nike for a luxe take on the hiking-friendly Nike Air Humara.<br><br>The women''s Nike Air Humara LX Jacquemus Brown is constructed of a smooth brown leather upper with tonal hairy suede overlays and striped exterior ribbons. A pendant-like golden Nike mini Swoosh graces each side of the upper in an elegant fashion. From there, a sculptural, jagged gum outsole adds the finishing touch.<br><br>The women''s Nike Air Humara LX Jacquemus Brown released in June of 2022.', 'women', 'https://images.stockx.com/images/Nike-Air-Humara-LX-Jacquemus-Brown-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1657005073', 'Jacquemus Ale Brown Gold (W)', 1, '2022-06-28', 170, 'Nike Air Humara LX', 'Nike-Air-Humara-LX-Jacquemus-Brown-W', 'Nike Air Humara LX Jacquemus Ale Brown Gold (W)', 'sneakers+nike+nike other+other+brown/light brown-pink+2022-06-28+170+dr0420-200');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('11360aa5-8927-4593-9f9d-f0be762147a4', 'Nike', 'Nike Basketball Blazer', 'White/Indigo/Obsidian', 'New', 'ID', 'The Nike Blazer Mid 77 Indigo (W) is part of a Nike collection that pays homage to the Indigofera Tinctoria plant, commonly referred to as True Indigo. This women''s sneaker features a white upper constructed using breathable canvas with synthetic suede overlays and an embroidered Indigo plant graphic. On its upper, it has a light blue swoosh and a light blue heel tab engraved with True Indigo’s scientific information. Furthermore, it boasts a white midsole and a rubber outsole.<br><br>The women''s Nike Blazer Mid 77 Indigo (W) was released on 15th June 2021. It retailed at $110.', 'women', 'https://images.stockx.com/images/Nike-Blazer-Mid-77-Indigo-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1653510886', 'Indigo (W)', 1, '2021-06-15', 110, 'Nike Blazer Mid 77', 'Nike-Blazer-Mid-77-Indigo-W', 'Nike Blazer Mid 77 Indigo (W)', 'sneakers+nike+nike basketball+blazer+white/indigo/obsidian+2021-06-15+110+dc9265-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('11416f4b-42ad-4b28-b495-e92f08133d48', 'Nike', 'Nike Dunk', 'White/Cargo Khaki', 'New', 'VN', 'The Nike Dunk High Cargo Khaki has khaki shoe laces that cover the white tongue. The Nike logo is included on a slip of fabric at the very top of the tongue.<br><br>This high-top The Nike Dunk High Cargo Khaki features two primary colors: khaki and white. The sole has the classic tread style that has become synonymous with Nike high-top shoes, and the primary body of the shoe is made out of leather. The Nike swoosh symbol appears in rich khaki green.<br><br>The Nike Dunk High Cargo Khaki was first released in June of 2022. The starting retail price for this pair of shoes was $115.', 'men', 'https://images.stockx.com/images/Nike-Dunk-High-Cargo-Khaki-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1647011682', 'Cargo Khaki (2021)', 1, '2022-04-01', 110, 'Nike Dunk High Retro', 'Nike-Dunk-High-Cargo-Khaki', 'Nike Dunk High Retro Cargo Khaki (2021)', 'sneakers+nike+nike+dunk+high+white/cargo khaki+2022-04-01+110+dd1399-107');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('116a1af5-5442-43fd-8c80-7dae618edcb9', 'adidas', 'adidas Yeezy', 'Vermillion/Vermillion/Vermillion', 'New', 'CN', 'The adidas Yeezy Foam RNNR Vermillion features an all-red one piece EVA foam construction with oval cut-outs to provide ventilation. At the base, a cushioned footbed offers support and stability.<br><br>The adidas Yeezy Foam RNNR Vermillion released in October of 2021 and retailed for $80.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Foam-RNNR-Vermillion-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1635875119', 'Vermillion', 1, '2021-10-29', 80, 'adidas Yeezy Foam RNNR', 'adidas-Yeezy-Foam-RNNR-Vermillion', 'adidas Yeezy Foam RNNR Vermillion', 'sneakers+adidas+adidas+yeezy+foam rnnr+vermillion/vermillion/vermillion+2021-10-29+80+gw3355');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('116a5fb2-ce62-4bca-a9b2-6971c96882ce', 'Jordan', 'Air Jordan One', 'Light Olive/Sail-White', 'New', 'VN', null, 'women', 'https://images.stockx.com/images/Air-Jordan-1-Low-SE-Light-Olive-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1664259098', 'Light Olive (W)', 1, '2022-09-02', 95, 'Jordan 1 Low SE', 'Air-Jordan-1-Low-SE-Light-Olive-W', 'Jordan 1 Low SE Light Olive (W)', 'sneakers+jordan+air jordan+one+light olive/sail-white+2022-09-02+95+dv0426-301');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('122744f9-9ea4-48ad-ac53-afa0c31fb12b', 'Nike', 'Air Max 95', 'Black/Black', 'New', 'CN', 'The Nike Air Max 95 Triple Black 2020 was unveiled as one of Nike’s Nike Air Max 95 model sneakers in January 2020.<br><br>The Nike Air Max 95 Triple Black 2020 is dressed in a black-on-black colorway. The sneaker features a black mesh-constructed upper on top of a black leather base. The black tongue’s top features an "aimax" labeling detail. Completing the design is the black rubber sole with Air Max units fitted within the heel for extra comfort. The black rubber outsole is patterned for maximum traction.<br><br>During its unveiling in January 2020, Nike Air Max 95 Triple Black 2020 retailed at $170.', 'men', 'https://images.stockx.com/images/Nike-Air-Max-95-Triple-Black-2020-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1652375322', 'Triple Black (2020)', 1, '2020-01-01', 170, 'Nike Air Max 95', 'Nike-Air-Max-95-Triple-Black-2020', 'Nike Air Max 95 Triple Black (2020)', 'sneakers+nike+air max+95+black/black+2020-01-01+170+ci3705-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('1269426a-2d47-4aeb-8c0b-a9d322e463b9', 'Jordan', 'Air Jordan One', 'Pollen/Black-White', 'New', 'CN', 'This Air Jordan 1 Retro High OG Pollen (GS) reimagines the 85 "Iowa" Dunk color scheme from the original Be True to Your School collection. <br><br>The Air Jordan 1 Retro High OG Pollen (GS) upper is crafted from black tumble leather, overlaid by a contrasting smooth Pollen leather, including the Swoosh and laces. The sneaker has the standard perforations for breathability, a black Air Jordan wing logo, and a white midsole for cushioning. The sneaker is finished off with a concentric Pollen rubber outsole providing traction.  <br><br>The grade school-sized Air Jordan 1 Retro High OG Pollen (GS) was released in August 2021 and retailed for $130.', 'child', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-OG-Pollen-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1628003408', 'Pollen (GS)', 1, '2021-08-14', 130, 'Jordan 1 Retro High OG', 'Air-Jordan-1-Retro-High-OG-Pollen-GS', 'Jordan 1 Retro High OG Pollen (GS)', 'sneakers+jordan+air jordan+one+pollen/black-white+2021-08-14+130+575441-701');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('126d4cd0-c979-411f-bf82-0dc1cf84e3f9', 'Nike', 'Dunk High', 'Off Noir/Starfish-Dark Driftwood-Lemon Wash-Sail-Black', 'New', 'ID', null, 'men', 'https://images.stockx.com/images/Nike-Dunk-High-PRM-Somos-Familia-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1668082598', 'Somos Familia', 1, '2022-10-26', 140, 'Nike Dunk High PRM', 'Nike-Dunk-High-PRM-Somos-Familia', 'Nike Dunk High PRM Somos Familia', 'sneakers+nike+dunk+high+mxscavengerhunt+off noir/starfish-dark driftwood-lemon wash-sail-black+2022-10-26+140+dz5354-045');
