INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('1333e403-eeac-42d0-94c2-7c7fccf79e2c', 'Jordan', 'Air Jordan Four', 'Amethyst Wave/Bright Crimson-Black-Cement Grey', 'New', 'CN', 'Jordan Brand honored NBA head coach Phil Jackson''s spiritual approach to coaching with the Air Jordan 4 Zen Master.<br><br>Nodding to Michael Jordan-era Chicago Bulls head coach Phil Jackson''s nickname "Zen Master", the Air Jordan 4 Zen Master offers a calming palette with faint blue and pink tie-dye canvas uppers with clear TPU eyelets and heel tabs. Black TPU netted inserts and woven Jordan Flight tongue labels bring a slight contrast. From there, a matching sole with an Air unit under the heel completes the design.<br><br>The Air Jordan 4 Zen Master released in June of 2022 and retailed for $210.', 'men', 'https://images.stockx.com/images/Air-Jordan-4-Retro-Zen-Master-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1655732734', 'Zen Master', 1, '2022-03-19', 210, 'Jordan 4 Retro', 'Air-Jordan-4-Retro-Zen-Master', 'Jordan 4 Retro Zen Master', 'sneakers+jordan+air jordan+four+amethyst wave/bright crimson-black-cement grey+2022-03-19+210+dh7138-506');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('1349f022-f1e8-4828-8b60-e74169ed0b54', 'Nike', 'Air Force One', 'Court Purple/Court Purple-White', 'New', 'VN', 'The Nike Air Force 1 Low 07 QS Skeleton Halloween 2021 features a purple leather upper with skeleton graphics on both lateral and medial sides. At the base, a semi-translucent glow-in-the-dark sole and Nike embroidery on the heel tab completes the design.<br><br>The Nike Air Force 1 Low 07 QS Skeleton Halloween 2021 released in October of 2021 and retailed for $130.', 'men', 'https://images.stockx.com/images/Nike-Air-Force-1-Low-07-QS-Purple-Skeleton-Halloween-2021-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1635780371', 'Purple Skeleton Halloween (2021)', 1, '2022-04-01', 130, 'Nike Air Force 1 Low ''07 QS', 'Nike-Air-Force-1-Low-07-QS-Purple-Skeleton-Halloween-2021', 'Nike Air Force 1 Low ''07 QS Purple Skeleton Halloween (2021)', 'sneakers+nike+air force+one+low+mxscavengerhunt+court purple/court purple-white+2022-04-01+130+cu8067-500');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('143cd5bd-bb9d-40e2-aedb-10164981d593', 'Jordan', 'Air Jordan One', 'White/Multi-Color/Black', 'New', 'ID', 'The Air Jordan 1 Mid Diamond Shorts for Grade School sizing (GS) is a Jordan brand colorway with a white and black scheme. Designed to honor the iconic Diamond Jordan basketball shorts, this mid-top sneaker features a white leather upper with black suede overlays on its eyelets, collar, and toe area. Additionally, it features nylon tongues, suede Nike Swooshes on its side panels, stamped wings logos on its collars, a rubber midsole, and a rubber outsole.<br><br>The Air Jordan 1 Mid Diamond Shorts GS was released on 9th February 2022. During its release, it had a retail price of $100.', 'child', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Diamond-Shorts-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1645431828', 'Diamond Shorts (GS)', 1, '2022-02-09', 100, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Diamond-Shorts-GS', 'Jordan 1 Mid Diamond Shorts (GS)', 'sneakers+jordan+air jordan+one+white/multi-color/black+2022-02-09+100+dn4321-100');
