INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('1727045c-c3ec-4aa6-97e4-7cce5c238e26', 'Nike', 'Nike Other Other', 'Dark Sulfur/White-Light Cream', 'New', 'VN', null, 'unisex', 'https://images.stockx.com/images/NikeCraft-General-Purpose-Shoe-Tom-Sachs-Yellow-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1662558895', 'Tom Sachs Archive Dark Sulfur', 1, '2022-09-02', 110, 'NikeCraft General Purpose Shoe', 'NikeCraft-General-Purpose-Shoe-Tom-Sachs-Yellow', 'NikeCraft General Purpose Shoe Tom Sachs Archive Dark Sulfur', 'sneakers+nike+nike other+other+dark sulfur/white-light cream+2022-09-02+110+da6672-700');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('1759b2d8-9b4f-4276-b9b2-500c2e6720ca', 'Jordan', 'Air Jordan Eleven', 'Black/Multi-Color-White-Multi-Color', 'New', 'CN', 'In 2020, Jordan Brand celebrated 25 years of one of their most popular models, the Jordan 11. To commemorate the famed silhouette, Michael Jordan and Nike released the Jordan 11 Jubilee. The sneaker’s distinct colorway was inspired by original sketches from the designer of the 1995 sneaker, Tinker Hatfield. <br><br>The Jordan 11 Jubilee showcases everything Hatfield envisioned for the sneaker 25 years ago; a performance product that can be worn easily both on and off the court. Features such as the two types of leather on the upper with hits of metallic lettering and Jumpman emblem add luxe elements to the athletic sneaker. A white midsole and foggy translucent outsole deliver contrast to the black sneaker. Carbon fiber plating on the sole provides stability and power to the wearer’s feet on the court.<br><br>The Jordan 11 Jubilee 25th Anniversary released in December of 2020 for $220.', 'men', 'https://images.stockx.com/images/Air-Jordan-11-Retro-Black-Clear-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1609186717', 'Jubilee 25th Anniversary', 1, '2020-12-12', 220, 'Jordan 11 Retro', 'Air-Jordan-11-Retro-Black-Clear', 'Jordan 11 Retro Jubilee 25th Anniversary', 'sneakers+jordan+air jordan+eleven+black/multi-color-white-multi-color+2020-12-12+220+ct8012-011');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('176409b2-977e-4272-b02b-8fab93796e8d', 'adidas', 'adidas Yeezy', 'Azael/Azael/Azael', 'New', 'CN', 'Yeezy introduces a new variation of the 700 with the Yeezy 700 V3 Azael, now available on StockX. The third incarnation of the Yeezy 700 is one of the most sophisticated designs we’ve seen from the ongoing collaborations, playing with shape, line, texture, and even expectations. The outer shell is reminiscent of a race car and an astronaut’s suit with a sole unit that feels progressive and substantial. <br><br>This 700 V3 is composed of an azael upper composed of monofilament engineered mesh with RPU overlays for structure and durability. The RPU cage has glow-in-the-dark features, along with 3M reflective detailing on the toe. The EVA midsole and herringbone rubber outsole completes the design. These sneakers released in December of 2019 and retailed for $200.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-700-V3-Azael-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606319725', 'Azael (2019/2022)', 1, '2019-12-23', 200, 'adidas Yeezy 700 V3', 'adidas-Yeezy-700-V3-Azael', 'adidas Yeezy 700 V3 Azael', 'sneakers+adidas+adidas+yeezy+700+v3+azael/azael/azael+2019-12-23+200+fw4980');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('18593eb3-3e52-4ff4-a608-76d685933e37', 'UGG', 'UGG Slippers', 'Chestnut', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/UGG-Tasman-Slipper-Chestnut.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1668619589', 'Chestnut', 1, null, 100, 'UGG Tasman Slipper', 'UGG-Tasman-Slipper-Chestnut', 'UGG Tasman Slipper Chestnut', 'sneakers+ugg+ugg+slippers+chestnut+100+5950-che');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('185ecb6f-2402-467c-8db4-c846bf8cdb7a', 'adidas', 'adidas Yeezy', 'Core Black/Core Black/Red', 'New', 'CN', '<b>PLEASE NOTE: This page is for the original and restock, so production dates may vary.The adidas Yeezy Boost 350 V2 Black Red is one of the first original colorways to drop after the silouhette’s debut in 2016. Despite its original 2017 release, the 350 V2 Black Red restocked in 2020, giving fans a second chance at grabbing a pair at retail.<br><br>The adidas Yeezy 350 V2 Black Red features familiar style cues that made the silhouette popular today. The upper consists of black Primeknit material for breathability. A black ribbed midsole encases an entire BOOST cushioning system for added comfort. Lastly, signature "SPLY-350" is knitted along the lateral side of each pair. <br><br>The adidas Yeezy 350 V2 originally released in February of 2017 and retailed for $220.', 'men', 'https://images.stockx.com/images/Adidas-Yeezy-Boost-350-V2-Core-Black-Red-2017-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606320792', 'Black Red (2017/2020)', 1, '2017-02-11', 220, 'adidas Yeezy Boost 350 V2', 'adidas-Yeezy-Boost-350-V2-Core-Black-Red-2017', 'adidas Yeezy Boost 350 V2 Black Red (2017/2020)', 'sneakers+adidas+adidas+yeezy+350+v2+core black/core black/red+2017-02-11+2020-12-05+220+cp9652');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('18a3d59b-ef1e-432e-be1a-b950e56f56a3', 'Nike', 'Nike Basketball Blazer', 'White/Sail-Black', 'New', 'CN', 'The Nike Blazer Low 77 Vintage White Black returns with its low-profile style, and heritage basketball looks.<br><br>The nearly 1-to-1 remake of the Nike Blazer Low 77 Vintage White Black features crisp leather on the upper with soft suede and synthetic details for added durability and throwback styling. The ultra-clean colors, simple lines, and low-cut, padded collar continue the look, which is wrapped up by an outsole fused with the midsole. The solid rubber outsole with herringbone pattern adds traction, durability, and heritage styling. <br><br>The Nike Blazer Low 77 Vintage White Black was released in December 2020 and originally retailed for $85.', 'men', 'https://images.stockx.com/images/Nike-Blazer-Low-77-Vintage-White-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1609770678', 'White Black', 1, '2020-12-04', 85, 'Nike Blazer Low 77 Vintage', 'Nike-Blazer-Low-77-Vintage-White-Black', 'Nike Blazer Low 77 Vintage White Black', 'sneakers+nike+nike basketball+blazer+white/sail-black+2020-12-04+85+da6464-101/da6364-101');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('18b06bac-a376-48e0-af79-0102348c69fa', 'Jordan', 'Air Jordan One', 'Black/Gym Red-White', 'New', 'CN', 'The Jordan 1 Mid Chicago Toe features a black, white, and Gym Red leather and nylon upper. From there, a nylon tongue featuring a black "Jumpman" logo set and a white midsole complete the design.<br><br>The Jordan 1 Mid Chicago Toe released in April of 2020 and retailed for $115.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Chicago-Toe-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1616187353', 'Chicago Toe', 1, '2020-04-01', 115, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Chicago-Toe', 'Jordan 1 Mid Chicago Toe', 'sneakers+jordan+air jordan+one+mid+black/gym red-white+2020-04-01+115+554724-069');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('18dfb7c0-a6c9-4ed5-ac15-6367f23f846c', 'adidas', 'adidas Adilette', 'Grey/Grey/Grey', 'New', 'CN', 'As part of the adidas Originals Spring / Summer 2022 collection, the adidas Adilette 22 Grey features a grooved light grey foam construction that boasts a look reminiscent of eroded sediment. On the lateral side of the sole, text that reads "The Brand With The Three Stripes" nods to adidas'' logo. From there, a soft footbed adds comfort and support.<br><br>The adidas Adilette 22 Slides Grey released in June of 2022 and retailed for $55.', 'unisex', 'https://images.stockx.com/images/adidas-Adilette-22-Slides-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1659074921', 'Grey', 1, '2022-09-13', 55, 'adidas Adilette 22 Slides', 'adidas-Adilette-22-Slides-Grey', 'adidas Adilette 22 Slides Grey', 'sneakers+adidas+adidas+adilette+grey/grey/grey+2022-09-13+55+gx6950');
