INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('19521b5b-c46c-4954-b0cf-d130b8caa9c8', 'adidas', 'adidas Yeezy', 'Rock/Rock/Rock', 'New', 'CN', 'The adidas Yeezy Desert Boot Rock features a beige mesh upper with tonal nubuck and suede overlays. From there, a matching grooved sole provides traction and stability.<br><br>The adidas Yeezy Desert Boot Rock released in April of 2019 and retailed for $200.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Desert-Boot-Rock-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1607055688', 'Rock', 1, '2019-04-13', 200, 'adidas Yeezy Desert Boot', 'adidas-Yeezy-Desert-Boot-Rock', 'adidas Yeezy Desert Boot Rock', 'sneakers+adidas+adidas+yeezy+desert boot+boots+rock/rock/rock+2019-04-13+200+eg6462');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('1990015c-2bd3-4748-a042-42ab4e0c2581', 'adidas', 'adidas Yeezy', 'Black/Black/Black', 'New', 'CN', 'You can never have too much heat, so cop the adidas Yeezy Boost 350 V2 Black. This Yeezy Boost 350 V2 comes with a black upper, black midsole, and a black sole. These sneakers released in June 2019 and retailed for $220. Buy these today on StockX.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Boost-350-V2-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1607647321', 'Black (Non-Reflective)', 1, '2019-06-07', 220, 'adidas Yeezy Boost 350 V2', 'adidas-Yeezy-Boost-350-V2-Black-Non-Reflective', 'adidas Yeezy Boost 350 V2 Black (Non-Reflective)', 'sneakers+adidas+adidas+yeezy+v2+350+black/black/black+2019-06-07+220+fu9006');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('19f15835-1a57-4563-aa5b-b86e6b8df635', 'Birkenstock', 'Birkenstock Clogs', 'Khaki', 'New', 'DE', null, 'unisex', 'https://images.stockx.com/images/Birkenstock-Boston-Vegan-Birkibuc-Khaki-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1669101149', 'Birkibuc Khaki', 1, '2022-08-01', 120, 'Birkenstock Boston Vegan', 'Birkenstock-Boston-Vegan-Birkibuc-Khaki', 'Birkenstock Boston Vegan Birkibuc Khaki', 'sneakers+birkenstock+birkenstock+clogs+khaki+2022-08-01+120+1020506/1020541');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('1aafa0b7-0821-4f5f-a42f-bfdaeb2d677d', 'Jordan', 'Air Jordan One', 'Black/White-Light Smoke Grey', 'New', 'CN', 'The upper of the Air Jordan 1 Shadow 2.0 is made of a black leather base with Light Smoke Grey overlays. A classic Wings logo appears on the lateral ankle wrap while a woven Nike Air label is stitched atop the tongue to complete the look.<br><br>The Air Jordan 1 Shadow 2.0 released in May of 2021 and retailed for $170.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-Black-White-Light-Smoke-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1621454319', ' Shadow 2.0', 1, '2021-05-15', 170, 'Jordan 1 Retro High', 'Air-Jordan-1-Retro-High-Black-White-Light-Smoke-Grey', 'Jordan 1 Retro High Shadow 2.0', 'sneakers+jordan+air jordan+one+black/white-light smoke grey+2021-05-15+170+555088-035');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('1c2bae7c-4fda-455f-89df-6590a4eae886', 'Nike', 'Air Max Plus', 'White/Hyper Jade-Black-Reflective Silver', 'New', 'ID', 'The Nike Air Max Plus has white shoe laces and black lining. The shoe provides enough cushion to be ideal for more intense exercise and sport.<br><br>This model has a black sole, with a cushioned white midsole. On the white midsole, there are several turquoise details. The majority of the body of the shoe is made out of mesh, with a white base and turquoise and black lines drawn horizontally across the foot. <br><br>The Nike Air Max Plus atmos White Hyper Jade was put onto the market in June of 2022. The first retail price for this model was $160 for men’s sizing.', 'men', 'https://images.stockx.com/images/Nike-Air-Max-Plus-atmos-White-Hyper-Jade-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1651844632', 'atmos White Hyper Jade', 1, '2021-12-07', 175, 'Nike Air Max Plus', 'Nike-Air-Max-Plus-atmos-White-Hyper-Jade', 'Nike Air Max Plus atmos White Hyper Jade', 'sneakers+nike+air max+plus+white/hyper jade-black-reflective silver+2021-12-07+175+604133-148');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('1e1114b6-94da-4f3f-9039-b8f91f3cda1c', 'adidas', 'adidas Forum', 'Cream White/Collegiate Red/Off White', 'New', 'VN', 'Ahead of the release of the 2021 film Home Sweet Home Alone, adidas teamed up with Disney to release an adidas Forum Low inspired by the adidas Phantoms that Macaulay Culkin''s character, Kevin, wears in the original 1990 film Home Alone.<br><br>The adidas Forum Low Home Alone nods to the assorted booby traps that Kevin sets in order to protect his family''s home from the Wet Bandits. Black burn marks throughout the white leather upper allude to Kevin''s blow torch trap, the medallion emblem on the heel represents the McCallister scorching door knob, and the orange heel tabs depict the tripwire Kevin uses throughout the movie to slow down the bandits. Along with the shoes, extra sock liners with imagery of the movie''s main characters are also included.  <br><br>The adidas Forum Low Home Alone released in December of 2021 and retailed for $110.', 'men', 'https://images.stockx.com/images/adidas-Forum-Low-Home-Alone-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1638996887', 'Home Alone', 1, '2021-12-01', 110, 'adidas Forum Low', 'adidas-Forum-Low-Home-Alone', 'adidas Forum Low Home Alone', 'sneakers+adidas+adidas+forum+forum+cream white/collegiate red/off white+2021-12-01+110+gz4378');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('1e37ccad-fff9-429f-9752-25033b16a5ee', 'Nike', 'Nike Dunk', 'Sail/Starfish-Black', 'New', 'CN', 'The Nike Dunk Low PRM Halloween features a Sail leather upper with black overlays and orange Swooshes. On the black overlays, subtle graphics of eyes from creatures of the night are painted that can glow in the dark. A glow-in-the-dark outsole and woven tongue tag complete this Halloween design.<br><br>The Nike Dunk Low PRM Halloween released in October of 2021 and retailed for $110.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-PRM-Halloween-2021-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1635781868', 'Halloween (2021)', 1, '2022-04-01', 110, 'Nike Dunk Low PRM', 'Nike-Dunk-Low-PRM-Halloween-2021', 'Nike Dunk Low PRM Halloween (2021)', 'sneakers+nike+nike+dunk+low+mxscavengerhunt+sail/starfish-black+2022-04-01+110+dd3357-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('1e3ba91f-5350-4fe3-abb7-feb2a6129cc9', 'Jordan', 'Air Jordan One', 'Gym Red/White-Black', 'New', 'CN', 'Jordan Brand added luxe materials to a classic silhouette with the release of the women''s Jordan 1 Retro High Satin Snake Chicago (W). This release combines Jumpman’s ongoing Satin 1 concept with the colorway that started it all.This women''s Jordan 1 consists of a white and red leather upper with red satin tongue and liner. Black faux snakeskin leather detailing appears on the upper as well. A white midsole, red outsole, and a traditional Jordan Wings graphic on the ankle completes the design. These sneakers released in August of 2020 and retailed for $170.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-Satin-Snake-Chicago-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606325457', 'Satin Snake Chicago (W)', 1, '2020-08-06', 170, 'Jordan 1 Retro High', 'Air-Jordan-1-Retro-High-Satin-Snake-Chicago-W', 'Jordan 1 Retro High Satin Snake Chicago (W)', 'sneakers+jordan+air jordan+one+women+gym red/white-black+2020-08-06+170+cd0461-601');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('1e3c65cc-3d7d-4ef7-b0af-ea7bae922bb2', 'Crocs', 'Crocs Collaborations', 'Red/Multi', 'New', 'CN', 'The Crocs Classic Clog Lightning McQueen is an official collaboration with Disney Pixar''s Cars franchise. These Lightning McQueen Crocs pay homage to the movie''s lead character, who is voiced by Owen Wilson. The Crocs look is loosely based on the Chevrolet Corvette C1, a racing car produced between 1953 and 1962.<br><br>These Lightning McQueen Crocs feature a red foam construction with printed graphics that resemble Lightning McQueen. Ventilation holes on the upper with a sole with grooves add the finishing touch.<br><br>The Crocs Classic Clog Lightning McQueen released in April of 2021 and retailed for $50.', 'men', 'https://images.stockx.com/images/Crocs-Classic-Clog-Lightning-McQueen-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1620405722', 'Lightning McQueen', 1, '2021-04-27', 50, 'Crocs Classic Clog', 'Crocs-Classic-Clog-Lightning-McQueen', 'Crocs Classic Clog Lightning McQueen', 'sneakers+crocs+crocs+collaborations+crocs collaborations+red/multi+2021-04-27+50+205759-610');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('1e4be5b4-cbc4-4245-b4bc-14ab87286019', 'Nike', 'Nike Basketball Dunk', 'Sail/Lapis/Off Noir/Neptune Green', 'New', 'ID', null, 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-SE-85-Neptune-Green-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1660143666', 'Neptune Green (W)', 1, '2022-08-02', 100, 'Nike Dunk Low SE 85', 'Nike-Dunk-Low-SE-85-Neptune-Green', 'Nike Dunk Low SE 85 Neptune Green (W)', 'sneakers+nike+nike basketball+dunk+sail/lapis/off noir/neptune green+2022-08-02+100+do9457-101');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('1ef1443d-f83a-4d53-98e5-5999033b8d08', 'Crocs', 'Crocs Collaborations', 'Brown/Light Brown/Blue', 'New', 'CN', 'In collaboration with Kellogg''s Cinnamon Toast Crunch, the Crocs Classic Clog Cinnamon Toast Crunch features a marbled brown and white foam construction with a checkered, multicolored ankle strap and blue heel pad. Atop the upper, Cinnamon Toast Crunch-themed jibbitz accentuate the fun theme.<br><br>The Crocs Classic Clog Cinnamon Toast Crunch released in May of 2022.', 'men', 'https://images.stockx.com/images/Crocs-Classic-Clog-Cinnamon-Toast-Crunch-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1651844486', 'Cinnamon Toast Crunch', 1, '2022-04-28', 70, 'Crocs Classic Clog', 'Crocs-Classic-Clog-Cinnamon-Toast-Crunch', 'Crocs Classic Clog Cinnamon Toast Crunch', 'sneakers+crocs+crocs+collaborations+crocs collaborations+brown/light brown/blue+2022-04-28+70+207920-2e9');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('1ef570ae-1407-45eb-a2a0-a85da3dfcd84', 'New Balance', 'New Balance 990v5', 'Grey', 'New', 'US', 'The New Balance 990v5 Grey is the fifth iteration of New Balance''s iconic 990 series that originated in 1982. The 990v5 Grey arrives in NB''s signature grey color scheme. Its upper is constructed of a grey mesh with matching suede overlays and translucent TPU side panels. Reflective detailing on the New Balance logo and piping shine when exposed to light. At the base, an ENCAP midsole offers utmost cushioning and support. This model is made in the United States of America.<br><br>The New Balance 990v5 released in February of 2019 and retailed for $175.', 'men', 'https://images.stockx.com/images/New-Balance-990v5-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1607650731', 'Grey', 1, '2019-02-13', 175, 'New Balance 990v5', 'New-Balance-990v5-Grey', 'New Balance 990v5 Grey', 'sneakers+new balance+new balance+990v5+grey+2019-02-13+175+m990gl5');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('1f67e947-a593-42e2-b2f9-fede3010e6c9', 'Nike', 'LeBron Other', 'White/Light Melon Orange/Light Lemon Yellow', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Nike-LeBron-Witness-6-Light-Melon-Orange.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1647245721', 'Light Melon Orange', 1, '2021-10-12', 110, 'Nike LeBron Witness 6', 'Nike-LeBron-Witness-6-Light-Melon-Orange', 'Nike LeBron Witness 6 Light Melon Orange', 'sneakers+nike+lebron+other+white/light melon orange/light lemon yellow+2021-10-12+110+dc8994-101');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('1fbc627b-1054-4e43-a5e8-aae2608676d0', 'Nike', 'Nike Basketball Other', 'Black/Mint Foam/White', 'New', 'VN', 'Designed for the fast lane, the Nike PG 6 Black Mint is a versatile basketball shoe.<br><br>The Nike PG 6 Black Mint features a black and mint colorway with a backward Nike Swoosh on the side. The shoe is constructed with a breathable dark grey mesh upper, a white base with black and mint green Phylon midsole for cushioning, and a rubber outsole for traction. Sporting a full-length ABZORB midsole, heel counter, and sock liner, the shoe gets plenty of traction.<br><br>The Nike PG 6 Black Mint shoe was released in March 2022 and retailed for $120.', 'men', 'https://images.stockx.com/images/Nike-PG-6-Black-Mint-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1652375543', 'Black Mint', 1, '2022-02-19', 110, 'Nike PG 6', 'Nike-PG-6-Black-Mint', 'Nike PG 6 Black Mint', 'sneakers+nike+nike basketball+other+black/mint foam/white+2022-02-19+110+dh8447-001/dc1974-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('1ffa9057-ac23-45c8-ab83-9bcafdb9bba3', 'Nike', 'Nike Dunk', 'Cacao Wow/Marina-Rough Green-Pilgrim', 'New', 'VN', 'The upper part of Nike Dunk Low NH Cacao Wow sneakers comprise of leather and a mesh. Hairy suede overlays run from the Nike Dunk Low NH Cacao Wow''s upper part down to the heels.<br><br>​​​​​​​This sneaker also features sets of aqua-colored beads. The beads are attached to the sneaker''s laces. The stitching details advanced by the aqua-colored help in elevating its overall look.<br><br>Nike Dunk Low NH Cacao Wow is categorized under Nike''s sports sneakers. This sneaker was released on July 21st, 2022. At the time of its debut, Nike Dunk Low NH Cacao Wow retailed at a price of $120.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-NH-Cacao-Wow-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1656421770', 'Cacao Wow', 1, '2022-07-21', 120, 'Nike Dunk Low NH', 'Nike-Dunk-Low-NH-Cacao-Wow', 'Nike Dunk Low NH Cacao Wow', 'sneakers+nike+nike+dunk+low+cacao wow/marina-rough green-pilgrim+2022-07-21+120+dr0159-200');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('20349b6a-e890-42ac-a6d9-9d88b0d21c2f', 'adidas', 'adidas Yeezy', 'Slate Bone/Slate Bone/Slate Bone', 'New', 'CN', null, 'men', 'https://images.stockx.com/images/adidas-Yeezy-350-V2-CMPCT-Slate-Bone-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1664626774', 'Slate Bone', 1, '2022-09-23', 230, 'adidas Yeezy 350 V2 CMPCT', 'adidas-Yeezy-350-V2-CMPCT-Slate-Bone', 'adidas Yeezy 350 V2 CMPCT Slate Bone', 'sneakers+adidas+adidas+yeezy+350+v2+slate bone/slate bone/slate bone+2022-09-23+230+h06519');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('20540125-6d4c-416c-bd8b-90e75c4f133f', 'New Balance', 'New Balance 550', 'White/Pink', 'New', 'CN', 'The New Balance 550 White Pink (Women''s) has a white midsole with pink highlights at the back and front, plus New Balance branding on the outer side of the midsole.<br><br>This shoe is made with a leather suede and mesh construction, featuring a white and pink colorway exclusively for women. It is a low-top sneaker with lace-up closure style and white laces. The majority of the shoe’s upper is white, but has pink details around the toes, heels, and on the big "NB" New Balance logo that appears on both sides.<br><br>The New Balance 550 White Pink (Women''s) shoe was released in March of 2022 at the retail price of $110.', 'women', 'https://images.stockx.com/images/New-Balance-550-White-Pink-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1649427804', 'White Pink (W)', 1, '2022-03-15', 110, 'New Balance 550', 'New-Balance-550-White-Pink-W', 'New Balance 550 White Pink (W)', 'sneakers+new balance+new balance+550+white/pink+2022-03-15+110+bbw550wp');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('20666871-f649-4624-8837-24052a01710b', 'Jordan', 'Air Jordan One', 'Light Chocolate/Crimson Bliss-Black-Sail', 'New', 'CN', 'The Jordan 1 Low Mocha features a white leather upper with Mocha Durabuck overlays and Swooshes. On the interior, bright pink lining pops against muted black Durabuck collars. A subtle Air Jordan Wings logo on the heel wrap adds the finishing touch.<br><br>The Jordan 1 Low Mocha released in November of 2021 and retailed for $100.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Low-Mocha-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1635261765', 'Mocha', 1, '2021-11-19', 100, 'Jordan 1 Low', 'Air-Jordan-1-Low-Mocha', 'Jordan 1 Low Mocha', 'sneakers+jordan+air jordan+one+light chocolate/crimson bliss-black-sail+2021-11-19+100+dc6991-200');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('207be8a3-4b9c-404c-82d4-cbb7a555844c', 'adidas', 'adidas Yeezy', 'Sand/Sand/Sand', 'New', 'CN', 'DISCLAIMER: US and UK sizing is the same and does not require any conversion. <br> <br>The adidas Yeezy Foam RNNR Sand arrives in a Sand monochromatic color scheme. Its one-piece sculpted upper with oval cut-outs provide a futuristic aesthetic to complete the design.<br><br>The adidas Yeezy Foam RNNR Sand released in May of 2021 and retailed for $75.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Foam-RNNR-Sand-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1617991585', 'Sand', 1, '2021-03-26', 80, 'adidas Yeezy Foam RNNR', 'adidas-Yeezy-Foam-RNNR-Sand', 'adidas Yeezy Foam RNNR Sand', 'sneakers+adidas+adidas+yeezy+foam rnnr+sand/sand/sand+2021-03-26+80+fy4567');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('20dfe222-8009-4a39-986e-767c144bfe97', 'Jordan', 'Air Jordan One', 'Black/Multi-Color/White/Black', 'New', 'CN', 'The Jordan 1 Low Diamond Shorts features a black Durabuck and white leather upper in a classic color blocked format, similar to legendary Jordan 1s like the Bred and Shadow colorways. At the heel, an Air Jordan Wings logo nods to the origins of the Air Jordan line. A white midsole and semi-translucent outsole add the finishing touch.<br><br>The Jordan 1 Low Diamond Shorts released in February of 2022 and retailed for $120.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Low-Diamond-Shorts-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1645637133', 'Diamond Shorts', 1, '2022-02-09', 120, 'Jordan 1 Low', 'Air-Jordan-1-Low-Diamond-Shorts', 'Jordan 1 Low Diamond Shorts', 'sneakers+jordan+air jordan+one+black/multi-color/white/black+2022-02-09+120+dh6931-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('20e348e7-c717-4864-b5e7-f7d2764d145a', 'Nike', 'Nike Dunk', 'Sail/Khaki-Light Chocolate', 'New', 'CN', 'Composed of tonal brown and Sail hues, the Nike Dunk High Light Chocolate can be dressed up or dressed down depending on the occasion. Its premium suede and leather construction gives its timeless silhouette a luxe touch, elevating the design. From there, hits of green on the woven tongue label and heel tab add a subtle contrast. <br><br>The Nike Dunk High Light Chocolate released in February of 2022 and retailed for $125.', 'men', 'https://images.stockx.com/images/Nike-Dunk-High-Light-Chocolate-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1633027334', 'Light Chocolate', 1, '2022-02-23', 125, 'Nike Dunk High', 'Nike-Dunk-High-Light-Chocolate', 'Nike Dunk High Light Chocolate', 'sneakers+nike+nike+dunk+high+sail/khaki-light chocolate+2022-02-23+125+dh5348-100');
