INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('2147dda3-8fdf-4ce2-a4a4-9e4e57b3ea8e', 'Jordan', 'Air Jordan One', 'White/Neutral Grey-Lucky Green', 'New', 'ID', 'The Jordan 1 Mid Grey Green features a white leather upper with grey Durabuck overlays and metallic green Swooshes and collars. From there, a metallic green lace tag and signature Wings logo on the collar completes the design.<br><br>The Jordan 1 Mid Grey Green released in November of 2021 and retailed for $120.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Grey-Green-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1634306178', 'Grey Green', 1, '2021-11-17', 120, 'Jordan 1 Mid SE', 'Air-Jordan-1-Mid-Grey-Green', 'Jordan 1 Mid SE Grey Green', 'sneakers+jordan+air jordan+one+white/neutral grey-lucky green+2021-11-17+120+dc7294-103');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('214c73be-76a0-41c5-96bd-f3b0fd795e02', 'New Balance', 'New Balance 550', 'White/Green', 'New', 'CN', 'The New Balance 550 White Green features a smooth white leather upper with a grey suede toe wrap and green detailing. From there, a New Balance Basketball woven tongue label and matching sole completes the design.<br><br>The New Balance 550 White Green released in June of 2021 and retailed for $120.', 'men', 'https://images.stockx.com/images/New-Balance-550-White-Green-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1628002321', 'White Green', 1, '2021-06-24', 120, 'New Balance 550', 'New-Balance-550-White-Green', 'New Balance 550 White Green', 'sneakers+new balance+new balance+550+550+mxscavengerhunt+white/green+2021-06-24+120+bb550wt1');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('21661d9f-682f-40fd-a9e6-5ad0066c76c4', 'Converse', 'Converse Chuck Taylor', 'Milk/White-High Risk Red', 'New', 'VN', 'Converse Chuck Taylor All Star 70s Ox Comme des Garcons PLAY White is a low-top iconic collaboration. It blends the minimalist eye and heart logo on a white canvas. Converse Chuck Taylor All Star 70s Ox Comme des Garcons PLAY White is a special edition colorway that was designed by graphic artist Filip Pagowski and Comme des Garçons founder Rei Kawakubo. The shoe usually features a Milk canvas upper with the oversized signature CDG red heart printed on the quarter panels.<br><br>Converse Chuck Taylor All Star 70s Ox Comme des Garcons PLAY White comes with a rubber cap and a 1970s vulcanized rubber sole. It was released in May 2015 at a retail price of $120.', 'men', 'https://images.stockx.com/images/Converse-Chuck-Taylor-All-Star-70s-Ox-Comme-Des-Garcons-Play-White-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1607647438', 'Comme des Garcons PLAY White', 1, '2019-07-09', 120, 'Converse Chuck Taylor All-Star 70 Ox', 'Converse-Chuck-Taylor-All-Star-70s-Ox-Comme-des-Garcons-PLAY-White', 'Converse Chuck Taylor All-Star 70 Ox Comme des Garcons PLAY White', 'sneakers+converse+converse+chuck taylor+comme des garcons+milk/white-high risk red+2019-07-09+120+150207c');
