INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('2213f21b-cf6e-4a0a-9613-95c5ddd8869f', 'adidas', 'adidas Yeezy', 'Light/Light/Light', 'New', 'CN', 'At a glance, the Yeezy Boost 350 V2 Light arrives in a clean triple white color palette, but when exposed to light, the white Primeknit upper changes to light pink and its mesh side stripe to dark yellow. An off-white Boost sole and canvas heel tab add the finishing touches.<br><br>The adidas Yeezy Boost 350 V2 Light released in August of 2021 and retailed for $220.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Boost-350-V2-Light-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1629383966', 'Light', 1, '2021-08-28', 220, 'adidas Yeezy Boost 350 V2', 'adidas-Yeezy-Boost-350-V2-Light', 'adidas Yeezy Boost 350 V2 Light', 'sneakers+adidas+adidas+yeezy+350+v2+light/light/light+2021-08-28+220+gy3438');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('2331dbb6-81d0-409c-840c-3d813cc94194', 'adidas', 'adidas Yeezy', 'Utility Black/Utility Black/Utility Black', 'New', 'CN', 'The hiking-inspired adidas Yeezy 500 Utility Black features a durable black mesh and suede upper that is prime for daily wear. From there, a sculptural adiPRENE sole offers responsiveness and support.<br><br>The adidas Yeezy 500 Utility Black originally released in July of 2018 for $200, and then restocked in November of 2020 and November of 2021.', 'men', 'https://images.stockx.com/images/Adidas-Yeezy-500-Utility-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606319127', 'Utility Black', 1, '2018-07-07', 200, 'adidas Yeezy 500', 'adidas-Yeezy-500-Utility-Black', 'adidas Yeezy 500 Utility Black', 'sneakers+adidas+adidas+yeezy+500+utility black/utility black/utility black+2018-07-07+200+f36640');
