INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('2365d412-e4ac-426b-88d2-1ab6c6fb837f', 'New Balance', 'New Balance 530', 'White/Silver/Navy', 'New', 'VN', 'The New Balance 530 White Silver Navy features a white mesh upper with metallic silver and white leather overlays. On the quarter panel, a grey New Balance logo outlined in navy adds contrast. From there, a white and grey ABZORB sole adds the finishing touch.<br><br>The New Balance 530 White Silver Navy released in February of 2021 and retailed for $95.', 'men', 'https://images.stockx.com/images/New-Balance-530-White-Silver-Navy-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1657865292', 'White Silver Navy', 1, '2021-02-17', 95, 'New Balance 530', 'New-Balance-530-White-Silver-Navy', 'New Balance 530 White Silver Navy', 'sneakers+new balance+new balance+530+white/silver/navy+2021-02-17+95+mr530sg');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('240e32e2-60b3-4e04-8dcc-597f944ae0a8', 'adidas', 'adidas Yeezy', 'Sulfur/Sulfur/Sulfur', 'New', 'CN', 'Constructed with a blend of EVA foam and recycled materials, adidas Yeezy Foam RNNR Sulfur arrives in an identical build to prior Foam RNNRs. Oval cut openings throughout the neutral-toned design create a sculptural look while providing ventilation. At the base, a cushioned footbed offers comfort and support.<br><br>The adidas Yeezy Foam RNNR Sulfur released in April of 2022 and retailed for $90.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Foam-RNNR-Sulfur-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1654153626', 'Sulfur', 1, '2022-04-16', 90, 'adidas Yeezy Foam RNNR', 'adidas-Yeezy-Foam-RNNR-Sulfur', 'adidas Yeezy Foam RNNR Sulfur', 'sneakers+adidas+adidas+yeezy+foam rnnr+sulfur/sulfur/sulfur+2022-04-16+90+gv6775');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('241fdc4a-364e-45a6-a94c-1f94f5bd4c85', 'Jordan', 'Air Jordan Three', 'White/Medium Grey-Violet Ore-White', 'New', 'CN', 'After a slew of collaborative releases with adidas and Nike, DC-based sneaker boutique A Ma Maniére teamed up with Jordan Brand to release a women’s exclusive Jordan 3 with the Air Jordan 3 A Ma Maniére (W). The release aligns with their short film Raised By Women, an ode to the strides and accomplishments of everyday women in urban communities.The Air Jordan 3 A Ma Maniére arrives featuring a white tumbled leather upper with Medium Grey suede on the toe wrap, eyestay, heel wrap, and ankle. Each panel of leather on the upper has a raw trim, revealing a natural, tan edge. To provide a vintage aesthetic, the eyelets, heel tab, and lower portion of the midsole are yellowed. From there, the tongue on the left sneaker features an embroidered A Ma Maniére logo, while the right features a Jumpman logo. Quilted satin lining on the interior of the shoe adds an element of luxury. A white, Violet Ore, and Medium Grey sole with a classic Air unit in the heel completes this retro look.The women''s Air Jordan 3 A Ma Maniére released in April of 2021 and retailed for $200.', 'women', 'https://images.stockx.com/images/Air-Jordan-3-Retro-A-Ma-Maniere-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1619806955', 'A Ma Maniére (W)', 1, '2021-06-10', 200, 'Jordan 3 Retro', 'Air-Jordan-3-Retro-A-Ma-Maniere-W', 'Jordan 3 Retro A Ma Maniére (W)', 'sneakers+jordan+air jordan+three+women+white/medium grey-violet ore-white+2021-06-10+200+dh3434-110');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('242178d4-0eff-4008-8439-6d064f9cee83', 'Jordan', 'Air Jordan Five', 'White/Multi-Color-Multi-Color-Total Orange', 'New', 'CN', 'After a history of appearing on popular Jordan 1s, the renowned Shattered Backboard colorway made its way to the Jordan 5 for the Air Jordan 5 Shattered Backboard.<br><br>Like other Shattered Backboard releases, white, orange, and black are prominent in the design''s color-blocking. Instead of utilizing signature Jordan 5 netted inserts on the quarter and tongue, the Shattered Backboard opts for a translucent mesh that also appears on the collar. Metallic shark-tooth details on the midsole and a semi-translucent outsole add the finishing touches.<br><br>The Air Jordan 5 Shattered Backboard released in October of 2021 and retailed for $190.', 'men', 'https://images.stockx.com/images/Air-Jordan-5-Retro-Total-Orange-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1632509359', 'Shattered Backboard', 1, '2021-10-02', 190, 'Jordan 5 Retro', 'Air-Jordan-5-Retro-Total-Orange', 'Jordan 5 Retro Shattered Backboard', 'sneakers+jordan+air jordan+five+white/multi-color-multi-color-total orange+2021-10-02+190+dc1060-100+headwear');
