INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('24c5d47d-9ca7-477d-8aba-b7de142bb364', 'Jordan', 'Air Jordan Four', 'White/Midnight Navy/Light Smoke Grey/Fire Red', 'New', 'ID', null, 'child', 'https://images.stockx.com/images/Air-Jordan-4-Retro-Midnight-Navy-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1667643437', 'Midnight Navy (GS)', 1, '2022-10-29', 160, 'Jordan 4 Retro', 'Air-Jordan-4-Retro-Midnight-Navy-GS', 'Jordan 4 Retro Midnight Navy (GS)', 'sneakers+jordan+air jordan+four+white/midnight navy/light smoke grey/fire red+2022-10-29+160+408452-140');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('252974a0-43da-4c2e-821e-0bb85cfe726b', 'Nike', 'Nike Dunk', 'White/Mint', 'New', 'ID', 'Composed of 50% recycled materials, the women''s Nike Dunk Low Next Nature White Mint (W) offers a more sustainable way to wear Dunks. The upper arrives in a simple white and Mint two-tone, color blocked look similar to some of the most popular Dunks to ever release. From there, matching soles and woven tongue labels complete the design.<br><br>The women''s Nike Dunk Low Next Nature White Mint (W) released in the Spring of 2022 and retailed for $100.', 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Next-Nature-White-Mint-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1650654943', 'Next Nature White Mint (W)', 1, '2022-03-11', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Next-Nature-White-Mint-W', 'Nike Dunk Low Next Nature White Mint (W)', 'sneakers+nike+nike+dunk+low+white/mint+2022-03-11+100+dn1431-102');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('253f8ae0-e498-4613-bb87-de479e4e9c63', 'Jordan', 'Air Jordan Four', 'Sail/Muslin-White-Black', 'New', 'CN', 'Jordan Brand and Virgil Abloh teamed up once again to release the third silhouette in their collaborative history with the women''s Jordan 4 Retro Off-White Sail (W), now available on StockX. After teasing the release of the Off-White 4 with samples in his MCA exhibit and presenting them in his Off-White FW2020 Women’s Show, Virgil Abloh finally delivered what might be the most anticipated release of 2020.The Air Jordan 4 Sail features full-grain leather uppers with hits of mesh and translucent materials on the toebox and heel of the shoe. From there, hits of light blue on the tongue’s Jumpman and the outsole’s Nike Swoosh provide contrast to the sail colored sneaker. These women''s sneakers released in July of 2020 and retailed for $200 USD.', 'women', 'https://images.stockx.com/images/Air-Jordan-4-Retro-Off-White-Sail-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1607655526', 'Off-White Sail (W)', 1, '2020-07-25', 200, 'Jordan 4 Retro', 'Air-Jordan-4-Retro-Off-White-Sail-W', 'Jordan 4 Retro Off-White Sail (W)', 'sneakers+jordan+air jordan+four+women+collections-filter+nike-off-white+jordan off white+sail/muslin-white-black+2020-07-25+200+cv9388-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('25dec062-a8f3-4e76-bfc0-776fc74729f7', 'Nike', 'Nike Dunk', 'White/Grey Fog', 'New', 'VN', 'The Nike Dunk Low Grey Fog features a white leather upper with Grey Fog leather overlays and Swooshes. From there, a matching woven tongue label, heel tab, and sole completes the design.<br><br>The Nike Dunk Low Grey Fog released in September of 2021 and retailed for $100.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Grey-Fog-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1632232056', 'Grey Fog', 1, '2021-09-21', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Grey-Fog', 'Nike Dunk Low Grey Fog', 'sneakers+nike+nike+dunk+low+white/grey fog+2021-09-21+100+dd1391-103');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('25ea4b22-0b10-4e80-a5d4-88a65ea972ec', 'Nike', 'Air Max 97', 'White/Wolf Grey-Black', 'New', 'CN', 'This Nike Air Max 97 "OG" edition comes in a white, wolf grey and black colorway. Made to commemorate the 30th Anniversary of the classic Air Max silhouette. This pair sports a clean all-white upper and sole with the only hits of color coming from the grey branding. They were one of three colorways that dropped alongside each other. The release date was August 1st, 2017 where they retailed for $160 in men''s sizes. Fans of the Air Max 97 were very pleased with this colorway and it quickly became a must-have. Perfect for everyday use, you can never go wrong with an a white pair of kicks. If you''re in need of a pair, hit up the marketplace to buy them. Those looking to sell can do so online today.', 'men', 'https://images.stockx.com/images/Nike-Air-Max-97-White-Wolf-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1607044794', 'Triple White Wolf Grey', 1, '2017-08-01', 160, 'Nike Air Max 97', 'Nike-Air-Max-97-White-Wolf-Grey', 'Nike Air Max 97 Triple White Wolf Grey', 'sneakers+nike+air max+97+white/wolf grey-black+2017-08-01+160+921826-101');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('2652a011-2d6d-4de4-955b-3f4edf8c6d22', 'Nike', 'Nike Dunk', 'Yellow/Bordeaux', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Arizona-State-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1666331082', 'Arizona State', 1, null, 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Arizona-State', 'Nike Dunk Low Arizona State', 'sneakers+nike+nike+dunk+yellow/bordeaux+100+dd1391-702');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('26bfa614-6928-4da0-a2d9-c030961c8aca', 'adidas', 'adidas Samba', 'Cloud White/Core Black/Gum', 'New', 'VN', 'The adidas Samba Vegan White Gum has white laces and a bright blue stamp that can be found at the top of the shoe’s tongue.<br><br>The adidas Samba Vegan White Gum has a gum colored sole that helps to provide traction. The base of the shoe’s body is a bright cloud white. On top of this base, there are black details, including the three iconic stripes that adidas is known for, as well as a black tag on the heel. <br><br>The adidas Samba Vegan White Gum was initially released in June of 2021. It had a starting retail price of $90.', 'men', 'https://images.stockx.com/images/adidas-Samba-Vegan-White-Gum-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1658152455', 'White Gum', 1, '2021-06-16', 90, 'adidas Samba Vegan', 'adidas-Samba-Vegan-White-Gum', 'adidas Samba Vegan White Gum', 'sneakers+adidas+adidas+samba+cloud white/core black/gum+2021-06-16+90+h01877');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('26f11b22-97cc-4844-9328-27a82bfabf80', 'adidas', 'adidas Yeezy', 'Mist/Mist/Mist', 'New', 'CN', 'In a monochromatic Mist styling, the adidas Yeezy Foam RNNR Mist features a sculptural EVA foam and algae blended construction. At the base, a grooved outsole provides traction and support.<br><br>The adidas Yeezy Foam RNNR Mist released in March of 2022 and retailed for $90.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Foam-RNNR-Mist-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1647545977', 'Mist', 1, '2022-03-11', 90, 'adidas Yeezy Foam RNNR', 'adidas-Yeezy-Foam-RNNR-Mist', 'adidas Yeezy Foam RNNR Mist', 'sneakers+adidas+adidas+yeezy+foam rnnr+mist/mist/mist+2022-03-11+90+gv6774');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('2728aeac-17d8-4d84-954e-26139fa04254', 'Jordan', 'Air Jordan One', 'Mystic Navy/White/Mint Foam', 'New', 'ID', 'The Air Jordan 1 Mid Blue Mint (Gradeschool) features a leather upper, with stitched and overlays an Air-Sole unit, heel Air unit, and an outsole with a herringbone traction pattern.<br><br>The Air Jordan 1 Mid Blue Mint (GS) features a blue and white color combination. The blue is accented with Metallic Silver from the TPU midsole and heel counter, while the Nike Air logo is executed in Electrolime at the tongue. The midsole is fitted with deep flex grooves and has a blend of a white rubber outsole.<br><br>The grade-schoolers Air Jordan 1 Mid Blue Mint for grade schoolers was released in March 2022 and retailed for $100.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Blue-Mint-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1659621254', 'Mystic Navy Mint Foam (GS)', 1, '2022-06-03', 100, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Blue-Mint-GS', 'Jordan 1 Mid Mystic Navy Mint Foam (GS)', 'sneakers+jordan+air jordan+one+aj1+mystic navy/white/mint foam+2022-06-03+100+554725-413');
