INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('28aff902-d9a8-4dfa-b6b8-12d2971eefcb', 'Jordan', 'Air Jordan One', 'Hyper Royal/Light Smoke Grey-White', 'New', 'CN', 'Jordan Brand added a new colorway to their Jordan 1 catalog in the spring of 2021 with the Air Jordan 1 Hyper Royal. The Hyper Royal utilizes material selection and color blocking to provide a vintage feel, similar to the 2019 Air Jordan 1 High Turbo Green.<br><br>The upper of the Air Jordan 1 Hyper Royal is constructed with white leather and distressed Hyper Royal suede overlays while the Swoosh and panels around the ankle are made with a Light Smoke Grey Durabuck. Consistent with Jordan 1s of the past, a classic white "Wings" logo appears on the lateral ankle. A blue woven Nike Air label stitched on the tongue, a white midsole, and a Light Smoke Grey outsole add the finishing touches to this retro design.<br><br>The Air Jordan 1 Hyper Royal released in April of 2021 and retailed for $170.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-Hyper-Royal-Smoke-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1618238995', 'Hyper Royal Smoke Grey', 1, '2021-04-17', 170, 'Jordan 1 Retro High', 'Air-Jordan-1-Retro-High-Hyper-Royal-Smoke-Grey', 'Jordan 1 Retro High OG Hyper Royal', 'sneakers+jordan+air jordan+one+hyper royal/light smoke grey-white+2021-04-17+170+555088-402');
