INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('29681338-8763-410e-b92e-f9b303d5164e', 'Jordan', 'Air Jordan One', 'Mystic Navy/Mint Foam-White', 'New', 'ID', 'The Air Jordan 1 Mid Blue Mint has both the Nike swoosh symbol and Air Jordan logo in blue. This shoe has the standard tread that is normally used for Air Jordan models.<br><br>This model has both a bright mint sole and a white midsole. On the body of the shoe, you will find a white leather base with a perforated toebox and blue and mint leather overlays. Blue laces are on top of the blue tongue. <br><br>The Air Jordan 1 Mid Blue Mint had an initial release date of June 2022. The retail price for this product was $120 when it debuted.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Blue-Mint-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1653401757', 'Mystic Navy Mint Foam', 1, '2022-04-01', 120, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Blue-Mint', 'Jordan 1 Mid Mystic Navy Mint Foam', 'sneakers+jordan+air jordan+one+aj1+mystic navy/mint foam-white+2022-04-01+120+554724-413');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('2992e4c5-416c-40ed-84a6-db4c7ebc9453', 'Jordan', 'Air Jordan One', 'Black/Particle Grey-White', 'New', 'CN', 'The Jordan 1 Low White Black Grey features a white leather upper with black overlays and grey Swooshes. From there, Jordan Wings and Jumpman logo embroideries on the heel and tongue complete the design.<br><br>The Jordan 1 Low White Black Grey released in the Summer of 2021 and retailed for $90.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Low-Black-White-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1629140709', 'Black White Grey', 1, '2021-11-12', 90, 'Jordan 1 Low', 'Air-Jordan-1-Low-Black-White-Grey', 'Jordan 1 Low Black White Grey', 'sneakers+jordan+air jordan+one+black/particle grey-white+2021-11-12+90+553558-040');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('29959197-95be-429c-a30c-47190cfa4323', 'Nike', 'Nike SB SB Dunk Low', 'Brown/Muli-Color-White-Gum', 'New', 'VN', 'The Nike SB Dunk Low Pro Paisley Brown features a brown, green, and red paisley-patterned textile upper with matching leather overlays and contrasting Swooshes. Nike SB woven tongue tags and white heel embroideries add further detailing. At the base, a white Zoom sole with a gum outsole completes the design.<br><br>The Nike SB Dunk Low Pro Paisley Brown releases in May of 2022 and retails for $130.', 'men', 'https://images.stockx.com/images/Nike-SB-Dunk-Low-Pro-Paisley-Brown-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1649082481', 'Paisley Brown', 1, '2022-05-01', 130, 'Nike SB Dunk Low Pro', 'Nike-SB-Dunk-Low-Pro-Paisley-Brown', 'Nike SB Dunk Low Pro Paisley Brown', 'sneakers+nike+nike sb+sb dunk low+brown/muli-color-white-gum+2022-05-01+130+dh7534-200');
