INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('2af4f7ac-ed7c-4010-98af-59a2fb50f9aa', 'Nike', 'Nike Dunk', 'Cool Grey/Medium Grey/White', 'New', 'ID', 'The Nike Dunk Low Two Tone Grey arrives with a light grey leather upper with darker tonal overlays and white Swooshes. A nylon tongue with a woven Nike label offers flexibility and comfort. At the base, a white and grey Air sole completes the design.<br><br>The Nike Dunk Low Two Tone Grey released in 2022 and retailed for $100.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Two-Tone-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1646168372', 'Two Tone Grey', 1, '2022-03-01', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Two-Tone-Grey', 'Nike Dunk Low Two Tone Grey', 'sneakers+nike+nike+dunk+low+cool grey/medium grey/white+2022-03-01+100+dj6188-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('2afe6b55-350c-4329-86fa-7e921fa65e5c', 'Nike', 'Nike Dunk', 'White/University Blue-Hyper Royal', 'New', 'ID', 'The Nike Dunk Low Disrupt 2 Hyper Royal W is a low-cut Nike sneaker with a University Blue, Hyper Royal, and White color scheme.<br><br>Constructed using recycled materials, The Nike Dunk Low Disrupt 2 Hyper Royal Wr boasts a white canvas upper contrasted with blue suede overlays. In addition, these sneakers feature decorative insoles, TPU reinforcement on their heel, embroidered mini-swooshes on their sides, up to three different lace options, and a rubber outsole.<br><br>The Nike Dunk Low Disrupt 2 Hyper Royal W was released in April 2022. Originally, it had a retail price of $110.', 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Disrupt-2-Hyper-Royal-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1652120947', 'White University Blue (W)', 1, '2022-04-01', 110, 'Nike Dunk Low Disrupt 2', 'Nike-Dunk-Low-Disrupt-2-Hyper-Royal-W', 'Nike Dunk Low Disrupt 2 White University Blue (W)', 'sneakers+nike+nike+dunk+low+white/university blue-hyper royal+2022-04-01+110+dh4402-102');
