INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('2b96fb6a-f635-4d49-b9a1-de1c4400186a', 'Jordan', 'Air Jordan One', 'Sail/Dark Mocha-Black-Black', 'New', 'CN', 'Jordan Brand continued one of its oldest Jordan 1 color blocking themes with the Kids Air Jordan 1 Retro High Dark Mocha. The Dark Mocha adds earth tones to the classic Jordan 1 Black Toe design. <br><br>The Kids Air Jordan Retro High Dark Mocha features a white leather upper with brown Durabuck material utilized on the heel overlay and collar flap portion of the shoe. The Wings logo can be found on the ankle, and the Swoosh logo on the medial side. A white midsole and black outsole completes the design.<br><br>The Kids Air Jordan 1 Retro High Dark Mocha was released in October of 2020 and retailed for $130.', 'child', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-Dark-Mocha-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606761730', 'Dark Mocha (GS)', 1, '2020-10-31', 130, 'Jordan 1 Retro High', 'Air-Jordan-1-Retro-High-Dark-Mocha-GS', 'Jordan 1 Retro High Dark Mocha (GS)', 'sneakers+jordan+air jordan+one+kids+high+sail/dark mocha-black-black+2020-10-31+130+575441-105');
