INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('2c395f35-37b2-4af8-bbce-bcaa34b9c360', 'Nike', 'Nike SB Blazer', 'White/Grey', 'New', 'VN', 'The Nike SB Zooom Blazer Mid Edge Floral Paisley White Grey has a gum sole with a white midsole. The body of the shoe has a base color of white and grey, with paysley detailing on top. The swoosh symbol appears in white.<br><br>Both the tongue of the shoe and the laces are white as well. The shoe is composed of a mixture of fabrics, including suede, leather, mesh, and rubber. <br><br>The Nike SB Zooom Blazer Mid Edge Floral Paisley White Grey first was made available for sale in September of 2021. This pair of shoes were first sold at a retail price of $100.', 'men', 'https://images.stockx.com/images/Nike-SB-Zooom-Blazer-Mid-Edge-Floral-Paisley-White-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1654859403', 'Floral White Grey', 1, '2022-04-14', 105, 'Nike SB Zooom Blazer Mid Edge', 'Nike-SB-Zooom-Blazer-Mid-Edge-Floral-Paisley-White-Grey', 'Nike SB Zooom Blazer Mid Edge Floral White Grey', 'sneakers+nike+nike sb+blazer+white/grey+2022-04-14+105+dm0859-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('2c50984e-75c1-487a-b302-18bfe04e653c', 'Jordan', 'Air Jordan One', 'White/Phantom Grey/Sail/Orange', 'New', 'VN', 'The Air Jordan 1 Mid Inside Out White Grey is covered in pieces of suede and leather that are in light grey and off-white shades.<br><br>The Air Jordan 1 Mid Inside Out White Grey presents a unique spin on the classic Air Jordan, with the body of the shoe featuring a variety of neutral colors and different fabrics. The Nike symbol on the side appears in white, with subtle red details. The laces are a buttery cream color and sit on top of a light pink tongue.<br><br>The Air Jordan 1 Mid Inside Out White Grey had an initial release date of April 2022. The starting retail price for this model was $130.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Inside-Out-White-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1653035042', 'Craft Inside Out White Grey', 1, '2022-03-01', 120, 'Jordan 1 Mid SE', 'Air-Jordan-1-Mid-Inside-Out-White-Grey', 'Jordan 1 Mid SE Craft Inside Out White Grey', 'sneakers+jordan+air jordan+one+white/phantom grey/sail/orange+2022-03-01+120+dm9652-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('2c896fe2-9f4f-4b0c-a884-2ed81ca34333', 'Nike', 'Nike Basketball Dunk', 'Aura/Worn Blue/White/Clear', 'New', 'CN', 'The gradeschool Nike Dunk Low Clear Blue (GS) features a light blue tumbled leather upper with Worn Blue overlays and a clear TPU Swoosh. At the base, a white and Worn Blue Air sole adds the finishing touch.<br><br>The gradeschool Nike Dunk Low Clear Blue (GS) released in 2022 and retailed for $85.', 'child', 'https://images.stockx.com/images/Nike-Dunk-Low-Clear-Blue-Swoosh-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1649959331', 'Clear Blue Swoosh (GS)', 1, '2022-04-22', 85, 'Nike Dunk Low', 'Nike-Dunk-Low-Clear-Blue-Swoosh-GS', 'Nike Dunk Low Clear Blue Swoosh (GS)', 'sneakers+nike+nike basketball+dunk+low+aura/worn blue/white/clear+2022-04-22+85+dh9765-401');
