INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('2d4313be-189e-491e-9dfa-4404693882f3', 'Jordan', 'Air Jordan One', 'Sail/Obsidian-University Blue', 'New', 'CN', 'Jordan Brand adds a new colorway to its hot streak of Jordan 1 releases with the Air Jordan 1 "Obsidian / University Blue", now available on StockX. Since its debut in 1985, the Air Jordan 1 has been a cultural monument, breaking barriers between the court and the streets. Jordan Brand has continued to shed new light on this timeless silhouette and does so with this release.<br><br>This AJ 1 features a similar design to the "UNC Patent" 1s that released in February of 2019, only this time the colorway receives a full leather treatment. This sneaker released in August of 2019 and retails for $160.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-UNC-Leather.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606322077', 'Obsidian UNC', 1, '2019-08-31', 160, 'Jordan 1 Retro High', 'Air-Jordan-1-Retro-High-UNC-Leather', 'Jordan 1 Retro High Obsidian UNC', 'sneakers+jordan+air jordan+one+high+sail/obsidian-university blue+2019-08-31+160+555088-140');
