INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('2e138dae-6833-4ed5-93cd-06e35567db60', 'Nike', 'Air Max Other', 'Black/White-Cool Grey-Wolf Grey', 'New', 'CN', 'The Nike Air Max Correlate Black White Grey is a comfortable yet flexible shoe that provides all of the best athletic qualities while still being stylish.<br><br>The Nike Air Max Correlate Black White Grey provides an ample amount of heel support and has a particularly cushioned sole. Splashes of pink and green appear in contrast to the black, white, and grey pattern that makes up a majority of the shoe. The upper part of the Nike Air Max Correlate Black White Grey molds to the foot, helping to provide support and protection while still remaining comfortable.<br><br>First released in May 2022 at a starting price of $155.', 'men', 'https://images.stockx.com/images/Nike-Air-Max-Correlate-Black-White-Grey.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1609757570', 'Black White Grey', 1, '2012-01-01', 120, 'Nike Air Max Correlate', 'Nike-Air-Max-Correlate-Black-White-Grey', 'Nike Air Max Correlate Black White Grey', 'sneakers+nike+air max+other+black/white-cool grey-wolf grey+2012-01-01+120+511416-011');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('2e1bbf96-2e92-4b79-8d9b-60d4c052f8e2', 'Nike', 'Nike Dunk', 'Rattan/Summit White/Sail/Black', 'New', 'ID', 'The Nike Dunk High Next Nature Toasty Rattan has an off-white sole, with the base featuring the same color.<br><br>White laces lay on top of a white tongue. The very top of the shoe falls just at the top of the ankle for most wearers. Strips of beige leather are used as accents on the sides of the shoes, as well as on the heel and toe. The Nike swoosh shape appears in black and wraps around the back of the foot.<br><br>The Nike Dunk High Next Nature Toasty Rattan first was put on the market in November of 2021. The starting price for these shoes was $130.', 'men', 'https://images.stockx.com/images/Nike-Dunk-High-Next-Nature-Toasty-Rattan-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1646233587', 'Next Nature Toasty Rattan', 1, '2021-11-05', 130, 'Nike Dunk High', 'Nike-Dunk-High-Next-Nature-Toasty-Rattan', 'Nike Dunk High Next Nature Toasty Rattan', 'sneakers+nike+nike+dunk+high+rattan/summit white/sail/black+2021-11-05+130+dd3362-200');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('2eb5ab03-ccca-4c72-9517-3a3174494a1c', 'Nike', 'Nike Dunk', 'Orange Pearl/White', 'New', 'CN', 'Nike delivered a warm-paletted women’s exclusive with the Nike Dunk Low Retro Orange Pearl. The Orange Pearl follows traditional Nike Dunk color-blocking, a design with panels of the shoe’s upper saturated by a designated color.The upper Nike Dunk Low Retro Orange Pearl is composed of white leather with Orange Pearl leather overlays and Swooshes. Classic Nike Air branding is featured on the nylon tongue, nodding to classic Dunk design elements. A white midsole and Orange Pearl outsole wrap up the design.The women''s Nike Dunk Low Retro Orange Pearl released in January of 2021 and retailed for $100.', 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Orange-Pearl-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1613671259', 'Orange Pearl (W)', 1, '2021-03-15', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Orange-Pearl', 'Nike Dunk Low Orange Pearl (W)', 'sneakers+nike+nike+dunk+low+orange pearl/white+2021-03-15+100+dd1503-102');
