INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('302c03e2-3e51-42da-8682-90542a6c878e', 'Jordan', 'Air Jordan One', 'Signal Blue/Black-White', 'New', 'CN', 'The Air Jordan 1 Mid Signal Blue (GS) is a shoe designed for grade schoolers (GS). This colorway boasts white underlays contrasted by shiny blue overlays surrounded by black trims. Besides having black trims, this shoe also boasts black woven tongue tags and laces. It features Nike Swooshes, the renowned wings logo on its ankle, and the Jumpman logo on its tongue. For traction, it has a well-designed rubber cupsole, and for comfort, it has a white midsole with air.<br><br>The Air Jordan 1 Mid Signal Blue (GS) was released on January 1, 2021. Originally, it had a retail price of $100.', 'child', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Signal-Blue-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1647268149', 'Signal Blue (GS)', 1, '2021-01-01', 100, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Signal-Blue-GS', 'Jordan 1 Mid Signal Blue (GS)', 'sneakers+jordan+air jordan+one+mid+signal blue/black-white+2021-01-01+100+bq6931-402');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('307d7842-2b4b-4f7f-b267-b3e6b57414dd', 'Jordan', 'Air Jordan One', 'College Navy/Summit White-Tech Grey', 'New', 'CN', 'Jordan Brand celebrated the 40th Anniversary of Michael Jordan''s 1982 NCAA title win over the Georgetown Bulldogs by bringing back the original 1985 Air Jordan 1 silhouette in his former opponent-turned-partner''s school colors.<br><br>Drawing inspiration from the Nike Terminator Georgetown, the Air Jordan 1 High ''85 Georgetown features a classic two-tone color blocked look, with a smooth grey leather upper and College Navy overlays. A yellowed nylon tongue with a woven Nike label nods to the appeal of vintage 1985 Jordan 1s. At the base, a white and navy air sole completes the design.<br><br>The Air Jordan 1 High ''85 Georgetown released in April of 2022 and retailed for $200.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-85-Georgetown-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1646752871', 'Georgetown', 1, '2022-04-02', 200, 'Jordan 1 Retro High 85', 'Air-Jordan-1-Retro-High-85-Georgetown', 'Jordan 1 Retro High 85 Georgetown', 'sneakers+jordan+air jordan+one+college navy/summit white-tech grey+2022-04-02+200+bq4422-400');
