INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('31e78d4d-cb96-4535-8b01-2f294836e7d6', 'Nike', 'Nike SB SB Dunk Low', 'Racer Blue/Laser Blue-University Blue-White', 'New', 'VN', 'As part of the 2022 Nike SB Fruit Pack, the Nike SB Dunk Low Blue Raspberry features a Laser Blue tumbled leather upper with Racer Blue suede overlays and University Blue Swooshes. On the inside face of the tongue, a woven label depicting a cartoon-style raspberry character adds a playful look to the silhouette. From there, a cushioned Zoom Air sole completes the design.<br><br>The Nike SB Dunk Low Blue Raspberry released in June of 2022 and retailed for $110.', 'men', 'https://images.stockx.com/images/Nike-SB-Dunk-Low-Blue-Raspberry-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1654265793', 'Blue Raspberry', 1, '2022-06-01', 110, 'Nike SB Dunk Low', 'Nike-SB-Dunk-Low-Blue-Raspberry', 'Nike SB Dunk Low Blue Raspberry', 'sneakers+nike+nike sb+sb dunk low+racer blue/laser blue-university blue-white+2022-06-01+110+dm0807-400');
