INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('321274a1-ab92-4ecb-8edd-2be24d447b4b', 'Jordan', 'Air Jordan Three', 'Silver/Light Graphite-Orange Peel-Sport Red', 'New', 'CN', 'Jordan Brand brought back a beloved Cool Grey from their archives with the Air Jordan 3 Cool Grey. The Cool Grey colorway has been prominently featured on some of Jumpman’s most prolific silhouettes, most notably the Air Jordan 11.<br><br>The upper of the Jordan 3 Cool Grey is constructed of a Cool Grey Durabuck with classic Elephant Print mudguards on the toe and heel. Hits of Sport Red and Orange Peel are located on the tongue, eyelets, Air bag, and heel tab. Instead of traditional "Nike Air" branding on the heel, this model stays true to its 2007 rendition and features a Jumpman logo. A white and dark grey sole completes this retro design.<br><br>The Air Jordan 3 Cool Grey released in February of 2021 and retailed for $190.', 'men', 'https://images.stockx.com/images/Air-Jordan-3-Retro-Cool-Grey-2021-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1611079916', 'Cool Grey (2021)', 1, '2021-02-20', 190, 'Jordan 3 Retro', 'Air-Jordan-3-Retro-Cool-Grey-2021', 'Jordan 3 Retro Cool Grey (2021)', 'sneakers+jordan+air jordan+three+silver/light graphite-orange peel-sport red+2021-02-20+190+ct8532-012');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('324faf07-41c9-455b-833f-d75a087baccc', 'Jordan', 'Air Jordan One', 'White/Black/Grey Fog/Bleached Coral', 'New', 'CN', 'Following the classic Black Toe theme, the Air Jordan 1 High OG Bleached Coral features a smooth white leather upper with black overlays and light grey Durabuck heel wraps. Tradition Nike woven tongue labels and Jordan Wings Logos on the collars add a retro feel. From there, a white and light grey Air sole completes the design.<br><br>The Air Jordan 1 High OG Bleached Coral releases in July of 2022 and retails for $180.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-OG-Stage-Haze-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1653035159', 'Bleached Coral', 1, '2022-07-02', 180, 'Jordan 1 Retro High OG', 'Air-Jordan-1-Retro-High-OG-Stage-Haze', 'Jordan 1 Retro High OG Bleached Coral', 'sneakers+jordan+air jordan+one+white/black/grey fog/bleached coral+2022-07-02+180+555088-108');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('32607e6f-8e4d-4598-842f-a3891cb14dd1', 'New Balance', 'New Balance 550', 'White/Gum', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/New-Balance-550-White-Gum-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1668754380', 'White Gum', 1, '2022-11-01', 120, 'New Balance 550', 'New-Balance-550-White-Gum', 'New Balance 550 White Gum', 'sneakers+new balance+new balance+550+white/gum+2022-11-01+120+bb550wgu');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('328deb9a-4232-4e31-bcc3-322af09b68c1', 'Nike', 'KD 14', 'Soft Pink/Dark Pink', 'New', 'VN', 'The Nike KD 14 Aunt Pearl are high tops and typically fall at the top of the ankle for most wearers. They also have extra cushioning, making them comfortable for longer walks.<br><br>The Nike KD 14 Aunt Pearl has a Gum rubber outsole, as well as a vibrant pink base that features a detailed pattern. Towards the front of the shoe, you will find a hot pink speckled pattern. Across the pink laces and tongue, there is a pink strap that features the iconic Nike Swoosh symbol.<br><br>First released in April of 2022, the Nike KD 14 Aunt Pearl had a starting retail price of $150.', 'men', 'https://images.stockx.com/images/Nike-KD-14-Aunt-Pearl-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1649428628', 'Aunt Pearl', 1, '2022-04-15', 160, 'Nike KD 14', 'Nike-KD-14-Aunt-Pearl', 'Nike KD 14 Aunt Pearl', 'sneakers+nike+kd+14+soft pink/dark pink+2022-04-15+160+dc9379-600/dc9380-600');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('32c8529c-2b39-44e3-8b6d-7b99ec546380', 'Jordan', 'Air Jordan One', 'Court Purple/White-Black', 'New', 'CN', 'Jordan Brand added a new colorway to the silhouette that started it all with the Jordan 1 Retro High Court Purple White, now available on StockX. This release follows similar design elements as the Chicago 1, only this time replacing red with Court Purple.<br><br>This Jordan 1 consists of a white leather upper with Court Purple overlays and black detailing. A black Swoosh and Wings logo, white midsole, and Court Purple outsole completes the design. These sneakers released in April of 2020 and retailed for $170.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-Court-Purple-White-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606321166', 'Court Purple White', 1, '2020-04-11', 170, 'Jordan 1 Retro High', 'Air-Jordan-1-Retro-High-Court-Purple-White', 'Jordan 1 Retro High Court Purple White', 'sneakers+jordan+air jordan+one+court purple/white-black+2020-04-11+170+555088-500');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('32d2aac9-0bac-4862-85c0-1dcbd7d2d03f', 'adidas', 'adidas Yeezy', 'MX Oat/MX Oat/MX Oat', 'New', 'CN', 'The adidas Yeezy Boost 350 V2 MX Oat features a yellow, orange, and blue swirl-patterned Primeknit upper with a mesh side stripe and yellow heel tab. From there, a semi-translucent Boost midsole and pale yellow rope laces complete the design.<br><br>The adidas Yeezy Boost 350 V2 MX Oat released in October of 2021 and retailed for $220.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Boost-350-V2-MX-Oat-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1634917162', 'MX Oat', 1, '2021-10-23', 220, 'adidas Yeezy Boost 350 V2', 'adidas-Yeezy-Boost-350-V2-MX-Oat', 'adidas Yeezy Boost 350 V2 MX Oat', 'sneakers+adidas+adidas+yeezy+350+v2+mx oat/mx oat/mx oat+2021-10-23+220+gw3773');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('3358de6a-ca12-4119-83d2-f021c52fd76d', 'Nike', 'Nike Dunk', 'White/Black', 'New', 'ID', 'The Nike Dunk Low Reverse Panda features the Nike Swoosh logo in black on the tongue and also on the heel padding behind the ankle.<br><br>The Nike Dunk Low Reverse Panda has a clean white color throughout, including the sole, with contrasting touches of black. The shoe also features a lace-up closure style with black laces. The Nike Swoosh is found on both sides, also in black, and these meet behind the ankle and below the white heel padding.<br><br>The Nike Dunk Low Reverse Panda first debuted in Asia in June, 2022, and then in the UK and Europe in July of 2022 at a retail price of $100.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Reverse-Panda-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1657781952', 'Reverse Panda', 1, '2022-06-15', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Reverse-Panda', 'Nike Dunk Low Reverse Panda', 'sneakers+nike+nike+dunk+low+white/black+2022-06-15+100+dj6188-101');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('33bb60f4-fae2-498f-b4b2-4fc8eae3ea47', 'Jordan', 'Air Jordan One', 'Sail/University Red-Ridgerock', 'New', 'CN', 'Nodding to the Air Jordan 1 High Travis Scott Mocha, the Air Jordan 1 Low Travis Scott Reverse Mocha offers a similar Mocha and off-white palette but in a reverse-style color blocking. Its upper is constructed with a Mocha Durabuck base, white leather overlays, and signature reverse Swooshes. Hits of red on the Wings logo heel embroidery and woven tongue label gives a sharp contrast to the design''s neutral look. From there, a yellowed Air sole adds a vintage feel.<br><br>The Air Jordan 1 Low Travis Scott Reverse Mocha released in July of 2022 and retailed for $190.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-Low-OG-SP-Travis-Scott-Reverse-Mocha_V2-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1659033979', 'Travis Scott Reverse Mocha', 1, '2022-07-21', 150, 'Jordan 1 Retro Low OG SP', 'Air-Jordan-1-Retro-Low-OG-SP-Travis-Scott-Reverse-Mocha', 'Jordan 1 Retro Low OG SP Travis Scott Reverse Mocha', 'sneakers+jordan+air jordan+one+sail/university red-ridgerock+2022-07-21+150+dm7866-162');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('3414f48d-e8bf-463f-9e6b-9d8520a202b9', 'Timberland', 'Timberland Boots', 'Black', 'New', 'CN', 'The Timberland 6-Inch Black Nubuck features a black Nubuck leather construction which comes from top-grain calfskin or cowhide. The leather is layered on the collar to create comfort and protect the feet from outside elements. Timberland also includes anti-fatigue technology that absorbs sudden impact and returns that energy to where it came from.<br><br>The Timberland 6-Inch Black Nubuck released in January of 2018 and retailed for $190.', 'men', 'https://images.stockx.com/images/Timberland-6-Black-Nubuck-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1637680363', 'Black Nubuck Premium', 1, '2018-01-01', 190, 'Timberland 6"', 'Timberland-6-Black-Nubuck', 'Timberland 6" Black Nubuck Premium', 'sneakers+timberland+timberland+boots+black+2018-01-01+190+tb010073-009/tb010073-001');
