INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('344b1ba2-03f8-4c93-bbaf-88f9271249a0', 'Nike', 'Air Force One', 'White/White-Metallic Gold-Flat Gold', 'New', 'VN', 'The women''s Nike Air Force 1 Low LX Lucky Charms White (W) features a smooth white leather upper with matching overlays and Swooshes. At the collar, a gold metallic chain with Nike charms pops against the white upper. From there, matching gold Nike Air embroidery at the heel completes the design.<br><br>The women''s Nike Air Force 1 Low LX Lucky Charms White (W) released in 2021 and retailed for $110.', 'women', 'https://images.stockx.com/images/Nike-Air-Force-1-Low-LX-Lucky-Charms-White-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1643281062', 'White Pendant (W)', 1, '2021-11-11', 110, 'Nike Air Force 1 Low LX', 'Nike-Air-Force-1-Low-LX-Lucky-Charms-White-W', 'Nike Air Force 1 Low LX White Pendant (W)', 'sneakers+nike+air force+one+low+white/white-metallic gold-flat gold+2021-11-11+110+dd1525-100');
