INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('348952df-d518-4987-bd0f-e7fd5a6b2821', 'Jordan', 'Air Jordan Four', 'White/Tech Grey-Black-Fire Red', 'New', 'CN', 'The Air Jordan 4 Retro White Oreo 2021 (GS) features white, tech grey, black, and fire red colors with a webbed canvas upper that combines with leather components at the toe cap and along the sides. From there, Tech Grey shading accents the rest of the upper, and speckling along the tongue, ankle, and midsole rounds out the look.<br><br>The Air Jordan 4 Retro White Oreo 2021 (GS) released in July of 2021 and retailed for $150.', 'child', 'https://images.stockx.com/images/Air-Jordan-4-Retro-White-Oreo-2021-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1623166171', 'White Oreo (2021) (GS)', 1, '2021-07-03', 150, 'Jordan 4 Retro', 'Air-Jordan-4-Retro-White-Oreo-2021-GS', 'Jordan 4 Retro White Oreo (2021) (GS)', 'sneakers+jordan+air jordan+four+white/tech grey-black-fire red+2021-07-03+150+dj4699-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('34cde069-c2e1-46cf-8d84-c2db4bd3d665', 'Jordan', 'Air Jordan One', 'White/Light Smoke Grey', 'New', 'CN', 'The women''s Jordan 1 Mid Light Smoke Grey (W) features white leather upper with Light Smoke Grey overlays and black Swooshes. From there, a classic Jordan Wings logo on the collar and Jumpman logo tongue label add the finishing touch.<br><br>The women''s Jordan 1 Mid Light Smoke Grey (W) released in October of 2021 and retailed for $120.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Light-Smoke-Grey-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1634224679', 'Light Smoke Grey (W)', 1, '2021-10-11', 120, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Light-Smoke-Grey-W', 'Jordan 1 Mid Light Smoke Grey (W)', 'sneakers+jordan+air jordan+one+white/light smoke grey+2021-10-11+120+bq6472-015');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('35890e63-fae4-416c-9ebb-4dfde3b6fca5', 'Jordan', 'Air Jordan One', 'Cardinal Red/White/Light Curry', 'New', 'VN', 'The Air Jordan 1 Low Cardinal Red has red laces that lay on top of a white tongue. The shoe’s logo can be found at the top of the tongue in red.<br><br>On this model, you will find a red sole paired with a white midsole. The body of the shoe is made out of white leather, with patches of red leather on the toes, heels, and sides. The famous Nike swoosh symbol appears in red leather as well.<br><br>The Air Jordan 1 Low Cardinal Red first came onto the market in June of 2022. It had an initial retail price of $100.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Low-Cardinal-Red-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1649427431', 'Cardinal Red', 1, '2022-03-29', 100, 'Jordan 1 Low', 'Air-Jordan-1-Low-Cardinal-Red', 'Jordan 1 Low Cardinal Red', 'sneakers+jordan+air jordan+one+cardinal red/white/light curry+2022-03-29+100+553558-607');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('35a63707-c42b-47db-a2b1-a5d110c0aef8', 'Jordan', 'Air Jordan One', 'Electro Orange/Black-White', 'New', 'CN', 'The Air Jordan 1 Mid Metallic Orange has the brand’s iconic perforated toebox. The Air Jordan and Nike symbols appear on the shoe embossed in black.<br><br>This high top model has a bright orange sole that sits right below a white midsole. You will find that the body of the shoe is primarily covered in patches of orange leather that sit on top of a white base. The Nike swoosh symbol is made out of white leather and has orange stitching.<br><br>The Air Jordan 1 Mid Metallic Orange was first released in August of 2022. The initial starting price of this model was $130.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Metallic-Orange-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1625842448', 'Metallic Orange', 1, '2021-08-11', 115, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Metallic-Orange', 'Jordan 1 Mid Metallic Orange', 'sneakers+jordan+air jordan+one+electro orange/black-white+2021-08-11+115+dm3531-800');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('35f99ed9-943b-41e9-aafc-c8215a4e3f0b', 'Nike', 'Dunk Low', 'Mineral Slate/Armory Navy-Black-White', 'New', 'ID', null, 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Armory-Navy-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1666248184', 'Armory Navy', 1, null, 120, 'Nike Dunk Low', 'Nike-Dunk-Low-Armory-Navy', 'Nike Dunk Low Armory Navy', 'sneakers+nike+dunk+low+mineral slate/armory navy-black-white+120+dr9705-300');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('3628056d-c75f-4833-b605-6826b2948c79', 'Jordan', 'Air Jordan Eleven', 'Black/White-Varsity Red', 'New', 'VN', 'The Air Jordan 11 Retro Playoffs 2019 for Grade School (GS) uses the classic Black/White/Varsity Red ‘bred’ colorway introduced in 1996. The patent leather mudguard, nylon mesh upper, tongue, webbed eyestays, and rope-like laces are black. A white Nike Air logo and swoosh appear on the black insole. The black leather collar features a red-stitched Jumpman and a white 23. A black Jumpman is visible through the translucent red rubber outsole with spots of black chevrons. A carbon-fiber midfoot shank in black and gray checks enhances the white midsole.<br><br>The Air Jordan 11 Retro Playoffs 2019 GS sneaker for kids was released on December 14, 2019, at a retail price of $170.', 'child', 'https://images.stockx.com/images/Air-Jordan-11-Retro-Playoffs-2019-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1607650698', 'Playoffs Bred (2019) (GS)', 1, '2019-12-14', 170, 'Jordan 11 Retro', 'Air-Jordan-11-Retro-Playoffs-2019-GS', 'Jordan 11 Retro Playoffs Bred (2019) (GS)', 'sneakers+jordan+air jordan+eleven+kids+black/white-varsity red+2019-12-14+170+378038-061');
