INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('3774e829-99f4-46d6-bb94-f9e19ad55ad3', 'adidas', 'adidas Yeezy', 'Sesame/Sesame/Sesame', 'New', 'CN', 'We don’t know if Kanye loves Sesame seeds but we do know that he’s released the adidas Yeezy Boost 350 V2 Sesame. This major silhouette comes with a sesame upper, sesame midsole, and a gum sole. These sneakers released in November 2018 and retailed for $220.  While getting your grub on stay fresh and cop these on StockX today.', 'men', 'https://images.stockx.com/images/Adidas-Yeezy-Boost-350-V2-Sesame-Thumb.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606322910', 'Sesame (2018/2022)', 1, '2018-11-23', 220, 'adidas Yeezy Boost 350 V2', 'adidas-Yeezy-Boost-350-V2-Sesame', 'adidas Yeezy Boost 350 V2 Sesame', 'sneakers+adidas+adidas+yeezy+v2+350+sesame/sesame/sesame+2018-11-23+220+f99710');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('37a872fc-837d-4ea5-8848-8b66a1326870', 'Jordan', 'Air Jordan One', 'White/Tropical Twist-Black', 'New', 'CN', 'Smaller sizes of the Air Jordan 1 Mid Igloo Gradeschool (GS) were made available by the Jordan Brand in tropical, black, and white color patterns. With a black upper and tropical accents on the ankle collar, lace stay, Jumpman emblems, heels, and Swoosh set against the crisp white shoe base, the company retains its impressive design aesthetic.<br><br>Like the other Air Jordan 1 models, the Air Jordan 1 Mid Igloo (GS) is made entirely of leather. The Jumpman and the wings logo are placed on the central tongue and side, respectively.<br><br>The Air Jordan 1 Mid Igloo (GS) was released on April 1, 2021 and retailed at $100.', 'child', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Igloo-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1623166011', 'Tropical Twist Igloo (GS)', 1, '2021-01-04', 90, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Igloo-GS', 'Jordan 1 Mid Tropical Twist Igloo (GS)', 'sneakers+jordan+air jordan+one+white/tropical twist-black+2021-01-04+90+554725-132');
