INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('37dbfb1c-708b-4cf0-8a17-e57ecee72ad8', 'Jordan', 'Air Jordan One', 'White/Dark Marina Blue', 'New', 'VN', 'The women''s Jordan 1 Low Marina Blue (W) arrives with a smooth white leather upper with Marina Blue overlays and Swooshes. At the heel, an embroidered Jordan Wings logo tributes the collar on the original Air Jordan 1. From there, a white and Marina Blue Air sole adds the finishing touch.<br><br>The women''s Jordan 1 Low Marina Blue (W) released in January of 2022 and retailed for $100.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-Low-Marina-Blue-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1649778740', 'Marina Blue (W)', 1, '2022-01-29', 100, 'Jordan 1 Low', 'Air-Jordan-1-Low-Marina-Blue-W', 'Jordan 1 Low Marina Blue (W)', 'sneakers+jordan+air jordan+one+white/dark marina blue+2022-01-29+100+dc0774-114');
