INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('383c39d2-1845-474e-bb9a-0eb7e4b84823', 'Nike', 'Nike Dunk', 'Carbon Green/Rift Blue-Sail', 'New', 'VN', 'The Nike Dunk Low Siempre Familia draws inspiration from Mictlān, the underworld in Aztec mythology that consists of nine layers, similar to Dante Alighieri''s Inferno. Its tonal green reptilian-textural upper and Iguana heel illustration symbolize the inhabitants of the 8th and 9th levels of Mictlān. A decorative multicolor Swoosh displays palettes and graphic styles commonly associated with Día de Muertos, the Mexican Day of the Dead.<br><br>The Nike Dunk Low Siempre Familia released in February of 2022 and retailed for $120.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Siempre-Familia-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1646080685', 'Siempre Familia', 1, '2022-02-17', 120, 'Nike Dunk Low', 'Nike-Dunk-Low-Siempre-Familia', 'Nike Dunk Low Siempre Familia', 'sneakers+nike+nike+dunk+low+mxscavengerhunt+carbon green/rift blue-sail+2022-02-17+120+do2160-335');
