INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('39511b50-d347-4102-9e6c-4415aac4d8a6', 'adidas', 'adidas Yeezy', 'Analog/Analog/Analog', 'New', 'CN', 'Yeezy is back from his Sunday Service Coachella performance with this new adidas Yeezy Boost 700 Analog. This Yeezy Boost 700 comes with a beige upper plus grey accents, three grey adidas stripes, beige midsole plus grey accents, and a black sole. These sneakers released in April 2019 and retailed for $300. Buy this Yeezy 700 on StockX ASAP.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Boost-700-Analog-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606322253', 'Analog', 1, '2019-04-27', 300, 'adidas Yeezy Boost 700', 'adidas-Yeezy-Boost-700-Analog', 'adidas Yeezy Boost 700 Analog', 'sneakers+adidas+adidas+yeezy+700+v1+analog/analog/analog+2019-04-27+300+eg7596');
