INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('39c1c000-79ef-456a-bf84-3588e074093e', 'Jordan', 'Air Jordan One', 'White/University Red-Black', 'New', 'ID', 'The Air Jordan 1 Retro High OG Heritage (GS) for grade schoolers can be worn on the basketball court or in town.<br><br>The color palette of the Air Jordan 1 Retro High OG Heritage (GS) for grade schoolers is made up of white, red, and black. A mixture of smooth and pebbled leather is used on the upper part of the shoe. On the toes and heels, you will find red accents, in addition to the red Nike Swoosh symbol on the side. Black laces lay on top of the white and black tongue, which is touched by red leather straps. <br><br>The Air Jordan 1 Retro High OG Heritage (GS) for grade schoolers for grade schoolers was first released in May of 2022. This model had a starting retail price of $170 for men’s sizing.', 'child', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-OG-Heritage-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1654798952', 'Heritage (GS)', 1, '2022-05-25', 140, 'Jordan 1 Retro High OG', 'Air-Jordan-1-Retro-High-OG-Heritage-GS', 'Jordan 1 Retro High OG Heritage (GS)', 'sneakers+jordan+air jordan+one+white/university red-black+2022-05-25+140+575441-161');
