INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('3b401d58-96a6-4a33-a78c-b5bc9ccef73c', 'Nike', 'Nike Dunk', 'Metallic Silver/Off Noir-White-Silver', 'New', 'ID', 'The women''s Nike Dunk Low Golden Gals Metallic Silver (W) features a white canvas upper with metallic silver cracked leather overlays and black Swooshes. From there, a woven tongue label and matching sole completes the design.<br><br>The women''s Nike Dunk Low Golden Gals Metallic Silver (W) released in December of 2021 and retailed for $110.', 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Shimmer-White-Metallic-Silver-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1634318263', 'Golden Gals Metallic Silver (W)', 1, '2021-12-09', 110, 'Nike Dunk Low', 'Nike-Dunk-Low-Shimmer-White-Metallic-Silver-W', 'Nike Dunk Low Golden Gals Metallic Silver (W)', 'sneakers+nike+nike+dunk+low+metallic silver/off noir-white-silver+2021-12-09+110+do5882-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('3bbcbf2e-50c6-483b-ac24-cb00f9519a36', 'Nike', 'Air Force One', 'White/Clear White', 'New', 'VN', 'The Nike Air Force 1 Mid Off-White White honors the 40th Anniversary of the Nike Air Force 1 by refreshing the classic design with Abloh''s signature avante-garde style. It features a white wood grain-textured, lightweight mesh construction with ripstop collar straps, and clear TPU Swooshes. At the base, a warped midsole with multi-colored sections of a track-inspired spiked outsole reference past Nike Off-White designs like the Nike Waffle Racer and Air Zoom Tempo Next%.<br><br>The Nike Air Force 1 Mid Off-White White released in June of 2022 and retailed for $185.', 'men', 'https://images.stockx.com/images/Nike-Air-Force-1-Mid-Off-White-White-Product-2.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1655993120', 'Off-White White', 1, '2022-06-23', 185, 'Nike Air Force 1 Mid', 'Nike-Air-Force-1-Mid-Off-White-White', 'Nike Air Force 1 Mid Off-White White', 'sneakers+nike+air force+one+white/clear white+2022-06-23+185+do6290-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('3c1c3be4-8c68-4bdd-a760-2a393018beb7', 'New Balance', 'New Balance 530', 'Ivory/White/Black', 'New', 'ID', 'Since its launch in 1992, New Balance 530 Ivory has become a popular unisex sneaker due to its performance running shoe design.<br><br>New Balance 530 Ivory''s upper is made of synthetic leather, while the midsole is produced through a cold cement process. New Balance 530 Ivory''s design is ivory, white, and black, with a style code of MR530SH. The sneaker weighs 339 grams (12 oz.) and features a lace-up closure. New Balance 530 Ivory also features the New Balance "N" logo on its quarter panel.<br><br>New Balance 530 Ivory became available on July 5, 2022, at a retail price of $80.', 'men', 'https://images.stockx.com/images/New-Balance-530-Ivory.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1648021405', 'Ivory', 1, '2020-03-05', 80, 'New Balance 530', 'New-Balance-530-Ivory', 'New Balance 530 Ivory', 'sneakers+new balance+new balance+530+ivory/white/black+2020-03-05+80+mr530sh');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('3c559bdd-d13a-412c-8a18-3bd88651be71', 'Jordan', 'Air Jordan One', 'White/Multi-Color-Total Orange', 'New', 'CN', 'Jordan Brand encourages sneaker customization with the Air Jordan 1 Prototype.<br><br>With a perforated line separating the collar from the rest of the upper, the Air Jordan 1 Prototype can be worn as a high-top or low-top if you choose to safely cut the collar away. White leather construction with multicolor leather and Durabuck overlays further amplify the DIY appeal of the design.<br><br>The Air Jordan 1 Prototype released in September of 2021 and retailed for $170.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-High-OG-Pro-White-Blue-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1633023637', 'Prototype ', 1, '2021-09-24', 170, 'Jordan 1 Retro High OG', 'Air-Jordan-1-High-OG-Pro-White-Blue-Black', 'Jordan 1 Retro High OG Prototype ', 'sneakers+jordan+air jordan+one+white/multi-color-total orange+2021-09-24+170+dc6515-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('3c6919e8-c6c9-4064-a264-5060fb76fbed', 'Puma', 'Puma Puma', 'Puma White/High Risk Red', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Puma-LaMelo-Ball-MB01-White-Red-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1659034585', 'Team Colors White High Risk Red', 1, '2022-07-13', 120, 'Puma LaMelo Ball MB.01 Lo', 'Puma-LaMelo-Ball-MB01-White-Red', 'Puma LaMelo Ball MB.01 Lo Team Colors White High Risk Red', 'sneakers+puma+puma+puma+puma white/high risk red+2022-07-13+120+376941-10');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('3c8a12f2-1c2b-4af1-aa76-2713ba849388', 'Jordan', 'Air Jordan One', 'University Red/Pomegranate-White', 'New', 'VN', 'The Air Jordan 1 Mid SE Pomegranate (Women''s) has the classic Air Jordan tread that makes it convenient for both exercise and daily wear.<br><br>The sole of this model is a bright red, placed directly next to a white midsole. The rest of the shoe’s body is covered in a mixture of matte and metallic reds. The Nike swoosh symbol is subtly included in metallic red, with the Air Jordan logo embossed in the fabric up above on the ankle. <br><br>The Air Jordan 1 Mid SE Pomegranate (Women''s) was first released onto the market in December of 2021. The initial retail price of this model was $135.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-Mid-SE-Pomegranate-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1646841830', 'Pomegranate (W)', 1, '2021-12-30', 130, 'Jordan 1 Mid SE', 'Air-Jordan-1-Mid-SE-Pomegranate-W', 'Jordan 1 Mid SE Pomegranate (W)', 'sneakers+jordan+air jordan+one+university red/pomegranate-white+2021-12-30+130+dh5894-600');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('3ccf748c-fb20-40ce-8ecd-645ffa4f8a7c', 'Jordan', 'Air Jordan Four', 'Pearl White/Dark Driftwood-Gym Red', 'New', 'VN', 'Jordan Brand commemorated American writer and illustrator Maurice Sendak''s 1963 children''s book Where The Wild Things Are with the kids-exclusive Air Jordan 4 Wild Things (GS).<br><br>The fleece collar and tongue on the Air Jordan 4 Wild Things (GS) takes inspiration from the furry monsters called Wild Things that the story''s main character, Max, encounters on his journey. From there, red and neon green eyelets add a vibrant pop, contrasting the design''s earthtone palettes.<br><br>The Air Jordan 4 Wild Things (GS) released in November of 2021 and retailed for $140.', 'child', 'https://images.stockx.com/images/Air-Jordan-4-Retro-Where-the-Wild-Things-Are-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1636482064', 'Where the Wild Things Are (GS)', 1, '2021-11-05', 140, 'Jordan 4 Retro', 'Air-Jordan-4-Retro-Where-the-Wild-Things-Are-GS', 'Jordan 4 Retro Where the Wild Things Are (GS)', 'sneakers+jordan+air jordan+four+pearl white/dark driftwood-gym red+2021-11-05+140+dh0572-264');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('3ce90ff4-c1be-4e50-905c-3203c8500c11', 'Jordan', 'Air Jordan Five', 'Black/Classic Jade-Fire Red-Metallic Silver', 'New', 'CN', 'The Air Jordan 5 Low CLOT Jade celebrates China''s appreciation for jade, as its heritage and tradition is infused with greatness. The design features a black satin-like upper with semi-translucent TPU netted inserts and light grey heel embroideries. Attached to the red woven laces, clear jade beads add further decoration. At the base, a midsole similar to the Jordan 5 Metallic and a jade semi-translucent outsole complete the design.<br><br>The Air Jordan 5 Low CLOT Jade released in May of 2022 and retailed for $200.', 'men', 'https://images.stockx.com/images/Air-Jordan-5-Retro-Low-CLOT-Jade-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1653399501', 'CLOT Jade', 1, '2022-05-14', 200, 'Jordan 5 Retro Low', 'Air-Jordan-5-Retro-Low-CLOT-Jade', 'Jordan 5 Retro Low CLOT Jade', 'sneakers+jordan+air jordan+five+black/classic jade-fire red-metallic silver+2022-05-14+200+dm4640-036');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('3cfccc03-6f52-444c-ab46-e9642186dc6b', 'Jordan', 'Air Jordan One', 'Light Smoke Grey/White/Anthracite', 'New', 'VN', 'The Jordan 1 Mid Light Smoke Grey Anthracite has toe cap, collar flaps, eyestays, and heel counter fashioned with a buttery "Light Smoke Grey" leather. The shoe''s upper base features a clean white leather that pops out of the toe box and mid-quarter panel. Jordan 1 Mid Light Smoke Grey Anthracite adds a striking contrast with its pitch-black Swoosh. It also features a black shade on the sock liner, tongue, and collar. The white and Light Smoke Grey midsole adds to the overall greyscale look. The shoe features a white Jumpman on the tongue tab and a white "Wings" logo on the collar flap. <br><br>Released in April, 2020, the Jordan 1 Mid Light Smoke Grey Anthracite had a retail price of $120.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Light-Smoke-Grey-Anthracite-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1643276910', 'Light Smoke Grey Anthracite', 1, '2022-04-07', 120, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Light-Smoke-Grey-Anthracite', 'Jordan 1 Mid Light Smoke Grey Anthracite', 'sneakers+jordan+air jordan+one+light smoke grey/white/anthracite+2022-04-07+120+554724-078');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('3d2b0362-4ae2-4983-bd5d-df0dc40e5183', 'Jordan', 'Air Jordan One', 'University Blue/White-Black-University Blue', 'New', 'CN', 'The toddler-sized (TD) Air Jordan 1 Retro High University Blue TD uses MJ''s UNC colorway, White/University Blue/Black. The tumbled white leather upper complements the white midsole and features perforations on the toe box. Blue suede overlays enhance the upper, collar, and heel. The Swoosh and collar are tumbled black leather, matching the black laces and "Wings" on the blue collar overlay. A blue Nike Air logo and Swoosh highlight the black insole and black patch on the white tongue. A circle pattern affords traction on the blue outsole.<br><br>The toddler-sized Air Jordan 1 Retro High University Blue TD was released on March 6, 2021, at a retail price of $60.', 'toddler', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-University-Blue-TD-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1616520545', 'University Blue (TD)', 1, '2021-03-06', 60, 'Jordan 1 Retro High', 'Air-Jordan-1-Retro-High-University-Blue-TD', 'Jordan 1 Retro High University Blue (TD)', 'sneakers+jordan+air jordan+one+university blue/white-black-university blue+2021-03-06+60+aq2665-134');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('3d507b22-f985-4e7c-86a9-d31dd68ee5f2', 'Jordan', 'Air Jordan Four', 'Dark Grey/Infrared 23-Black-Cement Grey', 'New', 'CN', 'Built in grade school sizing, the Air Jordan 4 Retro Infrared (GS) adds some color to an otherwise neutral colorway of the vintage silhouette.<br><br>The Air Jordan 4 Retro Infrared (GS) is built on a dark grey nubuck upper with black accents on the quarter panel netting, structural wings, and Jumpman-branded heel piece. Sitting atop the dark grey base is a lighter shade of grey forefoot overlay, while touches of Infrared appear on the molded eyelets and woven Jumpman tongue tag. Lightweight cushioning arrives via an exposed Air-sole unit nestled in the heel of the two-tone midsole.<br><br>The Air Jordan 4 Retro Infrared (GS) was released in June 2022 and retailed for $160.', 'child', 'https://images.stockx.com/images/Air-Jordan-4-Retro-Infrared-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1646935173', 'Infrared (GS)', 1, '2022-06-15', 160, 'Jordan 4 Retro', 'Air-Jordan-4-Retro-Infrared-GS', 'Jordan 4 Retro Infrared (GS)', 'sneakers+jordan+air jordan+four+dark grey/infrared 23-black-cement grey+2022-06-15+160+408452-061');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('3e3a7422-d1a3-4db2-901d-255c19667a7a', 'Nike', 'Air Max 270', 'White/Black-White', 'New', 'CN', 'Crafted from a breathable mesh and canvas upper, the Nike Air Max 270 White Black now features 270 degrees of visible Air for extra comfort. Drawing inspiration from the sleek Air Max 180, the Nike Air Max 270 White Black features a slip-in bootie construction to deliver a great fit. The sneaker boasts a Max Air unit with 270 degrees of air encapsulated in the heel. The sneaker utilizes lightweight and soft neoprene across the upper to ensure airflow to the foot. <br><br> The Nike Air Max 270 White Black was released in March 2018 at a retail price of $160.', 'men', 'https://images.stockx.com/images/Nike-Air-Max-270-White-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1609367759', 'White Black', 1, '2018-03-20', 160, 'Nike Air Max 270', 'Nike-Air-Max-270-White-Black', 'Nike Air Max 270 White Black', 'sneakers+nike+air max+270+white/black-white+2018-03-20+160+ah8050-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('3ea72ee2-d0cc-489b-bca8-0157a8717bdf', 'Nike', 'Nike Basketball Other', 'Black/Celestine Blue/Peach Cream/Metallic Gold', 'New', 'VN', null, 'unisex', 'https://images.stockx.com/images/Nike-PG-6-Black-Peach-Cream-Celestine-Blue.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1657655876', 'Black Peach Cream Celestine Blue', 1, '2022-07-10', 110, 'Nike PG 6', 'Nike-PG-6-Black-Peach-Cream-Celestine-Blue', 'Nike PG 6 Black Peach Cream Celestine Blue', 'sneakers+nike+nike basketball+other+black/celestine blue/peach cream/metallic gold+2022-07-10+110+dc1974-005');
