INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('400058d4-0d79-4b8d-a89f-9212adc0901d', 'New Balance', 'New Balance 550', 'White/Black', 'New', 'CN', 'Taking cues from the 1989 New Balance P550, the New Balance 550 White Black features a smooth white leather upper with perforated overlays and black piping. Puffed New Balance logos decorate the quarter panel. At the base, a matching white and black sole completes the design.<br><br>The New Balance 550 White Black released in November of 2021 and retailed for $110.', 'men', 'https://images.stockx.com/images/New-Balance-550-White-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1638903675', 'White Black', 1, '2021-12-01', 110, 'New Balance 550', 'New-Balance-550-White-Black', 'New Balance 550 White Black', 'sneakers+new balance+new balance+550+white/black+2021-12-01+110+bb550ha1');
