INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('43828c9c-b295-42ee-a2ec-461bc01fe00a', 'Jordan', 'Air Jordan Three', 'Black/Fire Red-Cement Grey-White', 'New', 'CN', 'One of the most anticipated releases of 2018, the Air Jordan 3 Retro OG marked the first time original "Nike Air" branding was featured on the "Black Cement" AJ 3 since it''s 2001 retro. Jordan stuck to the mantra of "if it aint broke, don’t fix it," on these, staying true to the OG with a black-based leather upper with cement grey, fire red, and white accents, finished off by the iconic elephant print detailing. Their release date was on Michael Jordan''s 55th birthday, February 17th, 2018, and went for $200 in mens sizes. The "Black Cement" Air Jordan 3 Retro OG is a must-have, and you don''t need us to tell you that. They should be in everyone''s collection, multiples if possible. If you''re on the hunt for a pair, you can buy them online today. Those with a pair to sell can hit up the StockX marketplace and see what they''re currently going for.', 'men', 'https://images.stockx.com/images/Air-Jordan-3-Retro-Black-Cement-2018-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1609356781', 'Black Cement (2018)', 1, '2018-02-17', 200, 'Jordan 3 Retro', 'Air-Jordan-3-Retro-Black-Cement-2018', 'Jordan 3 Retro Black Cement (2018)', 'sneakers+jordan+air jordan+three+black/fire red-cement grey-white+2018-02-17+200+854262-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4394ce2f-86c9-4a00-891f-ccdeee349ea2', 'Nike', 'Air Jordan One', 'White/White/White', 'New', 'CN', 'The Air Jordan 1 Mid Triple White GS is a relatively simple Grade School–sized (GS) shoe with an all-white colorway. Constructed using tumbled leather, this Air Jordan Mid has precise tonal stitching, white Nike Swooshes, and a perforated toe box to increase breathability. The shoe’s upper sits atop a rubber outsole hardened to improve grip, with an Air-cushioned midsole to enhance comfort.<br><br>The Air Jordan 1 Mid Triple White GS was released in 2020 as part of the Air Jordan collection. At the time of its release on June 30, 2020, this shoe had a retail price of $90.', 'child', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Triple-White-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606761693', 'Triple White (GS)', 1, '2020-06-30', 90, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Triple-White-GS', 'Jordan 1 Mid Triple White (GS)', 'sneakers+nike+air jordan+one+kids+white/white/white+2020-06-30+90+554725-130');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('443d1c8c-f2a8-482c-b6e2-52891c48daa3', 'Jordan', 'Air Jordan Eleven', 'Medium Grey/Multi-Color/Multi-Color', 'New', 'CN', 'Since its debut in 2001, the Air Jordan 11 Cool Grey has become one of the most celebrated colorways in the Jordan 11 catalog.<br><br>The Air Jordan 11 Cool Grey (2021) features a Cool Grey Durabuck upper with patent leather overlays and a signature Jumpman embroidery on the collar. From there, a white midsole and an icy blue translucent outsole complete the design.<br><br>The Air Jordan 11 Cool Grey (2021) released in December of 2021 and retails for $225.', 'men', 'https://images.stockx.com/images/Air-Jordan-11-Retro-Cool-Grey-2021-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1631898423', 'Cool Grey (2021)', 1, '2021-12-11', 225, 'Jordan 11 Retro', 'Air-Jordan-11-Retro-Cool-Grey-2021', 'Jordan 11 Retro Cool Grey (2021)', 'sneakers+jordan+air jordan+eleven+medium grey/multi-color/multi-color+2021-12-11+225+ct8012-005');
