INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('44f0d6f8-e330-4574-95c2-81b41287b8f0', 'Jordan', 'Air Jordan Eleven', 'Midnight Navy/Metallic Silver/White', 'New', 'ID', null, 'preschool', 'https://images.stockx.com/images/Air-Jordan-11-Retro-Midnight-Navy-PS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1668754261', 'Midnight Navy (PS)', 1, '2022-11-11', 100, 'Jordan 11 Retro', 'Air-Jordan-11-Retro-Midnight-Navy-PS', 'Jordan 11 Retro Midnight Navy (PS)', 'sneakers+jordan+air jordan+eleven+midnight navy/metallic silver/white+2022-11-11+100+do3857-441');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4550dc51-f3bc-4b00-b68a-6d6c763c1aeb', 'Nike', 'Air Max 90', 'Wolf Grey/Wolf Grey-Wolf Grey', 'New', 'CN', 'Originally designed for running, Nike Air Max 90 Recraft Wolf Grey features versatile heritage delivered in style and substance.<br><br>The Nike Air Max 90 Recraft Wolf Grey has a thick and full-bodied silhouette. Its midsole has a thick Air Max unit visible in the heel. The toe box''s upper, collar, and roof are covered with gray synthetic fabric stitched into a tight grid pattern. Its overlays around the toe box, eyelets, across the side, and on the heel are all in gray leather. The overlays feature a partially obscured Nike Swoosh and an Air Max logo.<br><br>The Nike Air Max 90 Recraft Wolf Grey was released on 14th February 2020 at a retail price of $120.', 'men', 'https://images.stockx.com/images/Nike-Air-Max-90-Recraft-Wolf-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1608515425', 'Recraft Wolf Grey', 1, '2020-02-14', 120, 'Nike Air Max 90', 'Nike-Air-Max-90-Recraft-Wolf-Grey', 'Nike Air Max 90 Recraft Wolf Grey', 'sneakers+nike+air max+90+wolf grey/wolf grey-wolf grey+2020-02-14+120+cn8490-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('456af692-df81-45bf-b148-a35244dc7103', 'Jordan', 'Air Jordan Seven', 'Black/Citrus-Varsity Red', 'New', 'CN', 'The Air Jordan 7 Retro "Citrus" from 2022 (Gradeschool) brings back a non-OG hue that was first introduced in 2006.<br><br>The Air Jordan 7 Retro Citrus 2022 (Gradeschool) upper is made of black nubuck, and has contrast orange stitching throughout as well as an inner sleeve reminiscent of the Huarache. The angular "23" heel patch and the embroidered Jumpman emblem on the lateral collar both include the Citrus color in a repeating pattern. The heel features a red webbing pull tab for simple on and off. On the black rubber midsole with embedded Air-sole padding, orange and scarlet elements recur.<br><br>The Air Jordan 7 Retro Citrus 2022(Gradeschool) was released on 13th October 2022 and retailed at $150.', 'child', 'https://images.stockx.com/images/Air-Jordan-7-Retro-Citrus-2022-GS.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1656519101', 'Citrus (2022) (GS)', 1, '2022-08-13', 150, 'Jordan 7 Retro', 'Air-Jordan-7-Retro-Citrus-2022-GS', 'Jordan 7 Retro Citrus (2022) (GS)', 'sneakers+jordan+air jordan+seven+black/citrus-varsity red+2022-08-13+150+dq6040-081');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4571f94f-dbcc-47b4-9b94-5ee9a32e3d86', 'Jordan', 'Air Jordan One', 'White/Crater Purple/Black', 'New', 'ID', 'Launched by Jordan Brand in April 2022, Air Jordan 1 High Zoom Air CMFT Crater Purple became one of Air Jordan 1 Zoom CMFT offerings.<br><br>Compared to the Jordan 1, Air Jordan 1 High Zoom Air CMFT Crater Purple’s main difference is the sole’s full-length Zoom unit. The Zoom unit promotes comfort by ensuring a softer and more responsive cushioning. Its design features a white leather base with an overlaying purple and cut-out swooshes. It further features; Zoom Air branded tongues, black wings, a rubber outsole on top of a Nike speckled white midsole, and collars.<br><br> On its release date, Air Jordan 1 High Zoom Air CMFT Crater Purple retailed at $140.DISCLAIMER: Purple may bleed onto white canvas when exposed to water.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-High-Zoom-Air-CMFT-Crater-Purple-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1659505846', 'Crater Purple', 1, '2022-04-26', 140, 'Jordan 1 High Zoom Air CMFT', 'Air-Jordan-1-High-Zoom-Air-CMFT-Crater-Purple', 'Jordan 1 High Zoom Air CMFT Crater Purple', 'sneakers+jordan+air jordan+one+white/crater purple/black+2022-04-26+140+ct0978-501');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4586abb2-b78d-4ad0-bf79-b9fefec4c07a', 'Jordan', 'Air Jordan One', 'Atmosphere/White-Laser Pink-Obsidian', 'New', 'CN', 'The women''s Air Jordan 1 High Atmosphere follows the classic Black Toe color blocking format with a white and dark navy leather upper. Light pink patent leather on the ankle and vamp nods to the pink bubblegum that Michael Jordan chewed throughout his time on the hardwood. Woven Nike tongue labels and a signature Jordan Wings logo draw inspiration from the original 1985 Jordan 1 design.<br><br>The women''s Air Jordan 1 High Atmosphere released in December of 2021 and retailed for $170.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-OG-Atmosphere-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1637087111', 'Atmosphere (W)', 1, '2021-12-22', 170, 'Jordan 1 Retro High OG', 'Air-Jordan-1-Retro-High-OG-Atmosphere-W', 'Jordan 1 Retro High OG Atmosphere (W)', 'sneakers+jordan+air jordan+one+atmosphere/white-laser pink-obsidian+2021-12-22+170+dd9335-641');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('460c6940-c11a-489c-af5f-2212d2caa625', 'Jordan', 'Air Jordan Fourteen', 'Light Ginger/Black/White', 'New', 'CN', null, 'men', 'https://images.stockx.com/images/Air-Jordan-14-Retro-Ginger-2022-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1665641448', 'Light Ginger (2022)', 1, '2022-08-17', 210, 'Jordan 14 Retro', 'Air-Jordan-14-Retro-Ginger-2022', 'Jordan 14 Retro Light Ginger (2022)', 'sneakers+jordan+air jordan+fourteen+light ginger/black/white+2022-08-17+210+487471-701');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4620f389-e217-4091-86d9-415f6d580e08', 'Jordan', 'Air Jordan One', 'White/Neutral Grey-Particle Grey', 'New', 'CN', 'Arriving in its original form, the Air Jordan 1 Low OG Neutral Grey features a white leather upper with Neutral Grey Durabuck Swooshes. A white and Neutral Grey sole completes the design.<br><br>The Air Jordan 1 Low OG Neutral Grey released in June of 2021 and retailed for $130.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Low-OG-Neutral-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1624632528', 'Neutral Grey (2021)', 1, '2021-06-24', 130, 'Jordan 1 Low OG', 'Air-Jordan-1-Low-OG-Neutral-Grey', 'Jordan 1 Low OG Neutral Grey (2021)', 'sneakers+jordan+air jordan+one+white/neutral grey-particle grey+2021-06-24+130+cz0790-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('466e5f28-19e8-4309-966d-39ba1b3bb73e', 'adidas', 'adidas Yeezy', 'Slate Carbon/Slate Carbon/Slate Carbon', 'New', 'CN', 'The adidas Yeezy 350 V2 CMPCT Slate Carbon features a sock-like black and Slate Carbon Primeknit upper with raised collars and woven eyelets. Hits of light brown add a subtle contrast to the design''s dark presence. At the base, an all-black Boost sole adds cushioning and support.<br><br>The adidas Yeezy 350 V2 CMPCT Slate Carbon released in May of 2022 and retailed for $230.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-350-V2-CMPCT-Slate-Carbon-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1654606072', 'Slate Carbon', 1, '2022-05-28', 230, 'adidas Yeezy 350 V2 CMPCT', 'adidas-Yeezy-350-V2-CMPCT-Slate-Carbon', 'adidas Yeezy 350 V2 CMPCT Slate Carbon', 'sneakers+adidas+adidas+yeezy+350+v2+slate carbon/slate carbon/slate carbon+2022-05-28+230+hq6319');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4674a929-f229-4b46-adda-30a0be7f3885', 'Nike', 'Air Max 1', 'Orange/Green/Blue-Off White', 'New', 'VN', 'South Korean boutique Kasina celebrated its 25th Anniversary with the Nike Air Max 1 Kasina Wong-Ang Orange.<br><br>Pulling inspiration from Wong-Ang Ducks, a style of carved wooden ducks traditionally gifted to newlywed couples, the Nike Air Max 1 Kasina Wong-Ang Orange incorporates colors and materials that are said to bring good fortune in Korean culture. It boast a premium brown tumbled leather upper with dark green faux horsehair overlays and brown and orange suede mudguards. At the heel, small Wong-Ang Duck embroidery nods to the Korean wedding custom. At the base, an icy, semi-translucent outsole revealing a geometric pattern on the bottom of the midsole adds the finishing touch.<br><br>The Nike Air Max 1 Kasina Wong-Ang Orange released in June of 2022 and retailed for $160.', 'men', 'https://images.stockx.com/images/Nike-Air-Max-1-Kasina-Won-Ang-Orange-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1655323943', 'Kasina Won-Ang Orange', 1, '2022-06-08', 160, 'Nike Air Max 1', 'Nike-Air-Max-1-Kasina-Won-Ang-Orange', 'Nike Air Max 1 Kasina Won-Ang Orange', 'sneakers+nike+air max+1+am1+orange/green/blue-off white+2022-06-08+160+dq8475-800');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4691c6cc-a41b-45dd-b998-a146300b85f7', 'Nike', 'Dunk Low', 'Pink Foam/White/Black', 'New', 'ID', null, 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Pink-Foam-Black-W.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1661934226', 'Pink Foam Black (W)', 1, '2022-09-01', 120, 'Nike Dunk Low', 'Nike-Dunk-Low-Pink-Foam-Black-W', 'Nike Dunk Low Pink Foam Black (W)', 'sneakers+nike+dunk+low+pink foam/white/black+2022-09-01+120+dj9955-600');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('46961046-bbab-40f0-9ba9-886f51361ed1', 'Jordan', 'Air Jordan One', 'Black/White-Light Smoke Grey', 'New', 'CN', 'The Air Jordan 1 Retro High Black White Light Smoke Grey GS features a black, white, and light smoke grey leather upper along the toe box and the sides of the silhouette. The upper is further wrapped in overlays of smoke grey that sit on top of a white midsole and dark black outsole, and a grey Swoosh logo and Air Jordan badges on the sides of the shoe complete the design. <br><br>The Air Jordan 1 Retro High Black White Light Smoke Grey GS released in May of 2021 and retailed for $130.', 'child', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-Black-White-Light-Smoke-Grey-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1621454282', 'Shadow 2.0 (GS)', 1, '2021-05-15', 130, 'Jordan 1 Retro High', 'Air-Jordan-1-Retro-High-Black-White-Light-Smoke-Grey-GS', 'Jordan 1 Retro High Shadow 2.0 (GS)', 'sneakers+jordan+air jordan+one+kids+black/white-light smoke grey+2021-05-15+130+575441-035');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('469a4104-d19b-43c5-980b-d6bed2c04ffe', 'adidas', 'adidas Yeezy', 'Turtledove/Blue Graphite/Chalk White', 'New', 'CN', 'Seven years following its 2015 debut, the iconic adidas Yeezy Boost 350 Turtle Dove made its return.<br><br>While the adidas Yeezy Boost 350 Turtle Dove (2022) does arrive with the same brown and grey patterned Primeknit upper, rope laces, and grooved Boost sole as the original release, there are some minor differences. The 2022 iteration is packaged in an updated box and features an upgraded outsole, built for daily wear.<br><br>The adidas Yeezy Boost 350 Turtle Dove (2022) released in August of 2022 and retailed for $230.<br><br>To shop the original adidas Yeezy Boost 350 Turtle Dove, <a href="https://stockx.com/adidas-yeezy-boost-350-turtledove">click here.</a> ', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Boost-350-Turtle-Dove-2022-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1660072498', 'Turtledove (2022)', 1, '2022-08-02', 230, 'adidas Yeezy Boost 350', 'adidas-Yeezy-Boost-350-Turtle-Dove-2022', 'adidas Yeezy Boost 350 Turtledove (2022)', 'sneakers+adidas+adidas+yeezy+350+v1+turtledove/blue graphite/chalk white+2022-08-02+230+aq4832');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('46da3eda-e6b0-4ea3-94f6-6ddda71aaf1d', 'Jordan', 'Air Jordan One', 'Light Mulberry/Light Bone/White/Black', 'New', 'VN', 'The Air Jordan 1 Mid Berry Pink (Women''s) was made for both comfort and utility, meaning that it can be worn to play a game of basketball or to walk around town.<br><br>This high top shoe has a berry-colored sole next to a white midsole. For the body of the shoe, there are berry-colored leather overlays that sit on top of the white base. The Nike swoosh symbol appears in black, as well as parts of the shoe near the ankle, and the Air Jordan symbol.<br><br>The Air Jordan 1 Mid Berry Pink (W) for women first hit the market in January of 2022. The retail price for this specific product was $120.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Berry-Pink-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1646923870', 'Light Mulberry (W)', 1, '2022-03-29', 130, 'Jordan 1 Mid SE', 'Air-Jordan-1-Mid-Berry-Pink-W', 'Jordan 1 Mid SE Light Mulberry (W)', 'sneakers+jordan+air jordan+one+light mulberry/light bone/white/black+2022-03-29+130+dc7267-500');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('473b7bc3-c541-429e-8c1f-d656e953066d', 'Nike', 'Nike Dunk', 'White/Gym Red-Yellow', 'New', 'VN', 'Nike has done it again with the Nike Dunk Low USC, code style DD1391-602 sneaker design featuring the University of Southern California Trojans'' official colors.<br><br>Nike Dunk Low USC is constructed of leather material on the upper and rubber on the outsole. Nike Dunk Low USC features a colorway composed of white, gym red, and yellow covering 90% of the upper, with yellow Nike branding at the heel and tongue. A white perforated vamp and a red suede Swoosh complete the design of this sneaker.<br><br>Nike Dunk Low USC was released at a retail price of $100 on August 9, 2022.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-USC-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1660311144', 'USC', 1, '2022-10-19', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-USC', 'Nike Dunk Low USC', 'sneakers+nike+nike+dunk+low+white/gym red-yellow+2022-10-19+100+dd1391-602');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('47843122-576f-457a-9911-1ac87767873d', 'Jordan', 'Air Jordan One', 'Coconut Milk/Black-Summit White-White', 'New', 'VN', 'The Air Jordan 1 Mid Coconut Milk (Women''s) fro women highlights neutral tones on a familiar silhouette modeled after the 1985 original.<br><br>The Air Jordan 1 Mid Coconut Milk (Women''s) starts off with a traditional white leather base; this Air Jordan 1 Mid mixes thin(GS) for grade schoolers up with the addition of creamy overlays in the toe, eye stays, ankle and heel. Hits of black in the Air Jordan branding, Jumpman logo on the tongue, Nike Swoosh and outsole round off the minimalistic palette.<br><br>The Air Jordan 1 Mid Coconut Milk (W) was released in February 2022 and retailed for $120.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Coconut-Milk-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1643116604', 'Coconut Milk (W)', 1, '2022-02-04', 120, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Coconut-Milk-W', 'Jordan 1 Mid Coconut Milk (W)', 'sneakers+jordan+air jordan+one+coconut milk/black-summit white-white+2022-02-04+120+bq6472-121');
