INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('486efd43-e36d-4233-870c-1fffc9a13bfb', 'Crocs', 'Crocs Collaborations', 'Almost White', 'New', 'CN', 'The Crocs Pollex Clog Salehe Bembury Stratus boasts an off white, exo-skeletal look with dramatic, fingerprint-like concave ridges throughout its foam construction. While there aren''t as many ventilation holes in this design compared to traditional Crocs Clogs, the remaining holes are located on high-heat areas of the foot for increased breathability. A removable canvas strap at the ankle provides wearers with an option for a more-secure fit.<br><br>The Crocs Pollex Clog Salehe Bembury Stratus released in May of 2022 and retailed for $85.', 'men', 'https://images.stockx.com/images/Crocs-Pollex-Clog-by-Salehe-Bembury-Stratus-Friends-and-Family-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1653632173', 'by Salehe Bembury Stratus', 1, '2022-05-24', 85, 'Crocs Pollex Clog', 'Crocs-Pollex-Clog-by-Salehe-Bembury-Stratus-Friends-and-Family', 'Crocs Pollex Clog by Salehe Bembury Stratus', 'sneakers+crocs+crocs+collaborations+crocs collaborations+almost white+2022-05-24+85+207393-1cn');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4876d7d3-35f4-4c00-9614-c5aa6767ab31', 'Nike', 'Air Max VaporMax', 'White/White-Pure Platinum', 'New', 'CN', 'The Nike Air VaporMax Plus White features an off-white neoprene upper with a white TPU cage and gray Swooshes. From there, the shoe''s signature translucent outsole and VM branding on the heel complete the design.<br><br>The Nike Air VaporMax Plus White released in February of 2018 and retailed for $190.', 'men', 'https://images.stockx.com/images/Nike-Air-VaporMax-Plus-White-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1607051989', 'White', 1, '2018-02-28', 190, 'Nike Air VaporMax Plus', 'Nike-Air-VaporMax-Plus-White', 'Nike Air VaporMax Plus White', 'sneakers+nike+air max+vapormax+white/white-pure platinum+2018-02-28+190+924453-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('48ca6f89-f4d2-45e0-ae0e-b2efa5c95de1', 'Nike', 'Nike SB SB Dunk Low', 'Green/Metallic Gold-White-Light Gum', 'New', 'VN', 'The Nike SB Dunk Low St. Patrick''s Day 2022 features a green suede upper with metallic gold Swooshes and white four leaf clover embroideries at the heel. A stuffed tongue achieves SB''s signature Dunk styling. From there, a white Zoom Air cushioned midsole and a gum outsole add the finishing touch.<br><br>The Nike SB Dunk Low St. Patrick''s Day 2022 released in March of 2022 and retailed for $110.', 'men', 'https://images.stockx.com/images/Nike-SB-Dunk-Low-Pro-St-Patricks-Day-2022-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1653401220', 'St. Patrick''s Day (2022)', 1, '2022-03-05', 110, 'Nike SB Dunk Low Pro', 'Nike-SB-Dunk-Low-Pro-St-Patricks-Day-2022', 'Nike SB Dunk Low Pro St. Patrick''s Day (2022)', 'sneakers+nike+nike sb+sb dunk low+green/metallic gold-white-light gum+2022-03-05+110+bq6817-303');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('49ab75a8-36cb-488c-903d-a8f804b6cf7f', 'Nike', 'Air Max 1', 'Elemental Gold/Sail-Black-Worn Blue', 'New', 'CN', 'PLEASE NOTE: Print Patterns May Vary. Nike and Concepts joined forces once again for the 1970''s inspired Nike Air Max 1 SP Concepts Heavy.<br><br>The Nike Air Max 1 SP Concepts Heavy nods to youth culture of the 1970''s and their style. Bleached denim, bandana, corduroy, and tiger camo M-65 jacket material make up the upper, offering a playful look. On the Swooshes, embroidered flowers add a vintage-inspired styling. From there, a speckled white midsole with a gum outsole completes the design.<br><br>The Nike Air Max 1 SP Concepts Heavy released in March of 2022 and retailed for $170.', 'men', 'https://images.stockx.com/images/Nike-Air-Max-1-SP-Concepts-Denim-Tiger-Camo-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1647032458', 'Concepts Heavy', 1, '2022-03-12', 170, 'Nike Air Max 1 SP', 'Nike-Air-Max-1-SP-Concepts-Denim-Tiger-Camo', 'Nike Air Max 1 SP Concepts Heavy', 'sneakers+nike+air max+1+elemental gold/sail-black-worn blue+2022-03-12+170+dn1803-900');
