INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('49f5a15b-ef57-485a-83c9-5c54cf144d6f', 'adidas', 'adidas Yeezy', 'Granite/Granite/Granite', 'New', 'CN', 'Composed of tonal grey mesh, suede, and leather, the adidas Yeezy 500 Granite offers a monochromatic styling similar to the early Yeezy 500s of 2018. Woven lace loops on the tongue nod to the tooling of 1990s hiking boots. From there, a sculptural sole with adiPrene cushioning provides comfort and support.<br><br>The adidas Yeezy 500 Granite released in May of 2022 and retailed for $210.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-500-Granite-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1653399233', 'Granite', 1, '2022-05-14', 210, 'adidas Yeezy 500', 'adidas-Yeezy-500-Granite', 'adidas Yeezy 500 Granite', 'sneakers+adidas+adidas+yeezy+500+granite/granite/granite+2022-05-14+210+gw6373');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4a151ea9-0926-4358-8f49-78981d025076', 'Jordan', 'Air Jordan Four', 'White/Midnight Navy/Light Smoke Grey-Fire Red', 'New', 'CN', null, 'men', 'https://images.stockx.com/images/Air-Jordan-4-Retro-White-Midnight-Navy-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1667401281', 'Midnight Navy', 1, '2022-10-29', 210, 'Jordan 4 Retro', 'Air-Jordan-4-Retro-White-Midnight-Navy', 'Jordan 4 Retro Midnight Navy', 'sneakers+jordan+air jordan+four+white/midnight navy/light smoke grey-fire red+2022-10-29+210+dh6927-140');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4a33ef38-2497-4229-8b28-c2fea95cc17c', 'adidas', 'adidas Yeezy', 'Yecheil/Yecheil/Yecheil', 'New', 'CN', 'Yeezy adds a flare to one of its most well-known designs with the adidas Yeezy 350 Yecheil Non-Reflective, now available on StockX. This 350 V2 strays away from the usual earth tones with a colorful palette, making it stand out from previous releases. This model was released in both reflective and non-reflective variations.<br><br>This Yeezy 350 V2 is composed of a black upper with white, red, yellow, and blue accents. A black Boost cushioned sole and black side stripe completes the design. These sneakers released in December of 2019 and retailed for $220.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Boost-350-V2-Yecheil-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606325433', 'Yecheil (Non-Reflective)', 1, '2019-12-20', 220, 'adidas Yeezy Boost 350 V2', 'adidas-Yeezy-Boost-350-V2-Yecheil', 'adidas Yeezy Boost 350 V2 Yecheil (Non-Reflective)', 'sneakers+adidas+adidas+yeezy+v2+350+yecheil/yecheil/yecheil+2019-12-20+220+fw5190');
