INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4b1f9686-d16d-4115-9f24-83f7bd613bd7', 'Jordan', 'Air Jordan One', 'White/Bright Crimson-Blue Hero', 'New', 'VN', null, 'child', 'https://images.stockx.com/images/Air-Jordan-1-Mid-SE-Take-Flight-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1636143074', 'Take Flight (GS)', 1, '2021-02-10', 100, 'Jordan 1 Mid SE', 'Air-Jordan-1-Mid-SE-Take-Flight-GS', 'Jordan 1 Mid SE Take Flight (GS)', 'sneakers+jordan+air jordan+one+white/bright crimson-blue hero+2021-02-10+100+bq6931-114');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4b3463e0-4d16-4320-bce8-a3fbba084bd6', 'Jordan', 'Air Jordan One', 'Black/Grey/Pink', 'New', 'ID', 'The Air Jordan 1 Low Black Grey Pink arrives dressed in a mix of black, grey, pink, and white.<br><br>The Air Jordan 1 Low Black Grey Pink features a white toe box with black on the side panels, tongues, laces, liner, Win(GS) for grade schoolers logo, and rubber outsole, while grey leathers are affixed to the toe, eye stays, and heel. Highlighting the shoe are contrasting pink accents on the branded areas, Swooshes, and stitching along the white midsole to complete the design. Underfoot, a white midsole and black outsole wrap up the design. <br><br>The Air Jordan 1 Low Black Grey Pink was released in April 2022 and retailed for $110.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Low-Black-Grey-Pink-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1651518878', 'Black Grey Pink', 1, '2022-04-11', 110, 'Jordan 1 Low', 'Air-Jordan-1-Low-Black-Grey-Pink', 'Jordan 1 Low Black Grey Pink', 'sneakers+jordan+air jordan+one+black/grey/pink+2022-04-11+110+553558-062');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4b510649-48a0-40af-abee-3853251ce9da', 'Nike', 'Nike Dunk', 'Black/Goldenrod/White', 'New', 'ID', 'Nodding to the origins of the Nike Dunk, the Nike Dunk Low Goldenrod revives one of the first Dunk Low colorways that first debuted in 1985 as part of the Be True To Your School collection.<br><br>Also known as the Dunk Low Iowa, the Nike Dunk Low Goldenrod features a black leather upper with golden yellow overlays and Swooshes. Classic Nike branding on the tongue label and heel tab deliver a retro feel. At the base, a white and yellow Air sole completes the design.<br><br>The Nike Dunk Low Goldenrod released in December of 2021 and retailed for $100.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Goldenrod-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1637177820', 'Championship Goldenrod (2021)', 1, '2021-12-16', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Goldenrod', 'Nike Dunk Low Championship Goldenrod (2021)', 'sneakers+nike+nike+dunk+low+black/goldenrod/white+2021-12-16+100+dd1391-004');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4bd60a49-00fd-46d4-8647-be3c7204a255', 'Common Projects', 'Luxury Brands Common Projects', 'White', 'New', 'IT', 'With its subtle details and simple structure, the Common Projects Original Achilles White is designed with casual walking in mind, rather than intense exercise or hitting the basketball court.<br><br>This Common Projects Original Achilles White features a crisp white sole, with the rest of the upper being in the same shade. The majority of the shoe is composed of leather, and a serial number is stamped in gold towards the heel. White laces lay on top of the simple white tongue that is free of any logo.<br><br>First released in January 2004, the Common Projects Original Achilles White had a starting retail price of $415.', 'men', 'https://images.stockx.com/images/Common-Projects-Original-Achilles-White-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1607668689', 'White', 1, '2004-01-01', 415, 'Common Projects Original Achilles', 'Common-Projects-Original-Achilles-White', 'Common Projects Original Achilles White', 'sneakers+common projects+luxury brands+common projects+white+2004-01-01+415+1528 xx 0506');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4bf124f8-b1f2-4a4f-b8c2-9a293eee8832', 'Nike', 'Air Max Plus', 'Black/Anthracite/Dark Smoke Grey/Lime', 'New', 'ID', 'The Nike Air Max Terrascape Plus is an updated silhouette of the Air Max Plus, with a Black Lime colorway. By weight, the kick is made out of 20% recycled materials.<br><br>The Nike Air Max Terrascape Plus has an upper made of 20% recycled TPU cage wrapping a large Swoosh print. It also has a Nike Grind outsole that is 13.5% recycled rubber. The black and white laces are 100% recycled polyester, while the vamp is 75% recycled polyester. A hardened rubber reinforces the heels, and it is labeled TS.<br><br>The Nike Air Max Terrascape Plus is a 1st November release. Originally, it retailed at $170.', 'men', 'https://images.stockx.com/images/Nike-Air-Max-Terrascape-Plus-Black-Barely-Volt-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1642074520', 'Black Lime', 1, '2021-11-01', 170, 'Nike Air Max Terrascape Plus', 'Nike-Air-Max-Terrascape-Plus-Black-Barely-Volt', 'Nike Air Max Terrascape Plus Black Lime', 'sneakers+nike+air max+plus+black/anthracite/dark smoke grey/lime+2021-11-01+170+dc6078-002');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4c772c88-8c08-424b-aa4d-0a0c3b82235c', 'Jordan', 'Air Jordan One', 'White/White/White', 'New', 'CN', 'Drawing from the original 1985 low-top silhouette, the Air Jordan 1 Low Triple White Tumbled Leather features an all-leather, all-white finish. The Air Jordan 1 Low Triple White Tumbled Leather brings a clean white look and colorway to the low-top construction. The sneaker’s upper is made from a mix of full-grain and tumbled leather for textural depth, and the lightly padded nylon tongue provides a comfortable fit. The Jumpman replaces the common "Nike" logo on the tongue tag, and the stitched Wings logo appears large on the heel panel. <br><br>The Air Jordan 1 Low Triple White Tumbled Leather was released in April, 2020, and retailed for $90.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Low-Triple-White-Tumbled-Leather-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1643885868', 'Triple White Tumbled Leather', 1, '2020-04-01', 90, 'Jordan 1 Low', 'Air-Jordan-1-Low-Triple-White-Tumbled-Leather', 'Jordan 1 Low Triple White Tumbled Leather', 'sneakers+jordan+air jordan+one+low+white/white/white+2020-04-01+90+553558-130');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4ce73ae5-1d15-402b-8306-e790512347f9', 'New Balance', 'New Balance 550', 'White/Blue', 'New', 'CN', 'The New Balance 550 White Blue is a redefined version of the classic basketball shoe released by New Balance in 1989. Released as part of the Conversations Amon(GS) for grade schoolerst Us pack, this shoe boasts several highlights.<br><br>Some of the highlights of the New Balance 550 White Blue features include an adjustable lace closure, an upper made out of leather, synthetic, and mesh, a cushioned midsole that improves its coziness, and a rubber outsole that enhances the traction of the shoe.<br><br>The rejuvenated New Balance 550 White Blue was released in December 2020. At the time of this shoe’s release, it commanded a retail price of $110.', 'men', 'https://images.stockx.com/images/New-Balance-550-White-Blue-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1613669984', 'White Blue', 1, '2020-12-01', 110, 'New Balance 550', 'New-Balance-550-White-Blue', 'New Balance 550 White Blue', 'sneakers+new balance+new balance+550+550+white/blue+2020-12-01+110+bb550sn1');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4d04aa56-b5e3-4be3-9a59-f9bdd74a2645', 'Nike', 'Air Force One', 'Grey/Black/White', 'New', 'VN', 'The Nike Air Force 1 Mid Stüssy Grey Black arrives with a grey smooth leather upper with black tumbled leather overlays and Swooshes. Atop the velcro ankle strap, Stüssy logo embroidery provides a custom feel. From there, a grayscale Air sole at the base adds the finishing touch.<br><br>The Nike Air Force 1 Mid Stüssy Grey Black released in May of 2022 and retailed for $150.', 'men', 'https://images.stockx.com/images/Nike-Air-Force-1-Mid-Stussy-Grey-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1653036583', 'Stussy Light Bone Black', 1, '2022-05-13', 150, 'Nike Air Force 1 Mid', 'Nike-Air-Force-1-Mid-Stussy-Grey-Black', 'Nike Air Force 1 Mid Stussy Light Bone Black', 'sneakers+nike+air force+one+mid+grey/black/white+2022-05-13+150+dj7840-002');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4e1a867d-959a-41fb-befa-5dc7189a43e5', 'adidas', 'adidas Yeezy', 'Ochre/Ochre/Ochre', 'New', 'CN', 'DISCLAIMER: US and UK sizing is the same and does not require any conversion. The adidas Yeezy Foam RNNR Ochre features a golden Ochre one-piece EVA foam construction. Oval cut-outs throughout the design provide ventilation, while a cushioned footbed offers support.<br><br>The adidas Yeezy Foam RNNR Ochre released in August of 2021 and retailed for $80.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Foam-RNNR-Ochre-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1633023377', 'Ochre', 1, '2021-08-02', 80, 'adidas Yeezy Foam RNNR', 'adidas-Yeezy-Foam-RNNR-Ochre', 'adidas Yeezy Foam RNNR Ochre', 'sneakers+adidas+adidas+yeezy+foam rnnr+ochre/ochre/ochre+2021-08-02+80+gw3354');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4e25d01d-5c06-4a6e-bed8-247a3ff3864c', 'Jordan', 'Air Jordan One', 'Black/Gym Red-White', 'New', 'CN', 'The Kids Air Jordan 1 Mid Banned 2020 offers a mid-top take on Michael Jordan’s first signature shoe, the controversial Jordan 1 High Banned. <br><br>On the upper of the Kids Air Jordan 1 Mid Banned 2020’s ankle flaps, Swoosh, heel counters, and toe boxes are all constructed with red leather. Black laces, leather medial side and toe panels, and tongue create a contrasted look to the design. A white midsole and red outsole complete the design.<br><br>The Kids Air Jordan 1 Mid Banned 2020 released in November of 2020 and retailed for $90.', 'child', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Banned-2020-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1609427966', 'Banned (2020) (GS)', 1, '2020-11-13', 90, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Banned-2020-GS', 'Jordan 1 Mid Banned (2020) (GS)', 'sneakers+jordan+air jordan+one+mid+black/gym red-white+2020-11-13+90+554725-074');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4e2e2822-895a-463d-901e-6e8f08a49594', 'Nike', 'Nike Dunk', 'White/University Red', 'New', 'VN', 'The Nike Dunk High University Red (GS) for grade schoolers is a high-top model that has basic tread, making it a convenient choice for everyday life.<br><br>This model has a bright red sole, coupled with a white midsole. The shoe itself has a white base, with red leather overlays. Red shoelaces lay on top of the white tongue. Both the Nike swoosh symbol and the brand’s logo are in the same bright red that adorns the shoe.<br><br>The Nike Dunk High University Red (GS) for grade schoolers for grade schoolers first entered the market in May of 2022. This shoe had a starting retail price of $100.', 'child', 'https://images.stockx.com/images/Nike-Dunk-High-University-Red-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1645801979', 'Championship White Red (GS)', 1, '2022-05-17', 100, 'Nike Dunk High', 'Nike-Dunk-High-University-Red-GS', 'Nike Dunk High Championship White Red (GS)', 'sneakers+nike+nike+dunk+high+white/university red+2022-05-17+100+db2179-106');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4e3aee6e-14f7-429c-8476-26626e055591', 'Jordan', 'Air Jordan One', 'Neutral Grey/Metallic Silver-White', 'New', 'CN', 'For the first time since 2001, Jordan Brand has brought back the Air Jordan 1 Retro High CO Japan Neutral Grey, now available on StockX. The Air Jordan 1 CO.JP originally released as a Japanese exclusive in very limited quantities. Only 2,001 pairs were released in the Neutral Grey colorway while other colorways were produced as an edition of 3,000. After 20 years, the CO.JP was reborn and finally released globally.<br><br>The Air Jordan 1 CO Japan Neutral Grey features a grey suede and silver leather upper with a bubble "Wings" stamp just like the 2001 version. The main difference between the 2020 iteration and its predecessor is in the tongue, where the updated pair features "Nike Air" embroidered on the tongue instead of the 2001s’ Jumpman tag. <br><br>The Air Jordan 1 CO Japan Neutral Grey released in August of 2020 and retailed for $170.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-CO-Japan-Neutral-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606322190', 'CO Japan Neutral Grey (2020)', 1, '2020-08-07', 170, 'Jordan 1 Retro High', 'Air-Jordan-1-Retro-High-CO-Japan-Neutral-Grey', 'Jordan 1 Retro High CO Japan Neutral Grey (2020)', 'sneakers+jordan+air jordan+one+neutral grey/metallic silver-white+2020-08-07+170+dc1788-029');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4e90c54f-cf60-4aef-97c8-cc63af72b6dc', 'Nike', 'KD Fifteen', 'White/Black/Royal Tint/White', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Nike-KD-15-Black-Royal-Tint-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1665042742', 'Black Royal Tint', 1, '2022-07-01', 150, 'Nike KD 15', 'Nike-KD-15-Black-Royal-Tint', 'Nike KD 15 Black Royal Tint', 'sneakers+nike+kd+fifteen+white/black/royal tint/white+2022-07-01+150+dm1054-101/dc1975-101');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4ec6b400-7e3a-45ed-b397-6584f625340a', 'Nike', 'Nike Dunk', 'White/Varsity Green-White', 'New', 'CN', 'The Nike Dunk Low Varsity Green is composed of white leather uppers with Varsity Green leather overlays and Swoosh logos. From there, woven retro Nike logo tongue labels and heel embroidery nod to original Dunks from 1985.<br><br>The Nike Dunk Low Varsity Green released in June of 2021 and retailed for $100.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Team-Green-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1646080687', 'Michigan State', 1, '2021-06-03', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Team-Green', 'Nike Dunk Low Michigan State', 'sneakers+nike+nike+dunk+low+white/varsity green-white+2021-06-03+100+dd1391-101');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4f2051cd-1eaf-481f-ad06-247d1946d4bf', 'Jordan', 'Air Jordan One', 'Metallic Gold/Black-White', 'New', 'CN', 'The Air Jordan 1 Mid got the golden treatment in addition to the Jordan 1 High in 2020. This Jordan Mid Metallic Gold model dons a shiny and reflective upper that is sure to make anyone take a second look at your feet.<br><br>The Air Jordan 1 Mid features metallic gold overlays with a mix of smooth white leather. A quintessential Nike Swoosh in black provides a contrast to the upper. A black and white Jumpman logo appears on the tongue tag in typical Jordan Mid fashion.<br><br>The Air Jordan 1 Mid Metallic Gold released in November of 2020 and retailed for $130.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Metallic-Gold-Black-White-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1607109040', 'Metallic Gold Black White', 1, '2020-11-30', 125, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Metallic-Gold-Black-White', 'Jordan 1 Mid Metallic Gold Black White', 'sneakers+jordan+air jordan+one+metallic gold/black-white+2020-11-30+125+dc1419-700');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4f3bf16a-03ce-49ad-82e6-cd591f7f446b', 'Salomon', 'Other Brands Salomon', 'Black/Black/Phantom', 'New', 'CN', null, 'men', 'https://images.stockx.com/images/Salomon-S-Lab-XT-6-Adv-Triple-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1644224898', 'Triple Black', 1, '2020-04-27', 190, 'Salomon S/Lab XT-6 Adv', 'Salomon-S-Lab-XT-6-Adv-Triple-Black', 'Salomon S/Lab XT-6 Adv Triple Black', 'sneakers+salomon+other brands+salomon+black/black/phantom+2020-04-27+190+l41086600');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4f45715d-222e-4479-908a-64fcd96ab845', 'Under Armour', 'Other Brands Under Armour', 'Blue/White', 'New', 'CN', null, 'men', 'https://images.stockx.com/images/Under-Armour-Curry-10-Sour-Patch-Kids-Sour-Then-Sweet.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1668465477', 'Sour Patch Kids Sour Then Sweet', 1, '2022-11-11', 160, 'Under Armour Curry 10', 'Under-Armour-Curry-10-Sour-Patch-Kids-Sour-Then-Sweet', 'Under Armour Curry 10 Sour Patch Kids Sour Then Sweet', 'sneakers+under armour+other brands+under armour+blue/white+2022-11-11+160+3025622-300');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4f4c0e99-a330-432a-b115-792b2ae5c806', 'Jordan', 'Air Jordan Five', 'White/Dark Concord-Black', 'New', 'VN', 'Jordan Brand paid homage to one of the most iconic Jordan 11 colorways with the Air Jordan 5 Dark Concord.<br><br>Referencing the Jordan 11 Concord, the Air Jordan 5 Dark Concord features a smooth white leather upper with TPU netted underlays and reflective tongues. Hits of Concord on the embroidered Jumpman logos, midsole shark teeth, and sockliner bring a pop of color to the design''s neutral base. From there, a black midsole with a visible Air heel unit atop an icy semi-translucent outsole completes the design.<br><br>The Air Jordan 5 Dark Concord released in August of 2022 and retailed for $200.', 'men', 'https://images.stockx.com/images/Air-Jordan-5-Retro-Concord-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1661522444', 'Dark Concord', 1, '2022-08-06', 200, 'Jordan 5 Retro', 'Air-Jordan-5-Retro-Concord', 'Jordan 5 Retro Dark Concord', 'sneakers+jordan+air jordan+five+white/dark concord-black+2022-08-06+200+dd0587-141');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4f7d30be-b8fb-4000-bdb5-4c01091e02c2', 'New Balance', 'New Balance 993', 'Powder Pink', 'New', 'US', null, 'men', 'https://images.stockx.com/images/New-Balance-993-Joe-Freshgoods-Performance-Art-Powder-Pink-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1668096427', 'Joe Freshgoods Performance Art Powder Pink', 1, '2022-10-07', 220, 'New Balance 993', 'New-Balance-993-Joe-Freshgoods-Performance-Art-Powder-Pink', 'New Balance 993 Joe Freshgoods Performance Art Powder Pink', 'sneakers+new balance+new balance+993+powder pink+2022-10-07+220+mr993jh1');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4f9edc5e-17ab-4afb-b82e-13fffcaf8e6b', 'Nike', 'Nike Dunk', 'White/University Blue-White', 'New', 'ID', 'Nodding to the University of North Carolina Tarheels, the Nike Dunk Low UNC is constructed of a white leather upper with University Blue overlays and Swooshes. From there, a white and University woven Nike tongue label completes the design.<br><br>The Nike Dunk Low UNC released in June of 2021 and retailed for $100.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-UNC-2021-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1624468252', 'UNC (2021)', 1, '2021-06-24', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-UNC-2021', 'Nike Dunk Low UNC (2021)', 'sneakers+nike+nike+dunk+low+white/university blue-white+2021-06-24+100+dd1391-102');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4fd9bccf-5a8a-4a88-904e-29b9bba850bc', 'New Balance', 'New Balance 2002R', 'Dark Navy/Mallard Blue', 'New', 'VN', 'The New Balance 2002R Protection Pack Dark Navy features an upper blue mesh with hits of white leather and overlays of navy suede with jagged edges.<br><br>The laces of the New Balance 2002R Protection Pack Dark Navy are light gray and the tongue is black with a yellow-gold underside, the same gold as the center of the heel with its "NB" branding. The "N" on the quarter panel is embroidered in dark and light gray and "2002R" is stamped on a white leather hit below the blue mesh collar. The ABZORB midsole surrounds the N-ergy columns in the heel and the outsole features blue-black traction. <br><br>The New Balance 2002R Protection Pack Dark Navy debuted in April 2022 and retailed for $150.', 'men', 'https://images.stockx.com/images/New-Balance-2002R-Protection-Pack-Dark-Navy-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1650653878', 'Protection Pack Dark Navy', 1, '2022-10-07', 150, 'New Balance 2002R', 'New-Balance-2002R-Protection-Pack-Dark-Navy', 'New Balance 2002R Protection Pack Dark Navy', 'sneakers+new balance+new balance+2002r+dark navy/mallard blue+2022-10-07+150+m2002rdf');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('4fefbbb7-d7cb-4860-be5c-cde6412bf041', 'Nike', 'Nike Dunk', 'White/Rose Whisper', 'New', 'ID', 'The women''s Nike Dunk Low Rose Whisper arrives in a classic two-tone color blocked look similar to the original Nike Dunks of the 1980s. This Dunk offers a warm palette primed for the summer weather, with a white and Rose Whisper leather construction. Matching woven tongue labels contribute to the design''s retro feel, while an EVA foam sole provides cushioning.<br><br>The women''s Nike Dunk Low Rose Whisper released in June of 2022 and retailed for $100.', 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Rose-Whisper-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1650654997', 'Rose Whisper (W)', 1, '2022-03-01', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Rose-Whisper-W', 'Nike Dunk Low Rose Whisper (W)', 'sneakers+nike+nike+dunk+low+white/rose whisper+2022-03-01+100+dd1503-118');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('502850f8-a3aa-4865-9878-047e28cd87f8', 'adidas', 'adidas NMD', 'Chalk White/Glow Orange-Clear Mint', 'New', 'VN', 'Commemorating the 20th Anniversary of their debut album In Search Of, iconic hip-hop group N.E.R.D. - made up of Pharrell Williams, Chad Hugo, and Shay Haley -  added their touch to one of Pharrell''s most popular signature models.<br><br>The adidas NMD Hu NERD Chalk White features an off-white Primeknit upper with N.E.R.D. logos prominently embroidered. On the heel tab, a "20" graphic is printed to honor the 20 years that have passed since the jumpstart of their career as a group. <br><br>The adidas NMD Hu NERD Chalk White released in August of 2021 and retailed for $220.', 'men', 'https://images.stockx.com/images/adidas-NMD-HU-Pharrell-NERD-Chalk-White-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1628178607', 'Pharrell NERD Chalk White', 1, '2021-07-06', 220, 'adidas NMD HU', 'adidas-NMD-HU-Pharrell-NERD-Chalk-White', 'adidas NMD HU Pharrell NERD Chalk White', 'sneakers+adidas+adidas+nmd+chalk white/glow orange-clear mint+2021-07-06+220+gw0246');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('508058d3-bdd2-438d-89c3-732b4a76682e', 'Nike', 'Air Force One', 'Black/Black', 'New', 'CN', 'The all-black Air Force 1 Low is a timeless classic in Nike''s catalog of heritage sneakers.<br><br>The Nike Air Force 1 Low ''07 Black features a triple black smooth leather upper with a matching Air sole and laces. Subtle Nike Air embroidery on the heel tab nods to the history of the AF-1 line. A metallic lace tag and woven tongue label complete the design.<br><br>The Nike Air Force 1 Low ''07 retails for $90.', 'men', 'https://images.stockx.com/images/Nike-Air-Force-1-07-Black-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1607050715', 'Black Black', 1, '2017-09-22', 90, 'Nike Air Force 1 Low ''07', 'Nike-Air-Force-1-07-Black-Black', 'Nike Air Force 1 Low ''07 Black Black', 'sneakers+nike+air force+one+low+black/black+2017-09-22+90+315122-001/cw2288-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('509cd60e-6174-4bcc-8fce-e01f08f0d33c', 'Nike', 'Nike Basketball Dunk', 'Dark Grey Heather/Off Noir-Wolf Grey', 'New', 'VN', 'The Nike Dunk Low SE ‘Copy/Paste’ are made of gray mesh on the lower part of the upper, which features the Nike logo on the entire upper. The same motif is found on the shoe’s insoles.<br><br>Multiple shades of gray are used for the leather overlays, while the rubber outsole, inner lining, heel tabs, and Swooshes are decorated with black detailing. The Nike Dunk Low SE ‘Copy/Paste’ are finished with white detailing on the midsole, heel logo, tongue, and laces.<br><br>The Nike Dunk Low SE ‘Copy/Paste were made available for $100 at the time of its debut on May 1, 2022.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Copy-Paste-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1652464034', 'Copy Paste', 1, '2022-05-01', 100, 'Nike Dunk Low SE', 'Nike-Dunk-Low-Copy-Paste', 'Nike Dunk Low SE Copy Paste', 'sneakers+nike+nike basketball+dunk+low+dark grey heather/off noir-wolf grey+2022-05-01+100+dq5015-063');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('50b8dfb8-327b-4703-8a9b-e6a344aef7b8', 'Jordan', 'Air Jordan Four', 'Black/Multi-Color-Multi-Color-Crimson', 'New', 'VN', 'Following similar color blocking as the Air Jordan 4 Thunder, the Air Jordan 4 Red Thunder features an all-black Durabuck upper with red netted underlays and eyelets. On the tongue, a signature Air Jordan Flight patch is stitched. A vibrant red midsole and Jumpman heel tab complete the retro design.<br><br>The Air Jordan 4 Red Thunder releases in January of 2022 and retails for $190.', 'men', 'https://images.stockx.com/images/Air-Jordan-4-Retro-Red-Thunder-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1641394023', 'Red Thunder', 1, '2022-01-15', 190, 'Jordan 4 Retro', 'Air-Jordan-4-Retro-Red-Thunder', 'Jordan 4 Retro Red Thunder', 'sneakers+jordan+air jordan+four+black/multi-color-multi-color-crimson+2022-01-15+190+ct8527-016');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('50d38cd1-1e86-4523-8f7b-e99dda90a12b', 'Nike', 'LeBron Other', 'Mantra Orange/University Gold/University Red/Light Blue Fury', 'New', 'ID', 'First appearing on LeBron in Space Jam: A New Legacy, the Nike LeBron 19 Tune Squad opened a new chapter in LeBron''s signature line with Nike.<br><br>Produced in a similar palette as the Tune Squad''s uniforms, the Nike LeBron 19 Tune Squad features a bright yellow mesh upper with red and translucent TPU overlays. Beneath a sharp turquoise midsole, a full-length 360 degree Air Max sole delivers cushioning for the high impact of competitive play.<br><Br>The Nike LeBron 19 Tune Squad released in December of 2021 and retailed for $200.', 'men', 'https://images.stockx.com/images/Nike-Lebron-19-Tune-Squad-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1642067451', 'Tune Squad', 1, '2021-12-18', 200, 'Nike LeBron 19', 'Nike-Lebron-19-Tune-Squad', 'Nike LeBron 19 Tune Squad', 'sneakers+nike+lebron+other+mantra orange/university gold/university red/light blue fury+2021-12-18+200+dc9338-800/dc9342-800');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('514baca5-40ab-4e00-9a44-46e285cf065a', 'Nike', 'Air Force One', 'White/Obsidian-white-Black', 'New', 'CN', null, 'women', 'https://images.stockx.com/images/Nike-Air-Force-1-Indigo-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1625756911', 'Indigo (W)', 1, '2021-06-15', 110, 'Nike Air Force 1', 'Nike-Air-Force-1-Indigo-W', 'Nike Air Force 1 Indigo (W)', 'sneakers+nike+air force+one+low+white/obsidian-white-black+2021-06-15+110+cz0269-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5170cc25-6fcb-4983-8665-8c1b41e72709', 'adidas', 'adidas Yeezy', 'MX Rock/MX Rock/MX Rock', 'New', 'CN', 'The adidas Yeezy Boost 350 V2 MX Rock features a marbled black, grey, and brown Primeknit upper styled in a pattern similar to the Yeezy 350 V2 MX Oat, only with dark tones. In signature fashion, a cushioned Boost sole, heel tab, and mesh side stripe complete the design.<br><br>The adidas Yeezy Boost 350 V2 MX Rock released in December of 2021 and retailed for $220.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Boost-350-V2-MX-Rock-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1656665081', 'MX Rock', 1, '2021-12-22', 220, 'adidas Yeezy Boost 350 V2', 'adidas-Yeezy-Boost-350-V2-MX-Rock', 'adidas Yeezy Boost 350 V2 MX Rock', 'sneakers+adidas+adidas+yeezy+350+v2+mx rock/mx rock/mx rock+2021-12-22+220+gw3774');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('51833186-9af8-4ced-9cd5-46798fe71a2d', 'adidas', 'adidas Yeezy', 'Cloud White/Cloud White', 'New', 'CN', 'In early 2020, images of the adidas Yeezy 450 began to circulate when Kanye was spotted outside of the Yeezy Season 8 fashion show during Paris Fashion Week. This otherworldly design captured the attention of Yeezy fans, mostly because it is unlike anything Yeezy has ever made. Then, one year later, Yeezy finally released its brand new 450 silhouette with the adidas Yeezy 450 Cloud White. <br><br>The adidas Yeezy 450 Cloud White is one of Yeezy’s most unique designs yet. Its simplified two-piece construction appears complex due to its extreme, molded foam sole. The sole clasps the mesh upper, acting as an exoskeleton to provide structure. Similar to the Yeezy 700 V3, this release does not feature Boost or adiPRENE technology. Instead, Yeezy utilizes EVA foam to deliver comfort.<br><br>The adidas Yeezy 450 Cloud White released in March of 2021 and retailed for $200.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-450-Cloud-White-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1615564111', 'Cloud White', 1, '2021-03-06', 200, 'adidas Yeezy 450', 'adidas-Yeezy-450-Cloud-White', 'adidas Yeezy 450 Cloud White', 'sneakers+adidas+adidas+yeezy+cloud white/cloud white+2021-03-06+200+h68038');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5205d462-ccbe-4b88-9224-2159b60c61b2', 'Nike', 'Nike Other Other', 'Sail/Midnight Navy-Gum Yellow', 'New', 'CN', 'In 2017, the re-release of the Nike Killshot 2 J Crew Sail Midnight Navy marked the return of one of Nike''s most popular exclusives. The history of the Killshot goes all the way back to the 1970s, but Nike launched the Midnight Navy colorway in 2012 as part of its collaboration with J.Crew. Originally, the Nike Killshot 2 J Crew Sail Midnight Navy was exclusively available at J.Crew. However, Nike re-released the Midnight Navy five year later globally.<br><br>The Nike Killshot 2 J Crew Sail Midnight Navy features a retro design that''s reminiscent of Nike''s original shoes from the 1970s. The shoe starts with a thick tan sole with an aged, weathered appearance and then leads to a clean, off-white upper with gray accents and a navy Swoosh logo. Instead of rubber, the Nike Killshot 2 J Crew Sail Midnight Navy comes with a gum sole with a textured underside to complete the retro look. For a final touch, "NIKE" is printed on the heel in weathered navy letters to suggest that this sneaker has seen a lot of history.<br><br>The Nike Killshot 2 J Crew Sail Midnight Navy released in February of 2017 and retailed for $90.', 'men', 'https://images.stockx.com/images/Nike-Killshot-2-J-Crew-Sail-Midnight-Navy-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1612289517', 'J Crew Sail Midnight Navy', 1, '2017-02-25', 90, 'Nike Killshot 2', 'Nike-Killshot-2-J-Crew-Sail-Midnight-Navy', 'Nike Killshot 2 J Crew Sail Midnight Navy', 'sneakers+nike+nike other+other+sail/midnight navy-gum yellow+2017-02-25+90+432997-107');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('520bb10f-bd72-4863-8cbc-974ebbf9d6e5', 'adidas', 'adidas Yeezy', 'Stone Sage/Stone Sage/Stone Sage', 'New', 'CN', 'The adidas Yeezy Foam RNNR Stone Sage features a sculptural EVA foam and algae blended construction that arrives in a Stone Sage monochromatic color scheme. From there, a grooved outsole provides traction and support.<br><br>The adidas Yeezy Foam RNNR Stone Sage released in March of 2022 and retailed for $90.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Foam-RNNR-Stone-Sage-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1647445127', 'Stone Sage', 1, '2022-03-11', 90, 'adidas Yeezy Foam RNNR', 'adidas-Yeezy-Foam-RNNR-Stone-Sage', 'adidas Yeezy Foam RNNR Stone Sage', 'sneakers+adidas+adidas+yeezy+foam rnnr+stone sage/stone sage/stone sage+2022-03-11+90+gx4472');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5259031f-0d6c-4a34-af97-5db276b475f6', 'Jordan', 'Air Jordan One', 'Light Fusion Red/White-Laser Orange-Black', 'New', 'CN', 'The Air Jordan 1 Light Fusion Red features a white leather upper with Light Fusion Red overlays and Laser Orange on the Swoosh and ankle wrap. A woven Nike label stitched atop the tongue completes the design.<br><br>The Air Jordan 1 Light Fusion Red released in June of 2021 and retailed for $170.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-OG-Light-Fusion-Red-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1621951758', 'Light Fusion Red', 1, '2021-06-12', 170, 'Jordan 1 Retro High OG', 'Air-Jordan-1-Retro-High-OG-Light-Fusion-Red', 'Jordan 1 Retro High OG Light Fusion Red', 'sneakers+jordan+air jordan+one+light fusion red/white-laser orange-black+2021-06-12+170+555088-603');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('52f286be-e78c-407a-a566-51051ea9984a', 'Nike', 'Dunk Low', 'Orange Horizon/Fortress Green-Sail', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Florida-A-M.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1665603195', 'Florida A&M University', 1, '2022-10-18', 120, 'Nike Dunk Low', 'Nike-Dunk-Low-Florida-A-M', 'Nike Dunk Low Florida A&M University', 'sneakers+nike+dunk+low+orange horizon/fortress green-sail+2022-10-18+120+dr6188-800');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('52f7ad8c-6e2a-440f-a3fc-9be60bd631cc', 'adidas', 'adidas Adilette', 'St Desert Sand/St Desert Sand/St Desert Sand', 'New', 'CN', 'As part of the adidas Originals Spring / Summer 2022 collection, the adidas Adilette 22 Slides St Desert Sand features a grooved Desert Sand foam construction that boasts a look reminiscent of eroded sediment. On the lateral side of the sole, text that reads "The Brand With The Three Stripes" nods to adidas'' logo. From there, a soft footbed adds comfort and support.<br><br>The adidas Adilette 22 Slides St Desert Sand released in June of 2022 and retailed for $55.', 'men', 'https://images.stockx.com/images/adidas-Adilette-22-Slides-St-Desert-Sand-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1654774522', 'St Desert Sand', 1, '2022-06-01', 55, 'adidas Adilette 22 Slides', 'adidas-Adilette-22-Slides-St-Desert-Sand', 'adidas Adilette 22 Slides St Desert Sand', 'sneakers+adidas+adidas+adilette+st desert sand/st desert sand/st desert sand+2022-06-01+55+gx6945');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5308fc27-373e-44a8-a6e4-3feeff9a4038', 'Jordan', 'Air Jordan One', 'White/Black-Royal- Sail', 'New', 'CN', 'The Air Jordan 1 Low Fragment Design x Travis Scott nods to the original 2016 Air Jordan 1 Fragment with its simple color blocking. It features a smooth white leather upper with black and royal blue leather overlays. From there, a signature reversed Swoosh and yellowed soles add a Cactus Jack flair to the classic silhouette.<br><br>The Air Jordan 1 Low Fragment Design x Travis Scott released in August of 2021 and retailed for $150.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Low-fragment-design-x-Travis-Scott-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1629307046', 'Fragment x Travis Scott', 1, '2021-08-13', 150, 'Jordan 1 Low', 'Air-Jordan-1-Low-fragment-design-x-Travis-Scott', 'Jordan 1 Low Fragment x Travis Scott', 'sneakers+jordan+air jordan+one+white/black-royal- sail+2021-08-13+150+dm7866-140');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('530b18b8-4490-4cf8-8fff-eed97d8fe11a', 'Crocs', 'Crocs Collaborations', 'Cobbler', 'New', 'CN', 'The Crocs Pollex Clog Salehe Bembury Cobbler arrives in a similar fashion to prior releases, being that it has a monochromatic fingerprint-looking foam construction and adjustable velcro heel straps for secure fit. The main standout of the Cobbler is the peach-inspired bright orange color, which isn''t a new adventure for Bembury - his first New Balance 2002R featured a similar palette.<br><br>The Crocs Pollex Clog Salehe Bembury Cobbler released in August of 2022 and retailed for $85.', 'men', 'https://images.stockx.com/images/Crocs-Pollex-Clog-by-Salehe-Bembury-Orange-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1662558774', 'by Salehe Bembury Cobbler', 1, '2022-08-19', 85, 'Crocs Pollex Clog', 'Crocs-Pollex-Clog-by-Salehe-Bembury-Orange', 'Crocs Pollex Clog by Salehe Bembury Cobbler', 'sneakers+crocs+crocs+collaborations+cobbler+2022-08-19+85+207393-837');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5318fd9a-52c0-4312-93a3-3d29591debaa', 'Jordan', 'Air Jordan One', 'Black/White', 'New', 'CN', 'The Air Jordan 1 Mid SE All-Star 2021 is a shoe designed to celebrate the NBA’s midseason event. Boasting a glossy design, this shoe’s upper is made out of white leather. Its white leather upper base is contrasted by a faux carbon-fiber Swoosh, ankle collar, and heel. This sneaker also features a black tongue, and white Jumpman branding embroidered on its tongue, insole, and collar. Furthermore, it has a cushioned midsole and a toughened black rubber outsole.<br><br>The grade school-sized Air Jordan 1 Mid SE All-Star 2021 was released on 6th March 2021. Originally, it retailed for $100.', 'child', 'https://images.stockx.com/images/Air-Jordan-1-Mid-SE-All-Star-2021-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1618238942', 'All-Star Carbon Fiber (2021) (GS)', 1, '2021-03-06', 100, 'Jordan 1 Mid SE', 'Air-Jordan-1-Mid-SE-All-Star-2021-GS', 'Jordan 1 Mid SE All-Star Carbon Fiber (2021) (GS)', 'sneakers+jordan+air jordan+one+black/white+2021-03-06+100+dd2192-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('53832f80-c566-48be-8580-1ea76a0310b8', 'Jordan', 'Air Jordan One', 'White/White/Black', 'New', 'VN', 'The Jordan Brand has always been inspired by the past in the creation of new shoe collections. The Air Jordan 1 Mid Split Black White has the same aesthetic as the Air Jordan 1 and combines the Bred (black + red) and OG Chicago colorways right down the middle.<br><br>This shoe comes in black and white, with white sitting on a black base on one half of the shoe''s upper, and black sitting on white on the other half. The shoes are constructed ofn 100% leather with nylon tongues that reveal the split, right through the Jumpman patchwork.<br><br>The Air Jordan 1 Mid Split Black White was released on January 5, 2022, and retailed for $110.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Split-Black-White-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1658238244', 'Black White (W)', 1, '2022-09-22', 135, 'Jordan 1 Mid Split', 'Air-Jordan-1-Mid-Split-Black-White', 'Jordan 1 Mid Split Black White (W)', 'sneakers+jordan+air jordan+one+mxscavengerhunt+white/white/black+2022-09-22+135+dr0501-101');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('54056dbc-9fd8-443c-8f65-e78eec3d8b2b', 'Jordan', 'Air Jordan One', 'Ashen Slate/Mystic Navy/White', 'New', 'VN', 'The Air Jordan 1 Low Ashen Slate tread and cushioning provide basic comfort and support. This shoe is ideal for everyday life, as well as light exercise and walking about.<br><br>This specific model has a black sole and a white midsole. The shoe features a white base with gray leather overlays. The Nike swoosh shape can be seen in a darker blue, with the same blue used for the tongue and the lining of the shoe.<br><br>The Air Jordan 1 Low Ashen Slate first was released onto the market in May of 2022. The retail price for this item started at $110.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Low-Ashen-Slate-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1652209562', 'Ashen Slate', 1, '2022-05-03', 110, 'Jordan 1 Low', 'Air-Jordan-1-Low-Ashen-Slate', 'Jordan 1 Low Ashen Slate', 'sneakers+jordan+air jordan+one+ashen slate/mystic navy/white+2022-05-03+110+553558-414');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('54159968-4ca0-425d-91e9-7bf4983df715', 'Jordan', 'Air Jordan One', 'Black/Orange/White', 'New', 'VN', 'The Air Jordan 1 High Zoom Air CMFT Pumpkin Spice introduces autumnal colors in an updated version of the sneaker icon.<br><br>The Air Jordan 1 High Zoom Air CMFT Pumpkin Spice is constructed on a Black suede base contrasted by a light shade of Orange suede overlays, with a darker shade of Orange introduced on the mesh collars and trim outsole. A cut-out Swoosh reveals a crisp white underlay, while a retro win(GS) for grade schoolers logo is stamped in black on the lateral collar flap. A Zoom Air unit delivers responsive cushioning underfoot.<br><br>The Air Jordan 1 High Zoom Air CMFT Pumpkin Spice was released in January 2022 and retailed for $140.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-High-Zoom-Air-CMFT-Pumpkin-Spice-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1642148576', 'Pumpkin Spice', 1, '2022-01-05', 140, 'Jordan 1 High Zoom Air CMFT', 'Air-Jordan-1-High-Zoom-Air-CMFT-Pumpkin-Spice', 'Jordan 1 High Zoom Air CMFT Pumpkin Spice', 'sneakers+jordan+air jordan+one+black/orange/white+2022-01-05+140+ct0978-200');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('542187c7-089d-4aba-a1f6-87943e7e1018', 'Jordan', 'Air Jordan Six', 'Magnet/College Navy', 'New', 'VN', null, 'child', 'https://images.stockx.com/images/Air-Jordan-6-Retro-Georgetown-2022-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1664518782', 'Georgetown (2022) (GS)', 1, '2022-09-03', 150, 'Jordan 6 Retro', 'Air-Jordan-6-Retro-Georgetown-2022-GS', 'Jordan 6 Retro Georgetown (2022) (GS)', 'sneakers+jordan+air jordan+six+magnet/college navy+2022-09-03+150+384665-012');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5424253c-edd9-4277-93c3-717ecd7187f9', 'Nike', 'Air Force One', 'Black/Clear Black', 'New', 'VN', 'The Nike Air Force 1 Mid Off-White honors the 40th Anniversary of the Nike Air Force 1 by refreshing the classic design with Abloh''s signature avante-garde style. It arrives with a black, wood grain-textured lightweight mesh upper with ripstop collar straps and clear TPU Swooshes. From there, a warped midsole with multi-colored sections of a track-inspired spiked outsole reference past Nike Off-White designs like the Nike Waffle Racer and Air Zoom Tempo Next%.<br><br>The Nike Air Force 1 Mid Off-White Black released in June of 2022 and retailed for $185.', 'men', 'https://images.stockx.com/images/Nike-Air-Force-1-Mid-Off-White-Black-Product-2.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1655993157', 'Off-White Black', 1, '2022-06-23', 185, 'Nike Air Force 1 Mid', 'Nike-Air-Force-1-Mid-Off-White-Black', 'Nike Air Force 1 Mid Off-White Black', 'sneakers+nike+air force+one+black/clear black+2022-06-23+185+do6290-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('542defe0-5488-486d-96be-b7b161cba522', 'Reebok', 'Reebok Other', 'Cloud White/Core Black/Azure', 'New', 'CN', null, 'men', 'https://images.stockx.com/images/Reebok-Shaq-Attaq-Orlando-2022-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1664866789', 'Orlando (2022)', 1, '2022-09-23', 170, 'Reebok Shaq Attaq', 'Reebok-Shaq-Attaq-Orlando-2022', 'Reebok Shaq Attaq Orlando (2022)', 'sneakers+reebok+reebok+other+cloud white/core black/azure+2022-09-23+170+gx3881');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('545c47a1-fa54-48a8-9725-81ecca33fc25', 'Nike', 'Nike Dunk', 'Black/Black-Summit White-Red Orbit', 'New', 'VN', 'The Nike Dunk Low Graffiti Pink features mismatched right and left shoes, each with a canvas upper with a perforated toebox and a mottled pattern of pink, purple, green, black, and red.<br><br>The toe cap, eyestays, forefoot, and collar overlay of the same mottled canvas with frayed edging. The leather swoosh, laces, sock lining, and tongue tag with red Nike and swoosh are all black. There is also black Nike branding on one mostly green and one mostly purple heel tab. The insole is black with a white Nike and swoosh superimposed over a white "Pink." The midsole is white and the outsole is black.  <br><br>The Nike Dunk Low Graffiti Pink was released on May 1, 2022 for $110 retail.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Graffiti-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1653401025', 'Graffiti Pink', 1, '2022-05-01', 110, 'Nike Dunk Low', 'Nike-Dunk-Low-Graffiti', 'Nike Dunk Low Graffiti Pink', 'sneakers+nike+nike+dunk+low+black/black-summit white-red orbit+2022-05-01+110+dm0108-002');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('545d83da-b3c1-4fc5-9110-48a8b918e519', 'Nike', 'Nike Basketball Penny', 'Black/Metallic Silver/Varsity Royal', 'New', 'CN', null, 'men', 'https://images.stockx.com/images/Nike-Air-Max-Penny-1-All-Star-Black-Metallic-Silver-Varsity-Royal-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1666162394', 'All Star Black Metallic Silver Varsity Royal', 1, null, 170, 'Nike Air Max Penny 1', 'Nike-Air-Max-Penny-1-All-Star-Black-Metallic-Silver-Varsity-Royal', 'Nike Air Max Penny 1 All Star Black Metallic Silver Varsity Royal', 'sneakers+nike+nike basketball+penny+black/metallic silver/varsity royal+170+dn2487-002');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('54d0b266-26c6-4079-9346-86e0029bbfee', 'Jordan', 'Air Jordan One', 'Grey/Berry/Black', 'New', 'CN', 'The Air Jordan 1 High Element Gore Tex Berry continues the food-themed colorways of the AJ1 and now features a waterproof GORE-TEX construction, durable nubuck leather, winter lining, and a gusseted tongue.<br><br>GORE-TEX is utilized for weatherproofing the Air Jordan 1 High Element Gore Tex Berry via a mix of ripstop, suede, and leather materials, while the heels bear the distinct GORE-TEX marking. Black accents are visible throughout the pair, and underfoot, a white midsole and a half black and grey translucent rubber outsole top off the design.<br><br>The Air Jordan 1 High Element Gore Tex Berry was released in March 2022 and originally retailed for $200.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-High-Element-Gore-Tex-Berry-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1646167893', 'Gore-Tex Berry', 1, '2022-03-28', 200, 'Jordan 1 High Element', 'Air-Jordan-1-High-Element-Gore-Tex-Berry', 'Jordan 1 High Element Gore-Tex Berry', 'sneakers+jordan+air jordan+one+grey/berry/black+2022-03-28+200+db2889-500');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('551786b7-63b4-40af-ad54-260fa49ed5e8', 'Nike', 'Nike Other Other', 'Black/University Gold', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Nike-Hot-Step-Air-Terra-Drake-NOCTA-Black-University-Gold-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1661437379', 'Drake NOCTA Black Yellow', 1, '2022-09-16', 180, 'Nike Hot Step Air Terra', 'Nike-Hot-Step-Air-Terra-Drake-NOCTA-Black-University-Gold', 'Nike Hot Step Air Terra Drake NOCTA Black Yellow', 'sneakers+nike+nike other+other+black/university gold+2022-09-16+180+dh4692-002');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('551fdd91-2c1b-472d-a9d8-61167d4b5085', 'Jordan', 'Air Jordan One', 'Black/White-Particle Grey', 'New', 'CN', 'The Air Jordan 1 Retro High Rebellionaire draws inspiration from the original Air Jordan 1 Shadow with its simple black and grey color blocked upper. Printed on the leather construction, graffiti style text covers the upper. At the base, a white and grey Air sole completes the design.<br><br>The Air Jordan 1 Retro High Rebellionaire released in March of 2022 and retailed for $170.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-OG-Rebellionaire-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1646841923', 'Rebellionaire', 1, '2022-03-12', 170, 'Jordan 1 Retro High OG', 'Air-Jordan-1-Retro-High-OG-Rebellionaire', 'Jordan 1 Retro High OG Rebellionaire', 'sneakers+jordan+air jordan+one+black/white-particle grey+2022-03-12+170+555088-036');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('555f8d64-f9b2-4925-833f-5d35c27b4174', 'Jordan', 'Air Jordan Four', 'Sail/Sail-Cement Grey-Fire Red', 'New', 'CN', 'The women''s Air Jordan 4 Blank Canvas arrives with a light grey canvas construction with matching TPU eyelet wings and Jumpman tongue embroidery. A signature heel tab with a Jumpman logo nods to Jordan 4 retros of the mid-2000s. From there, a canvas midsole and white outsole with hits of blue and red complete the design.<br><br>The women''s Air Jordan 4 Blank Canvas released in March of 2022 and retailed for $200.', 'women', 'https://images.stockx.com/images/Air-Jordan-4-Retro-Canvas-Sail-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1651856437', 'Blank Canvas (W)', 1, '2022-03-24', 200, 'Jordan 4 Retro', 'Air-Jordan-4-Retro-Canvas-Sail-W', 'Jordan 4 Retro Blank Canvas (W)', 'sneakers+jordan+air jordan+four+sail/sail-cement grey-fire red+2022-03-24+200+dq4909-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('557de1bf-4816-4ea1-9c83-cbb6af96fbe7', 'Nike', 'Nike Dunk', 'Light Pink/White/Red', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Nike-Dunk-High-1985-Pink-Denim-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1666081502', 'Barely Rose Denim', 1, '2022-09-27', 140, 'Nike Dunk High 1985', 'Nike-Dunk-High-1985-Pink-Denim', 'Nike Dunk High 1985 Barely Rose Denim', 'sneakers+nike+nike+dunk+high+light pink/white/red+2022-09-27+140+dq8799-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5585c446-deaf-45e2-9132-78acbb422a72', 'Jordan', 'Air Jordan Eleven', 'Medium Grey/Multi-Color/Multi-Color', 'New', 'CN', 'Like the original 2001 design, the gradeschool Air Jordan 11 Retro Cool Grey 2021 GS boasts a mid-top with a grey nubuck upper. This amazing colorway also boasts a white pylon cushioning boosted with a compact Air sole unit and strengthened with a translucent rubber outsole, an elegant "23" on its textile heel tab, and an embroidered white Jumpman logo on its lateral ankle.<br><br>The gradeschool Air Jordan 11 Retro Cool Grey 2021 GS was released on 12th November 2021. It retails at $185.', 'child', 'https://images.stockx.com/images/Air-Jordan-11-Retro-Cool-Grey-2021-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1636562470', 'Cool Grey (2021) (GS)', 1, '2021-12-11', 185, 'Jordan 11 Retro', 'Air-Jordan-11-Retro-Cool-Grey-2021-GS', 'Jordan 11 Retro Cool Grey (2021) (GS)', 'sneakers+jordan+air jordan+eleven+kids+medium grey/multi-color/multi-color+2021-12-11+185+378038-005');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('55862e25-36ca-4633-bafd-2674f2259ddb', 'New Balance', 'New Balance 550', 'White/Castlerock/Light Grey', 'New', 'VN', 'The New Balance 550 White Grey Dark Grey is a fresh take on the original 1989 design from this famous sneaker company.<br><br>The New Balance 550 White Grey Dark Grey features a dark grey hue around the heel, back of the ankle, and tongue. The tread underfoot, which was made with basketball in mind, has two different shades of grey that alternate. The midsoles are clean and simple, colored in a fresh white, and featuring the iconic "N" symbol that has come to be associated with New Balance. Perfect for both sports and walking around town, the New Balance 550 White Grey Dark Grey also has a breathable tongue to provide airflow.<br><br>First released in May 2022 at the retail price of $120.', 'men', 'https://images.stockx.com/images/New-Balance-550-White-Grey-Dark-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1654154068', 'White Grey Dark Grey', 1, '2022-05-12', 100, 'New Balance 550', 'New-Balance-550-White-Grey-Dark-Grey', 'New Balance 550 White Grey Dark Grey', 'sneakers+new balance+new balance+550+white/castlerock/light grey+2022-05-12+100+bb550wtg');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5598c616-d470-4821-90c8-bb53e52c494c', 'Jordan', 'Air Jordan One', 'Dark Concord/New Emerald-Black-White', 'New', 'VN', null, 'women', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Black-Grape-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1662035806', 'Black Grape (W)', 1, '2022-09-29', 110, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Black-Grape-W', 'Jordan 1 Mid Black Grape (W)', 'sneakers+jordan+air jordan+one+dark concord/new emerald-black-white+2022-09-29+110+bq6472-502');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('55a9ccfe-129a-438a-9989-b877c2a66279', 'Jordan', 'Air Jordan Four', 'White/Black-Neutral Grey', 'New', 'CN', 'Jordan Brand flipped one of its original Air Jordan 4 colorways for the Air Jordan 4 Military Black.<br><br>Pulling its color-blocked style from the Air Jordan 4 Military Blue, the Air Jordan 4 Military Black features a smooth white leather upper with a light grey Durabuck toe wrap and netted TPU inserts. Military Black eyelets, heel tabs, and underlays add a stark contrast to the upper. At the base, a white, black, and light grey sole with a visible Air unit completes the design.<br><br>The Air Jordan 4 Military Black released in May of 2022 and retailed for $210.', 'men', 'https://images.stockx.com/images/Air-Jordan-4-Retro-Military-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1652711257', 'Military Black', 1, '2022-05-21', 210, 'Jordan 4 Retro', 'Air-Jordan-4-Retro-Military-Black', 'Jordan 4 Retro Military Black', 'sneakers+jordan+air jordan+four+white/black-neutral grey+2022-05-21+210+dh6927-111');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('564cba13-6602-4975-bfaa-9fbfe9091d46', 'Jordan', 'Air Jordan One', 'Stealth/White/Sail', 'New', 'CN', 'Since its debut, Air Jordan 1 Low Vintage Grey remains one of the highest-selling variants in the Air Jordan 1 Low series.<br><br>Leather, nylon, and fiber are the main materials of the various components of Air Jordan 1 Low Vintage Grey’s heels. Its white leather base is complemented by the nylon tongue and the distressed midsole. The outsole, fabric linings, and laces of the shoe all feature grey overlays. The wings logo is embroidered in white on Air Jordan 1 Low Vintage Grey’s heels.<br><br>The Air Jordan 1 Low Vintage Grey is set to release September 2, 2022, at a price of $110.', 'men', 'https://images.stockx.com/images/Air-Air-Jordan-1-Low-Vintage-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1657780930', 'Vintage Stealth Grey', 1, '2022-09-02', 110, 'Air Jordan 1 Low', 'Air-Air-Jordan-1-Low-Vintage-Grey', 'Air Jordan 1 Low Vintage Stealth Grey', 'sneakers+jordan+air jordan+one+stealth/white/sail+2022-09-02+110+553558-053');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5774fd8d-8fc8-44df-8066-65b578984b5b', 'adidas', 'adidas Samba', 'Black/White/Dark Gum', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/adidas-Samba-Classic-Black-White-Dark-Gum-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1665124533', 'Black White Dark Gum', 1, '2022-06-01', 70, 'adidas Samba Classic', 'adidas-Samba-Classic-Black-White-Dark-Gum', 'adidas Samba Classic Black White Dark Gum', 'sneakers+adidas+adidas+samba+black/white/dark gum+2022-06-01+70+034563');
