INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('57e6f1d9-1961-43f3-a26b-69fad3fe66fa', 'Nike', 'Nike Other Running', 'Sail/White-White', 'New', 'CN', 'The Nike Vaporwaffle sacai Sail Gum features a Sail nylon upper with light grey suede overlays and tumbled leather Swooshes. Doubled tongues and Swooshes continue sacai''s design ethos of reconstruction. At the base, a stacked foam midsole atop a gum outsole completes the design.<br><br>The Nike Vaporwaffle sacai Sail Gum released in March of 2022 and retailed for $180.', 'men', 'https://images.stockx.com/images/Nike-Vaporwaffle-Sacai-White-Gum-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1628170255', 'sacai Sail Gum', 1, '2022-03-10', 180, 'Nike Vaporwaffle', 'Nike-Vaporwaffle-Sacai-White-Gum', 'Nike Vaporwaffle sacai Sail Gum', 'sneakers+nike+nike other+running+sail/white-white+2022-03-10+180+dd1875-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('580a2555-cf3f-4c84-8a79-d775cbd2daba', 'Nike', 'Air Force One', 'Black/Black-Black', 'New', 'CN', 'The Nike Air 1 Low Black W features stitched overlays on the upper side. It features air cushioning and Nike Air branding on the tongue and heel of the shoe. Nike Air Force 1 Low Black W also features a low-cut silhouette alongside a padded collar. It also adds a foam midsole and perforations on the toe for breathability. Its rubber outsole has a circular tread pattern for traction and durability.<br><br>The Nike Air Force 1 Low Black W was released in January 2019 at a retail price of $170.', 'women', 'https://images.stockx.com/images/Nike-Air-Force-1-Low-Black-2019-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1608517854', 'Black (W)', 1, '2019-01-01', 90, 'Nike Air Force 1 Low', 'Nike-Air-Force-1-Low-Black-2019-W', 'Nike Air Force 1 Low Black (W)', 'sneakers+nike+air force+one+low+black/black-black+2019-01-01+90+315115-038/dd8959-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('580c7747-444e-40b2-8521-5a8e2e04f72a', 'adidas', 'adidas Yeezy', 'Ochre/Ochre/Ochre', 'New', 'CN', 'The adidas Yeezy Slide Ochre is constructed entirely of EVA foam in a monochromatic fashion. A soft footbed offers immediate step-in comfort for daily wear. From there, deep groove treads on the sole provide traction and support.<br><br>The adidas Yeezy Slide Ochre released in December of 2021 and retailed for $60.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Slide-Ochre-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1638805392', 'Ochre', 1, '2021-12-13', 60, 'adidas Yeezy Slide', 'adidas-Yeezy-Slide-Ochre', 'adidas Yeezy Slide Ochre', 'sneakers+adidas+adidas+yeezy+slides+ochre/ochre/ochre+2021-12-13+60+gw1931');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('582d5f4d-67d9-4667-876c-92e207df1165', 'Nike', 'Nike Basketball Blazer', 'White/Black/Summit White/Pink Oxford', 'New', 'VN', 'The Nike Blazer Mid 77 Vintage Summit White Pink (W) sneaker made for women features a white leather upper with hits of rough white suede on the toe and quarter.<br><br>The pink swooshes connect in a pink arc across the heel that matches the pink word "NIKE" on the heel of this Nike Blazer Mid 77 Vintage Summit White Pink. The tongue is soft pink pebbled material with yellow edging and a white tag that has a black "NIKE" and an orange swoosh. The insole is pink with a white swoosh, the midsole is white and tumbled, and the outsole is patterned in white chevrons. <br><br>The Nike Blazer Mid 77 Vintage Summit White Pink (W) sneaker for women was released in August 2021 at a retail price of $100.', 'women', 'https://images.stockx.com/images/Nike-Blazer-Mid-77-Vintage-Summit-White-Pink-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1633027233', 'Summit White Pink (W)', 1, '2021-08-31', 100, 'Nike Blazer Mid 77 Vintage', 'Nike-Blazer-Mid-77-Vintage-Summit-White-Pink-W', 'Nike Blazer Mid 77 Vintage Summit White Pink (W)', 'sneakers+nike+nike basketball+blazer+white/black/summit white/pink oxford+2021-08-31+100+cz1055-118');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5836a63b-14d0-441d-9fc9-8be98eac1166', 'Jordan', 'Air Jordan One', 'Seafoam/Healing Orange-White', 'New', 'CN', 'The women''s Air Jordan 1 High Seafoam (W) arrives in a smooth white leather construction with Seafoam Durabuck overlays and Swooshes. On the laces, crisp bronze trimming stands out against the design''s subtle coloration.The women''s Air Jordan 1 High Seafoam (W) released in August of 2021 and retailed for $170.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-High-OG-Seafoam-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1627324677', 'Seafoam (W)', 1, '2021-08-12', 170, 'Jordan 1 Retro High OG', 'Air-Jordan-1-High-OG-Seafoam-W', 'Jordan 1 Retro High OG Seafoam (W)', 'sneakers+jordan+air jordan+one+seafoam/healing orange-white+2021-08-12+170+cd0461-002');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('58500828-a87d-4f88-a9ee-ff5d3219ab46', 'Puma', 'Puma Puma', 'Puma White/Silver', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Puma-LaMelo-Ball-MB01-White-Silver-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1659539079', 'White Silver', 1, '2022-07-13', 120, 'Puma LaMelo Ball MB.01', 'Puma-LaMelo-Ball-MB01-White-Silver', 'Puma LaMelo Ball MB.01 White Silver', 'sneakers+puma+puma+puma+puma white/silver+2022-07-13+120+376941-04');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('587c4f22-1738-4e38-8809-c0bd7eee3248', 'Jordan', 'Air Jordan One', 'Particle Grey/Particle Grey/White', 'New', 'VN', 'The Air Jordan 1 Mid SE Particle Grey (Women''s) features a neutral tone and is dominated by supple suede throughout.<br><br>The Air Jordan 1 Mid SE Particle Grey (W) features a Grey nubuck upper accented with fluffy suede overlays. Particle Grey suede covers the side Swoosh and eyelets, while the inner lining is made of white fleece. White laces run the length of the tongue and add contrast to the silhouette. Underfoot, a White midsole and Grey outsole finish round off the look. <br><br>The Air Jordan 1 Mid SE Particle Grey (Women''s) was released in February 2022 and retailed for $140.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-Mid-SE-Particle-Grey-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1648049702', 'Particle Grey (W)', 1, '2022-02-14', 140, 'Jordan 1 Mid SE', 'Air-Jordan-1-Mid-SE-Particle-Grey-W', 'Jordan 1 Mid SE Particle Grey (W)', 'sneakers+jordan+air jordan+one+particle grey/particle grey/white+2022-02-14+140+do7139-002');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('58a4ce6b-d601-45a1-bff1-59ee0657a2ac', 'Nike', 'Nike SB SB Dunk High', 'University Red/Spinach Green-Magic Ember', 'New', 'CN', 'Designed by Nike SB legend Todd Bratrud, the Nike SB Dunk High Strawberry Cough is composed of red ostrich-textual leather with shaggy green suede overlays and a green velour collar. From there, a graphic of a strawberry coughing embroidered on the heel and a semi-translucent sole add a custom feel.<br><br>The Nike SB Dunk High Strawberry Cough released in October of 2021 and retailed for $110.', 'men', 'https://images.stockx.com/images/Nike-SB-Dunk-High-Strawberry-Cough-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1665556759', 'Strawberry Cough', 1, '2021-10-22', 110, 'Nike SB Dunk High', 'Nike-SB-Dunk-High-Strawberry-Cough', 'Nike SB Dunk High Strawberry Cough (Regular Box)', 'sneakers+nike+nike sb+sb dunk high+university red/spinach green-magic ember+2021-10-22+110+cw7093-600');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('58b62683-1a44-45b6-8d76-1d340fbf3d84', 'Jordan', 'Air Jordan Five', 'Black/Racer Blue-Reflective Silver', 'New', 'CN', 'In a style similar to classic Jordan 5s of the past, the Air Jordan 5 Racer Blue features a black Durabuck upper with signature TPU netted inserts and a reflective padded tongue. At the base, Racer Blue accents pop against a black midsole and icy translucent sole.<br><br>The Air Jordan 5 Racer Blue released in February of 2022 and retailed for $200.', 'men', 'https://images.stockx.com/images/Air-Jordan-5-Retro-Racer-Blue-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1644491795', 'Racer Blue', 1, '2022-02-12', 200, 'Jordan 5 Retro', 'Air-Jordan-5-Retro-Racer-Blue', 'Jordan 5 Retro Racer Blue', 'sneakers+jordan+air jordan+five+black/racer blue-reflective silver+2022-02-12+200+ct4838-004');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('59e47da3-b0d8-4b50-96ef-b5c49f75075b', 'Nike', 'Dunk Low', 'Phantom/Black-Safety Orange', 'New', 'VN', null, 'child', 'https://images.stockx.com/images/Nike-Dunk-Low-Halloween-GS-2022-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1665468936', 'Halloween (2022) (GS)', 1, '2022-09-17', 90, 'Nike Dunk Low', 'Nike-Dunk-Low-Halloween-GS-2022', 'Nike Dunk Low Halloween (2022) (GS)', 'sneakers+nike+dunk+low+phantom/black-safety orange+2022-09-17+90+dh9765-003');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('59f9f4de-a8b8-46fc-841f-42961d3567e7', 'Nike', 'Nike Dunk', 'White/Black-White', 'New', 'CN', 'The Nike Dunk Low Retro White Black (GS) silhouette comes in a stark black and white colorway and is made from premium leather materials throughout. Additionally, white Nike lettering complements the rear ankle support of the silhouette while the Nike Air text along with the customary company Swoosh logo adorns the tongue. In keeping with the color scheme, a white midsole resting atop a black outsole rounds out the look of this Dunk Low Retro shoe. <br><br>The Nike Dunk Low Retro White Black (GS) released in March of 2021 and retailed for $85.', 'child', 'https://images.stockx.com/images/Nike-Dunk-Low-Retro-White-Black-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1613360456', 'White Black Panda (2021) (GS)', 1, '2021-03-10', 85, 'Nike Dunk Low Retro', 'Nike-Dunk-Low-Retro-White-Black-GS', 'Nike Dunk Low Retro White Black Panda (2021) (GS)', 'sneakers+nike+nike+dunk+low+white/black-white+2021-03-10+85+cw1590-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('59ff4e88-69bf-4b05-960c-afbfd8cc38cf', 'UGG', 'UGG Boots', 'Sand', 'New', 'VN', null, 'women', 'https://images.stockx.com/images/UGG-Classic-Ultra-Mini-Boot-Sand-W.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1667568203', 'Sand (W)', 1, null, 140, 'UGG Classic Ultra Mini Boot', 'UGG-Classic-Ultra-Mini-Boot-Sand-W', 'UGG Classic Ultra Mini Boot Sand (W)', 'sneakers+ugg+ugg+boots+sand+140+1116109-san');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5a1eebbb-8b60-4260-b602-580d271deee3', 'Jordan', 'Air Jordan One', 'Light Iron Ore/Varsity Red-Sail', 'New', 'VN', 'Jordan Brand pulled inspiration from old school varsity letterman jackets for the Air Jordan 1 High Varsity Red (Women''s).<br><br>Also known as the Jordan 1 Newstalgia for its nostalgic fabrication, the Air Jordan 1 High Varsity Red (Women''s) features a white smooth leather upper with red leather overlays, light grey collars, and matching chenille Swooshes. From there, signature woven Nike tongue tags, a corduroy-fabricated tongue, and a Jordan Wings logo atop the color complete the design.<br><br>The Air Jordan 1 High Varsity Red (Women''s) released in July of 2022 and retailed for $170.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-High-OG-Newstalgia-Chenille-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1659033948', 'Varsity Red (W)', 1, '2022-07-20', 170, 'Jordan 1 Retro High OG', 'Air-Jordan-1-High-OG-Newstalgia-Chenille-W', 'Jordan 1 Retro High OG Varsity Red (W)', 'sneakers+jordan+air jordan+one+light iron ore/varsity red-sail+2022-07-20+170+dj4891-061');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5a710c01-1755-4f11-b607-6bedf26b7981', 'Jordan', 'Air Jordan One', 'Hemp/Gum Yellow/White', 'New', 'ID', 'The Jordan 1 Mid Tan Gum features a white leather upper with Tan overlays and Swooshes. At the collar, a signature Air Jordan Wings logo is printed in white, similar to the original 1985 Air Jordan 1. From there, a Jumpman tongue label and gum outsole add the finishing touch.<br><br>The Jordan 1 Mid Tan Gum released in September of 2021 and retailed for $120.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Tan-Gum-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1633023775', 'Tan Gum', 1, '2021-09-03', 120, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Tan-Gum', 'Jordan 1 Mid Tan Gum', 'sneakers+jordan+air jordan+one+hemp/gum yellow/white+2021-09-03+120+554724-271');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5a83b120-edfa-4f93-bf87-bd6a100e893d', 'Jordan', 'Air Jordan One', 'Coconut Milk/Coconut Milk-Particle Grey-White-Gum Yellow', 'New', 'CN', 'The Air Jordan 1 Mid Cream Grey arrives in a neutral-hued colourway.<br><br>The Air Jordan 1 Mid Cream Grey sports a canvas base for its upper in the titular Cream colour, peeking out of the toe box, the quarter and the collar. The fuzzy suede overlays play with shading, dark grey on the toe cap, the mudguard and the eyestay panel and light grey on the collar flap and the cupsole. The signature profile Swooshes on both the medial and the lateral sides are the same suede material and shade of grey as the collar flap and cupsole.<br><br>The Air Jordan 1 Mid Cream Grey was released in February 2022 and retailed for $130.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Cream-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1645555841', 'Coconut Milk Particle Grey', 1, '2022-02-24', 130, 'Jordan 1 Mid SE', 'Air-Jordan-1-Mid-Cream-Grey', 'Jordan 1 Mid SE Coconut Milk Particle Grey', 'sneakers+jordan+air jordan+one+coconut milk/coconut milk-particle grey-white-gum yellow+2022-02-24+130+dn4281-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5aa1f61d-1ee9-41a7-97c8-63b2a366a01a', 'Nike', 'Nike Other Other', 'Black/Chrome', 'New', 'VN', 'The Nike Hot Step Air Terra Drake NOCTA Black features a black perforated tumbled leather reminiscent of the Air Jordan 14. Metallic mini Swoosh emblems at the toe and heel shine against a matte background. In addition to Air Max cushioning, G-TEK is also present in the sole, a technology found in the 1999 ACG Air Terra Humara. From there, NOCTA branding moments on the tongue and insole nod to Drake''s Nike sublabel.<br><br>The Nike Hot Step Air Terra Drake NOCTA Black released in March of 2022 and retailed for $180.', 'men', 'https://images.stockx.com/images/Nike-Hot-Step-Air-Terra-Drake-NOCTA-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1646687916', 'Drake NOCTA Triple Black', 1, '2022-03-03', 180, 'Nike Hot Step Air Terra', 'Nike-Hot-Step-Air-Terra-Drake-NOCTA-Black', 'Nike Hot Step Air Terra Drake NOCTA Triple Black', 'sneakers+nike+nike other+other+black/chrome+2022-03-03+180+dh4692-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5ac95a71-58c4-4495-adfa-0739f5f6c3c0', 'adidas', 'adidas Yeezy', 'Slate/Core Black/Slate', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/adidas-Yeezy-Boost-350-V2-Slate-Core-Black-Slate-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1663699524', 'Slate', 1, '2022-09-03', 230, 'adidas Yeezy Boost 350 V2', 'adidas-Yeezy-Boost-350-V2-Slate-Core-Black-Slate', 'adidas Yeezy Boost 350 V2 Slate', 'sneakers+adidas+adidas+yeezy+350+v2+slate/core black/slate+2022-09-03+230+hp7870');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5b85a42d-daed-44a8-b75e-42ec85fe41af', 'Nike', 'Air Force One', 'White/White-White', 'New', 'CN', 'Supreme and Nike paid homage to an NYC classic with the release of the Nike Air Force 1 Low Supreme White, now available on StockX. This collaboration adds Supreme’s world-renowned Box Logo to the side of a traditional all-white Air Force 1 design.<br><br>This Air Force 1 Low is comprised of an all-white leather upper with matching soles and detailing. A red Supreme Box Logo placed on the outside heel completes the design. These sneakers released in March of 2020 and retailed for $96.', 'men', 'https://images.stockx.com/images/Nike-Air-Force-1-Low-Supreme-Box-Logo-White-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606164536', 'Supreme White', 1, '2020-03-05', 96, 'Nike Air Force 1 Low', 'Nike-Air-Force-1-Low-Supreme-Box-Logo-White', 'Nike Air Force 1 Low Supreme White', 'sneakers+nike+air force+one+ss20+low+white/white-white+2020-03-05+96+cu9225-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5bf43351-3215-41df-9cb9-6340eba658d2', 'Jordan', 'Air Jordan One', 'White/Electro Orange-Black', 'New', 'CN', 'The Air Jordan 1 High Electro Orange features a white leather upper with black overlays and a Hyper Orange ankle wrap. From there, a matching woven tongue label and sole complete the design.<br><br>The Air Jordan 1 High Electro Orange released in July of 2021 and retailed for $170.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-Electro-Orange-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1626802469', 'Electro Orange', 1, '2021-07-17', 170, 'Jordan 1 Retro High', 'Air-Jordan-1-Retro-High-Electro-Orange', 'Jordan 1 Retro High Electro Orange', 'sneakers+jordan+air jordan+one+white/electro orange-black+2021-07-17+170+555088-180');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5c157789-c59d-41cb-8cdd-eb1913b2885e', 'Jordan', 'Air Jordan One', 'White/Grey/Red-Orange', 'New', 'ID', null, 'men', 'https://images.stockx.com/images/Air-Jordan-1-High-Zoom-Air-CMFT-Hare-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1657781030', 'Hare', 1, '2022-08-10', 140, 'Jordan 1 High Zoom Air CMFT', 'Air-Jordan-1-High-Zoom-Air-CMFT-Hare', 'Jordan 1 High Zoom Air CMFT Hare', 'sneakers+jordan+air jordan+one+white/grey/red-orange+2022-08-10+140+ct0978-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5c3ebb72-583c-40da-85c2-52a5a5676847', 'Nike', 'Nike Dunk', 'White/Green Glow-White', 'New', 'CN', 'After releasing the Nike Dunk Low Orange Pearl (W) and Nike Dunk Low College Navy (W) in the spring of 2021, Nike delivered yet another women’s exclusive Dunk Low this season with the Nike Dunk Low Green Glow (W). While the Green Glow is the first of its kind, its usage of traditional Dunk color blocking adds a familiarity to the design.The upper of the Nike Dunk Low Green Glow (W) is composed of white leather with Green Glow leather overlays and Swoosh logos. From there, a woven Nike label is sewn to the tongue and a white "NIKE" is embroidered on the heel. A white midsole and Green Glow outsole completes the design.The women''s Nike Dunk Low Green Glow (W) released in April of 2021 and retailed for $100.', 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Green-Glow-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1619204705', 'Green Glow (W)', 1, '2021-04-16', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Green-Glow-W', 'Nike Dunk Low Green Glow (W)', 'sneakers+nike+nike+dunk+low+white/green glow-white+2021-04-16+100+dd1503-105');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5c7f4f73-54d9-4539-b126-c44d697d2e2c', 'Nike', 'Air Force One', 'White/White', 'New', 'CN', 'The Nike Air Force 1 Mid White ''07 features a smooth white leather upper with matching overlays and Swooshes. From there, a velcro strap with Nike Swoosh embroidery and a matching Air sole completes the design.<br><br>The Nike Air Force 1 Mid White ''07 was re-released in December of 2015 and retailed for $95.', 'men', 'https://images.stockx.com/images/Nike-Air-Force-1-Mid-White-White-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1607058128', 'White', 1, '2016-01-01', 95, 'Nike Air Force 1 Mid ''07', 'Nike-Air-Force-1-Mid-White-White', 'Nike Air Force 1 Mid White ''07', 'sneakers+nike+air force+one+mid+white/white+2016-01-01+95+315123-111/cw2289-111');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5cb04fe7-ff65-43e6-9879-94bc70d38a9f', 'Nike', 'Air Max 90', 'Phantom/Hemp/Sanddrift/Black', 'New', 'VN', null, 'women', 'https://images.stockx.com/images/Nike-Air-Max-90-Futura-Tan-W.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1667398415', 'Tan (W)', 1, '2022-08-04', 130, 'Nike Air Max 90 Futura', 'Nike-Air-Max-90-Futura-Tan-W', 'Nike Air Max 90 Futura Tan (W)', 'sneakers+nike+air max+90+phantom/hemp/sanddrift/black+2022-08-04+130+dm9922-002');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5cba54f6-630d-4029-bf49-004205f2a3dd', 'adidas', 'adidas Ultra Boost', 'Cloud White/Cloud White/Core Black', 'New', 'CN', 'When you get your feet inside of a pair of adidas Ultra Boost 40 DNA White shoes you are ready to step out in style.<br><br>What makes the adidas Ultra Boost 40 DNA White shoes so unique is that they offer great performance innovations with an extra splash of flair. With all that performance, wearers get a surprise when they feel the comfort that Boost technology provides. The shoes offer a lightweight Primeknit upper combined with a high-performance sole. These stylish shoes are equally at home on the track and out on the town.<br><br>With a release date of November 2020, these great shoes retail for $200.', 'men', 'https://images.stockx.com/images/adidas-Ultra-Boost-40-DNA-White-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1620058617', 'White', 1, '2021-03-04', 200, 'adidas Ultra Boost 4.0 DNA', 'adidas-Ultra-Boost-40-DNA-White', 'adidas Ultra Boost 4.0 DNA White', 'sneakers+adidas+adidas+ultra boost+cloud white/cloud white/core black+2021-03-04+200+fy9120');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5ce25b36-a387-4804-b6c3-d10db8ed0064', 'adidas', 'adidas Basketball', 'Green/Green/Green', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/adidas-Forum-Low-The-Grinch.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1668611266', 'The Grinch', 1, '2022-12-01', 120, 'adidas Forum Low', 'adidas-Forum-Low-The-Grinch', 'adidas Forum Low The Grinch', 'sneakers+adidas+adidas+basketball+green/green/green+2022-12-01+120+hp6772');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5cf6161f-6568-4d07-899c-cc27d6f66749', 'Jordan', 'Air Jordan Four', 'Dark Grey/Infrared 23-Black-Cement Grey', 'New', 'VN', ' The Air Jordan 4 Infrared features a tonal grey Durabuck upper with black TPU mesh inserts, tech straps, and heel tabs. Hits of Infrared on the lacing system and woven Jordan Flight tongue label add a sharp contrast to the neutral-toned base. From there, a white sole with visible Air units completes the design.<br><br>The Air Jordan 4 Infrared released in June of 2022 and retailed for $200.', 'men', 'https://images.stockx.com/images/Air-Jordan-4-Retro-Infrared-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1645637225', 'Infrared', 1, '2022-06-15', 200, 'Jordan 4 Retro', 'Air-Jordan-4-Retro-Infrared', 'Jordan 4 Retro Infrared', 'sneakers+jordan+air jordan+four+dark grey/infrared 23-black-cement grey+2022-06-15+200+dh6927-061');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5cf797ed-dfd2-4c6c-894a-29778d7e99f2', 'Nike', 'Air Max Other', 'Black', 'New', 'CN', 'The trail boot-inspired Nike Air Max Goadome Black made its debut as part of the Nike Sportswear in November 2016.<br><br>Nike Air Max Goadome Black has a fully Black colorway. The boot is made of premium leather synthetic materials. Its upper features richly detailed leather and a Nike Air Max cushioning that ensures a clean, classic look with lasting comfort. The design is finished off by a waterproof finish and an aggressive outsole pattern that offers in and outdoor durability.<br><br>During its release in November 2016, the triple black colored Nike Air Max Goadome Black retailed at $170.', 'men', 'https://images.stockx.com/images/Nike-Air-Max-Goadome-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1612990797', 'Black', 1, '2016-11-19', 170, 'Nike Air Max Goadome', 'Nike-Air-Max-Goadome-Black', 'Nike Air Max Goadome 865031 Black', 'sneakers+nike+air max+other+black+2016-11-19+170+865031-009');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5d157c37-8f1b-4667-83f2-1469e492f346', 'Nike', 'Air Max 90', 'Black/White', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Nike-Air-Max-90-Terrascape-Crater-Foam-Black-White-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1658815582', 'Crater Foam Black White', 1, '2022-06-07', 150, 'Nike Air Max 90 Terrascape', 'Nike-Air-Max-90-Terrascape-Crater-Foam-Black-White', 'Nike Air Max 90 Terrascape Crater Foam Black White', 'sneakers+nike+air max+90+black/white+2022-06-07+150+dm0033-002');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5ddaf86b-f948-49d4-bb97-d1128b467808', 'Jordan', 'Air Jordan One', 'Black/Black-Metallic Gold', 'New', 'CN', 'Jordan Brand is no stranger to patent leather. Since the Air Jordan 11 debuted the material for the brand back in 1996, it’s found its way onto various models such as the Jordan 1, Jordan 4, and Jordan 7. 2020 marks the third issue of the patent-clad Air Jordan 1 Black Metallic Gold, with the first releasing back in 2001, and again in 2013.<br><br>The Air Jordan 1 Black Metallic Gold’s 2020 retro delivers slight cosmetic changes from its 2013 predecessor. The upper black and metallic gold patent leather upper. From there, a full translucent black sole with gold speckles completes the Jordan 1 classic.<br><br>The Air Jordan 1 Black Metallic Gold released in November of 2020 and retailed for $170.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-Black-Metallic-Gold-2020-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1611792401', 'Black Metallic Gold (2020)', 1, '2020-11-30', 170, 'Jordan 1 Retro High', 'Air-Jordan-1-Retro-High-Black-Metallic-Gold-2020', 'Jordan 1 Retro High Black Metallic Gold (2020)', 'sneakers+jordan+air jordan+one+black/black-metallic gold+2020-11-30+170+555088-032');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5e0dcac0-49eb-48a6-b9fe-da199ee50574', 'Nike', 'Nike Dunk', 'Pure Platinum/White-Wolf Grey', 'New', 'VN', 'Nike Sportswear added to their Dunk Low lineup with this Nike Dunk Low Two Toned Grey with grade school sizing (GS) colorway, arriving in a mix of gray tones. The Nike Dunk Low Two Toned Grey (GS) comes constructed in a full leather build featuring light and dark shades of gray. The clean two-toned Grey colorway sees the slightly darker shade of neutral overlaying the base layer, while the white Swoosh logo, laces, and midsole complete the two-tone look. A gray rubber outsole completes the design. <br><br>The Nike Dunk Low Two Toned Grey (GS) was released in March of 2022 at a retail price of $85.', 'child', 'https://images.stockx.com/images/Nike-Dunk-Low-Two-Toned-Grey-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1649690607', 'Two-Toned Grey (GS)', 1, '2022-03-01', 85, 'Nike Dunk Low', 'Nike-Dunk-Low-Two-Toned-Grey-GS', 'Nike Dunk Low Two-Toned Grey (GS)', 'sneakers+nike+nike+dunk+low+pure platinum/white-wolf grey+2022-03-01+85+dh9765-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5e335e61-9c92-4432-aeae-64a0a80c55cc', 'Nike', 'LeBron Twenty', 'Barely Green/Multi-color/Medium Soft Pink', 'New', 'CN', null, 'men', 'https://images.stockx.com/images/Nike-Lebron-20-Time-Machine-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1665171648', 'Time Machine', 1, '2022-09-29', 200, 'Nike Lebron 20', 'Nike-Lebron-20-Time-Machine', 'Nike Lebron 20 Time Machine', 'sneakers+nike+lebron+twenty+barely green/multi-color/medium soft pink+2022-09-29+200+dj5423-300/dj5422-300');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5e6a1e57-1c7d-435a-82bd-5666a13560fe', 'Nike', 'Nike Dunk', 'White/Black', 'New', 'CN', 'From the school-spirited College Colors Program to the vibrant Nike CO.JP collection, Nike Dunks have seen many colorways since the design’s inception in 1985. But with each new colorway, the Dunk’s classic color-blocking has remained in some capacity. Nike put its timeless color-blocking to work with the Nike Dunk Low Retro White Black.<br><br>The upper Nike Dunk Low Retro White Black is constructed of white leather with black leather overlays and Swooshes. Classic Nike branding is featured on the nylon tongue, nodding to traditional Dunk design elements. A white midsole and black outsole complete the design.<br><br>The Nike Dunk Low Retro White Black released in January of 2021 and retailed for $100.<br><br>To shop all Nike Dunks, <a href="https://stockx.com/nike/dunk">click here.</a>', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Retro-White-Black-2021-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1633027409', 'White Black Panda (2021)', 1, '2021-03-10', 110, 'Nike Dunk Low Retro', 'Nike-Dunk-Low-Retro-White-Black-2021', 'Nike Dunk Low Retro White Black Panda (2021)', 'sneakers+nike+nike+dunk+low+white/black+2021-03-10+110+dd1391-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5ee9da0d-d10a-4d5f-9b2c-6e170ac87aaf', 'Jordan', 'Air Jordan Eleven', 'Black/Dark Concord-White', 'New', 'CN', '<p>The <a href="https://stockx.com/jordan-11-retro-space-jams-2016"> Air Jordan 11 Space Jam </a> has released twice since it first appeared on the feet of Michael Jordan in the 1995 NBA Playoffs. The 2016 Jordan 11 Space Jam marks the third time that this iconic shoe and immensely popular colorway hit retail shelves. The Black, Dark Concord and White colorway received the Space Jam nickname due to the product placement in Space Jam the movie that released in 1996. With 2016 being the 20th anniversary and the rumors of LeBron James playing a role, the Jordan 11 Space Jam captures the spotlight once again with a retro release. After early speculations had the colors and shape of the silhouette slightly off, official images seem to have a majority of sneakerheads anticipating this release. If pre-release action is any indicator, the 2016 Air Jordan 11 Space Jam is one of the biggest release. </p>', 'men', 'https://images.stockx.com/images/Jordan-11-Retro-Space-Jams-2016-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606319512', 'Space Jam (2016)', 1, '2016-12-10', 220, 'Jordan 11 Retro', 'Air-Jordan-11-Retro-Space-Jam-2016', 'Jordan 11 Retro Space Jam (2016)', 'sneakers+jordan+air jordan+eleven+black/dark concord-white+2016-12-10+220+378037-003');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('5f1e77e4-55f9-460d-b98e-ceef229c45f5', 'Timberland', 'Timberland Boots', 'Wheat/Black', 'New', 'CN', 'The Timberland 6 Inch Premium Waterproof Wheat is one of the variants from the Timberland brand, a common footwear among men and trekking sports enthusiasts. <br><br>The boot is made from leather material at the upper part and rubber at the sole. The design unleashes in style code TB010062-713. 90% of the upper part of Timberland Waterproof is wheat, while the collar is black. The design consists of a stylish suede with a Timberland logo branded on the side of the shoe. <br><br>Timberland 6 Inch Premium Waterproof Wheat was first released on June 1, 2019, at a retail price of $210.', 'men', 'https://images.stockx.com/images/Timberland-6-Inch-Premium-Waterproof-Wheat.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1657956065', 'Wheat', 1, '2019-01-05', 210, 'Timberland 6" Premium Waterproof Boot', 'Timberland-6-Inch-Premium-Waterproof-Wheat', 'Timberland 6" Premium Waterproof Boot Wheat', 'sneakers+timberland+timberland+boots+wheat/black+2019-01-05+210+tb010061-713');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('6022bcb3-fabe-4ee5-b952-f098c058654d', 'Nike', 'Air Force One', 'Light Green Spark/Metallic Silver-Light Green Spark', 'New', 'CN', null, 'men', 'https://images.stockx.com/images/Nike-Air-Force-1-Low-Off-White-Light-Green-Spark-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1662666856', 'Off-White Brooklyn', 1, '2022-09-15', 160, 'Nike Air Force 1 Low', 'Nike-Air-Force-1-Low-Off-White-Light-Green-Spark', 'Nike Air Force 1 Low Off-White Brooklyn', 'sneakers+nike+air force+one+light green spark/metallic silver-light green spark+2022-09-15+160+dx1419-300');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('60304c95-866a-4f45-9e08-306a28db5705', 'Nike', 'Air Max 1', 'Metallic Silver/Noise Aqua-Pure Platinum', 'New', 'CN', 'In collaboration with Patta, the Nike Air Max 1 Patta Waves Noise Aqua (with Bracelet) features a grey mesh upper with white overlays with Aqua Swooshes and a wave-shaped mudguard. From there, classic Nike branding on the heel pays homage to the original line of Air Max 1s. A white midsole, multicolor outsole, and custom Patta woven tongue tags completes the design. <br><br>The Nike Air Max 1 Patta Waves Noise Aqua (with Bracelet) released in October of 2021 and retailed for $160.', 'men', 'https://images.stockx.com/images/Nike-Air-Max-1-Patta-Waves-Noise-Aqua-with-Bracelet-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1635780405', 'Patta Waves Noise Aqua (with Bracelet)', 1, '2021-11-04', 160, 'Nike Air Max 1', 'Nike-Air-Max-1-Patta-Waves-Noise-Aqua-with-Bracelet', 'Nike Air Max 1 Patta Waves Noise Aqua (with Bracelet)', 'sneakers+nike+air max+1+metallic silver/noise aqua-pure platinum+2021-11-04+160+dh1348-004');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('605fdb05-ef86-4724-b77a-1b076bcff178', 'Nike', 'Nike Basketball Kyrie', 'Orchid/Yellow Strike-Light Bone-Enamel Green-Barely Volt', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Nike-Kyrie-Low-5-1-World-1-People-Orchid.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1659342425', '1 World 1 People Orchid', 1, '2022-07-08', 120, 'Nike Kyrie Low 5', 'Nike-Kyrie-Low-5-1-World-1-People-Orchid', 'Nike Kyrie Low 5 1 World 1 People Orchid', 'sneakers+nike+nike basketball+kyrie+orchid/yellow strike-light bone-enamel green-barely volt+2022-07-08+120+dj6014-500/dj6012-500');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('60980862-8a0f-4b4a-bab0-6c062f8ac25c', 'Nike', 'Dunk Low', 'Phantom/Gold Suede-White-Volt', 'New', 'ID', 'The Nike Dunk Low Next Nature Light Curry (Women) is a variant of the Nike’s Dunk Low series.<br><br>The upper of Nike Dunk Low Next Nature Light Curry is made from recycled polyester, white in color, with brownish orange overlays on the ankle collar and the tongue. The pull tap and the laces are black. These rest on an all-white rubber midsole. The outsole of Nike Dunk Low Next Nature Light Curry is all-brownish orange except at the toe front and heel, which are black.<br><br>The Nike Dunk Low Next Nature Light Curry was first released on March 29, 2022, at a price of $110.', 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Next-Nature-Light-Curry-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1663957727', 'Next Nature Phantom (W)', 1, '2022-09-16', 115, 'Nike Dunk Low', 'Nike-Dunk-Low-Next-Nature-Light-Curry-W', 'Nike Dunk Low Next Nature Phantom (W)', 'sneakers+nike+dunk+low+low+phantom/gold suede-white-volt+2022-09-16+115+dn1431-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('60c90b1e-0c17-4325-810a-c9633941cd89', 'Nike', 'Nike Basketball Blazer', 'White/University Red/Off White', 'New', 'CN', 'The Nike Blazer Low Off-White White University Red boasts a multi-disciplinary, multi-sport aesthetic - a central motif in Virgil Abloh''s body of work. Encompassing aspects of basketball, skateboarding, and trail running silhouettes, the Off-White Blazer Low fuses an Air Terra Humara TPU heel piece with a classic vulcanized sole for a unique base. On the white leather upper, punched-out holes are scattered, similar to the Air Jordan 5 Off-White. An accented over-lacing system, exposed foam tongue, zip tie tag, and Swoosh tab all add Off-White''s signature detailing to this modified classic.<br><br>The Nike Blazer Low Off-White White University Red released in April of 2022 and retailed for $140.', 'men', 'https://images.stockx.com/images/Nike-Blazer-Low-Off-White-University-Red-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1647011617', 'Off-White University Red', 1, '2022-04-08', 140, 'Nike Blazer Low', 'Nike-Blazer-Low-Off-White-University-Red', 'Nike Blazer Low Off-White University Red', 'sneakers+nike+nike basketball+blazer+collections-filter+nike-off-white+virgil abloh+white/university red/off white+2022-04-08+140+dh7863-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('60daaf70-b945-40c2-a13f-f4cd71af16eb', 'Jordan', 'Air Jordan Four', 'White/Metallic Silver-Court Purple', 'New', 'CN', 'Jordan Brand pays homage to one of its first colorway themes with the Jordan 4 Retro Metallic Purple, now available on StockX. In 1985, the Air Jordan 1 was the first in its lineage to receive the "Metallic" treatment. Four metallic colorways originally released - including red, orange, purple, and green. This release draws inspiration from the color blocking of the Jordan 1 Metallic Purple.<br><br>This Jordan 4 features a white leather upper with white netted underlays and Metallic Purple detailing on the upper eyelets. A Metallic Purple Jumpman logo on the heel, white sole, and Metallic Purple Air bubble complete the design. These sneakers released in May of 2020 and retailed for $190 USD.', 'men', 'https://images.stockx.com/images/Air-Jordan-4-Retro-White-Court-Purple-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606315846', 'Metallic Purple', 1, '2020-05-20', 190, 'Jordan 4 Retro', 'Air-Jordan-4-Retro-White-Court-Purple', 'Jordan 4 Retro Metallic Purple', 'sneakers+jordan+air jordan+four+white/metallic silver-court purple+2020-05-20+190+ct8527-115');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('612d03d0-53e4-4ce2-baef-4aa14d7fba82', 'Nike', 'Nike Other Running', 'University Blue/Black-White-Light Crimson', 'New', 'ID', 'Originally produced as a gift for Nike''s friends and family in 2004, the Nike Air Presto Hello Kitty returned in 2022 for its first-ever official release.<br><br>The Nike Air Presto Hello Kitty nods to Sanrio''s Hello Kitty, a fictional character created by Yuko Shimizu in 1974. The upper is constructed of a light blue neoprene upper with Hello Kitty graphics and a semi translucent TPU lace cage. At the heel, a Hello Kitty styled heel wrap adds further detailing. From there, a white and black Air sole with Swoosh detailing completes the design.<br><br>The Nike Air Presto Hello Kitty released in May of 2022 and retailed for $140.', 'men', 'https://images.stockx.com/images/Nike-Air-Presto-Hello-Kitty-2022-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1651844672', 'Hello Kitty (2022)', 1, '2022-05-27', 140, 'Nike Air Presto', 'Nike-Air-Presto-Hello-Kitty-2022', 'Nike Air Presto Hello Kitty (2022)', 'sneakers+nike+nike other+running+sanrio+university blue/black-white-light crimson+2022-05-27+140+dv3770-400');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('6197b23f-1252-48a4-bff7-54a18a71e00a', 'Nike', 'Air Force One', 'Black/Black/White', 'New', 'VN', 'Nodding to one of Stüssy''s earliest Nike Dunk collaborations, the Nike Air Force 1 Mid Stüssy Black White arrives with a smooth black leather upper with faux snakeskin Swooshes and a Stüssy double "S" logo perforated toe box. From there, a logo embroidered ankle strap, metal heel embellishment, and dual-branded woven tongue tag add the finishing touches.<br><br>The Nike Air Force 1 Mid Stüssy Black White released in May of 2022 and retailed for $150.', 'men', 'https://images.stockx.com/images/Nike-Air-Force-1-Mid-Stussy-Black-White-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1653399715', 'Stussy Black White', 1, '2022-05-13', 150, 'Nike Air Force 1 Mid', 'Nike-Air-Force-1-Mid-Stussy-Black-White', 'Nike Air Force 1 Mid Stussy Black White', 'sneakers+nike+air force+one+black/black/white+2022-05-13+150+dj7840-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('61d186e6-d293-4c5c-82d3-c2b52fbd018d', 'Nike', 'Nike SB SB Dunk Low', 'Deep Royal Blue/White-Sport Red-Gum Light Brown', 'New', 'VN', 'The Nike SB Dunk Low Los Angeles Dodgers features a white leather upper with blue overlays and red Swoosh logos. The "Nike" brand name is prevanlent on the heel tab in red.<br><br>The Nike SB Dunk Low Los Angeles Dodgers is a low-top sneaker with lace-up closure style. The shoe features a blue and white color scheme that has shades similar to the traditional blue and white worn by the MLB''s LA Dodgers. It has a light-brown sole with a pink graphic on the ankle’s right side.<br><br>The Nike SB Dunk Low Los Angeles Dodgers was released in June of 2022 at the retail price of $110.', 'men', 'https://images.stockx.com/images/Nike-SB-Dunk-Low-Los-Angeles-Dodgers-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1657285119', 'Los Angeles Dodgers', 1, '2022-06-01', 110, 'Nike SB Dunk Low', 'Nike-SB-Dunk-Low-Los-Angeles-Dodgers', 'Nike SB Dunk Low Los Angeles Dodgers', 'sneakers+nike+nike sb+sb dunk low+deep royal blue/white-sport red-gum light brown+2022-06-01+110+do9395-400');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('61f42024-5548-4906-9ca5-1cb353a52eff', 'Balenciaga', 'Luxury Brands Balenciaga', 'Black/Black', 'New', 'IT', null, 'men', 'https://images.stockx.com/images/Balenciaga-Track-Black.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1607657550', 'Black', 1, '2018-09-03', 975, 'Balenciaga Track', 'Balenciaga-Track-Black', 'Balenciaga Track Black', 'sneakers+balenciaga+luxury brands+balenciaga+track+black/black+2018-09-03+975+542023 w1gb1 1000');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('620cac3b-4f0c-4285-a4b1-e7902d7043d5', 'Nike', 'Nike Basketball Dunk', 'Coconut Milk/White-Sail', 'New', 'VN', 'The Nike Dunk Low Coconut Milk features an off-white tumbled leather upper with pale yellow overlays and white Swooshes. Woven tongue labels and heel embroideries nod to the original 1985 design. From there, a matching Air sole at the base completes the design.<br><br>The Nike Dunk Low Coconut Milk released in March of 2022 and retailed for $100.<br><br>DISCLAIMER: Yellow may appear different in various lighting situations.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Coconut-Milk-V3-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1661735440', 'Coconut Milk', 1, '2022-03-01', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Coconut-Milk', 'Nike Dunk Low Coconut Milk', 'sneakers+nike+nike basketball+dunk+low+coconut milk/white-sail+2022-03-01+100+dj6188-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('622de249-ad70-49ed-9a98-7185f00139c7', 'adidas', 'adidas Samba', 'Core Black/Cloud White/Gum', 'New', 'CN', 'The adidas Samba Black-White Gum shoe, style B75807, is a product made from kangaroo leather with an innovative lightweight upper and gum rubber sole for grip. It features adidas stripes on its sides.<br><br>Of course, as their name suggests, the shoes are black and cloud-white and come with white or black shoelaces made of polyester and plastic. adidas Samba Black-White Gum’s tongue is branded with the adidas logo. Samba branding is just beneath the collar, close to the stripes on the sides of the sneakers.<br><br>adidas Samba Black-White Gum shoe, style B75807, was released on January 6, 2018 at a retail price of $80.', 'men', 'https://images.stockx.com/images/adidas-Samba-Black-White-Gum-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1615579186', 'Black White Gum', 1, '2018-06-01', 80, 'adidas Samba', 'adidas-Samba-Black-White-Gum', 'adidas Samba Black White Gum', 'sneakers+adidas+adidas+samba+core black/cloud white/gum+2018-06-01+80+b75807');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('628f50a3-fd63-4f10-b995-3730502e4b3e', 'Jordan', 'Air Jordan Eleven', 'White/Pure Violet-White', 'New', 'CN', 'Arriving in a white and pale lilac two-tone color scheme, the women''s Air Jordan 11 Low Pure Violet (W) captures the essence of a flower in spring bloom. Its glossy patent leather mudguards pay tribute to the original Jordan 11 construction while adding a new pastel hue. In traditional fashion, matching semi translucent outsoles add the finishing touch.<br><br>The Air Jordan 11 Low Pure Violet (W) released in April of 2022 and retailed for $190.', 'women', 'https://images.stockx.com/images/Air-Jordan-11-Retro-Low-Pure-Violet-W-V2-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1652467582', 'Pure Violet (W)', 1, '2022-04-28', 190, 'Jordan 11 Retro Low', 'Air-Jordan-11-Retro-Low-Pure-Violet-W', 'Jordan 11 Retro Low Pure Violet (W)', 'sneakers+jordan+air jordan+eleven+white/pure violet-white+2022-04-28+190+ah7860-101');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('62b4fa59-abed-4003-8868-274690053a2d', 'Nike', 'Air Max 1', 'Treeline/Light Bordeax', 'New', 'VN', 'Constructed with brown mesh, taupe Durabuck, and hairy green suede, the Nike Air Max 1 Treeline brings an earthy feel to this classic model. Hits of Light Bordeaux on the Swoosh and woven tongue label add a subtle contrast, while a cream Air Max sole provides a neutral base. <br><br>The Nike Air Max 1 Treeline released in May of 2022 and retailed for $150.', 'men', 'https://images.stockx.com/images/Nike-Air-Max-1-SH-Skunk-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1648503819', 'Treeline', 1, '2022-05-07', 150, 'Nike Air Max 1 SH', 'Nike-Air-Max-1-SH-Skunk', 'Nike Air Max 1 SH Treeline', 'sneakers+nike+air max+1+treeline/light bordeax+2022-05-07+150+dr9773-300');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('62ba571f-c942-40ac-94cc-b35d9403f4a0', 'Nike', 'Air Force One', 'University Red/University Red', 'New', 'CN', 'If you are a lover of red athletic shoes then the Nike Air Force 1 Low Triple Red is just for you. Every single part of the shoe is red, from the sole to the uppers, the tongue, the laces, and even the signature Nike swoosh. Embossed on the sole of the shoe you will find the word "Air," which you will also find on the back of the shoe underneath the Nike name and logo.<br><br>Released in February 2020, the Nike Air Force 1 Low Triple Red retailed for $110.', 'men', 'https://images.stockx.com/images/Nike-Air-Force-1-Low-Triple-Red-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1607668936', 'Triple Red', 1, '2020-02-01', 110, 'Nike Air Force 1 Low', 'Nike-Air-Force-1-Low-Triple-Red', 'Nike Air Force 1 Low Triple Red', 'sneakers+nike+air force+one+low+university red/university red+2020-02-01+110+cw6999-600');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('62fbae69-e7c9-4bad-940f-e420c7be4bdd', 'Jordan', 'Air Jordan Four', 'University Blue/Tech Grey/White/Black', 'New', 'CN', 'Released in 2021, the Air Jordan 4 Retro University Blue GS brings a silhouette with a suede upper and a popular shade of blue inspired by the University of North Carolina. It has a bright blue pallet often with a Jumpman icon on the back, tongue, and sole. The upper made from University Blue Suede and black plastic lace holders on its throat.<br><br>The back of the grade school-sized Air Jordan 4 Retro University features classic cement detailing alongside a small visible air unit at the heels. It was retailed at $150.', 'child', 'https://images.stockx.com/images/Air-Jordan-4-Retro-University-Blue-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1620059090', 'University Blue (GS)', 1, '2021-04-28', 150, 'Jordan 4 Retro', 'Air-Jordan-4-Retro-University-Blue-GS', 'Jordan 4 Retro University Blue (GS)', 'sneakers+jordan+air jordan+four+university blue/tech grey/white/black+2021-04-28+150+408452-400');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('63270715-ad06-4480-a6a2-890bc421c04c', 'Nike', 'Nike Dunk', 'White/Black-White', 'New', 'CN', 'A toddler’s shoe (TD), the Nike Dunk Low Retro White Black TD comes in a classic colorway. Crafted from soft leather, the Nike Dunk Low Retro White Black (TD) upper is made from a white base overlaid by contrasting black throughout. The black extends to the iconic Swoosh branding and the lightly padded nylon tongue. The tooling continues the two-toned design to include a white midsole and a black rubber outsole that draws directly from the Air Jordan 1.<br><br>The Nike Dunk Low Retro White Black (TD) was released in March 2021 at a retail price of $50.', 'toddler', 'https://images.stockx.com/images/Nike-Dunk-Low-Retro-White-Black-TD-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1630350060', 'White Black Panda (2021) (TD)', 1, '2021-03-10', 50, 'Nike Dunk Low Retro', 'Nike-Dunk-Low-Retro-White-Black-TD', 'Nike Dunk Low Retro White Black Panda (2021) (TD)', 'sneakers+nike+nike+dunk+low+white/black-white+2021-03-10+50+cw1589-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('63ca5823-53e2-4552-a43c-b1fb730f4ae7', 'Nike', 'Dunk Low', 'Team Dark Green/Team Orange-White', 'New', 'ID', null, 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Retro-Miami-Hurricanes-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1668583499', 'Miami Hurricanes', 1, '2022-10-01', 110, 'Nike Dunk Low Retro', 'Nike-Dunk-Low-Retro-Miami-Hurricanes', 'Nike Dunk Low Retro Miami Hurricanes', 'sneakers+nike+dunk+low+team dark green/team orange-white+2022-10-01+110+dd1391-300');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('642ff43c-66db-4ba5-b53c-68fb0b6ee1b7', 'Nike', 'Air Force One', 'Mushroom/Mushroom/Mushroom', 'New', 'VN', 'Coming fresh off of Earth Day, Billie Eilish added an eco-friendly twist to one of Nike''s most storied models with the Nike Air Force 1 Billie Eilish Mushroom.<br><br>With a recycled Durabuck upper and Nike Grind midsole, the Nike Air Force 1 Billie Eilish Mushroom takes a more sustainable approach to achieve a high-end look. Its monotone Mushroom palette emphasizes its unique, chunky mid-foot straps that borrow from both the Alpha Force Low and Air Trainer 3 designs. From there, a classic Nike Air heel embroidery completes this collaboration.<br><br>The Nike Air Force 1 Billie Eilish Mushroom released in April of 2022 and retailed for $170.', 'men', 'https://images.stockx.com/images/Nike-Air-Force-1-High-07-SP-Billie-Eilish-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1651696133', 'Billie Eilish Mushroom', 1, '2022-04-25', 170, 'Nike Air Force 1 High ''07 SP', 'Nike-Air-Force-1-High-07-SP-Billie-Eilish', 'Nike Air Force 1 High ''07 SP Billie Eilish Mushroom', 'sneakers+nike+air force+one+high+mushroom/mushroom/mushroom+2022-04-25+170+dm7926-200');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('651be6b7-9f64-41db-8c98-42e1b684107e', 'Jordan', 'Air Jordan Four', 'White/Black-Neutral Grey', 'New', 'ID', 'The Air Jordan 4 Retro Military Black PS is a continuation of the coveted Air Jordan 4. Although this shoe is not an OG colorway, it borrows its composition of colors from the 1989 Air Jordan 4 Military Blue, simply swapping the iconic blue with black.<br><br>Like all other Air Jordan 4 retros, this modernized mid-top features mesh netting on the side panels and the tongue, a one-of-a-kind lacing support system that offers several eyelets for custom lace placement, supportive wings, and a rubber outsole.<br><br>The Air Jordan 4 Retro Military Black PS was released on 21st May 2022. Originally, it had a retail price of $90.', 'preschool', 'https://images.stockx.com/images/Air-Jordan-4-Retro-Military-Black-PS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1654264283', 'Military Black (PS)', 1, '2022-05-21', 90, 'Jordan 4 Retro', 'Air-Jordan-4-Retro-Military-Black-PS', 'Jordan 4 Retro Military Black (PS)', 'sneakers+jordan+air jordan+four+white/black-neutral grey+2022-05-21+90+bq7669-111');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('656bd940-6236-4196-8daf-cb5f6936be22', 'Jordan', 'Air Jordan One', 'Taxi/White/Black', 'New', 'CN', null, 'men', 'https://images.stockx.com/images/Air-Air-Jordan-1-Low-University-Gold-White.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1655714093', 'Taxi', 1, '2022-09-01', 90, 'Jordan 1 Low', 'Air-Air-Jordan-1-Low-University-Gold-White', 'Jordan 1 Low Taxi', 'sneakers+jordan+air jordan+one+taxi/white/black+2022-09-01+90+553558-701');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('6672f081-b5c6-4901-9611-789e6d7a25c1', 'Jordan', 'Air Jordan One', 'Black/White/Amethyst Wave/Bleached Coral', 'New', 'ID', 'The Air Jordan 1 Mid Master (GS) for grade schoolers is convenient for both playing a game of basketball and casually walking around town. The shoes have the standard Nike high top tread.<br><br>This stylish model has a white base, with patches of leather in black and purple hues covering the body. Black laces lay on top of a black tongue, with the Air Jordan logo at the top of the tongue appearing in a shimmery pink shade.<br><br>The first release date of the Air Jordan 1 Mid SE Zen Master (GS) for grade schoolers was June 2022. The starting retail price for this model is $110.', 'child', 'https://images.stockx.com/images/Air-Jordan-1-Mid-SE-Zen-Master-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1652711164', 'Zen Master (GS)', 1, '2022-06-23', 110, 'Jordan 1 Mid SE', 'Air-Jordan-1-Mid-SE-Zen-Master-GS', 'Jordan 1 Mid SE Zen Master (GS)', 'sneakers+jordan+air jordan+one+black/white/amethyst wave/bleached coral+2022-06-23+110+dm6216-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('668450c6-dd1f-4f92-8e7d-0a0306280a1b', 'adidas', 'adidas Yeezy', 'Glow Green/Glow Green/Glow Green', 'New', 'CN', 'Constructed of bright Glow Green EVA foam, the adidas Yeezy Slide Glow Green provides lightweight durability with a luminous look. From there, strategic groove placement on the underfoot enhances traction and comfort.<br><br>The adidas Yeezy Slide Glow Green released in September of 2021 and retailed for $60.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Slide-Glow-Green-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1633023465', 'Glow Green', 1, '2021-09-06', 60, 'adidas Yeezy Slide', 'adidas-Yeezy-Slide-Glow-Green', 'adidas Yeezy Slide Glow Green', 'sneakers+adidas+adidas+yeezy+slides+glow green/glow green/glow green+2021-09-06+60+gx6138');
