INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('66b66032-0b89-4687-b4c4-97fd863294f0', 'Converse', 'Converse Chuck Taylor', 'Steel Gray/Egret/Black', 'New', 'CN', 'A collaboration between Converse and Comme Des Garcons, the PLAY line, birthed the Converse Chuck Taylor All-Star 70s Hi Comme des Garcons PLAY Grey, a variation of the All-Star Chuck 70 High sneaker model. It is constructed with an upper gray canvas accentuated by an oversized heart and eyes logo in basic black and white on the lateral side.<br><br>This high-top shoe sits on an egret-colored rubber midsole, brown finish outsole, and toe box that enhance durability. It retains the signature canvas lace-up closure.<br><br>The Converse Chuck Taylor All-Star 70s Hi Comme des Garcons PLAY Grey was released on June 3, 2021, and retailed for $150.', 'unisex', 'https://images.stockx.com/images/Converse-Chuck-Taylor-All-Star-70s-Hi-Comme-des-Garcons-PLAY-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1637075731', 'Comme des Garcons PLAY Grey', 1, '2021-06-03', 150, 'Converse Chuck Taylor All-Star 70s Hi', 'Converse-Chuck-Taylor-All-Star-70s-Hi-Comme-des-Garcons-PLAY-Grey', 'Converse Chuck Taylor All-Star 70s Hi Comme des Garcons PLAY Grey', 'sneakers+converse+converse+chuck taylor+steel gray/egret/black+2021-06-03+150+171847c');
