INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('67d47150-cac1-496b-ab5b-1caf5b3908b8', 'Jordan', 'Air Jordan One', 'White/Pine Green-Light Smoke Grey', 'New', 'VN', 'The Air Air Jordan 1 Mid SE White Pine Green Smoke Grey (GS) for grade schoolers for grade schoolers is molded after the 1985 original silhouette.<br><br>The Air Air Jordan 1 Mid SE White Pine Green Smoke Grey (GS) for grade schoolers upper features a white leather base fortified with grey suede overlays and accented with a grassy green Swoosh. The green continues to the ankle collar, the retro Win(GS) for grade schoolers logo stamped on the lateral ankle, and the sneaker''s woven Jumpman tongue tag. The sneaker is built on a rubber cupsole with Air-sole heel cushioning and a green rubber outsole.<br><br>The Air Air Jordan 1 Mid SE White Pine Green Smoke Grey (GS) for grade schoolers was released in March 2022 and retailed for $100.', 'child', 'https://images.stockx.com/images/Air-Air-Jordan-1-Mid-SE-White-Pine-Green-Smoke-Grey-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1645715915', 'White Pine Green Smoke Grey (GS)', 1, '2022-04-13', 100, 'Jordan 1 Mid SE', 'Air-Air-Jordan-1-Mid-SE-White-Pine-Green-Smoke-Grey-GS', 'Jordan 1 Mid SE White Pine Green Smoke Grey (GS)', 'sneakers+jordan+air jordan+one+white/pine green-light smoke grey+2022-04-13+100+dc7248-103');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('68191cea-e5d5-407a-baeb-7693d2b0057b', 'Jordan', 'Air Jordan Thirteen', 'White/French Blue/Light Steel Grey/Fire Red', 'New', 'VN', 'The Air Jordan 13 French Blue features a white perforated leather upper with French Blue Durabuck mudguards and a grey leather toe wrap. Nodding to Michael Jordan''s "Black Cat" nickname, a signature Jordan holographic emblem at the collar is reminiscent of panther eyes, while a sculptural sole takes the form of cat paws.<br><br>The Air Jordan 13 French Blue released in August of 2022 and retailed for $200.', 'men', 'https://images.stockx.com/images/Air-Jordan-13-Retro-French-Blue-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1661350084', 'French Blue', 1, '2022-08-19', 200, 'Jordan 13 Retro', 'Air-Jordan-13-Retro-French-Blue', 'Jordan 13 Retro French Blue', 'sneakers+jordan+air jordan+thirteen+white/french blue/light steel grey/fire red+2022-08-19+200+414571-164');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('681ee0e6-829e-41f0-9bca-a381ef90ff8d', 'Nike', 'Nike Dunk', 'Vast Grey/Summit White/Pearl White', 'New', 'CN', 'The Nike Dunk Low Premium Vast Grey features a tonal grey suede upper, with warmer tones making up the base while cooler tones make up the overlays. From there, a contrasting cream and grey sole completes the design.<br><br>The Nike Dunk Low Premium Vast Grey released in August of 2022 and retailed for $110.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Premium-Vast-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1642765088', 'Vast Grey', 1, '2022-08-23', 110, 'Nike Dunk Low Premium', 'Nike-Dunk-Low-Premium-Vast-Grey', 'Nike Dunk Low Premium Vast Grey', 'sneakers+nike+nike+dunk+low+vast grey/summit white/pearl white+2022-08-23+110+dd8338-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('68231983-357a-4430-808a-8b795e8af9f4', 'Nike', 'Dunk Low', 'Pure Platinum/White-Wolf Grey', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Wolf-Grey-Pure-Platinum.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1660248390', 'Wolf Grey Pure Platinum', 1, '2022-10-15', 160, 'Nike Dunk Low', 'Nike-Dunk-Low-Wolf-Grey-Pure-Platinum', 'Nike Dunk Low Wolf Grey Pure Platinum', 'sneakers+nike+dunk+low+pure platinum/white-wolf grey+2022-10-15+160+dx3722-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('683cbf5b-33e8-4aba-ae14-6c55eb9c6389', 'Nike', 'Nike Dunk', 'Sail/Black/Chile Red/Black', 'New', 'ID', 'In celebration of the 75th Anniversary of the NBA, Nike teamed up with the NBA to release a Chicago Bulls-themed Nike Dunk Low.<br><br>The Nike Dunk Low EMB 75th Anniversary Chicago features a Sail leather upper with a red toe wrap and black overlays. From there, a commemorative NBA logo woven tongue tags and matching sole completes the design.<br><br>The Nike Dunk Low EMB 75th Anniversary Chicago released in October of 2021 and retailed for $110.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-EMB-NBA-75th-Anniversary-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1635520438', 'NBA 75th Anniversary Chicago', 1, '2021-10-23', 110, 'Nike Dunk Low EMB', 'Nike-Dunk-Low-EMB-NBA-75th-Anniversary', 'Nike Dunk Low EMB NBA 75th Anniversary Chicago', 'sneakers+nike+nike+dunk+low+sail/black/chile red/black+2021-10-23+110+dd3363-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('68969a31-6929-4048-a8d7-672c99049633', 'Nike', 'Air Max 97', 'Metallic Silver/University Red-Black-White', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Nike-Air-Max-97-OG-Silver-Bullet-2022-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1667976636', 'OG Silver Bullet (2022)', 1, '2022-11-11', 185, 'Nike Air Max 97', 'Nike-Air-Max-97-OG-Silver-Bullet-2022', 'Nike Air Max 97 OG Silver Bullet (2022)', 'sneakers+nike+air max+97+metallic silver/university red-black-white+2022-11-11+185+dm0028-002');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('68e5b4c1-76c6-477b-9eeb-c459ab4fbad3', 'Nike', 'Nike Basketball Kyrie', 'Bright Crimson/Red Plum/University Blue/Black', 'New', 'CN', 'The Nike Kyrie 4 Low Bright Crimson Aquatone takes center stage, tracing the lines between a vibrant palette and the new ''1 World 1 People'' collection.<br><br>The Nike Kyrie 4 Low Bright Crimson Aquatone sits on a bright orange base, with blue tints on the forefoot, lining, and outsole, while a deeper purple matching the tongue and lace, but not the pink that fills out the rest of the upper and midsole, also appears. Nike branding is embroidered in bright yellow on the right foot''s tongue; the Kyrie logo sees a similar color treatment, edged in the same hue, but filled with a brighter aqua.<br><br>The Nike Kyrie 4 Low Bright Crimson Aquatone was released in September 2021 and retailed for $110.', 'men', 'https://images.stockx.com/images/Nike-Kyrie-4-Low-Bright-Crimson-Aquatone-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1635435238', 'Bright Crimson Aquatone', 1, '2021-09-03', 110, 'Nike Kyrie 4 Low', 'Nike-Kyrie-4-Low-Bright-Crimson-Aquatone', 'Nike Kyrie 4 Low Bright Crimson Aquatone', 'sneakers+nike+nike basketball+kyrie+bright crimson/red plum/university blue/black+2021-09-03+110+cw3985-600/cz0105-600');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('69042295-26a9-4d7a-97c0-0f69ab34b5af', 'Nike', 'Air Max 90', 'Obsidian/Marina-Thunder Blue', 'New', 'VN', 'The Nike Air Max 90 Terrascape Obsidian takes on a blocky type of design, featuring a dark obsidian backdrop with a terracotta-colored sole unit.<br><br>The Nike Air Max 90 Terrascape Obsidian upper sections are made from breathable mesh, with leather overlays. Slip-on construction provides a secure fit to ensure comfort in these sneakers. This sneaker features a black, thunder blue, and marina upper with brown accents. The suede and mesh upper sits atop a thick midsole, completed by a leather heel cage, leather and mesh toebox, and thunder blue Swoosh.<br><br>The Nike Air Max 90 Terrascape Obsidian was released in April 2022 and retailed for $150.', 'men', 'https://images.stockx.com/images/Nike-Air-Max-90-Terrascape-Obsidian-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1651696240', 'Obsidian', 1, '2022-02-04', 150, 'Nike Air Max 90 Terrascape', 'Nike-Air-Max-90-Terrascape-Obsidian', 'Nike Air Max 90 Terrascape Obsidian', 'sneakers+nike+air max+90+obsidian/marina-thunder blue+2022-02-04+150+dh4677-400');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('690de7ab-036d-4b9c-8185-5279046d5d7f', 'Jordan', 'Air Jordan One', 'White Onyx/White/Cardinal Red/Light Curry', 'New', 'CN', 'Pairing pure white with beige leather overlays, the Air Jordan 1 Mid Beige Red (GS) for grade schoolers is anchored in a calm, relaxing mood.<br><br>The Air Jordan 1 Mid Beige Red (GS) for grade schoolers starts with a white leather base on the upper with beige leather overlays for a contrast. Adding bright red on the laces, tongue ta(GS) for grade schoolers, inner liner, Swooshes, and the Win(GS) for grade schoolers logos on the ankles provides some pop. Yellow Jumpman logos on the tongues, white rubber midsoles, and black rubber outsoles round out the look.<br><br>The Air Jordan 1 Mid Beige Red (GS) for grade schoolers was released in April 2022 and retailed for $100.', 'child', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Beige-Red-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1646409448', 'Light Curry Cardinal (GS)', 1, '2022-04-25', 100, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Beige-Red-GS', 'Jordan 1 Mid Light Curry Cardinal (GS)', 'sneakers+jordan+air jordan+one+white onyx/white/cardinal red/light curry+2022-04-25+100+554725-201');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('698f6167-8c90-4ca4-a190-baa6aa694740', 'Jordan', 'Air Jordan Twelve', 'Black/Varsity Red-White', 'New', 'CN', 'In celebration of its 25th Anniversary, Jordan Brand brought back the shoe that Michael Jordan wore while winning his 5th NBA Title, the Air Jordan 12 Retro Playoffs.<br><br>Debuted in 1997, the Air Jordan 12 Playoff captures Michael Jordan and the Chicago Bulls'' dominance in the 1990s era of NBA basketball. This 2022 model sticks to the original design, featuring a black tumbled leather upper with a white textural mudguard and red Jumpman embroidery on the tongue. At the heel, a woven Jordan label and "23" text add subtle branding. At the base, a white sole with carbon fiber detailing completes the design.<br><br>The Air Jordan 12 Playoffs released in March of 2022 and retailed for $210.', 'men', 'https://images.stockx.com/images/Air-Jordan-12-Retro-Playoffs-2022-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1646231976', 'Playoffs (2022)', 1, '2022-03-11', 210, 'Jordan 12 Retro', 'Air-Jordan-12-Retro-Playoffs-2022', 'Jordan 12 Retro Playoffs (2022)', 'sneakers+jordan+air jordan+twelve+black/varsity red-white+2022-03-11+210+ct8013-006');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('6a445c9a-4510-41be-be15-020e8e5ac60d', 'Jordan', 'Air Jordan One', 'Varsity Red/Black-White', 'New', 'CN', 'Similar to the Jordan 1 High Chicago Gold Cleat that was released in 2017, the Jordan 1 Low Golf Chicago gears the iconic colorway for the golf course. It features a smooth white leather upper with red overlays and black Swooshes. A black debossed Wings logo at the heel pays tribute to the first Air Jordan logo ever created. At the base, a red grooved outsole adds traction and support for long days on the green.<br><br>The Jordan 1 Low Golf Chicago releases in 2022 and retails for $140.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-Low-Golf-Chicago-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1642763788', 'Chicago', 1, '2022-03-24', 140, 'Jordan 1 Retro Low Golf', 'Air-Jordan-1-Retro-Low-Golf-Chicago', 'Jordan 1 Retro Low Golf Chicago', 'sneakers+jordan+air jordan+one+varsity red/black-white+2022-03-24+140+dd9315-600');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('6a70f753-1871-4dfb-b211-47405b7ef853', 'Nike', 'Nike Basketball Dunk', 'Team Red/Team Red-White', 'New', 'VN', 'Constructed of  white and Team Red smooth leather, the Nike Dunk Low Team Red is an ode to the original look of the 1985 Nike Dunk Low. Nike embroideries on the heel tab and a woven tongue label arrive in a classic fashion. From there, a white and Team Red sole completes the design.<br><br>The Nike Dunk Low Team Red released in May of 2022 and retailed for $100.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Team-Red-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1648821059', 'Team Red (2022)', 1, '2022-05-12', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Team-Red', 'Nike Dunk Low Team Red (2022)', 'sneakers+nike+nike basketball+dunk+low+team red/team red-white+2022-05-12+100+dd1391-601');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('6acd51de-b75d-48ae-b2dc-2ea1c48e9a82', 'Jordan', 'Air Jordan One', 'Black/Chile Red/Particle Grey/Sail', 'New', 'CN', 'The Air Jordan 1 Element GORE-TEX Particle Grey features a moisture-wicking GORE-TEX upper with premium black and grey leather overlays. From there, 3M Swooshes, Jordan Wings logos, and GORE-TEX branding are reminiscent of reflective detailing on weather-proof jackets.<br><br>The Air Jordan 1 Element GORE-TEX Particle Grey released in December of 2021 and retailed for $200.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-Element-Gore-Tex-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1639371153', 'Gore-Tex Black Particle Grey', 1, '2021-12-04', 200, 'Jordan 1 Retro High Element', 'Air-Jordan-1-Retro-High-Element-Gore-Tex', 'Jordan 1 Retro High Element Gore-Tex Black Particle Grey', 'sneakers+jordan+air jordan+one+black/chile red/particle grey/sail+2021-12-04+200+db2889-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('6b6113b9-4655-4710-b567-e601be334fb8', 'Jordan', 'Air Jordan One', 'White/Hyper Crimson/Pink Blast', 'New', 'VN', 'The Air Jordan 1 Mid Edge Glow (GS) for grade schoolers introduces some color to Michael Jordan’s signature shoe that has been re-engineered in youth sizing.<br><br>The Air Jordan 1 Mid Edge Glow (GS) for grade schoolers is constructed on a white leather base covering the perforated toe and mid-panel. Highlighter pink, neon green, and orange piping introduce contrast, breaking up the neutral appearance between each panel. A Hyper Crimson leather Swoosh with pink trim appears on either side, while the Win(GS) for grade schoolers detailing is done in white on the collar. Underfoot, a white midsole and pink outsole finish off the look.<br><br>The Air Jordan 1 Mid Edge Glow (GS) for grade schoolers was released in July 2020 and retailed for $100.', 'child', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Edge-Glow-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1630617023', 'Edge Glow (GS)', 1, '2020-07-04', 100, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Edge-Glow-GS', 'Jordan 1 Mid Edge Glow (GS)', 'sneakers+jordan+air jordan+one+white/hyper crimson/pink blast+2020-07-04+100+cv4611-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('6c534d8e-3e6a-4c68-9014-bd4d9cc030d3', 'Nike', 'Nike Dunk', 'Blue Jay/University Gold-White', 'New', 'VN', 'The Nike Dunk Low UCLA closely resembles the school colors used by the University of California Los Angeles.<br><br>The upper of the Nike Dunk Low UCLA is made of University Gold-colored leather. The sneaker’s upper part also features ''Blue Jay'' leather overlays. The tongue of this shoe is golden colored and features blue detailing. The white midsole of this sneaker create an airy break from the combination of a gold-blue color that widely constitutes this shoe. <br><br>A matching blue outsole rounds off this sneaker. Nike Dunk Low UCLA will debut on August 9th, 2022 at a retail price of $100.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-UCLA-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1659591846', 'UCLA', 1, '2022-10-25', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-UCLA', 'Nike Dunk Low UCLA', 'sneakers+nike+nike+dunk+low+blue jay/university gold-white+2022-10-25+100+dd1391-402');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('6c65bf42-b92a-4747-86ef-21cb7fba65e3', 'adidas', 'adidas Yeezy', 'Onyx/Onyx/Onyx', 'New', 'CN', 'The adidas Yeezy Slide Onyx (Kids) applies an onyx finish to the sandal, featuring a rubberized foam build with a textured surface.<br><br>The minimalist design of the adidas Yeezy Slide Onyx (Kids) is free of any exterior branding, save for adidas’ three-stripe logo stamped on the soft top layer of the footbed. Open-toe construction delivers ventilated comfort, while the pair’s footbed includes a soft top layer for comfort. Underfoot, the pair features deep horizontal sawtooth-like grooves that provide traction.<br><br>The adidas Yeezy Slide Onyx (Kids) was released in March 2021 and retailed for $50.', 'child', 'https://images.stockx.com/images/adidas-Yeezy-Slide-Onyx-Kids-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1647613918', 'Onyx (Kids)', 1, '2021-03-07', 50, 'adidas Yeezy Slide', 'adidas-Yeezy-Slide-Onyx-Kids', 'adidas Yeezy Slide Onyx (Kids)', 'sneakers+adidas+adidas+yeezy+slides+kids+onyx/onyx/onyx+2021-03-07+50+hq4115');
