INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('6e3fd470-961c-4dec-8c6c-c31bf92b3d9c', 'adidas', 'adidas Yeezy', 'Core Black/Dazzling Blue/Core Black', 'New', 'CN', 'The adidas Yeezy 350 V2 Dazzling Blue is reminiscent of the 2016 Yeezy 350 V2 Black Friday Pack. Instead of featuring a marbled pattern and sheer side stripe, it opts for a solid black Primeknit upper and blue side stripe with "SPLY-350" text. At the base, a muted Boost sole offers comfort and support.<br><br>The adidas Yeezy 350 V2 Dazzling Blue released in February of 2022 and retailed for $220.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Boost-350-V2-Dazzling-Blue-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1647268107', 'Dazzling Blue', 1, '2022-02-26', 220, 'adidas Yeezy Boost 350 V2', 'adidas-Yeezy-Boost-350-V2-Dazzling-Blue', 'adidas Yeezy Boost 350 V2 Dazzling Blue', 'sneakers+adidas+adidas+yeezy+350+v2+core black/dazzling blue/core black+2022-02-26+220+gy7164');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('6e4f6bbb-fb82-4119-beb0-bc9d4b1bd415', 'Jordan', 'Air Jordan Twelve', 'Stealth/White/Cool Grey', 'New', 'VN', null, 'child', 'https://images.stockx.com/images/Air-Jordan-12-Retro-Stealth-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1661941930', 'Stealth (GS)', 1, '2022-08-27', 150, 'Jordan 12 Retro', 'Air-Jordan-12-Retro-Stealth-GS', 'Jordan 12 Retro Stealth (GS)', 'sneakers+jordan+air jordan+twelve+stealth/white/cool grey+2022-08-27+150+153265-015');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('6e749dd5-8901-4dde-94ac-1058016c9c02', 'Nike', 'Nike Basketball Dunk', 'Black/Teal-White', 'New', 'VN', 'At the top of its black tongue, the Nike Dunk Low Barbershop Black has the brand’s red logo. An abstract print appears on the side of the shoe, just above the Swoosh.<br><br>This model has an ice blue sole with a white midsole. Next to the midsole, you will see the black base, composed of pebbled leather. The lining of the shoe and the Nike swoosh logo are both made out of the same ice blue.<br><br>The Nike Dunk Low Barbershop Black was first put on the market in June of 2022. It had a retail price that started at $110 for men’s sizes.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Barbershop-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1654800013', 'Barber Shop Black', 1, '2022-03-01', 110, 'Nike Dunk Low SE', 'Nike-Dunk-Low-Barbershop-Black', 'Nike Dunk Low SE Barber Shop Black', 'sneakers+nike+nike basketball+dunk+low+black/teal-white+2022-03-01+110+dh7614-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('6f016cea-26de-4c4d-aadb-f203cdba6aeb', 'Jordan', 'Air Jordan One', 'Sail/Light Bone/College Grey/Black', 'New', 'CN', 'The Air Jordan 1 Element GORE-TEX Light Bone features a moisture-wicking GORE-TEX upper with tonal grey Durabuck and leather overlays. From there, 3M Swooshes, Jordan Wings logos, and GORE-TEX branding are reminiscent of reflective detailing on element-proof jackets.<br><br>The Air Jordan 1 Element GORE-TEX Light Bone released in December of 2021 and retailed for $200.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-High-Element-Gore-Tex-Light-Bone-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1638980987', 'Gore-Tex Light Bone', 1, '2021-12-16', 200, 'Jordan 1 High Element', 'Air-Jordan-1-High-Element-Gore-Tex-Light-Bone', 'Jordan 1 High Element Gore-Tex Light Bone', 'sneakers+jordan+air jordan+one+sail/light bone/college grey/black+2021-12-16+200+db2889-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('6f170790-5143-4e30-b9e6-def1229542ee', 'Nike', 'Dunk Low', 'Blue Chill/Yellow/Strike-White', 'New', 'CN', 'Nike Dunk Low Next Nature aims to save the environment, utilizing at least 20% of its making on recycled materials. It’s an expansion to kids having a mix of white, yellow, and light blue colorways.<br><br>The Nike Dunk Low Next Nature has an upper made predominately with white leather. Around the ankle is a white synthetic mesh fabric. Light blue overlays over the white upper completed with a yellow Swoosh on the side. This yellow branding also appears on the white tongue, insole, and heel tabs. The shoe also features white laces and a rubber midsole. A light grey treaded outsole completes the design.<br><br>This Nike Dunk Low Next Nature debuted on 10th August 2022 at a retail price of $90.', 'child', 'https://images.stockx.com/images/Nike-Dunk-Low-Next-Nature-Home-Simpson-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1657198087', 'Next Nature Homer Simpson (GS)', 1, '2022-08-10', 90, 'Nike Dunk Low', 'Nike-Dunk-Low-Next-Nature-Home-Simpson-GS', 'Nike Dunk Low Next Nature Homer Simpson (GS)', 'sneakers+nike+dunk+low+blue chill/yellow/strike-white+2022-08-10+90+dx3382-400');
