INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('6fe4f537-54c4-4856-8c18-68bf088d754d', 'Jordan', 'Air Jordan Eleven', 'Black/Red-Sail-White', 'New', 'CN', 'The women''s exclusive Air Jordan 11 Animal Instinct (W) features a muted black Durabuck upper with animal print faux fur overlays. Metallic Jumpman logos and semi translucent outsoles add key elements true to the origins of the Jordan 11 design.<br><br>The Air Jordan 11 Animal Instinct (W) released in November of 2021 and retailed for $225.', 'women', 'https://images.stockx.com/images/Air-Jordan-11-Retro-Animal-Instinct-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1647268227', 'Animal Instinct (W)', 1, '2020-11-26', 225, 'Jordan 11 Retro', 'Air-Jordan-11-Retro-Animal-Instinct-W', 'Jordan 11 Retro Animal Instinct (W)', 'sneakers+jordan+air jordan+eleven+black/red-sail-white+2020-11-26+225+ar0715-010');
