INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('70a62984-a355-4ca5-8515-50b97b294af6', 'Nike', 'Air Force One', 'White/Black-Pomegranate-Habanero Red', 'New', 'VN', 'The Nike Air Force 1 Low Carabiner Swoosh Red features the brand’s classic tread, making it convenient for walking throughout everyday life.<br><br>This simple yet stylish Nike Air Force 1 Low Carabiner Swoosh Red was created with utility in mind. This shoe features a white sole and base, with patches of black found on the tongue and heel. The Nike swoosh symbol has a different and modern look, with a black base and a carabiner overlay in the same shape as the logo.<br><br>The Nike Air Force 1 Low Carabiner Swoosh Red had an initial release date of March 2022. The original retail price of this item was $130.', 'men', 'https://images.stockx.com/images/Nike-Air-Force-1-Low-Carabiner-Swoosh-Red-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1647351584', 'Carabiner Swoosh Red', 1, '2022-03-01', 130, 'Nike Air Force 1 Low', 'Nike-Air-Force-1-Low-Carabiner-Swoosh-Red', 'Nike Air Force 1 Low Carabiner Swoosh Red', 'sneakers+nike+air force+one+low+white/black-pomegranate-habanero red+2022-03-01+130+dh7579-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('70c21323-cfa2-441f-9e0f-29b0daa415aa', 'Nike', 'Nike Dunk', 'Rift Blue/Grey Fog/Sail/Cave Purple', 'New', 'VN', 'The Nike Dunk Low Next Nature Toasty Rift Blue arrives with a Grey Fog quilted upper made up of 100% recycled polyester with Rift Blue Durabuck overlays and black Swooshes. A blue fleece lined interior offers a winterized feel. From there, a white and gum Air sole adds the finishing touch.<br><br>The Nike Dunk Low Next Nature Toasty Rift Blue released in February of 2022 and retailed for $110.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Toasty-Grey-Blue-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1646233554', 'Next Nature Rift Blue', 1, '2022-02-01', 110, 'Nike Dunk Low SE', 'Nike-Dunk-Low-Toasty-Grey-Blue', 'Nike Dunk Low SE Next Nature Rift Blue', 'sneakers+nike+nike+dunk+low+rift blue/grey fog/sail/cave purple+2022-02-01+110+dd3358-400');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('70e686e9-8243-4c77-a9c2-97be03470113', 'Nike', 'Air Force One', 'Flax/Gum/Light Brown/Black/Wheat', 'New', 'CN', 'The Nike Air Force 1 Low Flax pays unofficial homage to the classic wheat Timberland work boot with its monochromatic flax suede uppers and overlays. Boot styled two-tone rope laces and top eyelets with metal grommets provide functionality and a rugged appeal. At the base, a matching flax Air sole is geared for daily wear and tear.<br><br>The Nike Air Force 1 Low Flax released in September of 2019 for $100, and restocked in April of 2022 for $130.', 'men', 'https://images.stockx.com/images/Nike-Air-Force-1-Low-Flax-2019-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1607056265', 'Flax (2019/2022)', 1, '2019-09-09', 100, 'Nike Air Force 1 Low', 'Nike-Air-Force-1-Low-Flax-2019', 'Nike Air Force 1 Low Flax (2019/2022)', 'sneakers+nike+air force+one+low+flax/gum/light brown/black/wheat+2019-09-09+100+cj9179-200');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('710dbdaf-5b07-47ef-91f2-f3d568094058', 'Nike', 'Air Max 95', 'Black/White-Pure Platinum-Light Smoke Grey', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Nike-Air-Max-95-Fish-Scales.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1658218479', 'Fish Scales', 1, null, 180, 'Nike Air Max 95', 'Nike-Air-Max-95-Fish-Scales', 'Nike Air Max 95 Fish Scales', 'sneakers+nike+air max+95+black/white-pure platinum-light smoke grey+180+dq3979-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('7136a7f0-9cdf-46dd-a0e9-b83c263d84eb', 'Jordan', 'Air Jordan One', 'White/Gym Red-Black', 'New', 'CN', 'The Air Jordan 1 Mid Gym Red Black White delivers a fresh take on the classic Chicago Bulls team colors, composed entirely of black and white leather overlays. A Gym Red Swoosh appears on each side of the sneaker with a matching embossed Gym Red Wings logo on the ankle. Lastly, a black and Gym Red Jumpman tag is stitched on the tongue.<br><br>The Air Jordan 1 Mid Gym Red Black White released in 2021 for $120', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Metallic-Red-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1618343536', 'Gym Red Black White', 1, '2021-08-01', 120, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Metallic-Red', 'Jordan 1 Mid Gym Red Black White', 'sneakers+jordan+air jordan+one+white/gym red-black+2021-08-01+120+554724-122');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('715e3677-67b8-48d8-a71a-3dbaa1b4b37d', 'Nike', 'Air Force One', 'White/White', 'New', 'CN', 'The women''s Nike Air Force 1 Low White silhouette (W) continues the tradition of the 1982 Air Force 1. The sneaker features an all-white leather upper with a perforated toe box and Swoosh overlays. A Nike heel embroidery and white sole completes the design.The women''s Nike Air Force 1 Low White 2018 (W) released in January 2018 and retailed for $90.', 'women', 'https://images.stockx.com/images/Nike-Air-Force-1-Low-White-2018-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1607656514', 'White (W)', 1, '2018-01-01', 110, 'Nike Air Force 1 Low ''07', 'Nike-Air-Force-1-Low-White-2018-W', 'Nike Air Force 1 Low ''07 White (W)', 'sneakers+nike+air force+one+low+white/white+2018-01-01+110+315115-112/dd8959-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('715fc618-f9a3-4bc2-90c2-bbfb9f24e9dd', 'adidas', 'adidas Yeezy', 'Carbon/Carbon/Carbon', 'New', 'CN', 'Kanye West and adidas keep the ball rolling with the Yeezy 350 V2 Carbon. This release marks the 12th colorway of the favorite 350 V2 model in 2020 and this colorway’s dark-hued upper makes it the perfect piece of footwear for fall.<br><br>The Yeezy 350 V2 Carbon holds all of the familiar elements that make the silhouette so popular; breathable Primeknit solid black mesh with its signature side stripe, ribbed patterned off-white midsole, and classic BOOST cushioning make the 350 V2 Carbon easy to love and easy to wear.<br><br>The Yeezy 350 V2 Carbon released in October of 2020.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Boost-350-V2-Carbon-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1609432836', 'Carbon', 1, '2020-10-02', 220, 'adidas Yeezy Boost 350 V2', 'adidas-Yeezy-Boost-350-V2-Carbon', 'adidas Yeezy Boost 350 V2 Carbon', 'sneakers+adidas+adidas+yeezy+350+v2+v3+carbon/carbon/carbon+2020-10-02+220+fz5000');
