INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('732a2e6b-f916-48a1-a381-abb90dbe771a', 'Jordan', 'Air Jordan One', 'University Gold/Light Bordeaux-White', 'New', 'CN', 'Jordan Brand honored Michael Jordan''s time as a member of one of the most historic African American college fraternities with the Air Jordan 1 High Brotherhood.<br><br>Drawing inspiration from the Omega Psi Phi crest, the Air Jordan 1 High Brotherhood arrives with a vibrant University Gold, purple, and white leather construction. Its color blocking is simple and bold, similar to past Jordan 1 releases like the Shattered Backboards and Bred Toes. In retro fashion, a woven Nike tongue label and Wings logo at the collar complete the design.<br><br>The Air Jordan 1 High Brotherhood released in February of 2022 and retailed for $170.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-OG-Brotherhood-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1645431855', 'Brotherhood', 1, '2022-02-24', 170, 'Jordan 1 Retro High OG', 'Air-Jordan-1-Retro-High-OG-Brotherhood', 'Jordan 1 Retro High OG Brotherhood', 'sneakers+jordan+air jordan+one+university gold/light bordeaux-white+2022-02-24+170+555088-706');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('733b3bf9-e069-4186-988f-119608f36d26', 'Nike', 'Air Max 270', 'Black/Black-Black', 'New', 'CN', 'Crafted from a breathable mesh and canvas upper, the Nike Air Max 270 Triple Black now features 270 degrees of visible Air for extra comfort. Drawing inspiration from the sleek Air Max 180, the Nike Air Max 270 Triple Black features a slip-in bootie construction to deliver a great fit. The sneaker boasts a Max Air unit with 270 degrees of air encapsulated in the heel. The sneaker utilizes lightweight and soft neoprene across the upper to ensure airflow to the foot. <br><br>The Nike Air Max 270 Triple Black was released in March 2018 at a retail price of $160.', 'men', 'https://images.stockx.com/images/Nike-Air-Max-270-Triple-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1607664371', 'Triple Black', 1, '2018-03-16', 160, 'Nike Air Max 270', 'Nike-Air-Max-270-Triple-Black', 'Nike Air Max 270 Triple Black', 'sneakers+nike+air max+270+black/black-black+2018-03-16+160+ah8050-005');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('733e9e42-ce63-4476-a10a-3a4648699ee7', 'Jordan', 'Air Jordan Four', 'Black/Multi-Color-Multi-Color-Crimson', 'New', 'CN', 'The grade school-sized (GS) Air Jordan 4 Retro Red Thunder GS uses a Black/Crimson/White colorway that features a white Jumpman on the black heel, tongue, insole, and outsole. The upper of black nubuck is accented with red mesh on the toe box, quarter, and inner tongue. Other features of the Air Jordan 4 Retro Red Thunder GS include red waffle eyestays and a black plastic heel tab. The red midsole features a visible Air compartment. On the black rubber outsole, the iconic star pattern arches over an area of red rubber chevrons.<br><br>The grade school-sized Air Jordan 4 Retro Red Thunder GS was released on January 15, 2022, at a retail price of $140.', 'child', 'https://images.stockx.com/images/Air-Jordan-4-Retro-Red-Thunder-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1641935707', 'Red Thunder (GS)', 1, '2022-01-15', 140, 'Jordan 4 Retro', 'Air-Jordan-4-Retro-Red-Thunder-GS', 'Jordan 4 Retro Red Thunder (GS)', 'sneakers+jordan+air jordan+four+black/multi-color-multi-color-crimson+2022-01-15+140+408452-016');
