INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('746376c0-1fd5-449f-8eab-6c32d9489cf2', 'Nike', 'Nike SB SB Dunk Low', 'Fire Pink/Gym Red-Mocha-White-Royal Blue-Black', 'New', 'CN', 'Nike and Dutch artist and sneaker collab veteran Parra teamed up for an Olympic inspired Nike SB Dunk Low with the Nike SB Dunk Low Parra Abstract Art.<br><br>The Nike SB Dunk Low Parra Abstract Art highlights Parra''s surreal take on pop art. Off-white leather on the upper creates a blank canvas so that overlays smothered in vibrant, retro Parra patterns rise to prominence. Additional details like the embroidered mini-Swoosh on the toe box and gum outsole offer nostalgic appeal.<br><br>The Nike SB Dunk Low Parra Abstract Art released in July of 2021 and retailed for $110.', 'men', 'https://images.stockx.com/images/Nike-SB-Dunk-Low-Parra-2021-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1627326877', 'Parra Abstract Art (2021)', 1, '2021-07-31', 110, 'Nike SB Dunk Low Pro', 'Nike-SB-Dunk-Low-Parra-2021', 'Nike SB Dunk Low Pro Parra Abstract Art (2021)', 'sneakers+nike+nike sb+sb dunk low+fire pink/gym red-mocha-white-royal blue-black+2021-07-31+110+dh7695-600');
