INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('75757db3-3ebb-4b76-8a01-121de86b7426', 'adidas', 'adidas Yeezy', 'Hi-Res Blue/Hi-Res Blue-Hi-Res Blue', 'New', 'CN', 'The adidas Yeezy Boost 700 Hi Res Blue has a base that appears in a bright blue color. Throughout the shoe, you will find details in purple, orange, black, and different shades of blue. It is made out of a combination of different materials, like leather, suede, and mesh.<br><br>The adidas Yeezy Boost 700 Hi Res Bluehas a chunky sole that is decorated with orange accents. It is made with extra cushioning in order to provide the wearer with extra support and make the shoe durable. <br><br>The adidas Yeezy Boost 700 Hi Res Blue were first put onto the market in August of 2022. This shoe’s release price began at $300.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Boost-700-Hi-Res-Blue-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1660025163', 'Hi-Res Blue', 1, '2022-08-02', 300, 'adidas Yeezy Boost 700', 'adidas-Yeezy-Boost-700-Hi-Res-Blue', 'adidas Yeezy Boost 700 Hi-Res Blue', 'sneakers+adidas+adidas+yeezy+700+v1+hi-res blue/hi-res blue-hi-res blue+2022-08-02+300+hp6674');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('76146c33-2180-4afb-a7fa-b7049d4ad3fc', 'Crocs', 'Crocs Crocs', 'Turquoise Tonic', 'New', 'CN', null, 'men', 'https://images.stockx.com/images/Crocs-Pollex-Clog-by-Salehe-Bembury-Tide-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1664259289', 'by Salehe Bembury Tide', 1, '2022-09-22', 85, 'Crocs Pollex Clog', 'Crocs-Pollex-Clog-by-Salehe-Bembury-Tide', 'Crocs Pollex Clog by Salehe Bembury Tide', 'sneakers+crocs+crocs+crocs+turquoise tonic+2022-09-22+85+207393-4st');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('763d306b-526a-400d-95a7-888e33b353cc', 'Jordan', 'Air Jordan One', 'Grey/White/Cream', 'New', 'ID', 'Air Jordan 1 Low is a retro-release of the Dunk Low line. The GS branding means that the shoe is designed for kids.<br><br>The Vintage Grey Air Jordan 1 Low Gradeschool has a pristine white leather upper and perforated toe box. This is accessorized with gray overlays, laces, Swooshes, heel cap, and rubber outsole. There’s an embroidered gray Jumpman logo on the white tongue and insole. Inside the shoe is a gray, padded mesh fabric. The shoe also features white wings on the heels. A vintage-style rubber midsole completes the design.<br><br>This Air Jordan 1 Low GS was released on September 2, 2022. It retailed at $75.', 'child', 'https://images.stockx.com/images/Air-Air-Jordan-1-Low-Vintage-Grey-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1665080420', 'Vintage Grey (GS)', 1, '2022-09-02', 75, 'Air Jordan 1 Low', 'Air-Air-Jordan-1-Low-Vintage-Grey-GS', 'Air Jordan 1 Low Vintage Grey (GS)', 'sneakers+jordan+air jordan+one+grey/white/cream+2022-09-02+75+553560-053');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('76553281-6ef3-4c98-8c3b-99e829a87141', 'Jordan', 'Air Jordan Five', 'Sail/Washed Yellow-Violet Star', 'New', 'CN', null, 'men', 'https://images.stockx.com/images/Air-Jordan-5-Retro-DJ-Khaled-We-The-Best-Sail-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1669100641', 'DJ Khaled We The Best Sail', 1, '2022-11-28', 225, 'Jordan 5 Retro', 'Air-Jordan-5-Retro-DJ-Khaled-We-The-Best-Sail', 'Jordan 5 Retro DJ Khaled We The Best Sail', 'sneakers+jordan+air jordan+five+sail/washed yellow-violet star+2022-11-28+225+dv4982-175');
