INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('76beb63d-a3b1-4951-a44a-24eee806026e', 'adidas', 'adidas Yeezy', 'Solid Grey/Chalk White/Core Black', 'New', 'CN', 'The Yeezy 700 Boost Wave Runner is the shoe that led Yeezy''s pivot from a sleek, minimal aesthetic to a chunky, 90s inspired one. This was the gateway sneaker between knit runners like the 350 and the grungy skate look of the 550. The Yeezy 700 Wave Runner features a grey mesh and leather upper with black suede overlays and teal mesh underlays. At the base, a thick Boost sole and contrasting hits of orange complete the design.<br><br>The adidas Yeezy Boost 700 Wave Runner originally released in November of 2017, and most recently re-released in March of 2022 for a retail price of $300.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Wave-Runner-700-Solid-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1628533740', 'Wave Runner', 1, '2017-11-01', 300, 'adidas Yeezy Boost 700', 'adidas-Yeezy-Wave-Runner-700-Solid-Grey', 'adidas Yeezy Boost 700 Wave Runner', 'sneakers+adidas+adidas+yeezy+700+v1+solid grey/chalk white/core black+2017-11-01+300+b75571');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('76dda00a-bd8d-4c2d-b8e9-ce06a92f426e', 'Nike', 'Nike Basketball Dunk', 'Grey/White/Teal', 'New', 'VN', 'The Nike Dunk Low LE Barbershop Grey features a light grey suede upper with beige patterned collar overlays and a white textile Swoosh. Red and blue striped detailing along the overlays and heels nod to classic Barbershop poles. At the base, a white and light blue Air sole completes the design.<br><br>The Nike Dunk Low LE Barbershop Grey released in 2022 and retailed for $110.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Barbershop-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1651610541', 'Barber Shop Grey', 1, '2022-05-01', 110, 'Nike Dunk Low SE', 'Nike-Dunk-Low-Barbershop-Grey', 'Nike Dunk Low SE Barber Shop Grey', 'sneakers+nike+nike basketball+dunk+low+grey/white/teal+2022-05-01+110+dh7614-500');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('771e7335-ac9b-4f3d-8f5a-366bed5417ed', 'adidas', 'adidas Yeezy', 'Zyon/Zyon/Zyon', 'New', 'CN', 'Yeezy adds another colorway of its most well-known design with the adidas Yeezy 350 Zyon, now available on StockX. This 350 V2 dons a similar pattern as the Static colorway, only this time ditching a white side stripe and grey accents for a darker brown stripe and mocha hues.<br><br>This Yeezy 350 V2 is composed of a Zyon Primeknit upper with a dark tonal side stripe. A translucent Boost cushioned sole and cream interior completes the design. These sneakers released in March of 2020 and retailed for $220.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Boost-350-V2-Zyon-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606325931', 'Zyon', 1, '2020-07-18', 220, 'adidas Yeezy Boost 350 V2', 'adidas-Yeezy-Boost-350-V2-Zyon', 'adidas Yeezy Boost 350 V2 Zyon', 'sneakers+adidas+adidas+yeezy+350,v2+zyon/zyon/zyon+2020-07-18+220+fz1267');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('77591486-c016-4779-b87a-9cabaa022e16', 'Jordan', 'Air Jordan Four', 'Tour Yellow/White-Dark Blue Grey', 'New', 'CN', 'Originally released in 2006, the Air Jordan 4 Retro Lightning (2021) is one of the most renowned retro Jordan 4 colorways in Jordan Brand''s catalog. It features a Tour Yellow Durabuck upper with black netted panels and dark grey eyelets. On the tongue, a black Jordan Flight logo patch with white and yellow accents complements the upper. From there, a Jumpman logo on the heel tab and white midsole with a visible Air unit completes the design.<br><br>The Air Jordan 4 Retro Lightning (2021) released in August of 2021 and retailed for $220.', 'men', 'https://images.stockx.com/images/Air-Jordan-4-Retro-Lightning-2021-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1633023947', 'Lightning (2021)', 1, '2021-08-28', 220, 'Jordan 4 Retro', 'Air-Jordan-4-Retro-Lightning-2021', 'Jordan 4 Retro Lightning (2021)', 'sneakers+jordan+air jordan+four+tour yellow/white-dark blue grey+2021-08-28+220+ct8527-700');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('783b4bdb-db32-4096-a8fe-82493946e9ea', 'Nike', 'Nike Dunk', 'Grey Fog/White/Blue Void/Blue Void', 'New', 'ID', 'In commemoration of the NBA''s 75th Anniversary, Nike delivered an exclusive iteration of the Nike Dunk Low paying homage to the history of the Brooklyn Nets.<br><br>The Nike Dunk Low EMB NBA 75th Anniversary Brooklyn Nets features a light grey leather upper with navy and white overlays. On the heel, a Brooklyn Nets graphic that takes inspiration from the retro New Jersey Nets logo is prominently displayed. From there, an NBA 75th Anniversary woven tongue label and red stitching details complete the design.<br><br>The Nike Dunk Low EMB NBA 75th Anniversary Brooklyn Nets released in October of 2021 and retailed for $110.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Brooklyn-Nets-NBA-75th-Anniversary-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1635358517', 'NBA 75th Anniversary Brooklyn Nets', 1, '2021-10-19', 110, 'Nike Dunk Low EMB', 'Nike-Dunk-Low-Brooklyn-Nets-NBA-75th-Anniversary', 'Nike Dunk Low EMB NBA 75th Anniversary Brooklyn Nets', 'sneakers+nike+nike+dunk+low+grey fog/white/blue void/blue void+2021-10-19+110+dd3363-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('78643144-b0d0-4be2-97bc-d4b465b0204e', 'Jordan', 'Air Jordan One', 'White/Black/Grey Fog/Bleached Coral', 'New', 'CN', 'Released in June of 2022, the Retro High Stage Haze (GS) for grade schoolers for grade schoolers from Air Jordan consists of a simple pattern that is a mix of black, grey, and white. This specific model has a tongue label that contains a touch of coral, which can also be seen partially on the insole.<br><br>The primary material of the Air Jordan 1 Retro High Stage Haze (GS) for grade schoolers is both cracked and smooth leather, with suede being used on the sides and heels. The laces follow the entire length of the shoe and go to approximately mid-ankle. <br><br>The original retail price for the Air Jordan 1 Retro High Stage Haze (GS) for grade schoolers model started at $170 for men’s sizes.', 'child', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-Stage-Haze-GS.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1652346288', 'Bleached Coral (GS)', 1, '2022-07-02', 140, 'Jordan 1 Retro High OG', 'Air-Jordan-1-Retro-High-Stage-Haze-GS', 'Jordan 1 Retro High OG Bleached Coral (GS)', 'sneakers+jordan+air jordan+one+white/black/grey fog/bleached coral+2022-07-02+140+575441-108');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('786812bf-b916-440e-8b50-dffd2329c6d3', 'Jordan', 'Air Jordan One', 'Light Smoke Grey/Black-White', 'New', 'CN', 'The Air Jordan 1 Mid Light Smoke Grey represents a neutral ground between high and low-cut models.<br><br>The shoe features a perforated toebox, a smooth upper made of leather with successive white inserts at the lower area, and an ankle with grey inserts on the rest of the shoe. Black laces that match with the Swoosh complete the look, while the regular branding features and grey sole with two-tone white complement the design. The shoe also has the trademark Air Jordan wings emblem.<br><br>The Air Jordan 1 Mid Light Smoke Grey was released on 9 June, 2020, retailing at $115.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Light-Smoke-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606319491', 'Light Smoke Grey', 1, '2020-06-09', 115, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Light-Smoke-Grey', 'Jordan 1 Mid Light Smoke Grey', 'sneakers+jordan+air jordan+one+mid+light smoke grey/black-white+2020-06-09+115+554724-092');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('7884cec4-1fe9-41b8-93aa-28d6c7622fa5', 'Jordan', 'Air Jordan One', 'Armory Navy/White-Black', 'New', 'ID', 'The Jordan 1 Mid Armory Navy features a white leather upper with dark navy overlays and Swooshes. At the ankle, black leather collars add a subtle contrast to the overlays. A Jordan Wings logo at the ankle and Jumpman woven label on the tongue complete the design.<br><br>The Jordan 1 Mid Armory Navy release in 2022 and retail for $115.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Dark-Teal-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1667229903', 'Armory Navy', 1, '2022-03-29', 115, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Dark-Teal', 'Jordan 1 Mid Armory Navy', 'sneakers+jordan+air jordan+one+armory navy/white-black+2022-03-29+115+554724-411');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('78e82585-975d-4981-8d40-0b4c65a7c466', 'Nike', 'Nike Other Running', 'Black/Off-Noir/Off-Noir', 'New', 'CN', 'The Nike Vaporwaffle sacai Black Gum features a black nylon upper with matching monochromatic suede overlays and tumbled leather Swooshes. Doubled tongues and Swooshes continue sacai''s aesthetic of reconstruction and abstraction. At the base, a stacked foam midsole atop a gum outsole adds the finishing touch.<br><br>The Nike Vaporwaffle sacai Black Gum released in March of 2022 and retailed for $180.', 'men', 'https://images.stockx.com/images/Nike-Vaporwaffle-Sacai-Black-Gum-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1637338635', 'sacai Black Gum', 1, '2022-03-10', 180, 'Nike Vaporwaffle', 'Nike-Vaporwaffle-Sacai-Black-Gum', 'Nike Vaporwaffle sacai Black Gum', 'sneakers+nike+nike other+running+black/off-noir/off-noir+2022-03-10+180+dd1875-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('78f5669f-6052-41d7-ba19-95353195d80e', 'Jordan', 'Air Jordan Eleven', 'Black/White/Sail/Gym Red', 'New', 'CN', 'With its supportive structure and comfortable sole, the Air Jordan 11 Retro Low 72 10 (GS) for grade schoolers works well for more intense exercise, as well as everyday walking around. <br><br>This unique and supportive model has an off-white, cushioned sole, with a bright white midsole. The shoe’s body is made up of black leather, both smooth and pebbled. It is a low rise model that ends at the bottom of the ankle.<br><br>The model was designed to be comfortable for long periods.The Air Jordan 11 Retro Low 72 10 (GS) for grade schoolers for grade schoolers had an initial release date of May 2022. The starting retail price for this model was $190.', 'child', 'https://images.stockx.com/images/Air-Jordan-11-Retro-Low-72-10-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1651856497', '72-10 (GS)', 1, '2022-05-14', 135, 'Jordan 11 Retro Low', 'Air-Jordan-11-Retro-Low-72-10-GS', 'Jordan 11 Retro Low 72-10 (GS)', 'sneakers+jordan+air jordan+eleven+black/white/sail/gym red+2022-05-14+135+528896-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('794b194b-94c1-4fe1-8bc2-5dd41252420e', 'Nike', 'Nike Dunk', 'Sail/Harvest Moon', 'New', 'VN', 'The women''s Nike Dunk Low Harvest Moon (W) features a white leather upper with light brown overlays and Swooshes. From there, a matching woven tongue label and sole complete the design.<br><br>The women''s Nike Dunk Low Harvest Moon (W) releases in 2022 and retails for $100.', 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Harvest-Moon-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1644827833', 'Harvest Moon (W)', 1, '2022-02-02', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Harvest-Moon-W', 'Nike Dunk Low Harvest Moon (W)', 'sneakers+nike+nike+dunk+low+sail/harvest moon+2022-02-02+100+dd1503-114');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('799cd1c2-110b-4c55-a0ed-0d7d3750e321', 'Jordan', 'Air Jordan Five', 'Crimson Bliss/Leche Blue/Sail', 'New', 'CN', null, 'child', 'https://images.stockx.com/images/Air-Jordan-5-Retro-DJ-Khaled-We-The-Best-Crimson-Bliss-GS.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1668008075', 'DJ Khaled We The Best Crimson Bliss (GS)', 1, '2022-11-28', 160, 'Jordan 5 Retro', 'Air-Jordan-5-Retro-DJ-Khaled-We-The-Best-Crimson-Bliss-GS', 'Jordan 5 Retro DJ Khaled We The Best Crimson Bliss (GS)', 'sneakers+jordan+air jordan+five+crimson bliss/leche blue/sail+2022-11-28+160+dv4983-641');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('79c0888b-4967-4ccc-a5f8-ba57294dc90a', 'UGG', 'UGG Slippers', 'Chestnut', 'New', 'CN', null, 'women', 'https://images.stockx.com/images/UGG-Tazz-Slipper-Chestnut-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1645037409', 'Chestnut (W)', 1, '2021-11-01', 120, 'UGG Tazz Slipper', 'UGG-Tazz-Slipper-Chestnut-W', 'UGG Tazz Slipper Chestnut (W)', 'sneakers+ugg+ugg+slippers+chestnut+2021-11-01+120+1122553-che');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('79ddb164-28e2-459e-90e0-26dc4d99ca45', 'Jordan', 'Air Jordan Eleven', 'Black/White/Sail/Gym Red', 'New', 'CN', 'The Air Jordan 11 Retro Low 72-10 (Preschool) takes inspiration from the Air Jordan 11''s 2015 design motif. The shoe pays homage to the Chicago Bulls'' season, which saw Michael Jordan lead his club to a 72–10 record.<br><br>The Air Jordan 11 Retro Low 72-10 (Preschool) black leather upper has a tonal patent leather mudguard. The Jumpman branding on the shoe comes in crimson, giving the show a color-popped accent on the heel and tongue. The shoe sits on a white Phylon midsole with air-sole cushioning.<br><br>-he Air Jordan 11 Retro Low 7210 was released on May 14, 2022, and comes in preschool sizes. The shoe retailed in most stores at about $95.', 'preschool', 'https://images.stockx.com/images/Air-Jordan-11-Retro-Low-72-10-PS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1654606159', '72-10 (PS)', 1, '2022-05-14', 80, 'Jordan 11 Retro Low', 'Air-Jordan-11-Retro-Low-72-10-PS', 'Jordan 11 Retro Low 72-10 (PS)', 'sneakers+jordan+air jordan+eleven+black/white/sail/gym red+2022-05-14+80+505835-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('7a2c96be-0969-4e0f-a02b-fd86e996be77', 'Nike', 'Nike Other Training', 'Grey Haze/Olive Aura-Canvas', 'New', 'VN', 'Pulling inspiration from backpacking gear, the Nike Air Trainer 1 SP Travis Scott Grey Haze features a light grey canvas upper with darker grey mesh overlays and single stitch Swoosh logos. Canvas shrouds on the upper give wearers options for styling. At the heel and inside of the tongue, concealed zipper pockets provide extra storage. From there, "Cactus Corporation" insignias at the heel and forefoot velcro strap add a custom feel.<br><br>The Nike Air Trainer 1 SP Travis Scott Grey released in May of 2022 and retailed for $160.', 'men', 'https://images.stockx.com/images/Nike-Air-Trainer-1-SP-Travis-Scott-Grey-Haze-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1655966068', 'Travis Scott Grey Haze', 1, '2022-05-27', 160, 'Nike Air Trainer 1 SP', 'Nike-Air-Trainer-1-SP-Travis-Scott-Grey-Haze', 'Nike Air Trainer 1 SP Travis Scott Grey Haze', 'sneakers+nike+nike other+training+cactus jack+collections-filter+nike-travis-scott+grey haze/olive aura-canvas+2022-05-27+160+dr7515-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('7a4ccfe6-1933-4edb-a9f8-0499dd33c40b', 'adidas', 'adidas Yeezy', 'Dark Glow/Dark Glow/Dark Glow', 'New', 'CN', 'The adidas Yeezy 700 V3 Dark Glow features a black Primeknit upper with a black TPU cage that glows vivid blue when exposed to the dark. From there, an EVA foam sole adds support for a cushioned fit.<br><br>The adidas Yeezy 700 V3 Dark Glow released in August of 2021 and retailed for $200.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-700-V3-Blue-Glow-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1628537919', 'Dark Glow', 1, '2021-08-02', 200, 'adidas Yeezy 700 V3', 'adidas-Yeezy-700-V3-Blue-Glow', 'adidas Yeezy 700 V3 Dark Glow', 'sneakers+adidas+adidas+yeezy+700+v3+dark glow/dark glow/dark glow+2021-08-02+200+gx6144');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('7a952b69-f360-4eeb-8a02-dc4dd7dd0081', 'adidas', 'adidas Yeezy', 'Bone/Bone/Bone', 'New', 'CN', 'DISCLAIMER: US and UK sizing is the same and does not require any conversion.<br>The adidas Yeezy Slide Bone (Restock Pair) features a slightly different composition than the original adidas Yeezy Slide Bone that debuted in the fall of 2019. Instead of a smooth EVA foam construction, it has a pebbled, more textural touch. At the base, a grooved sole and cushioned footbed completes the design.<br><br>The adidas Yeezy Slide Bone (Restock Pair) released in May of 2022 and retailed for $60.<br><br>To shop the original adidas Yeezy Slide Bone, <a href="https://stockx.com/yeezy-slide-bone">click here.</a>  ', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Slide-Bone-2022-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1660143189', 'Bone (2022 Restock)', 1, '2022-05-31', 60, 'adidas Yeezy Slide', 'adidas-Yeezy-Slide-Bone-2022', 'adidas Yeezy Slide Bone (2022 Restock)', 'sneakers+adidas+adidas+yeezy+slides+bone/bone/bone+2022-05-31+60+fz5897');
