INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('7cfe0c22-7e77-4e54-89ca-c03007ecbfd1', 'Nike', 'Air Max 90', 'Roma Green/Sail/Orange/Mean Green', 'New', 'VN', 'The Nike Air Max 90 SE Running Club has a white midsole with an orange and green outsole. <br><br>This model is made of a mixture of suede, leather, and mesh materials. The body of the shoe features several bright colors, including shades of orange and green. On the tongue, there are vintage tear away ta(GS) for grade schoolers held together with a Nike pin. The shoe provides plenty of support, making it convenient for long walks or exercising.<br><br>The Nike Air Max 90 SE Running Club was first put on the market in November of 2022. The starting retail price for this pair of shoes was $130.', 'men', 'https://images.stockx.com/images/Nike-Air-Max-90-SE-Running-Club-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1647250601', 'Running Club', 1, '2021-11-16', 160, 'Nike Air Max 90 SE', 'Nike-Air-Max-90-SE-Running-Club', 'Nike Air Max 90 SE Running Club', 'sneakers+nike+air max+90+roma green/sail/orange/mean green+2021-11-16+160+dc9336-300');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('7d2497e9-7416-4f4f-a9f4-2a947613518e', 'Nike', 'Nike Basketball Dunk', 'White/Gym Red/White', 'New', 'VN', 'The women''s Nike Dunk Low Next Nature White Gym Red (W) features a white Flyleather upper with Gym Red overlays and Swooshes. From there, matching soles and woven tongue labels add the finishing touch.<br><br>The women''s Nike Dunk Low Next Nature White Gym Red (W) released in May of 2022 and retailed for $105.', 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Next-Nature-White-Gym-Red-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1644492744', 'Next Nature White Gym Red (W)', 1, '2022-05-12', 105, 'Nike Dunk Low', 'Nike-Dunk-Low-Next-Nature-White-Gym-Red-W', 'Nike Dunk Low Next Nature White Gym Red (W)', 'sneakers+nike+nike basketball+dunk+low+white/gym red/white+2022-05-12+105+dn1431-101');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('7d37091c-f214-491a-a50c-d289f0f7e255', 'Nike', 'Nike Dunk', 'White/Black-Total Orange', 'New', 'VN', 'The Nike Dunk High Black White 2021features a smooth white leather upper with perforations on the toe box. Black leather overlays, eyestays and Swooshes match the black laces. Orange hits on the insole add the Total Orange to the vintage White/Black colorway. The rubber outsole is black with a concentric-circles pattern for traction. The midsole is white with visible threading around the shoe. Black Nike branding appears on the white tongue and the heel features a black loop with arcs of white-on-white horizontal threading below it.<br><br> The Nike Dunk High Black White 2021 was released on January 27, 2022 at a retail price of $115.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Black-White-2021-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1645037142', 'Black White (2021)', 1, '2022-01-27', 110, 'Nike Dunk High', 'Nike-Dunk-High-Black-White-2021', 'Nike Dunk High Black White (2021)', 'sneakers+nike+nike+dunk+high+white/black-total orange+2022-01-27+110+dd1399-105');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('7df6d52b-c347-4d3b-b08b-3120ff51e9d4', 'Nike', 'Nike SB SB Dunk Low', 'Black/White-Orange', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Nike-SB-Dunk-Low-HUF-San-Francisco-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1666679302', 'HUF San Francisco', 1, '2022-11-16', 130, 'Nike SB Dunk Low', 'Nike-SB-Dunk-Low-HUF-San-Francisco', 'Nike SB Dunk Low HUF San Francisco', 'sneakers+nike+nike sb+sb dunk low+black/white-orange+2022-11-16+130+fd8775-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('7e19959d-b108-4384-90b0-dd43202f7daf', 'Nike', 'Nike Basketball Penny', 'Black/Varsity Royal-White', 'New', 'VN', 'The Nike Air Max Penny 1 Orlando is a reissue of the model designed by Penny Hardaway.<br><br>The Nike Air Max Penny 1 Orlando is made in black and white fabric and has a sculptural white mudguard. It also features a jeweled Nike logo. The final touch is added by the while stitching over the black frabric. And finally, it features a woven striped tongue.<br><br>The Nike Air Max Penny 1 Orlando released in August of 2022 and retailed for $170.', 'men', 'https://images.stockx.com/images/Nike-Air-Max-Penny-1-Orlando-2022-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1657005113', 'Orlando (2022)', 1, '2022-08-11', 170, 'Nike Air Max Penny 1', 'Nike-Air-Max-Penny-1-Orlando-2022', 'Nike Air Max Penny 1 Orlando (2022)', 'sneakers+nike+nike basketball+penny+black/varsity royal-white+2022-08-11+170+dn2487-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('7e64bee6-bfdc-439c-a4e2-3692a5cb240c', 'Nike', 'Air Force One', 'White/Pink Oxford/Rose Whisper/Amethyst Ash', 'New', 'VN', 'The entirety of the Nike Air Force 1 Low Shadow Amethyst Ash W is covered in smooth leather. The heel tab appears in baby pink, as well as several details surrounding the shoelace eyelets. <br><br>This pair of Nike Air Force 1 Low Shadow Amethyst Ash W features a thick white sole as well as a white base. On top of the white base, you will find light pink overlays and panels. The classic Nike symbol appears on the side in a pastel purple.<br><br>The Nike Air Force 1 Low Shadow Amethyst Ash (W) for women first had a release date of December 2021. This model was initially released for $120 for women’s sizes.', 'women', 'https://images.stockx.com/images/Nike-Air-Force-1-Low-Shadow-Amethyst-Ash-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1643887878', 'Amethyst Ash (W)', 1, '2021-12-21', 120, 'Nike Air Force 1 Low Shadow', 'Nike-Air-Force-1-Low-Shadow-Amethyst-Ash-W', 'Nike Air Force 1 Low Shadow Amethyst Ash (W)', 'sneakers+nike+air force+one+low+white/pink oxford/rose whisper/amethyst ash+2021-12-21+120+ci0919-113');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('7f9236e2-3bef-4bb8-b218-81fb6e099c7c', 'Nike', 'Nike Basketball Other', 'White/Black-Bright Crimson', 'New', 'VN', 'The Nike PG 6 Bright Crimson has a white base, with splashes of black and pink being used in the upper. <br><br>Similar to past models, the Nike PG 6 Bright Crimso has a low-top build. It is equipped with extra cushioning that is composed of React foam. Whether you’re on the court or walking around town, this model will provide you with ample comfort and support. The sole has a speckled pattern, coupled with purple plastic details and pink highlights, sitting just below the iconic Nike symbol in pink.<br><br>Initially released in February of 2022, the Nike PG 6 Bright Crimson had a starting retail price of $120.', 'men', 'https://images.stockx.com/images/Nike-PG-6-Bright-Crimson-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1653510962', 'Fluoro', 1, '2022-02-07', 120, 'Nike PG 6', 'Nike-PG-6-Bright-Crimson', 'Nike PG 6 Fluoro', 'sneakers+nike+nike basketball+other+white/black-bright crimson+2022-02-07+120+dc1974-100/dh8447-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('80aed0e6-05b4-4815-aa36-6988d76e73bf', 'Nike', 'Nike SB SB Dunk High', 'Orange/Yellow/White', 'New', 'VN', 'As part of the 2022 Nike SB Fruit Pack, the Nike SB Dunk High Pineapple features a pale yellow cracked leather upper with golden yellow suede overlays and bright yellow Swooshes. On the inside face of the tongue, a woven label depicting a cartoon-style pineapple character adds a playful look to the silhouette. At the base, a cushioned Zoom Air sole completes the design.<br><br>The Nike SB Dunk High Pineapple released in June of 2022 and retailed for $120.', 'men', 'https://images.stockx.com/images/Nike-SB-Dunk-High-Pineapple-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1654606600', 'Pineapple', 1, '2022-06-18', 120, 'Nike SB Dunk High', 'Nike-SB-Dunk-High-Pineapple', 'Nike SB Dunk High Pineapple', 'sneakers+nike+nike sb+sb dunk high+orange/yellow/white+2022-06-18+120+dm0808-700');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('80b49526-6eba-4537-b126-2fe295bf6f53', 'Nike', 'Nike Basketball Dunk', 'Summit White/Bright Spruce', 'New', 'VN', 'The women''s exclusive Nike Dunk Low Ocean (W) boasts a white tumbled leather upper with glossy Deep Blue textured overlays that are representative of the waves in the ocean. At the base, a tonal blue marbled, semi-translucent outsole adds the finishing touch.<br><br>The women''s Nike Dunk Low Ocean (W) released in May of 2022 and retailed for $110.', 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Ocean-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1652283567', 'Ocean (W)', 1, '2022-05-01', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Ocean-W', 'Nike Dunk Low Ocean (W)', 'sneakers+nike+nike basketball+dunk+low+summit white/bright spruce+2022-05-01+100+dv3029-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('810b56b2-6c1e-47d6-b772-dea9e258366a', 'Nike', 'Nike Dunk', 'White/White-White', 'New', 'ID', 'Everything is white in the monochromatic Nike Dunk Low Triple White 2021 (W).<br><br>The women''s Nike Dunk Low Triple White 2021 (W) features leather uppers, supple leathers making up the side paneling, and a breathable mesh is used for the tongue. Touches of black are served on the Nike branding atop the tongue and insoles, with everything else clad in a crisp white hue. The midsole and treading below also add to its appeal, with everything served up with colorless finishes. <br><br>The women''s Nike Dunk Low Triple White 2021 (W) was released in August 2021 and retailed for $100.', 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Triple-White-2021-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1631303124', 'Triple White (2021) (W)', 1, '2021-08-18', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Triple-White-2021-W', 'Nike Dunk Low Triple White (2021) (W)', 'sneakers+nike+nike+dunk+low+white/white-white+2021-08-18+100+dd1503-109');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('81b74010-15b2-4861-b169-a9696412e5bb', 'Nike', 'Nike Basketball Blazer', 'White/White-Metallic Gold', 'New', 'VN', 'Nike Blazer Mid LX White Pendants Women is part of a larger Nike’s "Lucky Charms" collection notable for its classic silhouette in a heavenly white colorway.<br><br>Nike Blazer Mid LX Lucky Charms White Women features all-white leather with tonal detailing on the Swooshes on the side panels, inner liners, mesh lining, tongues, rubber soles, and laces. The shoe also features metallic gold branding at the tongue and heel. The defining characteristic of sleek shoes is the bling on the ankle with golden lucky charms.<br><br>Nike Blazer Mid LX Lucky Charms White Women was released in November 2021 at a retail price of $120.', 'women', 'https://images.stockx.com/images/Nike-Blazer-Mid-LX-Lucky-Charms-White-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1654199202', 'White Pendants (W)', 1, '2021-11-11', 110, 'Nike Blazer Mid LX', 'Nike-Blazer-Mid-LX-Lucky-Charms-White-W', 'Nike Blazer Mid LX White Pendants (W)', 'sneakers+nike+nike basketball+blazer+white/white-metallic gold+2021-11-11+110+dm0850-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('824f2844-dd41-4fce-8e2a-64917c3f0d09', 'Jordan', 'Air Jordan One', 'Varsity Red/Black-Sail-Muslin', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/air-jordan-1-retro-high-og-lost-and-found-ps.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1666124849', 'Chicago Lost and Found (PS)', 1, '2022-11-19', 85, 'Jordan 1 Retro High OG', 'Air-Jordan-1-Retro-High-OG-Lost-and-Found-PS', 'Jordan 1 Retro High OG Chicago Lost and Found (PS)', 'sneakers+jordan+air jordan+one+chicago+chicago 1+varsity red/black-sail-muslin+2022-11-19+85+fd1412-612');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('8334d027-dafb-426d-b209-b8e07bf1b15b', 'adidas', 'adidas Yeezy', 'Sand Taupe/Sand Taupe/Sand Taupe', 'New', 'CN', 'The Yeezy 350 V2 continued its reign in 2020 with the release of the Sand Taupe colorway. The sneaker brings back adidas and Yeezy’s love for taupe colors that appear on many of their silhouettes. Drops such as the Yeezy 500 Blush, 350 V2 Flax, and 350 Oxford Tan all feature similar hues. This Yeezy adds to that lightly shaded collection.<br><br>The Yeezy 350 V2 Sand Taupe features three colors on the sneaker’s upper. Its Primeknit construction is similar to the other 350 V2 colorways that have released. The midsole is filled with adidas’ signature BOOST cushioning to add comfort with every step, plus another set of laces are included with the sneaker to add versatility.<br><br>The adidas Yeezy 350 V2 Sand Taupe released in December 2020 for $220.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Boost-350-V2-Eliada-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1609768689', 'Sand Taupe', 1, '2020-12-19', 220, 'adidas Yeezy Boost 350 V2', 'adidas-Yeezy-Boost-350-V2-Eliada', 'adidas Yeezy Boost 350 V2 Sand Taupe', 'sneakers+adidas+adidas+yeezy+350+v2+sand taupe/sand taupe/sand taupe+2020-12-19+220+fz5240');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('83464f8e-a76c-4583-8600-1b4e28a54920', 'New Balance', 'New Balance 550', 'White/Au Lait/Brown', 'New', 'VN', 'The New Balance 550 Au Lait (Women''s) offers wearers extra cushioning, making it a convenient shoe for exercising, long walks, or simply just wandering throughout town. On the side, you will find the classic N for the New Balance logo.<br><br>This fresh take on the classic New Balance style has a white and brown Gum rubber sole, paired with a cream-colored base that is overlaid by several other neutral shades. On the toes, you will find splashes of grey, while on the heel, there are earth-colored pieces of fabric.<br><br> Initially released in March of 2022, the New Balance 550 Au Lait (W) for women had a starting price of $110.', 'women', 'https://images.stockx.com/images/New-Balance-550-Au-Lait-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1649865272', 'Au Lait (W)', 1, '2022-03-15', 100, 'New Balance 550', 'New-Balance-550-Au-Lait-W', 'New Balance 550 Au Lait (W)', 'sneakers+new balance+new balance+550+white/au lait/brown+2022-03-15+100+bbw550wa');
