INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('84712575-9a1e-4b96-8cd1-229d52915a63', 'Puma', 'Puma Puma', 'Red/Green', 'New', 'VN', 'The Puma MB.01 received its first collaboration courtesy of LaMelo Ball''s favorite Adult Swim cartoon, Rick and Morty.<br><br>Sporting a mismatched neon two-tone look, the Puma MB.01 Rick and Morty draws inspiration from otherworldly adventures of Rick and Morty. The left shoe features a slime green palette, while the right shoe is smothered in the neon red tones. On the back of the tongues, illustrations of both Rick and Morty contribute a customized feel.<br><br>The Puma MB.01 Rick and Morty released in February of 2022 and retailed for $135.', 'men', 'https://images.stockx.com/images/Puma-MB01-LaMelo-Ball-Rick-and-Morty-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1645637275', 'Rick and Morty', 1, '2022-02-18', 135, 'Puma LaMelo Ball MB.01', 'Puma-MB01-LaMelo-Ball-Rick-and-Morty', 'Puma LaMelo Ball MB.01 Rick and Morty', 'sneakers+puma+puma+puma+lamelo ball+red/green+2022-02-18+135+376682-01');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('84e43608-e389-4e25-abd3-cf8d094fec3f', 'Nike', 'Nike Dunk', 'White/Sail-Grey', 'New', 'VN', 'The women''s Nike Dunk Low Next Nature Sail is constructed of 50% recycled materials. Two-tone black and white Flyleather composes the upper in a simple, color blocked look similar to some of the most popular Dunks to release. From there, matching soles and woven tongue labels add a finishing touch.<br><br>The women''s Nike Dunk Low Next Nature Sail released in November of 2021 and retailed for $100.', 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Move-To-Zero-Sail-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1646406397', 'Next Nature Sail (W)', 1, '2021-11-03', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Move-To-Zero-Sail-W', 'Nike Dunk Low Next Nature Sail (W)', 'sneakers+nike+nike+dunk+#vegan+low+white/sail-grey+2021-11-03+100+dd1873-101');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('85a121a6-1870-4445-903c-5a9a4dec4348', 'adidas', 'adidas Yeezy', 'Vanta/Vanta/Vanta', 'New', 'CN', 'The adidas Yeezy Boost 700 V2 Vanta features a muted, all-black mesh, leather, and suede construction in a styling influenced by 1990s running shoes. At the base, a Boost-cushioned sole adds comfort and support.<br><br>The adidas Yeezy Boost 700 V2 Vanta originally released in June of 2019 and retailed for $300.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Boost-700-V2-Vanta_01.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606323012', 'Vanta', 1, '2019-06-06', 300, 'adidas Yeezy Boost 700 V2', 'adidas-Yeezy-Boost-700-V2-Vanta', 'adidas Yeezy Boost 700 V2 Vanta', 'sneakers+adidas+adidas+yeezy+700+v2+vanta/vanta/vanta+2019-06-06+300+fu6684');
