INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('869d972c-50fb-4c5f-a216-ab1ca550e2d4', 'Jordan', 'Air Jordan One', 'White/Wolf Grey-Aluminium', 'New', 'VN', 'The women''s Jordan 1 Low Wolf Grey (W) features a white leather upper with Wolf Grey Durabuck overlays and Swooshes. From there, a Jordan Wings logo on the heel and a translucent outsole adds the finishing touch.The women''s Jordan 1 Low Wolf Grey (W) released in July of 2021 and retailed for $100.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-Low-Wolf-Grey-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1626802392', 'Wolf Grey (W)', 1, '2021-07-20', 100, 'Jordan 1 Low', 'Air-Jordan-1-Low-Wolf-Grey-W', 'Jordan 1 Low Wolf Grey (W)', 'sneakers+jordan+air jordan+one+white/wolf grey-aluminium+2021-07-20+100+dc0774-105');
