INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('86e109d7-3215-475c-9997-a91f05821c16', 'New Balance', 'New Balance 2002R', 'Marblehead/Light Aluminum', 'New', 'CN', 'The New Balance 2002R Marblehead Light Aluminum was originally released in 2005. Its minimalist features shades of grey colorway.<br><br>The stylish and versatile New Balance 2002R Marblehead Light Aluminum top features several colors of grey. Its design is of the platinum fabric base and supple leather details. It consists of a netting top with a plain, perforated ashy faux leather surface. It also displays a matching outsole that complements the finishing. The New Balance 2002R Marblehead Light Aluminum has ABZORB innovation and N-ergy padding underfoot.<br><br>The New Balance 2002R Marblehead Light Aluminum was released in September of 2020 for a price of $140.', 'men', 'https://images.stockx.com/images/New-Balance-2002R-Marblehead-Light-Aluminum-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1653055248', 'Marblehead Light Aluminum', 1, '2020-09-01', 140, 'New Balance 2002R', 'New-Balance-2002R-Marblehead-Light-Aluminum', 'New Balance 2002R Marblehead Light Aluminum', 'sneakers+new balance+new balance+2002r+2002r+marblehead/light aluminum+2020-09-01+140+ml2002rc');
