INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('879af9d9-6e67-4623-b6f5-58efc730324f', 'Jordan', 'Air Jordan One', 'White/Aluminum-Wolf Grey', 'New', 'CN', 'The women''s Jordan 1 Mid Wolf Grey Aluminum (W) features a white leather upper with Wolf Grey Durabuck overlays and an Aluminum Swoosh. From there, a Jumpman woven tongue label and icy translucent sole completes the design.The women''s Jordan 1 Mid Wolf Grey Aluminum (W) released in July of 2021 and retailed for $115.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Grey-Blue-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1626802413', 'Wolf Grey Aluminum (W)', 1, '2021-07-15', 115, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Grey-Blue-W', 'Jordan 1 Mid Wolf Grey Aluminum (W)', 'sneakers+jordan+air jordan+one+white/aluminum-wolf grey+2021-07-15+115+bq6472-105');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('88217b78-dcc6-4a6a-92cf-ef23a6a47f78', 'Jordan', 'Air Jordan Thirteen', 'Navy/Black/White/University Blue', 'New', 'VN', 'Jordan Brand reimagines one of the original Air Jordan 13 Low colorways as a high-top with the Air Jordan 13 Brave Blue.<br><br>Drawing inspiration from the 1998 Air Jordan 13 Low Navy, the Air Jordan 13 Brave Blue features a black tumbled leather upper with Brave Blue mesh overlays and black Durabuck underlays. At the collar, a Jumpman hologram commemorates the design''s signature styling. A sculptural white and black EVA foam sole provides support for daily wear.<br><br>The Air Jordan 13 Brave Blue released in April of 2022 and retailed for $200.', 'men', 'https://images.stockx.com/images/Air-Jordan-13-Retro-Brave-Blue-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1651610364', 'Brave Blue', 1, '2022-04-29', 200, 'Jordan 13 Retro', 'Air-Jordan-13-Retro-Brave-Blue', 'Jordan 13 Retro Brave Blue', 'sneakers+jordan+air jordan+thirteen+navy/black/white/university blue+2022-04-29+200+dj5982-400');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('8836c214-2d90-41eb-b727-bb1a6f87dd86', 'Jordan', 'Air Jordan Five', 'Silver/Green Bean-Flint Grey', 'New', 'CN', 'Having debuted in 2006, the Air Jordan 5 Green Bean (2022) marks the first time the colorway has ever been reissued. It arrives in its original grey reflective construction with hits of Green Bean on the tongue and midsole. At the base, an icy blue semi translucent outsole completes the design.<br><br>The Air Jordan 5 Green Bean (2022) released in May of 2022 and retailed for $210.', 'men', 'https://images.stockx.com/images/Air-Jordan-5-Retro-Green-Bean-2022-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1655237336', 'Green Bean (2022)', 1, '2022-05-28', 200, 'Jordan 5 Retro', 'Air-Jordan-5-Retro-Green-Bean-2022', 'Jordan 5 Retro Green Bean (2022)', 'sneakers+jordan+air jordan+five+silver/green bean-flint grey+2022-05-28+200+dm9014-003');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('883ed449-87ff-424e-97b2-a636bcbad53a', 'Jordan', 'Air Jordan Four', 'Black/Multi-Color-Multi-Color-Crimson', 'New', 'ID', 'The Air Jordan 4 Retro Red Thunder (PS) introduces a familiar color blocking that recalls the coveted ‘Thunder’ colorway, originally released in 2006 and subsequently reissued in 2012.<br><br>The Air Jordan 4 Retro Red Thunder (PS) sports a black nubuck upper with contrasting pops of crimson. The crimson appears on the sneaker’s molded eyelets, interior tongue, quarter panel, throat, and midsole, which packs visible Air-sole cushioning under the heel. Jumpman branding decorates the tongue tag and heel.<br><br>The Air Jordan 4 Retro Red Thunder (PS) was released in January 2022 and originally retailed at a price of $80.', 'preschool', 'https://images.stockx.com/images/Air-Jordan-4-Retro-Red-Thunder-PS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1643276961', 'Red Thunder (PS)', 1, '2022-01-15', 80, 'Jordan 4 Retro', 'Air-Jordan-4-Retro-Red-Thunder-PS', 'Jordan 4 Retro Red Thunder (PS)', 'sneakers+jordan+air jordan+four+black/multi-color-multi-color-crimson+2022-01-15+80+bq7669-016');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('885e8fdb-1360-496d-804d-4e2bcdc3c18b', 'Jordan', 'Air Jordan 6', 'White/University Red-Black', 'New', 'VN', 'The Air Jordan 6 Red Oreo features a white tumbled leather and perforated Durabuck construction with a matching mesh and rubber tongue. Hits of red with white speckles on the heel tab and midsole nod to the spray-paint styling of the 2010 Air Jordan 6 Oreo. From there, an icy semi translucent outsole completes the design.<br><br> The Air Jordan 6 Red Oreo released in June of 2022 and retailed for $200.', 'men', 'https://images.stockx.com/images/Air-Jordan-6-Retro-Red-Oreo-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1655385700', 'Red Oreo', 1, '2022-06-04', 200, 'Jordan 6 Retro', 'Air-Jordan-6-Retro-Red-Oreo', 'Jordan 6 Retro Red Oreo', 'sneakers+jordan+air jordan+6+white/university red-black+2022-06-04+200+ct8529-162');
