INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('89131ac0-da39-4dae-9995-5d8f3021eea7', 'Jordan', 'Air Jordan Nine', 'Chile Red/Black', 'New', 'VN', 'The Air Jordan 9 Chile Red arrives with a Chile Red Durabuck construction with matching patent leather mudguards and quilted paneling. At the heel, an embroidered "23" and rubber Jumpman insignia stay true to the model''s original detailing. From there, a muted black sole and matching lace hooks complete the design.<br><br>The Air Jordan 9 Chile Red released in May of 2022 and retailed for $190.', 'men', 'https://images.stockx.com/images/Air-Jordan-9-Retro-Chile-Red-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1652711343', 'Chile Red', 1, '2022-05-07', 200, 'Jordan 9 Retro', 'Air-Jordan-9-Retro-Chile-Red', 'Jordan 9 Retro Chile Red', 'sneakers+jordan+air jordan+nine+chile red/black+2022-05-07+200+ct8019-600');
