INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('89da6f02-ac66-4616-a86e-6529b16ba87a', 'Jordan', 'Air Jordan One', 'White/White/Black', 'New', 'CN', 'The Jordan 1 Low SE Homage White Black (Women)''s design references the 2018’s Air Jordan 1 High OG Homage. The women’s shoe has adopted a split pattern of design.<br><br>The design features a full construction of tumbled leather with a white base and black overlays on its lateral sides. The overlays are, however, reversed on the shoe’s medial sides and the nylon tongues. These tongues are marked with the Jumpman’s tongue tags. Air Jordan 1 Low SE Homage White Black (Women) is elevated by white midsoles. These midsoles are paired with contrasting black rubber outsoles.<br><br>Air Jordan 1 Low SE Homage White Black (Women) was released in July 2022 at a retail price of $114.95.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-Low-SE-Homage-White-Black-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1657866214', 'Homage Split White Black (W)', 1, '2022-09-22', 120, 'Jordan 1 Low SE', 'Air-Jordan-1-Low-SE-Homage-White-Black-W', 'Jordan 1 Low SE Homage Split White Black (W)', 'sneakers+jordan+air jordan+one+white/white/black+2022-09-22+120+dr0502-101');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('89e5f49c-5d31-48cf-8a37-0dd22d0d1ce3', 'Nike', 'Air Max 1', 'Metallic Silver/Rush Maroon', 'New', 'CN', 'The Nike Air Max 1 Patta Waves Noise Rush Maroon features a grey mesh upper with smooth maroon leather overlays and wave-shaped mudguards. A yellowed Air sole with a brown outsole adds the finishing touches.<br><br>The Nike Air Max 1 Patta Waves Noise Rush Maroon released in November of 2021 and retailed for $160.', 'men', 'https://images.stockx.com/images/Nike-Air-Max-1-Patta-Waves-Rush-Maroon-with-Bracelet-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1637338212', 'Patta Waves Rush Maroon (with Bracelet)', 1, '2021-11-19', 160, 'Nike Air Max 1', 'Nike-Air-Max-1-Patta-Waves-Rush-Maroon-with-Bracelet', 'Nike Air Max 1 Patta Waves Rush Maroon (with Bracelet)', 'sneakers+nike+air max+1+metallic silver/rush maroon+2021-11-19+160+do9549-001');
