INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('8a3ace01-73ae-4b0b-914b-ed69915d4ac6', 'adidas', 'adidas Yeezy', 'Mono Cinder/Mono Cinder/Mono Cinder', 'New', 'CN', 'The adidas Yeezy Boost 350 V2 Mono Cinder arrives with a Cinder lightweight mesh upper with a tonal side stripe and perforations exposing an interior skeletal frame. A Cinder Boost sole and heel loop completes its monochromatic look.<br><br>The adidas Yeezy Boost 350 V2 Mono Cinder released in June of 2021 and retailed for $220.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Boost-350-V2-Mono-Cinder-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1635434704', 'Mono Cinder', 1, '2021-06-24', 220, 'adidas Yeezy Boost 350 V2', 'adidas-Yeezy-Boost-350-V2-Mono-Cinder', 'adidas Yeezy Boost 350 V2 Mono Cinder', 'sneakers+adidas+adidas+yeezy+350+v2+mono cinder/mono cinder/mono cinder+2021-06-24+220+gx3791');
