INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('8a7498ab-425e-4047-bbfb-abb2008c647c', 'adidas', 'adidas Superstar', 'Core Black/Cloud White/Core Black', 'New', 'VN', null, 'unisex', 'https://images.stockx.com/images/adidas-Superstar-Core-Black-Cloud-White-Gold-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1662039505', 'Core Black Cloud White Gold', 1, '2019-12-23', 85, 'adidas Superstar', 'adidas-Superstar-Core-Black-Cloud-White-Gold', 'adidas Superstar Core Black Cloud White Gold', 'sneakers+adidas+adidas+superstar+core black/cloud white/core black+2019-12-23+85+eg4959');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('8ba853b9-1bc4-477b-a899-1eaef66df3e0', 'Nike', 'Air Max 97', 'White/Gum Light Brown/White', 'New', 'VN', 'The Nike Air Max 97 White Gum falls under the category of Nike sporting sneakers for amateur sports, like running. This sneaker''s white mesh upper is made of leather and textile, enhancing its durability.<br><br>Nike Air Max 97 White Gum midsole features foam cushioning that provides underfoot comfort. The foam midsole guarantee a lightweight and springy feel when walking or running. This sneaker''s outsole is made of a rubber gum that promotes durability and adds style and traction throughout the period of wear.<br><br>Nike Air Max 97 White Gum was made available at the retail price of $170 on July 4th, 2021.', 'men', 'https://images.stockx.com/images/Nike-Air-Max-97-White-Gum-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1629132054', 'White Gum', 1, '2021-04-07', 170, 'Nike Air Max 97', 'Nike-Air-Max-97-White-Gum', 'Nike Air Max 97 White Gum', 'sneakers+nike+air max+97+white/gum light brown/white+2021-04-07+170+dj2740-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('8c14c656-a1f7-43af-9a87-d35c4561ffb5', 'adidas', 'adidas Yeezy', 'Ash Pearl/Ash Pearl/Ash Pearl', 'New', 'CN', 'Trailing the 2021 releases of the Ash Blue and Ash Stone colorways, Yeezy extended the Ash theme with the adidas Yeezy Boost 350 V2 Ash Pearl. The Ash Pearl colorway builds off of previous models, utilizing material selection to create a stylish and responsive design.<br><br>Similar to the Ash Blue and Ash Stone releases, the upper of the Yeezy Boost 350 V2 Ash Pearl features a two-tone construction. White and black Primeknit make up the lower portion of the upper, while cream and tan make up the upper half. Dividing the two sections of the upper is a tan mesh stripe that runs across the lateral side of the shoe. A white and gum Boost sole adds the cushioning and responsiveness that the 350 is known for.<br><br>The adidas Yeezy Boost 350 V2 Ash Pearl released in March of 2021 and retailed for $220.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Boost-350-V2-Ash-Pearl-2021-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1666939654', 'Ash Pearl', 1, '2021-03-20', 220, 'adidas Yeezy Boost 350 V2', 'adidas-Yeezy-Boost-350-V2-Ash-Pearl-2021', 'adidas Yeezy Boost 350 V2 Ash Pearl', 'sneakers+adidas+adidas+yeezy+350+v2+ash pearl/ash pearl/ash pearl+2021-03-20+220+gy7658');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('8c65b5e1-af86-4987-a30c-ee8e5af4fe38', 'Nike', 'Nike Basketball Kyrie', 'Blue/Pink/Cream', 'New', 'CN', 'The Nike Kyrie Low 5 Community also features the Nike Swoosh prominently displayed on either side, plus a small Swoosh on the upper inside.<br><br>These shoes feature multiple colors, which include blue, cream, pink, and hints of black. The sole is primarily cream-colored, the outer side of the shoe contains pink accents, and the upper features a light blue and cream tie-dye. The sneakers are low-top and have a lace-up closure style with black laces, a cream-colored tongue, and blue pull tabs.<br><br>The Nike Kyrie Low 5 Community was released for a $130 price tag in July of 2022 as part of a Nike and Jewel Lloyd collaboration.', 'men', 'https://images.stockx.com/images/Nike-Kyrie-Low-5-Community-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1656421876', 'Community', 1, '2022-07-08', 130, 'Nike Kyrie Low 5', 'Nike-Kyrie-Low-5-Community', 'Nike Kyrie Low 5 Community', 'sneakers+nike+nike basketball+kyrie+blue/pink/cream+2022-07-08+130+dv2530-900 / dv2531-900');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('8d057d00-71d5-4844-aa45-2cc022473dd3', 'Nike', 'Nike Dunk', 'Midas Gold/Tough Red-White', 'New', 'VN', 'The Nike Dunk Low Midas Gold features a Midas Gold leather upper with Tough Red overlays and Swooshes. From there, matching woven tongue tags and soles complete the design.<br><br>The Nike Dunk Low Midas Gold released in October of 2021 and retailed for $100.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Midas-Gold-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1636482253', 'Midas Gold', 1, '2022-02-15', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Midas-Gold', 'Nike Dunk Low Midas Gold', 'sneakers+nike+nike+dunk+low+midas gold/tough red-white+2022-02-15+100+dd1391-701');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('8d16bcb0-17de-42cf-a515-b05b620687b6', 'Converse', 'Converse One Star', 'Green Flash/White/Black', 'New', 'VN', null, 'unisex', 'https://images.stockx.com/images/Converse-One-Star-Pro-Ox-Stussy-8-Ball.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1667507957', 'Stussy 8-Ball', 1, '2022-11-05', 100, 'Converse One Star Pro Ox', 'Converse-One-Star-Pro-Ox-Stussy-8-Ball', 'Converse One Star Pro Ox Stussy 8-Ball', 'sneakers+converse+converse+one star+green flash/white/black+2022-11-05+100+a03712c');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('8d7e4265-8554-458b-9eb5-1b4c80b83458', 'Jordan', 'Air Jordan Other', 'Black/Metallic Silver/Signal Blue', 'New', 'VN', 'Despite having several colorways already on the market, Jordan Brand has added to its 2022 collection, offering a brand new Air Jordan Luka 1 Black Signal Blue.<br><br>Air Jordan Luka 1 Black Signal Blue has a black-mesh top that is reinforced with a fuse and Flywire cables. The top''s medial side features the green-themed phrase, "NON-DESISTAS NON-EXIERIS," meaning, " Do not Give Up, Nor Surrender." The sneaker''s midsole features a speckled grey and a blue Iso Plate. The outer sole features a clear rubber with placements of Iso Plate with an injection of Formula 23 foam.<br><br>Upon its release in November 2022, Air Jordan Luka 1 Black Signal Blue will retail at $110.', 'men', 'https://images.stockx.com/images/Air-Jordan-Luka-1-Black-Signal-Blue-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1667486167', 'Black Signal Blue', 1, '2022-09-28', 110, 'Jordan Luka 1', 'Air-Jordan-Luka-1-Black-Signal-Blue', 'Jordan Luka 1 Black Signal Blue', 'sneakers+jordan+air jordan+other+black/metallic silver/signal blue+2022-09-28+110+fb1800-004/fb1801-004');
