INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('8dfef137-6ef3-4395-9f2f-db57b089b0b5', 'Nike', 'Air Max 95', 'Summit White/Chile Red-Off Noir-Smoke Grey', 'New', 'ID', 'The Nike Air Max 95 Smoke Grey is a retro release by Nike to respect the Japanese culture.<br><br>The Nike Air Max 95 Smoke Grey has a striking blend of neutral tones and accents on the upper. However, the Japan-inspired appeal comes in its monochromatic Seigaiha graphics on the heels. These are debossed in a reflective panel, with wave-like etchings on the outsole. The insole also has Asian cherry blossom floral patterns. The shoe also features bright white overlays and tongue contrasting gradient gray panels that transition from top to bottom.<br><br>This Nike Air Max 95 Smoke Grey retailed at $180 when it was released on 22nd September 2021.', 'men', 'https://images.stockx.com/images/Nike-Air-Max-95-Japan-Plum-Blossom-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1632510114', 'Smoke Grey', 1, '2021-09-22', 180, 'Nike Air Max 95', 'Nike-Air-Max-95-Japan-Plum-Blossom', 'Nike Air Max 95 Smoke Grey', 'sneakers+nike+air max+95+summit white/chile red-off noir-smoke grey+2021-09-22+180+dh9792-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('8e7bd9d0-df1d-4707-b111-e1a91783ad91', 'Nike', 'Air Force One', 'Fossil/Sail', 'New', 'VN', 'Taking inspiration from the 2020 Nike Air Force 1 Low Stüssy Fossil, the Nike Air Force 1 Mid Stüssy Hemp reimagines the neutral-toned design in a mid-top format. It features a hemp-like woven upper with puff embroidered Swooshes and an alternate, long-haired textile on the heel tabs. Metal heel embellishments, dual-branded tongue tags, and a Stüssy double "S" logo perforated on the toe box complete the design.<br><br>The Nike Air Force 1 Mid Stüssy Hemp released in May of 2022 and retailed for $150.', 'men', 'https://images.stockx.com/images/Nike-Air-Force-1-Mid-Stussy-Fossil-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1653036422', 'Stussy Fossil', 1, '2022-05-13', 150, 'Nike Air Force 1 Mid', 'Nike-Air-Force-1-Mid-Stussy-Fossil', 'Nike Air Force 1 Mid Stussy Fossil', 'sneakers+nike+air force+one+fossil/sail+2022-05-13+150+dj7841-200');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('8eaf1af5-672a-4d39-8bf8-1f80ca1d714a', 'Nike', 'Air Max 1', 'Baroque Brown/Lemon Drop-Wheat-Chile Red', 'New', 'VN', 'In collaboration with Travis Scott''s record label Cactus Jack, the Nike Air Max 1 Travis Scott Cactus Jack Brown draws inspiration from the Nike ACG Pocket Knife hiking shoe. It features a layered mesh upper with tonal-brown Durabuck overlays and reversed Swoosh logos. A drawstring Gillie lacing system nods to common features on trail runners. At the base, a yellowed sole with a cloudy Air unit completes the design.<br><br>The Nike Air Max 1 Travis Scott Cactus Jack Brown released in May of 2022 and retailed for $150.', 'men', 'https://images.stockx.com/images/Nike-Air-Max-1-Travis-Scott-Baroque-Brown-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1645116120', 'Travis Scott Cactus Jack Baroque Brown', 1, '2022-05-27', 150, 'Nike Air Max 1', 'Nike-Air-Max-1-Travis-Scott-Baroque-Brown', 'Nike Air Max 1 Travis Scott Cactus Jack Baroque Brown', 'sneakers+nike+air max+1+am1+cactus jack+collections-filter+nike-travis-scott+baroque brown/lemon drop-wheat-chile red+2022-05-27+150+do9392-200');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('8ff727cd-f831-421b-a3c4-9abcbebfec29', 'Jordan', 'Air Jordan One', 'White/Racer Blue-Black', 'New', 'VN', 'The Jordan 1 Mid White Black Royal features a white and black leather upper with Royal collars and Swooshes. From there, a white and black sole completes the design.<br><br>The Jordan 1 Mid White Black Royal released in the Summer of 2021 and retailed for $115.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Mid-White-Black-Royal-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1626289212', 'White Black Racer Blue', 1, '2021-08-05', 115, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-White-Black-Royal', 'Jordan 1 Mid White Black Racer Blue', 'sneakers+jordan+air jordan+one+white/racer blue-black+2021-08-05+115+554724-140');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('9013d751-fb66-4ba3-93b7-c3ac8c7447dc', 'Nike', 'Nike Basketball Other', 'Violet Frost/Light Crimson/Purple Pulse/Canyon Purple/Barely Volt', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Nike-PG-6-Paulette.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1663002917', 'Paulette', 1, '2022-09-01', 110, 'Nike PG 6', 'Nike-PG-6-Paulette', 'Nike PG 6 Paulette', 'sneakers+nike+nike basketball+other+violet frost/light crimson/purple pulse/canyon purple/barely volt+2022-09-01+110+dc1974-500');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('903ca759-9417-45fb-8d03-9a8970e42c39', 'Jordan', 'Air Jordan One', 'Coconut Milk/Black/White', 'New', 'ID', 'On the heels of the Air Jordan 1 Low Coconut Milk W, you will also find black detailing. This is a low-top model and has the standard Air Jordan tread.<br><br>The sole of the Air Jordan 1 Low Coconut Milk W is a cream color and sits right below the bright white midsole. The majority of the rest of the shoe is made out of the same cream color, with the exception being the black Nike swoosh symbol that is on the side.<br><br>The Air Jordan 1 Low Coconut Milk (W) for women had a starting release date of November 2021. It was released at an initial retail price of $100.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-Low-Coconut-Milk-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1642595924', 'Coconut Milk (W)', 1, '2021-11-01', 90, 'Jordan 1 Low', 'Air-Jordan-1-Low-Coconut-Milk-W', 'Jordan 1 Low Coconut Milk (W)', 'sneakers+jordan+air jordan+one+coconut milk/black/white+2021-11-01+90+dc0774-121');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('90ab2ca9-b977-4ea2-8420-97ba1042bea9', 'Crocs', 'Crocs Collaborations', 'Sasquatch/Black', 'New', 'CN', 'Since its release, Crocs Pollex Clog by Salehe Bembury Sasquatch remains of the highest-selling variants in the Crocs catalog. <br><br>The construction of Pollex Clog mainly utilizes croslite material. These Crocs come in an attractive sasquatch black colorway and feature a heel attached to the optional sport mode for great fitting. The upper part is perforated to enhance its breathability and allow the shedding of water and other particles, such as debris, from inside the Crocs. <br><br>The Crocs Pollex Clog by Salehe Bembury Sasquatch was released on September 22, 2022. At the time of the release, its retail price was $85.', 'men', 'https://images.stockx.com/images/Crocs-Pollex-Clog-by-Salehe-Bembury-Sasquatch-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1656620150', 'by Salehe Bembury Sasquatch', 1, '2022-11-10', 85, 'Crocs Pollex Clog', 'Crocs-Pollex-Clog-by-Salehe-Bembury-Sasquatch', 'Crocs Pollex Clog by Salehe Bembury Sasquatch', 'sneakers+crocs+crocs+collaborations+sasquatch/black+2022-11-10+85+207393-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('90d7808c-36cc-4dec-8ee5-3b548b918467', 'Jordan', 'Air Jordan One', 'Baroque Brown/Black-Laser Orange-Racer Pink', 'New', 'CN', 'Remember back in 2005 when Nike collaborated on a Dunk High with Undefeated? The LA sneaker boutique put their very unique spin on the basketball silhouette, adding bold colors and an unpadded throat of the shoe. Now, the same mismatched color pattern has returned, only this time it on the Air Jordan 1. <br><br>The Air Jordan 1 Bio Hack pushes the model to a whole new territory when it comes to color palettes. The upper is made of various suedes and leathers, matched with a hodgepodge of black, Baroque Brown, and Racer Pink. A metallic leather Swoosh is contrasted by a light green midsole to add even further appeal to the traditional model.<br><br>The Air Jordan 1 Bio Hack released in September of 2020 for $170.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-Bio-Hack-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606318464', 'Tokyo Bio Hack', 1, '2020-09-04', 170, 'Jordan 1 Retro High', 'Air-Jordan-1-Retro-High-Bio-Hack', 'Jordan 1 Retro High Tokyo Bio Hack', 'sneakers+jordan+air jordan+one+high+baroque brown/black-laser orange-racer pink+2020-09-04+170+555088-201');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('91a1d18b-b691-4362-b85f-edc6ba2a5861', 'Jordan', 'Air Jordan One', 'White/Black-Red', 'New', 'VN', 'The Jordan 1 Lows (Gradeschool) are not new to the market, and the Jordan brand continues to expand the Chicago Bull''s color palette iterations in honor of Michael Jordan''s career with the team. The Air Jordan 1 Low Bulls comes constructed in full leather with mesh tongues and lining.<br><br>The shoe''s black and red overlays provide contrast to the white base. It also has a white midsole with a rubber outsole that matches the branding in color.<br><br>The Air Jordan 1 Low Bulls were released on June 10, 2022, and retailed at $97. The Grade School (GS) version is made for smaller sizes.', 'child', 'https://images.stockx.com/images/Air-Jordan-1-Low-Bulls-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1660253137', 'Bulls (GS)', 1, '2022-03-26', 100, 'Jordan 1 Low', 'Air-Jordan-1-Low-Bulls-GS', 'Jordan 1 Low Bulls (GS)', 'sneakers+jordan+air jordan+one+white/black-red+2022-03-26+100+553560-163');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('91ad2946-0cc8-42e1-a57f-be2bc9981f73', 'New Balance', 'New Balance 2002R', 'Bone/Light Aluminum', 'New', 'CN', 'The New Balance 2002R Bone Light Aluminum sneaker features a bone-colored mesh upper with overlays of tonal bone suede and tonal bone synthetic leather.<br><br>The "N" on the quarter is a synthetic material. The tongue is tonal bone mesh and suede and the laces are bone cotton. The aluminum color appears in the "2002R" branding on the quarter, the "NB" branding on the heel, and the tab on the back of the collar. The insole is light gray with dark gray writing, the bone midsole has energy columns that are visible on the lateral side only, and the outsole is black and bone rubber.<br><br>The New Balance 2002R Bone Light Aluminum was released in September 2020 at a retail price of $140.', 'men', 'https://images.stockx.com/images/New-Balance-2002R-Bone-Light-Aluminum-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1615914171', 'Bone Light Aluminum', 1, '2020-09-01', 140, 'New Balance 2002R', 'New-Balance-2002R-Bone-Light-Aluminum', 'New Balance 2002R Bone Light Aluminum', 'sneakers+new balance+new balance+2002r+2002r+bone/light aluminum+2020-09-01+140+ml2002re');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('92072e65-8fe0-4696-9b0b-ccc62e7e8e8b', 'Nike', 'Nike Basketball Dunk', 'Tan/White', 'New', 'CN', null, 'men', 'https://images.stockx.com/images/Nike-Dunk-High-Tan-Suede-White.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1663771666', 'Tan Suede White', 1, '2022-09-17', 125, 'Nike Dunk High', 'Nike-Dunk-High-Tan-Suede-White', 'Nike Dunk High Tan Suede White', 'sneakers+nike+nike basketball+dunk+tan/white+2022-09-17+125+dq7679-001');
