INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('931d091f-8dbe-455b-868f-1cc2f981eb10', 'Nike', 'Nike SB Blazer', 'Industrial Blue/Black', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Nike-SB-Blazer-Mid-QS-Supreme-Denim-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1663957856', 'Supreme Denim', 1, '2022-09-08', 118, 'Nike SB Blazer Mid QS', 'Nike-SB-Blazer-Mid-QS-Supreme-Denim', 'Nike SB Blazer Mid QS Supreme Denim', 'sneakers+nike+nike sb+blazer+industrial blue/black+2022-09-08+118+dx8421-400');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('93681f3d-f509-4101-80f4-5ef11f198577', 'Nike', 'Air Max VaporMax', 'White/Black-Metallic Silver-White', 'New', 'VN', 'The Nike Air VaporMax 2021 FK White Black Metallic Silver is a thoughtfully crafted shoe. Notably, 40% of this sneaker is constructed from recycled materials. Its stretchy FlyKnit upper, for example, is made from recycled yarn.<br><br>Originally designed for running, this sneaker features a soft collar, webbing eyestays for a modern look, traditional lacing, and heel padding for comfort. It also features Nike Grind rubber details for increased traction and longevity and the VaporMax’s traditional TPU Clip. All these features are set atop its revolutionary VaporMax 2 Air unit.<br><br>The Nike Air VaporMax 2021 FK White Black Metallic Silver was released in June 2021 at a retail price of $200.', 'men', 'https://images.stockx.com/images/Nike-Air-VaporMax-2021-FK-White-Black-Metallic-Silver-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1653040916', 'White Black Metallic Silver', 1, '2021-06-24', 200, 'Nike Air VaporMax 2021 FK', 'Nike-Air-VaporMax-2021-FK-White-Black-Metallic-Silver', 'Nike Air VaporMax 2021 FK White Black Metallic Silver', 'sneakers+nike+air max+vapormax+white/black-metallic silver-white+2021-06-24+200+dh4084-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('93749624-dc50-4de1-82ac-198d076e85d9', 'Jordan', 'Air Jordan Other', 'Beach/Cherrywood Red', 'New', 'VN', null, 'women', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Split-Beach-Cherrywood-Red-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1668525953', 'Beach Cherrywood Red (W)', 1, null, 135, 'Jordan 1 Mid Split', 'Air-Jordan-1-Mid-Split-Beach-Cherrywood-Red-W', 'Jordan 1 Mid Split Beach Cherrywood Red (W)', 'sneakers+jordan+air jordan+other+beach/cherrywood red+135+dr0501-200');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('938c20e9-9e1b-4c45-af07-b259d6944780', 'Nike', 'Nike Dunk', 'Team Orange/Orange-Crimson Bliss', 'New', 'VN', 'The women''s Nike Dunk Low Winter Solstice (Women''s) features a unique design that nods to the low-hanging sun that accompanies the winter months.<br><br>The Nike Dunk Low Winter Solstice (W) utilizes three shades of orange that appear on the toe, toe box, mid-panel, and overlays. Aside from the tonal color blocking scheme, the silhouette features sun-ray embroideries throughout the upper. ’12.21.12’ is displayed on the tongue tag of the right shoe and the sock liner of the left, nodding to the official start of the winter solstice in the year 2021.<br><br>The women''s Nike Dunk Low Winter Solstice (W) was released in December 2021 and retailed for $200.', 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Winter-Solstice-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1655475864', 'Winter Solstice (W)', 1, '2021-12-16', 100, 'Nike Dunk Low NH', 'Nike-Dunk-Low-Winter-Solstice-W', 'Nike Dunk Low NH Winter Solstice (W)', 'sneakers+nike+nike+dunk+low+team orange/orange-crimson bliss+2021-12-16+100+do6723-800');
