INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('944bd222-fc6c-4094-8a6a-a315c12a565f', 'Jordan', 'Air Jordan Two', 'Grey Fog/Siren Red-Light Smoke Grey', 'New', 'CN', 'The Air Jordan 1 Union LA Grey Fog features a grey canvas upper with matching perforated suede overlays and mudguards. Light blue eyelets, eyestay patches, and piping add a pop of color. Matching tongues with a yellowed woven tag and exposed foam edges offer a worn-in look to this futuristic design. From there, "UN|LA" and "HO2021" external tags provide a custom feel.<br><br>The Air Jordan 1 Union LA Grey Fog released in April of 2022 and retailed for $225.', 'men', 'https://images.stockx.com/images/Air-Jordan-2-Retro-Union-Grey-Fog-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1650653257', 'Union Grey Fog', 1, '2022-04-15', 225, 'Jordan 2 Retro SP', 'Air-Jordan-2-Retro-Union-Grey-Fog', 'Jordan 2 Retro SP Union Grey Fog', 'sneakers+jordan+air jordan+two+grey fog/siren red-light smoke grey+2022-04-15+225+dn3802-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('94505eac-9a01-4e86-bbad-b77179a7a747', 'Nike', 'Nike Dunk', 'White/Venice', 'New', 'VN', 'The women''s Nike Dunk Low Venice (W) features a smooth white leather upper with light violet overlays and Swooshes. From there, matching woven tongue labels and soles complete the design.<br><br>The women''s Nike Dunk Low Venice (W) released in February of 2022 and retailed for $100.', 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Light-Violet-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1644492693', 'Venice (W)', 1, '2022-02-02', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Light-Violet-W', 'Nike Dunk Low Venice (W)', 'sneakers+nike+nike+dunk+low+white/venice+2022-02-02+100+dd1503-116');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('94647a69-08bd-4efb-87a3-be1a30808c70', 'Jordan', 'Air Jordan One', 'Wolf Grey/Black-Photon Dust-White', 'New', 'CN', 'The Jordan 1 Low Golf Wolf Grey gears the classic Jordan 1 model for the fairways. It features a tonal grey leather upper with black Swooshes and white Jordan Wings branding on the heel tab. At the base, an icy translucent outsole with grooves provides traction and stability.<br><br>The Jordan 1 Low GolfWolf Grey released in January of 2022 and retailed for $140.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-Low-Golf-Wolf-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1642105879', 'Wolf Grey', 1, '2022-01-20', 140, 'Jordan 1 Retro Low Golf', 'Air-Jordan-1-Retro-Low-Golf-Wolf-Grey', 'Jordan 1 Retro Low Golf Wolf Grey', 'sneakers+jordan+air jordan+one+wolf grey/black-photon dust-white+2022-01-20+140+dd9315-002');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('9488abea-f022-4973-92e4-3f72cc6e50e2', 'Jordan', 'Air Jordan Six', 'Medium Olive/Black-Sail-University Red', 'New', 'CN', 'Trailing the buzz of their recent collaborations, Travis Scott and Jordan Brand team up once again for the Jordan 6 Retro Travis Scott, now available on StockX. This is the fourth Air Jordan silhouette that Cactus Jack has touched. This sneaker made its mainstream debut when Travis rocked them on stage during his Super Bowl LIII performance and the rest is history.<br><br>This AJ 6 features an olive upper with black detailing and red contrasting accents on the tongue and lace locks. A side cargo pocket is displayed on the collar, giving this sneaker a design modification that makes it the first of its kind. A sail midsole, glow-in-the-dark translucent outsole, 3M detailing and both Nike Air and Cactus Jack branding on the heel completes the design. These sneakers released in October of 2019 for $250.', 'men', 'https://images.stockx.com/images/Air-Jordan-6-Retro-Travis-Scott-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1611191963', 'Travis Scott', 1, '2019-10-11', 250, 'Jordan 6 Retro', 'Air-Jordan-6-Retro-Travis-Scott', 'Jordan 6 Retro Travis Scott', 'sneakers+jordan+air jordan+six+collections-filter+nike-travis-scott+medium olive/black-sail-university red+2019-10-11+250+cn1084-200');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('94e6e5fb-da8a-42a7-9550-8e2aae036c3d', 'Jordan', 'Air Jordan One', 'Brown Basalt/Oatmeal/Summit White/Pecan', 'New', 'VN', 'The women''s Jordan 1 Mid SE Brown Basalt Oatmeal (W) features a beige tumbled leather upper with dark brown Durabuck overlays and Pecan Swooshes. The lining of the shoe is composed of a dark brown shearling fleece, offering a winterized iteration of the renowned silhouette. At the base, a white and beige Air sole completes the design.<br><br>The women''s Jordan 1 Mid SE Brown Basalt Oatmeal (W) released in March of 2022 and retailed for $130.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-Mid-SE-Brown-Basalt-Oatmeal-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1660913034', 'Brown Basalt Oatmeal (W)', 1, '2022-03-30', 130, 'Jordan 1 Mid SE', 'Air-Jordan-1-Mid-SE-Brown-Basalt-Oatmeal-W', 'Jordan 1 Mid SE Brown Basalt Oatmeal (W)', 'sneakers+jordan+air jordan+one+brown basalt/oatmeal/summit white/pecan+2022-03-30+130+do6699-200');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('9542834f-2caa-428f-bd32-2e5f362abeab', 'Nike', 'Nike Other Training', 'Coriander/Ashen Slate-Wheat-Light Sienna', 'New', 'VN', 'The Nike Air Trainer 1 SP Coriander infuses Nike’s 1987 cross trainer silhouette with a mix of colors, patterns, and materials.<br><br>The Nike Air Trainer 1 SP Coriander features a fabric upper with synthetic overlays, along with perforations in the toebox and heel. Reflective 3M accents highlight the shoe and surround the quarter panel Swoosh that partially covers an iridescent plastic window. An orange forefoot buckle matches the orange laces. The yellow midsole has a hidden Air unit and the gray outsole has blue and red speckles throughout.    <br><br>The Nike Air Trainer 1 SP Coriander was released on February 11, 2022 for $150 retail.', 'men', 'https://images.stockx.com/images/Nike-Air-Trainer-1-SP-Coriander-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1642599578', 'Coriander', 1, '2022-02-11', 150, 'Nike Air Trainer 1 SP', 'Nike-Air-Trainer-1-SP-Coriander', 'Nike Air Trainer 1 SP Coriander', 'sneakers+nike+nike other+training+coriander/ashen slate-wheat-light sienna+2022-02-11+150+dh7338-300');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('955862fd-3e63-4121-be67-5325cd1afe18', 'Jordan', 'Air Jordan Nine', 'Military Brown/Legion Green-University Red-Black', 'New', 'CN', null, 'men', 'https://images.stockx.com/images/Air-Jordan-9-Retro-Boot-Military-Brown.png?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1608519588', 'Military Brown Legion Green', 1, '2018-10-13', 225, 'Jordan 9 Retro Boot NRG', 'Air-Jordan-9-Retro-Boot-Military-Brown', 'Jordan 9 Retro Boot Military Brown', 'sneakers+jordan+air jordan+nine+military brown/legion green-university red-black+2018-10-13+225+ar4491-200');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('95a7f08e-49a1-4293-be5d-3442cdcc60c3', 'Nike', 'Nike Dunk', 'Racer Blue/Racer Blue Coconut', 'New', 'VN', 'Nike releases the Nike Dunk Low Jackie Robinson (GS) for grade schoolers to celebrate the 75th Anniversary since Jackie Robinson started at first base for the Brooklyn Dodgers.<br><br>Dressed in a Dodgers color blocking, the Nike Dunk Low Jackie Robinson (GS) for grade schoolers features unique details such as his number #42 on the heels and the quote, "I’m not concerned with your liking or disliking me. All I ask is that you respect me as a human being" on the insoles. Other details include a special 75th Anniversary logo on the tongues, baseball stitched laces atop a white midsole and black rubber sole.<br><br>The Nike Dunk Low Jackie Robinson (GS) for grade schoolers was released in May 2022 and retailed for $110.', 'child', 'https://images.stockx.com/images/Nike-Dunk-Low-Jackie-Robinson-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1660143640', 'Jackie Robinson (GS)', 1, '2022-07-19', 115, 'Nike Dunk Low', 'Nike-Dunk-Low-Jackie-Robinson-GS', 'Nike Dunk Low Jackie Robinson (GS)', 'sneakers+nike+nike+dunk+low+racer blue/racer blue coconut+2022-07-19+115+dv2203-400');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('95d18fb5-f608-42fe-82b3-a2b8763a9fe4', 'Jordan', 'Air Jordan Five', 'Varsity Red/Black-White', 'New', 'CN', '2021 marked 12 years since the Air Jordan 5 Defining Moments pack dropped, and in the same year, one-half of that pack resurfaced on the SNKRS app. <br><br>The Air Jordan 5 Raging Bulls is a suede lover’s dream, bringing back the same look and feel from the 2009 version. The upper is composed entirely out of red suede, celebrating MJ’s tenure with the Chicago Bulls. From there, a red and black embroidered "23" appears on the lateral side of each shoe’s heel, highlighting Jordan’s quintessential jersey number. In usual Jordan 5 fashion, the upper part of the tongue is made of reflective materials with a contrasting black Jumpman logo. Lastly, the model’s World War II fighter jet inspiration is made apparent from the white and red shark tooth details that lay atop a black midsole. <br><br>The Air Jordan 5 Raging Bulls released in April of 2021 for $190.', 'men', 'https://images.stockx.com/images/Air-Jordan-5-Retro-Raging-Bulls-Red-2021-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1616603755', 'Raging Bull Red (2021)', 1, '2021-04-10', 190, 'Jordan 5 Retro', 'Air-Jordan-5-Retro-Raging-Bulls-Red-2021', 'Jordan 5 Retro Raging Bull Red (2021)', 'sneakers+jordan+air jordan+five+varsity red/black-white+2021-04-10+190+dd0587-600');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('95e0ff50-e5f8-4fed-88b8-1ebf5cd839ae', 'Nike', 'Air Jordan One', 'Black/Black/Black', 'New', 'CN', 'The Air Jordan 1 Mid Triple Black is a mid-cut design of the OG Air Jordan 1. Composed of a leather upper on top of a hardened rubber outsole, this shoe has a monochromatic look, as every part of the shoe, from the laces to the Swooshes, is black. Created with basketball players in mind, it boasts a cushioned midsole and ankle support.<br><br>The Air Jordan 1 Mid Triple Black was released as part of the 2020 first-quarter Jordan Brand collection on March 24. At the time of its release, this shoe had a retail price of $115.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Triple-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1644311412', 'Triple Black', 1, '2020-03-24', 115, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Triple-Black', 'Jordan 1 Mid Triple Black', 'sneakers+nike+air jordan+one+black/black/black+2020-03-24+115+554724-091');
