INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('96588850-48bb-4ac4-b69a-19883da8b4d8', 'Jordan', 'Air Jordan One', 'Volt/Black/Sail', 'New', 'CN', 'The Air Jordan 1 High Visionaire features a smooth white leather upper with black leather collars, neon yellow overlays, and black Swooshes. A classic Jordan Wings logo at the collar and Nike woven tongue labels nod to the OG 1985 design. From there, an off-white and black Air sole adds the finishing touch.<br><br>The Air Jordan 1 High Visionaire released in June of 2022 and retailed for $170.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-OG-Visionaire-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1655385644', 'Visionaire', 1, '2022-06-11', 170, 'Jordan 1 Retro High OG', 'Air-Jordan-1-Retro-High-OG-Visionaire', 'Jordan 1 Retro High OG Visionaire', 'sneakers+jordan+air jordan+one+volt/black/sail+2022-06-11+170+555088-702');
