INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('97abd082-288d-47e1-9cad-13110774933d', 'Jordan', 'Air Jordan Eleven', 'Black/White-Varsity Red', 'New', 'VN', '<b>Please Note: Both plastic shoe trees are required for verification.<b> <br>Jordan Brand brings back a monument of Jordan hype with the Air Jordan 11 Retro Playoffs Bred, now available on StockX. These sneakers represent MJ’s comeback from retirement to win his fourth title with the Chicago Bulls and the 1996 Finals MVP. This is the fourth time this colorway has been retroed since it’s original debut.<br><br>This Jordan 11 features a black upper with shiny patent leather overlays and red detailing. A red translucent outsole, white midsole, and "23" insignia on the heel completes the design. These sneakers released in November of 2019 and retailed for $220.', 'men', 'https://images.stockx.com/images/Air-Jordan-11-Retro-Playoffs-2019-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606320266', 'Playoffs Bred (2019)', 1, '2019-12-14', 220, 'Jordan 11 Retro', 'Air-Jordan-11-Retro-Playoffs-2019', 'Jordan 11 Retro Playoffs Bred (2019)', 'sneakers+jordan+air jordan+eleven+black/white-varsity red+2019-12-14+220+378037-061');
