INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('988d4692-904f-4987-af96-b7bf2fac2381', 'Nike', 'Nike Dunk', 'Blue/Purple-Pink', 'New', 'VN', 'Arriving in a pastel palette similar to Easter Eggs, the women''s Nike Dunk Low Easter features a light grey smooth leather upper with light purple overlays and faint pink Swooshes. A woven Nike tongue tag and embroidered heel tab adds a vintage look. From there, an off-white and purple foam sole completes the design.<br><br>The women''s Nike Dunk Low Easter released in April of 2022 and retailed for $110.', 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Easter-2022-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1648741007', 'Easter 2022 (W)', 1, '2022-04-17', 110, 'Nike Dunk Low', 'Nike-Dunk-Low-Easter-2022-W', 'Nike Dunk Low Easter 2022 (W)', 'sneakers+nike+nike+dunk+low+blue/purple-pink+2022-04-17+110+dd1503-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('98fb3c6f-c5ed-480e-9dc0-b55978d1bdbe', 'New Balance', 'New Balance 2002R', 'Vintage Orange/Marigold', 'New', 'VN', 'The New Balance 2002R Protection Pack Vintage Orange remains the best-selling variant of the original 2002 Luxury Kick since its debut.<br><br>The vintage yellow upper of the shoe is created using suede, premium mesh, and leather as the main materials. The foam tongue topping the classic abzorb midsole with cotton laces rounds up the design of New Balance 2002R Protection Pack Vintage Orange. The N-energy outsole of the shoe is made of salt water white rubber.<br><br>New Balance 2002R Protection Pack Vintage Orange was first released in August 2022 at select retailers in Europe and Asia at a price of $150.', 'men', 'https://images.stockx.com/images/New-Balance-2002R-Protection-Pack-Vintage-Orange-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1659335155', 'Protection Pack Vintage Orange', 1, '2022-09-29', 150, 'New Balance 2002R', 'New-Balance-2002R-Protection-Pack-Vintage-Orange', 'New Balance 2002R Protection Pack Vintage Orange', 'sneakers+new balance+new balance+2002r+vintage orange/marigold+2022-09-29+150+m2002rde');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('99761f06-6f2d-455c-99cb-1ee03c25a879', 'Nike', 'Nike Basketball Dunk', 'Pink/Pink', 'New', 'ID', 'Since its first release, the Nike Dunk Low Triple Pink (Preschool) remains one of the high-selling variants of the Nike Dunk Low series.<br><br>The upper of Nike Dunk Low Triple Pink (Preschool) is constructed with white-based leather featuring pink overlays of synthetic leather made from recycled polyester material. The toe box is made of white perforated leather. Its pull tab, which is embroidered with the symbol of "NIKE," is also constructed using pink synthetic leather. The midsole and outsole of the Nike Dunk Low Triple Pink (Preschool) are made of pink and white rubber.<br><br>Nike Dunk Low Triple Pink (Preschool) was first released on September 13, 2022, at a price of $85.', 'child', 'https://images.stockx.com/images/Nike-Dunk-Low-Triple-Pink-PS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1661784100', 'Triple Pink (PS)', 1, '2022-09-13', 65, 'Nike Dunk Low', 'Nike-Dunk-Low-Triple-Pink-PS', 'Nike Dunk Low Triple Pink (PS)', 'sneakers+nike+nike basketball+dunk+pink/pink+2022-09-13+65+dh9756-600');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('9997dc5a-26dc-4475-85d6-1e2f3637e5b4', 'adidas', 'adidas Yeezy', 'Desert Sand/Desert Sand/Desert Sand', 'New', 'CN', 'The adidas Yeezy Foam RNR Desert Sand arrives with a Desert Sand, oval-cut foam construction made of part EVA and algae. From there, a cushioned footbed offers comfort and support, while a sculptural sole with deep treads provides traction.<br><br>The adidas Yeezy Foam RNR Desert Sand released in June of 2022 and retailed for $80.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Foam-RNR-Desert-Sand-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1655490868', 'Desert Sand', 1, '2022-06-11', 80, 'adidas Yeezy Foam RNR', 'adidas-Yeezy-Foam-RNR-Desert-Sand', 'adidas Yeezy Foam RNR Desert Sand', 'sneakers+adidas+adidas+yeezy+foam rnnr+desert sand/desert sand/desert sand+2022-06-11+80+gv6843');
