INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('9a140894-0b62-48dc-bb31-d2017f403d6d', 'New Balance', 'New Balance 550', 'White/Mint Green', 'New', 'VN', 'The New Balance 550 White Mint Green is a low-top sneaker that features a mixed colorway of white and mint green.<br><br>White is the dominating color with hints of mint green on the sole, tongue, rear, and sides. The shoe has a lace-up closure style with white laces and the New Balance logo on the tongue. The side profile of the New Balance 550 White Mint Green features a perforated design with tiny holes as well as the "N" logo on both sides and the number "550" on the outer sides.<br><br>The New Balance 550 White Mint Green was released in March 2022 at the retail price of $100.', 'men', 'https://images.stockx.com/images/New-Balance-550-White-Mint-Green-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1651519339', 'White Mint Green', 1, '2022-03-14', 100, 'New Balance 550', 'New-Balance-550-White-Mint-Green', 'New Balance 550 White Mint Green', 'sneakers+new balance+new balance+550+white/mint green+2022-03-14+100+bb550fs1');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('9a4d44f9-4b16-4abc-ba58-c0db340ee791', 'Jordan', 'Air Jordan One', 'Varsity Red/Black-Sail-Muslin', 'New', 'CN', 'The original Air Jordan 1 Chicago colorway was first introduced in 1985 and has only been retroed a few times since. But 2022 is the year that the colorway returns with an added vintage look. Pre-yellowed accents and cracked leather uppers showcase a fabricated look of age and wear. The Air Jordan 1 Lost and Found Chicago released in November of 2022 for $180.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-OG-Chicago-Reimagined-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1665691099', 'Chicago Lost and Found', 1, '2022-11-19', 180, 'Jordan 1 Retro High OG', 'Air-Jordan-1-Retro-High-OG-Chicago-Reimagined', 'Jordan 1 Retro High OG Chicago Lost and Found', 'sneakers+jordan+air jordan+one+chicago+chicago 1+varsity red/black-sail-muslin+2022-11-19+180+dz5485-612');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('9ae53776-f55c-413f-8520-ee36cd69584d', 'Jordan', 'Air Jordan Other', 'Black/Metallic Silver-Signal Blue-Siren Red-Green Glow', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Air-Jordan-Luka-1-Neo-Turquoise-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1665498619', 'Neo Turquoise', 1, '2022-10-07', 110, 'Jordan Luka 1', 'Air-Jordan-Luka-1-Neo-Turquoise', 'Jordan Luka 1 Neo Turquoise', 'sneakers+jordan+air jordan+other+black/metallic silver-signal blue-siren red-green glow+2022-10-07+110+dn1771-104/dn1772-104');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('9afe1fe7-1df0-4503-99a1-7adf472657bc', 'Jordan', 'Air Jordan Three', 'Muslin/University Red-Cement Grey-Sail', 'New', 'CN', 'The Air Jordan 3 Muslin features a heavy-duty canvas upper with grey suede overlays and cream TPU eyestays. At the heel, a matching cream heel tab with a red Jumpman logo adds contrast to the neutral tones prominent throughout the design. From there, a white and grey Air Max sole completes the design.<br><br>The Air Jordan 3 Muslin released in March of 2022 and retailed for $200.', 'men', 'https://images.stockx.com/images/Air-Jordan-3-Retro-Muslin-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1648503692', 'Muslin', 1, '2022-03-25', 200, 'Jordan 3 Retro', 'Air-Jordan-3-Retro-Muslin', 'Jordan 3 Retro Muslin', 'sneakers+jordan+air jordan+three+muslin/university red-cement grey-sail+2022-03-25+200+dh7139-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('9b30cf8d-59c8-4c5f-87af-754758eff374', 'Nike', 'Air Max One', 'Orange/Cream/Yellow-Green', 'New', 'VN', null, 'women', 'https://images.stockx.com/images/Nike-Air-Max-1-PRM-Somos-Familia-Updated.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1666715736', 'Somos Familia (W)', 1, '2022-10-23', 130, 'Nike Air Max 1 PRM', 'Nike-Air-Max-1-PRM-Somos-Familia', 'Nike Air Max 1 PRM Somos Familia (W)', 'sneakers+nike+air max+one+mxscavengerhunt+orange/cream/yellow-green+2022-10-23+130+dz5352-847');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('9b4dc2fc-c061-43b1-85e3-1a8785d03402', 'Nike', 'LeBron Other', 'White/Yellow-Teal-Red', 'New', 'CN', 'First seen on the 2009 Nike Zoom LeBron 6, the Stewie Griffin colorway returned in all of its cartoonish glory for the Nike LeBron 18 Low Stewie Griffin.<br><br.The Nike LeBron 18 Low Stewie Griffin draws inspiration from Family Guy''s infant star Stewie Griffin. Its red, blue, yellow, white, and black color scheme and graphics portray the character''s signature overalls and shirt. On the performance end, a white React sole and a 270 Air heel unit provide cushioning for enhanced stability.<br><br>The Nike LeBron 18 Low Stewie Griffin released in September of 2021 and retailed for $160.', 'men', 'https://images.stockx.com/images/Nike-Lebron-18-Low-Stewie-Griffin-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1643118853', 'Stewie Griffin', 1, '2021-09-03', 160, 'Nike LeBron 18 Low', 'Nike-Lebron-18-Low-Stewie-Griffin', 'Nike LeBron 18 Low Stewie Griffin', 'sneakers+nike+lebron+other+cartoon art+white/yellow-teal-red+2021-09-03+160+cv7564-104/cv7562-104');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('9c4b9e76-cb7a-4466-9d5d-ff8ec2a0e732', 'Jordan', 'Air Jordan Four', 'White/Midnight Navy/Light Smoke Grey/Fire Red', 'New', 'ID', null, 'toddler', 'https://images.stockx.com/images/Air-Jordan-4-Retro-Midnight-Navy-TD-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1669100502', 'Midnight Navy (TD)', 1, '2022-10-29', 70, 'Jordan 4 Retro', 'Air-Jordan-4-Retro-Midnight-Navy-TD', 'Jordan 4 Retro Midnight Navy (TD)', 'sneakers+jordan+air jordan+four+white/midnight navy/light smoke grey/fire red+2022-10-29+70+bq7670-140');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('9c50c484-1eda-4a58-9777-6c94ffcaf797', 'Nike', 'Air Max 95', 'Black/Dark Beetroot-Pearl Grey', 'New', 'VN', 'While originally designed for more powerful runners, the Nike Air Max 95 Dark Beetroot sneaker, and brainchild of Sergio Lozano.<br><br>The Nike Air Max 95 Dark Beetroot silhouette boasts a black-to-grey gradient on the upper, black and white mesh panel eye stays, and burgundy-colored lace loops. To complete the anatomy-inspired aesthetic are mini Swoosh embroideries on the heel, "Air Max" labeling on the tongue, and an air bubble on the midsoles. It has dark burgundy hit with cutting-edge, anatomy-inspired aesthetics.<br><br>The Nike Air Max 95 Dark Beetroot sneaker was released in September 2022, retailing at $185.', 'men', 'https://images.stockx.com/images/Nike-Air-Max-95-Dark-Beetroot-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1660660780', 'Dark Beetroot', 1, '2022-07-12', 185, 'Nike Air Max 95', 'Nike-Air-Max-95-Dark-Beetroot', 'Nike Air Max 95 Dark Beetroot', 'sneakers+nike+air max+95+black/dark beetroot-pearl grey+2022-07-12+185+dq9001-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('9cc8eab5-5e02-4119-85c1-bb890aef0d7f', 'Nike', 'Nike Dunk', 'White/Orange', 'New', 'CN', 'Nike celebrated the 35th Anniversary of the Nike Dunk by releasing the Nike Dunk Low SP Syracuse (2020), now available on StockX. The Nike Dunk debuted as part of the 1985 Nike College Color’s program, a program that delivered footwear in the school colors of 12 popular basketball programs allowing fans to support their favorite teams from head to toe. This Syracuse colorway was among the first collegiate colorways Nike released, breaking the mold for colorways used on basketball shoes.<br><br>This Nike Dunk Low SP is composed of a white leather upper with orange blaze leather overlays. A white midsole, orange outsole, and classic Nike branding on the tongue complete the design. These sneakers released in March of 2020 and retailed for $100.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-SP-Syracuse-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1666939629', 'Syracuse (2020/2022)', 1, '2020-03-14', 100, 'Nike Dunk Low SP', 'Nike-Dunk-Low-SP-Syracuse', 'Nike Dunk Low SP Syracuse (2020/2022)', 'sneakers+nike+nike+dunk+low+white/orange+2020-03-14+100+cu1726-101');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('9cc9cf55-947d-4adc-978a-2582a6bc38ca', 'Jordan', 'Air Jordan One', 'Washed Teal/Mint Foam-White', 'New', 'ID', 'The Air Jordan 1 Mid Island Green (Women''s) is another colorway of the Air Jordan 1 sneakers that first made their debut in 1985.<br><br>They are high-top sneakers with a lace-up closure design with white laces. The primary color of the shoe is white with island green highlights on the sides where the laces go through, round the heel of the shoe, and at the front where the sole is attached. The Air Jordan 1 Mid Island Green (Women''s) also has the Nike Swoosh on the side, the Air Jordan logo on the outer ankle, and the Jumpman logo on the tongue.<br><br>The Air Jordan 1 Mid Island Green (Women''s) was released for retail at the price of $115 in July 2020.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Island-Green-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1654858683', 'Washed Teal (W)', 1, '2022-07-22', 115, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Island-Green-W', 'Jordan 1 Mid Washed Teal (W)', 'sneakers+jordan+air jordan+one+washed teal/mint foam-white+2022-07-22+115+dv2229-300');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('9cef4a34-e238-4f5d-8dc9-35a1718fd1a2', 'Nike', 'Nike Dunk', 'Racer Blue/White', 'New', 'VN', 'The Nike Dunk Low Racer Blue White features a smooth Racer Blue leather upper with contrasting white leather overlays and Swooshes. A woven Nike tongue tag and heel embroidery nod to the original stylings of the 1985 Nike Dunk. At the base, a matching EVA foam sole completes the design.<br><br>The Nike Dunk Low Racer Blue White released in 2022 and retailed for $100.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Racer-Blue-White-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1654154937', 'Racer Blue White', 1, '2022-09-03', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Racer-Blue-White', 'Nike Dunk Low Racer Blue White', 'sneakers+nike+nike+dunk+low+racer blue/white+2022-09-03+100+dd1391-401');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('9d00688c-31bd-445c-8748-dfdde4fcf1a0', 'Nike', 'Nike Other Other', 'Beige/Sail-Brown-Gum', 'New', 'VN', 'French designer Simon Porte Jacquemus teamed up with Nike for a luxe take on the hiking-friendly Nike Air Humara.<br><br>The women''s Nike Air Humara LX Jacquemus Beige is constructed of a smooth light beige leather upper with brown hairy suede overlays and striped exterior ribbons. A pendant-like golden Nike mini Swoosh graces each side of the upper in an elegant fashion. At the base, a sculptural, jagged gum outsole is versatile enough for the streets and the trails.<br><br>The women''s Nike Air Humara LX Jacquemus Beige released in June of 2022.', 'women', 'https://images.stockx.com/images/Nike-Air-Humara-LX-Jacquemus-Beige-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1657005041', 'Jacquemus Light Bone Gold (W)', 1, '2022-06-28', 170, 'Nike Air Humara LX', 'Nike-Air-Humara-LX-Jacquemus-Beige-W', 'Nike Air Humara LX Jacquemus Light Bone Gold (W)', 'sneakers+nike+nike other+other+beige/sail-brown-gum+2022-06-28+170+dr0420-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('9d74b899-cec1-407f-8901-5f41215f8d60', 'Nike', 'Nike Other Other', 'White/Blue/Red', 'New', 'VN', 'The summer- rotation-designed Nike Air Griffey Max 1 USA 2022 was unveiled as one of the sneaker community’s cornerstone Nike Air Griffey Max offerings in June 2022.<br><br>Nike Air Griffey Max 1 USA 2022 is dressed in a red, white, and blue colorway. The sneaker’s patriotic flair is provided by adopting a combination of a tumbled white leather base with the royal blue nubuck overlays on the forefoot straps. The shoe’s Swooshes, eyestays, Air support panels, outsole tread, and strap hardware feature royal blue accents. The visible elastic white laces on the white tongue complete the sneaker’s design.<br><br>During its release in June 2022, Nike Air Griffey Max 1 USA 2022 retailed at $170.', 'men', 'https://images.stockx.com/images/Nike-Air-Griffey-Max-1-USA-2022-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1655918844', 'USA (2022)', 1, '2022-06-24', 170, 'Nike Air Griffey Max 1', 'Nike-Air-Griffey-Max-1-USA-2022', 'Nike Air Griffey Max 1 USA (2022)', 'sneakers+nike+nike other+other+white/blue/red+2022-06-24+170+dx3723-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('9db8bbb1-73be-4570-b39b-baf0a18ffc44', 'Nike', 'Dunk Low', 'Light Iron Ore/Black/White/University Red', 'New', 'ID', null, 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Light-Iron-Ore-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1668755060', 'Light Iron Ore (W)', 1, null, 120, 'Nike Dunk Low', 'Nike-Dunk-Low-Light-Iron-Ore-W', 'Nike Dunk Low Light Iron Ore (W)', 'sneakers+nike+dunk+low+light iron ore/black/white/university red+120+dq7576-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('9dc9c3ed-aa13-46c7-b63b-c60bd9a1c285', 'Jordan', 'Air Jordan One', 'Light Iron Ore/Atmosphere-White', 'New', 'VN', 'The Air Jordan 1 Mid SE Light has white laces and a white tongue. At the top of the tongue, you will find the Air Jordan symbol in grey.<br><br>The Air Jordan 1 Mid SE Light Iron Ore W has a light grey outsole, with a bright white midsole on top. A mixture of pebbled leather and canvas-like fabric is used for the rest of the body. Grey canvas panels are carefully placed on the sides, surrounding the pink leather Nike swoosh symbol.<br><br>The Air Jordan 1 Mid SE Light Iron Ore (W) for women was initially released in February of 2022. The starting retail price for this shoe model was $135.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-Mid-SE-Light-Iron-Ore-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1645115307', 'Light Iron Ore (W)', 1, '2022-02-08', 120, 'Jordan 1 Mid SE', 'Air-Jordan-1-Mid-SE-Light-Iron-Ore-W', 'Jordan 1 Mid SE Light Iron Ore (W)', 'sneakers+jordan+air jordan+one+light iron ore/atmosphere-white+2022-02-08+120+dn4045-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('9e1a2f89-a3c4-4e10-ab59-4178fd4c3c3f', 'Jordan', 'Air Jordan One', 'Black/Gym Red-Particle Grey', 'New', 'VN', 'The Jordan 1 Mid Shadow Red features a grey smooth leather upper with black overlays and Swooshes. At the collar, a debossed red Air Jordan Wings logo nods to the original Air Jordan 1 design. From there, a woven Jumpman tongue tag, white midsole, and black outsole complete the design.<br><br>The Jordan 1 Mid Shadow Red released in October of 2021 and retailed for $120.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Shadow-Red-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1634306214', 'Shadow Red', 1, '2021-10-06', 120, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Shadow-Red', 'Jordan 1 Mid Shadow Red', 'sneakers+jordan+air jordan+one+black/gym red-particle grey+2021-10-06+120+554724-096');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('9e2685be-53b7-4a60-94d3-21d5e0776b59', 'adidas', 'adidas Yeezy', 'Mono Ice/Mono Ice/Mono Ice', 'New', 'CN', 'The adidas Yeezy 350 V2 Mono Ice is one of three from the Mono pack. Each sneaker’s upper is constructed from a new monofilament mesh in Ice blue that exposes the model’s inner cage lining. The Mono pack brings back the heel’s pull tab design on each pair. To finish it out, a familiar Boost sole is added for comfort for the wearer.<br><br>The adidas Yeezy 350 V2 Mono Ice released in June of 2021 for $220, exclusively in the US. ', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Boost-350-V2-Mono-Ice-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1624459930', 'Mono Ice', 1, '2021-06-18', 220, 'adidas Yeezy Boost 350 V2', 'adidas-Yeezy-Boost-350-V2-Mono-Ice', 'adidas Yeezy Boost 350 V2 Mono Ice', 'sneakers+adidas+adidas+yeezy+350+v2+mono ice/mono ice/mono ice+2021-06-18+220+gw2869');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('9ee080b0-305d-4846-a5af-acf438aaad7a', 'adidas', 'adidas Yeezy', 'Reflective/Steeple Grey/Solar Red', 'New', 'CN', 'One of Yeezy''s most celebrated designs received a reflective makeover with the adidas Yeezy Boost 350 V2 Beluga Reflective.<br><br>The adidas Yeezy Boost 350 V2 Beluga Reflective builds off of the original Beluga colorway by adding reflective qualities and speckled orange accents to its Primeknit upper. Signature details like a Boost sole and orange side stripe complete the design.<br><br>The adidas Yeezy Boost 350 V2 Beluga Reflective released in December of 2021 and retailed for $240.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Boost-350-V2-Beluga-Reflective-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1638996919', 'Beluga Reflective', 1, '2021-12-18', 240, 'adidas Yeezy Boost 350 V2', 'adidas-Yeezy-Boost-350-V2-Beluga-Reflective', 'adidas Yeezy Boost 350 V2 Beluga Reflective', 'sneakers+adidas+adidas+yeezy+350+v2+reflective/steeple grey/solar red+2021-12-18+240+gw1229');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('9f6d3536-d252-44e9-beb3-259a77282b25', 'Jordan', 'Air Jordan Three', 'Black/Silver/White/Pine Green', 'New', 'CN', 'The Air Jordan 3 Retro Pine Green GS takes the classic 1988 design and adds a host of new touches.<br><br>These Air Jordan 3 Retro Pine Green GS shoes offer unique features such as elephant-print overlays with a very unique pine green color on the heel. You will also find these striking green accents on the eyelets as well and they also feature a perforated leather collar. Of course, no Air Jordan 3 would be complete without the Jumpman logo on the tongue of the shoe. You will also find a smaller version of this logo on the heel of the shoes.<br><br>With a release date of October 2021, these shoes retailed at a price of $140.', 'child', 'https://images.stockx.com/images/Air-Jordan-3-Retro-Pine-Green-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1635357797', 'Pine Green (GS)', 1, '2021-10-30', 140, 'Jordan 3 Retro', 'Air-Jordan-3-Retro-Pine-Green-GS', 'Jordan 3 Retro Pine Green (GS)', 'sneakers+jordan+air jordan+three+black/silver/white/pine green+2021-10-30+140+398614-030');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('9f76e1d2-b3a2-4783-9d5c-b1fd2761430b', 'Nike', 'Kobe Six', 'Green Apple/Volt-Crimson-Black', 'New', 'CN', 'Nike opened a new chapter at the end of 2020 and refreshed the Kobe 6 design with the Nike Kobe 6 Protro Grinch. The Kobe 6 Grinch originally debuted in 2011 when Kobe Bryant’s Los Angeles Lakers faced LeBron James’ Miami Heat in a legendary match up on Christmas Day. This is the first Kobe 6 to receive the Kobe Protro treatment, a design process that takes classic Kobe designs and updates them with modern tech for improved performance.<br><br>At a first glance, the Nike Kobe 6 Grinch looks identically like the OG pair from 2011: it features a Green Apple and Volt textured, snake-inspired upper as a tribute to Kobe’s Black Mamba moniker. A black Swoosh, red Kobe branding on the tongue, and green translucent outsole accentuate the shoe’s reptile theme. But, because this is a Protro, there are some differences. The updated Kobe 6 Grinch arrives with a more responsive Zoom Air cushioning system and scaled-down traction for an improved court feel. The silhouette shape is even altered to provide a lower, sleeker fit. <br><br>The Nike Kobe 6 Grinch released in December of 2020 and retailed for $180. ', 'men', 'https://images.stockx.com/images/Nike-Kobe-6-Protro-Grinch-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1611766717', 'Grinch (2020)', 1, '2020-12-24', 190, 'Nike Kobe 6 Protro', 'Nike-Kobe-6-Protro-Grinch', 'Nike Kobe 6 Protro Grinch (2020)', 'sneakers+nike+kobe+six+green apple/volt-crimson-black+2020-12-24+190+cw2190-300');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('9fcad3b5-02b4-4ea3-a9c9-1efda1a831ef', 'UGG', 'UGG Boots', 'Black', 'New', 'CN', null, 'women', 'https://images.stockx.com/images/UGG-Classic-Ultra-Mini-Black-W.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1636063631', 'Black (W)', 1, null, 140, 'UGG Classic Ultra Mini', 'UGG-Classic-Ultra-Mini-Black-W', 'UGG Classic Ultra Mini Black (W)', 'sneakers+ugg+ugg+boots+black+140+1116109');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('9ff22a11-8c30-4798-a774-392337b879de', 'Jordan', 'Air Jordan One', 'Taxi/White-Black', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Air-Air-Jordan-1-Mid-Taxi-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1663095195', 'Taxi', 1, '2022-08-20', 125, 'Air Jordan 1 Mid', 'Air-Air-Jordan-1-Mid-Taxi', 'Air Jordan 1 Mid Taxi', 'sneakers+jordan+air jordan+one+taxi/white-black+2022-08-20+125+554724-701');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('9ff7f8c7-b45e-4791-bd8f-54111a199f71', 'Jordan', 'Air Jordan One', 'White/Wolf Grey', 'New', 'VN', 'The women''s Jordan 1 Low LV8D Wolf Grey (W) arrives in a smooth white leather construction with Wolf Grey overlays and Swooshes. At the heel, an embroidery appearing as an outline of the Jordan Wings logo adds a modern feel. From, a thick platform Air sole at the base completes the design.<br><br>The women''s Jordan 1 Low LV8D Wolf Grey (W) released in February of 2022 and retailed for $140.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-Low-LV8D-Elevated-Wolf-Grey-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1646409732', 'Wolf Grey (W)', 1, '2022-02-19', 140, 'Jordan 1 Elevate Low', 'Air-Jordan-1-Low-LV8D-Elevated-Wolf-Grey-W', 'Jordan 1 Elevate Low Wolf Grey (W)', 'sneakers+jordan+air jordan+one+white/wolf grey+2022-02-19+140+dh7004-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a0e50548-e73c-46e8-a5f0-a2e211e5cbc1', 'Jordan', 'Air Jordan Six', 'University Blue/White/College Navy/Black', 'New', 'VN', 'Jordan Brand drew inspiration from Michael Jordan''s alma mater, the University of North Carolina, for the Air Jordan 6 Retro UNC White. <br><br>Constructed with University Blue Durabuck and white leather, the Air Jordan 6 Retro UNC White utilizes color blocking reminiscent of the renowned Jordan 6 Carmine. Hits of navy blue on the tongue and midsole integrate UNC''s lesser known school color. At the heel, a Jordan Team patch nod to the jock tags that are stitched to the bottom of UNC''s uniforms. From there, an icy semi-translucent Air sole completes the design.<br><br>The Air Jordan 6 Retro UNC White released in March of 2022 and retailed for $210.', 'men', 'https://images.stockx.com/images/Air-Jordan-6-Retro-UNC-White-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1646233940', 'UNC White', 1, '2022-03-05', 210, 'Jordan 6 Retro', 'Air-Jordan-6-Retro-UNC-White', 'Jordan 6 Retro UNC White', 'sneakers+jordan+air jordan+six+university blue/white/college navy/black+2022-03-05+210+ct8529-410');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a18844f1-6bea-4927-9f13-506f3ac021ab', 'Crocs', 'Crocs Collaborations', 'Orange/Green', 'New', 'CN', 'Inspired by Anwar Carrot’s Garden of style and innovation, Crocs Classic All-Terrain Clog Carrots features a streetwear fashion force.<br><br>The Crocs Classic All-Terrain Clog Carrots carries Carrot’s signature Orange blended with green accents and three removable carrot charms. The shoe features adjustable rugged turbo backstraps and back oversized "Carrots" branding split between each foot in large white font. It also features a rugged lug outsole with an enhanced tread. Its upper is made of fully molded Croslite foam and ventilation ports for breathability. The crocs feature customizable Jibbitz charms.<br><br>The Crocs All Terrain Clog Carrots were released in September 2020 at a retail price of $59.', 'men', 'https://images.stockx.com/images/Crocs-All-Terrain-Clog-Carrots-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1610080329', 'Carrots', 1, '2020-09-17', 60, 'Crocs Classic All-Terrain Clog', 'Crocs-All-Terrain-Clog-Carrots', 'Crocs All-Terrain Clog Carrots', 'sneakers+crocs+crocs+collaborations+crocs collaborations+orange/green+2020-09-17+60+207266-810');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a1cb8abf-13fd-4573-9ee0-f4e20435942c', 'Jordan', 'Air Jordan One', 'Black/White-Game Royal-Black', 'New', 'CN', 'Jordan Brand adds a twist to a classic with the Jordan 1 Retro High Royal Toe, now available on StockX. Releases like the Shattered Backboard 1 and Bred Toe have shifted all eyes on Jordan’s "Black Toe" inspired colorways. The Royal Toe takes inspiration from the original Jordan 1 Royal colorway (which released in 1985) and adds design elements of the Black Toe 1 to create a familiar, but new dialogue.<br><br>This AJ 1 features a white and royal leather upper with black leather overlays and detailing. A white midsole, royal outsole, and branded leather tongue tag completes this design. These sneakers released in May of 2020 and retailed for $170 USD.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-Black-Game-Royal-Toe-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606322574', 'Royal Toe', 1, '2020-05-09', 170, 'Jordan 1 Retro High', 'Air-Jordan-1-Retro-High-Black-Game-Royal-Toe', 'Jordan 1 Retro High Royal Toe', 'sneakers+jordan+air jordan+one+black/white-game royal-black+2020-05-09+170+555088-041');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a1cbd5fd-d5e7-4251-96f2-755b8628807a', 'New Balance', 'New Balance 550', 'White/Grey', 'New', 'CN', null, 'child', 'https://images.stockx.com/images/New-Balance-550-White-Grey-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1661522583', 'White Grey (GS)', 1, '2022-07-13', 80, 'New Balance 550', 'New-Balance-550-White-Grey-GS', 'New Balance 550 White Grey (GS)', 'sneakers+new balance+new balance+550+white/grey+2022-07-13+80+gsb550pb');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a28402f6-b6fa-4cb7-a541-6fdabe6e932c', 'Nike', 'Nike Other Running', 'Black/Anthracite/Elemental Gold/White', 'New', 'CN', 'This Nike Go FlyEase Black Gum model features a white sole that has a splash of earth-colored Gum rubber at the toes. The rest of the shoe is black, with crisscrossing layers and patches of different mesh materials. At the very top of the shoe, you will find a small version of the famous Nike swoosh symbol in white.<br><br>The Nike Go FlyEase Black Gum is designed with both comfort and style in mind, making it a convenient shoe for exercising or simply walking throughout the day. <br><br>Released in May of 2022, the Nike Go FlyEase Black Gum had a starting price of $120.', 'men', 'https://images.stockx.com/images/Nike-Go-FlyEase-Black-Gum-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1647617495', 'Black Gum', 1, '2021-02-15', 120, 'Nike Go FlyEase', 'Nike-Go-FlyEase-Black-Gum', 'Nike Go FlyEase Black Gum', 'sneakers+nike+nike other+running+black/anthracite/elemental gold/white+2021-02-15+120+cw5883-003');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a2cefb66-c917-4d52-8afb-6de99d69f922', 'Alexander McQueen', 'Luxury Brands Alexander McQueen', 'Ivory', 'New', 'IT', null, 'women', 'https://images.stockx.com/images/Alexander-McQueen-Oversized-Ivory-Black-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1609358963', 'Ivory Black (W)', 1, '2019-12-04', 490, 'Alexander McQueen Oversized', 'Alexander-McQueen-Oversized-Ivory-Black-W', 'Alexander McQueen Oversized Ivory Black (W)', 'sneakers+alexander mcqueen+luxury brands+alexander mcqueen+ivory+2019-12-04+490+553770whgp79061');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a3100765-43dc-4477-9005-5d92b717a1f6', 'Jordan', 'Air Jordan Four', 'White/Black-Neutral Grey', 'New', 'ID', 'The Air Jordan 4 Retro Military Black for Grade Schoolers (GS) for grade schoolers first was sold on the market in May of 2022. <br><br>This unique shoe model provides a modern spin on the original retro item that was created in 1989. It features a white sole and base with suede and leather overlays in neutral shades of beige and black. The Air Jordan 4 Retro Military Black (GS) for grade schoolers has mesh side panels that were designed not only for style, but also for their breathability. The model provides the feet with plenty of support for walking and exercise.<br><br> The retail price for this item started at $210 for adult sizes.', 'child', 'https://images.stockx.com/images/Air-Jordan-4-Retro-Military-Black-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1653401817', 'Military Black (GS)', 1, '2022-05-21', 160, 'Jordan 4 Retro', 'Air-Jordan-4-Retro-Military-Black-GS', 'Jordan 4 Retro Military Black (GS)', 'sneakers+jordan+air jordan+four+white/black-neutral grey+2022-05-21+160+408452-111');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a3160349-762c-4d79-9987-b109a3bbe728', 'Converse', 'Converse Chuck Taylor', 'Black/White-High Risk Red', 'New', 'CN', 'Japanese designer Rei Kawakubo is one of the most prolific fashion designers of all time. Aside from her Comme des Garçons collections, she has had numerous sneaker collaborations over the years. One of the most outstanding of these collaborations involves her different iterations of work modifying and styling up the Converse Chuck Taylor with her sub-label Comme des Garçons PLAY. Kawakubo’s first iteration of his Converse Chuck Taylors came about in 2009 when she modified the original by stripping back its contrast stitching. Six years later, in 2015, she took the All Star Chuck 70s as her template and created a shoe so beloved that it has been re-released every year since.<br><br>The most immediately recognizable thing in shoes from the Comme des Garçons PLAY line is their heart and eyes logo, originally conceived and created by Filip Pagowski. Unlike the original 2009 version, however, the 2015 version and every version thereafter has moved away from the original minimalist philosophy that inspired Kawakubo to start this line of collaborations. The Converse Chuck Taylor All-Star 70s Hi Comme des Garçons PLAY harks back to the classic 70s Chuck Taylor style but with a high-top collar that snugly hugs the ankles and a black upper, white laces and a white sole and toe cap.<br><br>The Converse Chuck Taylor All-Star 70s Hi Comme des Garçons PLAY Black was released in March of 2019 and retailed for $125.', 'men', 'https://images.stockx.com/images/Converse-Chuck-Taylor-All-Star-70s-Hi-Comme-Des-Garcons-PLAY-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1607647392', 'Comme des Garcons PLAY Black', 1, '2019-03-30', 125, 'Converse Chuck Taylor All-Star 70 Hi', 'Converse-Chuck-Taylor-All-Star-70s-Hi-Comme-des-Garcons-PLAY-Black', 'Converse Chuck Taylor All-Star 70 Hi Comme des Garcons PLAY Black', 'sneakers+converse+converse+chuck taylor+comme des garcons+black/white-high risk red+2019-03-30+125+150204c');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a36d296a-ab80-4281-9c2b-a06a176e28c3', 'Nike', 'Nike Basketball Dunk', 'Grey/Purple/Yellow', 'New', 'VN', 'The Nike Dunk Low Union LA Passport Pack Court Purple draws a resemblance to the 1999 Nike Dunk High CO.JP City Pack. Beneath a tear-away ripstop shroud, it features a Court Purple and white smooth leather construction. From there, a Union LA Frontman logo on the heel and "UN|LA" quarter panel tabs add the finishing touch.<br><br>The Nike Dunk Low Union LA Passport Pack Court Purple released in April of 2022 and retailed for $150.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Union-Grey-Purple-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1648741050', 'Union Passport Pack Court Purple', 1, '2022-03-31', 150, 'Nike Dunk Low', 'Nike-Dunk-Low-Union-Grey-Purple', 'Nike Dunk Low Union Passport Pack Court Purple', 'sneakers+nike+nike basketball+dunk+low+grey/purple/yellow+2022-03-31+150+dj9649-500');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a391f827-2e9c-4fd5-ac67-8a4c835a9796', 'Jordan', 'Air Jordan Thirteen', 'Gym Red/Flint Grey-White-Black', 'New', 'CN', 'Jordan flipped one of the most popular Jordan 13 colorways of all time to create a new colorway with the Air Jordan 13 Red Flint. The Red Flint draws its inspiration from the often re-issued Air Jordan 13 Flint, remixing to the iconic colorway.<br><br>The Air Jordan 13 Red Flint features an upper made of red reflective mesh, white leather, and Flint Durabuck. In line with Jordan 13s of the past, a holographic Jumpman emblem is displayed on the lateral ankle. An embroidered Jumpman insignia on the tongue, and a Flint and white sole complete this Jordan 13.<br><br>The Jordan 13 Red Flint released in April of 2021 and retailed for $190.', 'men', 'https://images.stockx.com/images/Air-Jordan-13-Retro-Gym-Red-Flint-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1619202000', 'Gym Red Flint Grey', 1, '2021-05-01', 190, 'Jordan 13 Retro', 'Air-Jordan-13-Retro-Gym-Red-Flint-Grey', 'Jordan 13 Retro Gym Red Flint Grey', 'sneakers+jordan+air jordan+thirteen+gym red/flint grey-white-black+2021-05-01+190+dj5982-600');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a3dff87f-8a03-4a77-8f53-c4cca46c8b60', 'Nike', 'Nike Other Training', 'Dark Smoke Grey/Black/Iron Grey/Off Noir', 'New', 'VN', 'The Nike Air Trainer 1 SP Dark Smoke Grey makes over the world’s first cross training shoe with a refreshed design and modern materials.<br><br>The Nike Air Trainer 1 SP Dark Smoke Grey’s layered upper combines black textile, dark grey synthetic nubuck, reflective accents, and translucent quarter panels. A lockdown strap runs across the forefoot, and the breathable mesh and lightweight nylon construction complement the aforementioned strap well. A series of curved silver strips around the toe, mid-foot, and around the heel introduce new, functional reflective capabilities to the 1987 design.<br><br>The Nike Air Trainer 1 SP Dark Smoke Grey was released in March 2022 and retailed for $150.', 'men', 'https://images.stockx.com/images/Nike-Air-Trainer-1-SP-Dark-Smoke-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1648234588', 'Dark Smoke Grey', 1, '2022-03-17', 150, 'Nike Air Trainer 1 SP', 'Nike-Air-Trainer-1-SP-Dark-Smoke-Grey', 'Nike Air Trainer 1 SP Dark Smoke Grey', 'sneakers+nike+nike other+training+dark smoke grey/black/iron grey/off noir+2022-03-17+150+dh7338-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a3f69ad6-6f66-4b7d-8548-2e4a5fa88785', 'UGG', 'UGG Boots', 'Chestnut', 'New', 'VN', null, 'women', 'https://images.stockx.com/images/UGG-Classic-Mini-Platform-Boot-Chestnut-W.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1668193894', 'Chestnut (W)', 1, null, 160, 'UGG Classic Mini Platform Boot', 'UGG-Classic-Mini-Platform-Boot-Chestnut-W', 'UGG Classic Mini Platform Boot Chestnut (W)', 'sneakers+ugg+ugg+boots+chestnut+160+1134991-che');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a4041681-83a3-412d-973b-71c315a09f4f', 'adidas', 'adidas Yeezy', 'Pure/Pure/Pure', 'New', 'CN', 'DISCLAIMER: US and UK sizing is the same and does not require any conversion. <br> <br>The adidas Yeezy Slide Pure is constructed of Pure EVA foam with a soft footbed that offers an immediate step in comfort. An outsole with accentuated grooves for traction and support adds the finishing touches to the design.<br><br>The adidas Yeezy Slide Pure released in April of 2021 and retailed for $60.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Slide-Pure-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1642073908', 'Pure (First Release)', 1, '2021-04-26', 55, 'adidas Yeezy Slide', 'adidas-Yeezy-Slide-Pure', 'adidas Yeezy Slide Pure (First Release)', 'sneakers+adidas+adidas+yeezy+slides+pure/pure/pure+2021-04-26+55+gz5554');
