INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a485985b-832e-48e0-bf55-105a50af84e3', 'Jordan', 'Air Jordan One', 'Black/Archaeo Brown-Dark Chocolate', 'New', 'CN', 'The Air Jordan 1 Hand Crafted features a white leather upper with multicolor leather and Durabuck overlays for a unique look. From there, Wings logo collar patches and two-tone laces add a DIY feel.<br><br>The Air Jordan 1 Hand Crafted released in December of 2021 and retailed for $170.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-OG-Hand-Crafted-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1644572973', 'Hand Crafted', 1, '2021-12-18', 170, 'Jordan 1 Retro High OG', 'Air-Jordan-1-Retro-High-OG-Hand-Crafted', 'Jordan 1 Retro High OG Hand Crafted', 'sneakers+jordan+air jordan+one+black/archaeo brown-dark chocolate+2021-12-18+170+dh3097-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a58b0285-082a-4a71-a8f3-b59939cdeaf0', 'Jordan', 'Air Jordan One', 'White/University Red-Black', 'New', 'CN', 'The Air Jordan 1 Retro High OG Heritage flips the original Chicago colorway for a bold, unique look. It features a white and University Red smooth leather upper with black leather collars and red Swooshes. From there, a black and red woven Nike tongue label and an Air sole at the base completes the design.<br><br>The Air Jordan 1 Retro High OG Heritage released in 2022 and retailed for $170.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-OG-Heritage-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1649081695', 'Heritage', 1, '2022-05-25', 170, 'Jordan 1 Retro High OG', 'Air-Jordan-1-Retro-High-OG-Heritage', 'Jordan 1 Retro High OG Heritage', 'sneakers+jordan+air jordan+one+white/university red-black+2022-05-25+170+555088-161');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a5dff77e-9d87-4c19-bd48-e7fed3e9de25', 'Nike', 'Nike Dunk', 'Black/Pure Platinum-White', 'New', 'VN', null, 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Disrupt-2-Panda-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1661437298', 'Panda (W)', 1, '2022-07-23', 120, 'Nike Dunk Low Disrupt 2', 'Nike-Dunk-Low-Disrupt-2-Panda-W', 'Nike Dunk Low Disrupt 2 Panda (W)', 'sneakers+nike+nike+dunk+low+black/pure platinum-white+2022-07-23+120+dv4024-002');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a61a456b-4b07-46f9-a748-f03c74ed7eeb', 'Jordan', 'Air Jordan One', 'White/White/Vivid Green', 'New', 'CN', 'The Air Jordan 1 Mid Green Python (W) for women swaps outs its overlays for the titular material. <br><br>The Air Jordan 1 Mid Green Python (W) features a two-tone colorway, white leather on the base, and a Green Python leather overlay featuring a faux-reptile print. The two-toned kicks are dominated by its titular shade, which features snake-like scales across the collars, forefoot and heel overlays, Swooshes, and backdrops of the ball-and-win(GS) for grade schoolers-logos. White appears on the toe boxes, quarters, tongues, and midsoles. More touches of Green Python make their way onto the Jumpman logos stamped on the tongues.<br><br>The Air Jordan 1 Mid Green Python (W) was released in May 2022 and retailed for $135.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Green-Python-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1655732660', 'Green Python (W)', 1, '2022-05-03', 135, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Green-Python-W', 'Jordan 1 Mid Green Python (W)', 'sneakers+jordan+air jordan+one+white/white/vivid green+2022-05-03+135+dv2959-113');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a6365b69-ad87-4b8e-b2b5-a6c6766a5b80', 'Nike', 'Nike SB SB Dunk Low', 'Black/White-Multi Color', 'New', 'ID', null, 'men', 'https://images.stockx.com/images/Nike-Dunk-SB-Low-Pro-QS-Neckface-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1666851980', 'Neckface', 1, '2022-10-27', 120, 'Nike SB Dunk Low Pro QS', 'Nike-Dunk-SB-Low-Pro-QS-Neckface', 'Nike SB Dunk Low Pro QS Neckface', 'sneakers+nike+nike sb+sb dunk low+black/white-multi color+2022-10-27+120+dq4488-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a73d85cb-cda9-4992-8bf2-59a79b1060ef', 'Nike', 'Nike SB SB Dunk Low', 'Light Cognac/Light Cognac/White', 'New', 'VN', 'The Nike SB Dunk Low Light Cognac was first released in May of 2022 for a starting price of $100.<br><br>Part of Nike’s "Orange Label" series, the Nike SB Dunk Low Light Cognac features an orange-pink and white color scheme. The sole of the shoe is white, with the rest of the item alternating in patches of leather in both colors. The tongue is a mixture of orange-pink and white while the laces are purely white.<br><br>The Nike SB Dunk Low Light Cognac is a low-top model, meaning that the top of the shoe usually falls at the base of the ankle for the average wearer.', 'men', 'https://images.stockx.com/images/Nike-SB-Dunk-Low-Light-Cognac-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1653041643', 'Light Cognac', 1, '2022-05-01', 100, 'Nike SB Dunk Low Pro ISO', 'Nike-SB-Dunk-Low-Light-Cognac', 'Nike SB Dunk Low Pro ISO Light Cognac', 'sneakers+nike+nike sb+sb dunk low+light cognac/light cognac/white+2022-05-01+100+dm8998-200');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a745a433-2fa3-43a7-8f38-521fad453d7c', 'Crocs', 'Crocs Slides and Sandals', 'Stucco/Stucco', 'New', 'CN', null, 'men', 'https://images.stockx.com/images/Crocs-Echo-Clog-Stucco-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1666247553', 'Stucco', 1, '2022-10-05', 70, 'Crocs Echo Clog', 'Crocs-Echo-Clog-Stucco', 'Crocs Echo Clog Stucco', 'sneakers+crocs+crocs+slides and sandals+stucco/stucco+2022-10-05+70+207937-160');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a76883fd-666f-4800-80e2-ca266fb675dc', 'Nike', 'Air Force One', 'White/Black', 'New', 'CN', 'After a year-long hiatus, K-Pop star G-Dragon’s fashion label, Peaceminusone, teamed up with Nike once again to release the Nike Air Force 1 Low Peaceminusone Para-noise 2.0. This sequel release follows the same DIY theme as last year’s AF-1 Para-noise, only this time the colorway was flipped.<br><br>The Air Force 1 Low Peaceminusone Para-noise 2.0 features a white upper treated with a special lacquer coating that will rub off over time, revealing G-Dragon’s hidden artwork. The Peaceminusone Daisy motif is embroidered on the tongue and is accompanied by black paint streaks on the entire white sole. Black overlays, detailing, and laces complete the design.<br><br>The Air Force 1 Low Peaceminusone Para-noise 2.0 released in November of 2020 for $200.', 'men', 'https://images.stockx.com/images/Nike-Air-Force-1-Low-G-Dragon-Peaceminusone-Para-Noise-20-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1609362259', 'G-Dragon Peaceminusone Para-Noise 2.0', 1, '2020-11-25', 200, 'Nike Air Force 1 Low', 'Nike-Air-Force-1-Low-G-Dragon-Peaceminusone-Para-Noise-20', 'Nike Air Force 1 Low G-Dragon Peaceminusone Para-Noise 2.0', 'sneakers+nike+air force+one+low+white/black+2020-11-25+200+dd3223-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a7aa2c1b-50c9-4799-8ec4-4299e9f6a886', 'Jordan', 'Air Jordan One', 'University Gold/Light Bordeaux-White', 'New', 'CN', 'The Air Jordan 1 Retro High OG Brotherhood (GS) for grade schoolers for grade schoolers showcases a distinctive palette that celebrates Omega Psi Phi, Michael Jordan’s fraternity at the University of North Carolina.<br><br>The Air Jordan 1 Retro High OG Brotherhood (GS) for grade schoolers features an all-leather upper that combines white quarter panels with contrasting hits of Light Bordeaux and university gold on the forefoot and heel overlays. Uni gold continues to the toe box, collar flap, and woven tongue tag, featuring Nike Air branding. The sneaker rests on a rubber cupsole with encapsulated Air-sole cushioning in the heel.<br><br>The Air Jordan 1 Retro High OG Brotherhood (GS) for grade schoolers was released in February 2022 and retailed for $130.', 'child', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-OG-Brotherhood-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1648065394', 'Brotherhood (GS)', 1, '2022-02-24', 130, 'Jordan 1 Retro High OG', 'Air-Jordan-1-Retro-High-OG-Brotherhood-GS', 'Jordan 1 Retro High OG Brotherhood (GS)', 'sneakers+jordan+air jordan+one+university gold/light bordeaux-white+2022-02-24+130+575441-706');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a7b86615-26d0-4849-afa4-0f41b4d3e3c7', 'adidas', 'adidas Yeezy', 'Pure/Pure/Pure', 'New', 'CN', 'DISCLAIMER: US and UK sizing is the same and does not require any conversion.<br>The adidas Yeezy Slide Pure (Restock Pair) features a slightly different composition than the original adidas Yeezy Slide Pure that debuted in the spring of 2021. Instead of a smooth EVA foam construction, it has a pebbled, more textural touch. At the base, a grooved sole and cushioned footbed completes the design.<br><br>The adidas Yeezy Slide Pure (Restock Pair) released in December of 2021 and retailed for $60.<br><br>To shop the original adidas Yeezy Slide Pure, <a href="https://stockx.com/adidas-yeezy-slide-pure">click here.</a>  ', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Slide-Pure-Restock-Pair-1.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1639593302', 'Pure (Restock Pair)', 1, '2021-12-13', 60, 'adidas Yeezy Slide', 'adidas-Yeezy-Slide-Pure-Restock-Pair', 'adidas Yeezy Slide Pure (Restock Pair)', 'sneakers+adidas+adidas+yeezy+slides+pure/pure/pure+2021-12-13+60+gw1934');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a7da019a-87c6-4046-a36d-5e26c6bf57a1', 'Nike', 'Nike SB SB Dunk High', 'Cloud Grey/Rush Blue-Team Orange-White', 'New', 'VN', 'The Nike SB Dunk High New York Mets is a skateboarding sneaker that sports a Cloud Gray/Rush Blue/Team Orange colorway inspired by the away uniform of the New York Mets.<br><br>The gray mesh upper features suede gray overlays and a blue swoosh with an orange outline. A 7 ( a nod to the NY train) and an apple ( a nod to the home run apple that pops up in Citi Field) appear on the inside tongue tags. The midsole of the Nike SB Dunk High New York Mets is white and the outsole is gum and blue with some pink, as a nod to ballplayers chewing gum.<br><br> The Nike SB Dunk High New York Mets were released on July 26, 2022 for $125 retail.', 'men', 'https://images.stockx.com/images/Nike-SB-Dunk-High-New-York-Mets-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1654859103', 'New York Mets', 1, '2022-06-01', 120, 'Nike SB Dunk High', 'Nike-SB-Dunk-High-New-York-Mets', 'Nike SB Dunk High New York Mets', 'sneakers+nike+nike sb+sb dunk high+cloud grey/rush blue-team orange-white+2022-06-01+120+dh7155-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a7dd8e93-4a57-4265-9dcd-fd873a371b65', 'Puma', 'Puma Puma', 'Ivy/Holiday', 'New', 'CN', null, 'men', 'https://images.stockx.com/images/Puma-Rider-FV-Pokemon-Bulbasaur-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1669101641', 'Pokémon Bulbasaur', 1, '2022-11-12', 100, 'Puma Rider FV', 'Puma-Rider-FV-Pokemon-Bulbasaur', 'Puma Rider FV Pokémon Bulbasaur', 'sneakers+puma+puma+puma+ivy/holiday+2022-11-12+100+387324-01');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a8192d52-a777-4b08-a716-cba144023f6c', 'Nike', 'Air Max 270', 'Black/Black-White', 'New', 'CN', null, 'men', 'https://images.stockx.com/images/Nike-Air-Max-270-React-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1664519149', 'Black', 1, '2019-09-17', 160, 'Nike Air Max 270 React', 'Nike-Air-Max-270-React-Black', 'Nike Air Max 270 React Black', 'sneakers+nike+air max+270+black/black-white+2019-09-17+160+ci3866-004');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a84b53cb-e946-41ba-9744-3f66d4c89c7c', 'Nike', 'Nike Dunk', 'Black/White-University Red', 'New', 'CN', 'The women''s Nike Dunk High Panda (W) features white and black leather upper with a matching sole. From there, hits of red on the woven tongue label add some subtle flair.The women''s Nike Dunk High Black White (W) released in July of 2021 and retailed for $110.', 'women', 'https://images.stockx.com/images/Nike-Dunk-High-Panda-2021-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1638807175', 'Panda (2021) (W)', 1, '2021-07-27', 110, 'Nike Dunk High', 'Nike-Dunk-High-Panda-2021-W', 'Nike Dunk High Panda (2021) (W)', 'sneakers+nike+nike+dunk+high+black/white-university red+2021-07-27+110+dd1869-103');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a861cf10-6267-45d0-9190-1bcb4dea8183', 'Nike', 'Nike SB SB Dunk Low', 'Habanero Red/White-Blue Hero', 'New', 'VN', 'While the Nike SB Dunk Low Bart Simpson is not an official collaboration with The Simpsons, it channels color inspiration to the rambunctious character and follows a similar format to the Nike SB Dunk High Marge Simpson and the Nike SB Dunk Low Homer Simpson.<br><br>The Nike SB Dunk Low Bart Simpson features a yellow leather upper with orange Durabuck overlays and a white Swoosh. Hits of blue on the sock liner and outsole add a cool-toned contrast to the shoe''s warm palette. At the base, a Zoom sole provides comfort and support.<br><br>The Nike SB Dunk Low Bart Simpson released in May of 2022 and retailed for $100.', 'men', 'https://images.stockx.com/images/Nike-SB-Dunk-Low-Pro-Bart-Simpson-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1650655298', 'Bart Simpson', 1, '2022-06-29', 110, 'Nike SB Dunk Low Pro', 'Nike-SB-Dunk-Low-Pro-Bart-Simpson', 'Nike SB Dunk Low Pro Bart Simpson', 'sneakers+nike+nike sb+sb dunk low+habanero red/white-blue hero+2022-06-29+110+bq6817-602');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a89f9183-9f6d-4ff7-bffc-e31f4f0fe388', 'Nike', 'Nike Dunk', 'Wolf Grey/Neutral Grey-Sail', 'New', 'VN', 'The Nike Dunk High Premium Culture Day was designed and manufactured by Nike and inspired by the extinct Naumann''s elephant species.<br><br>Nike Dunk High Premium Culture Day features a gray suede overlay. The underlay is made of crumbled leather. Additionally, the shoe’s Swoosh is made of smooth white leather and its tongue from traditional nylon. The shoes also include the Nike logo on the side, in light gray, with a black collar. The overall design is light blue and gray shoe with a touch of white.<br><br>Nike Dunk High Premium Culture Day was released on April 27, 2022, and retailed at $110.', 'men', 'https://images.stockx.com/images/Nike-Dunk-High-Premium-Culture-Day.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1650530433', 'Culture Day', 1, '2022-04-27', 110, 'Nike Dunk High Premium', 'Nike-Dunk-High-Premium-Culture-Day', 'Nike Dunk High Premium Culture Day', 'sneakers+nike+nike+dunk+high+wolf grey/neutral grey-sail+2022-04-27+110+dr8753-077');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a8cbd65f-f6ff-404b-9b1a-0649ad3bc2e9', 'Jordan', 'Air Jordan Eleven', 'Black/Multi-Color-White-Multi-Color', 'New', 'CN', 'The Air Jordan 11s first made their appearance in 1995. They came in time for Jordan’s return to basketball that year, and he wore them during his great 1995-1996 season. Today, retro Jordan 11s still carry on the classic look, feel and legacy of the originals. Moreover, the kids'' version of these legendary shoes is the perfect way to let your kids be like Mike.<br><br>The Air Jordan 11 Retro Jubilee Kids is designed to hark back to the 1990s. It features a black upper with a silver Jumpman on the rear of its collar and the number 23 in metallic silver above the logo. While the sole is made of a thick and durable yet stylish white foam, black patent leather dominates the rest of the design.<br><br>The Air Jordan 11 Retro Jubilee Black Clear Kids was released in December of 2020 and retailed for $180.', 'child', 'https://images.stockx.com/images/Air-Jordan-11-Retro-Black-Clear-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1609357582', 'Jubilee (GS)', 1, '2020-12-12', 180, 'Jordan 11 Retro', 'Air-Jordan-11-Retro-Black-Clear-GS', 'Jordan 11 Retro Jubilee (GS)', 'sneakers+jordan+air jordan+eleven+kids+black/multi-color-white-multi-color+2020-12-12+180+378038-011');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a93b7b3c-5845-4738-a9aa-1730f2408d09', 'Jordan', 'Air Jordan One', 'Sail/Burgundy Crush', 'New', 'CN', 'The Air Jordan 1 A Ma Maniére features a premium cracked leather upper with burgundy reptilian-textural leather collars and Swooshes. Silky quilted lining and custom woven tongue and insole labels add a sense of luxury. At the base, a yellowed sole provides a vintage feel to complete the design.<br><br>The Air Jordan 1 A Ma Maniére released in November of 2021 and retailed for $200.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-OG-A-Ma-Maniere-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1638286909', 'A Ma Maniére', 1, '2021-12-03', 200, 'Jordan 1 Retro High OG', 'Air-Jordan-1-Retro-High-OG-A-Ma-Maniere', 'Jordan 1 Retro High OG A Ma Maniére', 'sneakers+jordan+air jordan+one+sail/burgundy crush+2021-12-03+200+do7097-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('a9532713-0d0b-4a92-9f02-8c8217297a6c', 'Nike', 'Nike SB SB Dunk Low', 'Valor Blue/Team Maroon/White/Gum', 'New', 'VN', 'Paying homage to the Philadelphia Phillies, the Nike SB Dunk Low Philadelphia Phillies, boasts a Valor blue Durabuck and suede upper, Team Maroon Swooshes, and woven tongue labels with graphics depicting two Philly staples: the Liberty Bell and a Philly cheese steak sandwich. From there, a white and gum brown Nike Zoom sole completes the design.<br><br>The Nike SB Dunk Low Philadelphia Phillies released in July of 2022 and retailed for $115.', 'men', 'https://images.stockx.com/images/Nike-SB-Dunk-Low-Valour-Blue-Team-Maroon-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1654859404', 'Philadelphia Phillies', 1, '2022-07-26', 115, 'Nike SB Dunk Low', 'Nike-SB-Dunk-Low-Valour-Blue-Team-Maroon', 'Nike SB Dunk Low Philadelphia Phillies', 'sneakers+nike+nike sb+sb dunk low+valor blue/team maroon/white/gum+2022-07-26+115+dq4040-400');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('ab7e153d-412f-48df-a6bd-bde548693501', 'Jordan', 'Air Jordan One', 'Atmosphere/Obsidian-Laser Pink-White', 'New', 'VN', 'The Air Jordan 1 Retro High OG Atmosphere PS is a high top and typically reaches the top of the average wearer’s ankle.<br><br>TheAir Jordan 1 Retro High OG Atmosphere PS offers a clean pattern with subtle details. The sole of the shoe is in fresh white, with a thin strip of pink at the very bottom. The Nike swoosh symbol appears in black, sandwiched between patches of pink, black, and white. Both the tongue and the laces appear in black as well.<br><br>First released in December of 2021, the Air Jordan 1 Retro High OG Atmosphere PS had a starting retail price of $170.', 'child', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-OG-Atmosphere-PS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1641565520', 'Atmosphere (PS)', 1, '2021-12-22', 80, 'Jordan 1 Retro High OG', 'Air-Jordan-1-Retro-High-OG-Atmosphere-PS', 'Jordan 1 Retro High OG Atmosphere (PS)', 'sneakers+jordan+air jordan+one+atmosphere/obsidian-laser pink-white+2021-12-22+80+cu0449-641');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('abd10f3a-59f6-4c26-8e41-66d0d0722734', 'Nike', 'Air Force One', 'White/White', 'New', 'VN', 'The Nike Air Force 1 Low LE Triple White GS  features triple white leather upper perforations on the toebox as well as two perforations under each Swoosh. The Swoosh and overlays are also white leather. The outsole is white with a concentric-circles pattern and stars in the rubber. The midsole is white with a hidden Air compartment. The midsole says "AIR" in white. A silver tab saying "AF1" is on the top of the white laces.<br><br> This grade school-sized shoe, the Nike Air Force 1 Low LE Triple White GS, was released on April 13, 2021 at a retail price of $90.', 'child', 'https://images.stockx.com/images/Nike-Air-Force-1-Low-LE-Triple-White-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1626967317', 'Triple White (GS)', 1, '2021-04-14', 75, 'Nike Air Force 1 Low LE', 'Nike-Air-Force-1-Low-LE-Triple-White-GS', 'Nike Air Force 1 Low LE Triple White (GS)', 'sneakers+nike+air force+one+low+white/white+2021-04-14+75+dh2920-111');
