INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('ad93e5de-f874-4e52-83ae-b1b65c21f2eb', 'Jordan', 'Air Jordan Six', 'University Blue/White/College Navy/Black', 'New', 'CN', 'The Grade School–sized(GS) Air Jordan 6 Retro UNC White GS uses the colorway University Blue/White/College Navy/Black to reflect the colors of Micheal Jordan''s alma mater, the UNC Tar Heels. Blue nubuck with white leather overlays make up the upper. The polyurethane hit on the midsole, the molded TPU heel tab, and the sock lining are navy. A Jumpman appears on the tongue, laces tab, insole, outsole, and on the Jordan Team patch stitched on the heel. The midsole has a visible Air unit, and the outsole is translucent blue and white.<br><br>The Air Jordan 6 Retro UNC White GS was released on April 27, 2022, at a retail price of $160.', 'child', 'https://images.stockx.com/images/Air-Jordan-6-Retro-UNC-White-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1647010408', 'UNC White (GS)', 1, '2022-04-27', 160, 'Jordan 6 Retro', 'Air-Jordan-6-Retro-UNC-White-GS', 'Jordan 6 Retro UNC White (GS)', 'sneakers+jordan+air jordan+six+university blue/white/college navy/black+2022-04-27+160+384665-410');
