INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('ae20064d-e440-48cd-b9e8-9dcc85c57ea8', 'Alexander McQueen', 'Luxury Brands Alexander McQueen', 'Ivory', 'New', 'IT', 'The Alexander McQueen Oversized Ivory Black is an oversized sneaker that is primarily made out of calf leather.<br><br>The  Alexander McQueen Oversized Ivory Black sneaker a rounded rubber toe as well as a rubber sole. The majority of the shoe is a bright white color. On the heel of the shoe, there are black details. The shoe also has perforated air holes in order to help make them be more breathable. The Alexander McQueen Oversized Ivory Black also has white laces.<br><br>The Alexander McQueen Oversized Ivory Black first became available on the market in December of 2019. This model of shoes had a starting retail price of $490.', 'men', 'https://images.stockx.com/images/Alexander-McQueen-Oversized-Ivory-Black.png?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1611694834', 'Ivory Black', 1, '2019-03-02', 490, 'Alexander McQueen Oversized', 'Alexander-McQueen-Oversized-Ivory-Black', 'Alexander McQueen Oversized Ivory Black', 'sneakers+alexander mcqueen+luxury brands+alexander mcqueen+ivory+2019-03-02+490+553680whgp59061');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('aea345d4-ab23-4d2b-909b-f2fad68cc92a', 'Nike', 'Nike Basketball Blazer', 'Black/Sail-White', 'New', 'IN', 'The Nike Blazer is a monument in the history of Nike Basketball. The design was first popularized by NBA great George "The Iceman" Gervin in the 1970s and is now a classic lifestyle sneaker.<br><br>The Nike Blazer Mid 77 Vintage White Black features a smooth white leather upper with grey suede mudguards and black Swooshes. A white sole and classic Nike branded woven tongue label complete the design.<br><br>The Nike Blazer Mid 77 Vintage White Black released in March of 2019 and retailed for $100.', 'men', 'https://images.stockx.com/images/Nike-Blazer-Mid-77-Vintage-White-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606325720', 'White Black', 1, '2019-03-25', 100, 'Nike Blazer Mid 77 Vintage', 'Nike-Blazer-Mid-77-Vintage-White-Black', 'Nike Blazer Mid 77 Vintage White Black', 'sneakers+nike+nike basketball+blazer+black/sail-white+2019-03-25+100+bq6806-100');
