INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('b0c0114a-f1c3-45c1-9d6a-33a8a62e9944', 'Nike', 'Nike SB SB Dunk High', 'Coconut Milk/Black/Team Orange', 'New', 'CN', 'Nike SB Dunk High San Francisco Giants, style code DO9394-100, has become one of the most celebrated footwear lines in the Nike series.<br><br>Nike SB Dunk High San Francisco Giants is a product of synthetic leather at the upper and a rubber outsole. The sneaker is embellished in a coconut milk, team orange, and black colorway. It features black with an orange Swoosh across the quarter panel to the heel notch. The white midsole and black team orange at the outsole complete the sneaker''s design.<br><br>Nike SB Dunk High San Francisco Giants debuted at a retail price of $125 on July 26, 2022.', 'men', 'https://images.stockx.com/images/Nike-SB-Dunk-High-San-Francisco-Giants-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1657782130', 'San Francisco Giants', 1, '2022-07-26', 125, 'Nike SB Dunk High Pro Premium', 'Nike-SB-Dunk-High-San-Francisco-Giants', 'Nike SB Dunk High Pro Premium San Francisco Giants', 'sneakers+nike+nike sb+sb dunk high+coconut milk/black/team orange+2022-07-26+125+do9394-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('b0f0b29c-3a0f-41ce-b212-8d3caa31e376', 'Nike', 'Air Force One', 'Flax/Flax-Gum Light Brown', 'New', 'CN', 'Drawing inspiration from classic work boots, the Nike Air Force 1 Low SP Supreme Wheat features a Flax Durabuck upper with Supreme Box Logo insignias on the lateral heels. At the base, a matching Flax Air sole completes the design. This model was exclusively sold through Supreme stores and their online shops.<br><br>The Nike Air Force 1 Low SP Supreme Wheat released in November of 2021 and retailed for $150.', 'men', 'https://images.stockx.com/images/Nike-Air-Force-1-Low-Supreme-Flax-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1637088094', 'Supreme Wheat', 1, '2021-11-05', 150, 'Nike Air Force 1 Low SP', 'Nike-Air-Force-1-Low-Supreme-Flax', 'Nike Air Force 1 Low SP Supreme Wheat', 'sneakers+nike+air force+one+low+flax/flax-gum light brown+2021-11-05+150+dn1555-200');
