INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('b1496e22-50e2-4b21-9270-0b61c8c89f79', 'Jordan', 'Air Jordan Eleven', 'White/Black-Concord', 'New', 'CN', 'Jordan Brand is reaching harder than MJ on Space Jam for the sneaker of the year crown by releasing the Jordan 11 Retro Concord (2018). This Iconic Jordan 11 colorway is showcasing a white upper with black accents, white midsole, and a freezing cold translucent sole. These sneakers released in December 2018 and retailed for $220. Revisit the dominant legacy MJ left behind and grab a pair on StockX today.', 'men', 'https://images.stockx.com/images/Air-Jordan-11-Retro-Concord-2018-1.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606320605', 'Concord (2018)', 1, '2018-12-08', 220, 'Jordan 11 Retro', 'Air-Jordan-11-Retro-Concord-2018', 'Jordan 11 Retro Concord (2018)', 'sneakers+jordan+air jordan+eleven+white/black-concord+2018-12-08+220+378037-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('b17b7c31-fa01-4624-80f1-cb73a3a4b7cc', 'New Balance', 'New Balance 2002R', 'Phantom/Dark Grey', 'New', 'CN', 'The New Balance 2002R Protection Pack Phantom features a charcoal mesh upper with monotone jagged suede overlays and unfinished edges. From there, a black Nrgy midsole and matching outsole add the finishing touches.<br><br>The New Balance 2002R Protectioon Pack Phantom released in August of 2021 and retailed for $150.', 'men', 'https://images.stockx.com/images/New-Balance-M2002-Protection-Pack-Phantom-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1635780257', 'Protection Pack Phantom', 1, '2021-08-20', 150, 'New Balance 2002R', 'New-Balance-M2002-Protection-Pack-Phantom', 'New Balance 2002R Protection Pack Phantom', 'sneakers+new balance+new balance+2002r+2002r+phantom/dark grey+2021-08-20+150+m2002rdb');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('b17f014f-e6e6-441c-a6e4-d5d5a3a8916d', 'adidas', 'adidas Yeezy', 'Static/Static/Static', 'New', 'CN', 'Ignore the static, adidas and Kanye are teaming up to release the adidas Yeezy 700 V2 Static. This Yeezy 700 comes with a grey upper with white accents, white midsole, and a black sole. These sneakers released in December 2018 and retailed for $300. The 700’s have been one of the hottest adidas silhouette this year so place a Bid on these today.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-700-V2-Static-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1625589442', 'Static (2018/2022)', 1, '2018-12-29', 300, 'adidas Yeezy Boost 700 V2', 'adidas-Yeezy-700-V2-Static', 'adidas Yeezy Boost 700 V2 Static (2018/2022)', 'sneakers+adidas+adidas+yeezy+v2+700+static/static/static+2018-12-29+300+ef2829');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('b1a1caa9-c27b-4f04-b78b-f2d374f023a3', 'Jordan', 'Air Jordan One', 'Black/Hyper Royal-White', 'New', 'CN', 'The Air Jordan 1 Mid Black Royal Tumbled Leather is reminiscent of the legendary Royal Air Jordan 1 from 1985.<br><br>Released as part of the Air Jordan 1 Mid Fall lineup, the Air Jordan 1 Mid Black Royal Tumbled Leather features a black tumbled leather upper with royal blue overlays, a crisp white midsole, and a sturdy black rubber outsole. This exceptional colorway boasts a Nike woven tag on its nylon tongue, and on its lateral collar flap it boasts a traditional Air Jordan Wings logo.<br><br>The Air Jordan 1 Mid Black Royal Tumbled leather was released in December 2020. It retailed at $115.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Black-Royal-Tumbled-Leather-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1611952919', 'Hyper Royal Tumbled Leather', 1, '2020-12-30', 115, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Black-Royal-Tumbled-Leather', 'Jordan 1 Mid Hyper Royal Tumbled Leather', 'sneakers+jordan+air jordan+one+black/hyper royal-white+2020-12-30+115+554724-077');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('b209a35a-bee6-4b30-a8c3-931d429ac4db', 'Nike', 'Air Max VaporMax', 'Black/Black-Dark Grey', 'New', 'CN', 'The Nike VaporMax Plus Triple Black is a combination of the Air Max Plus series, which was released in 1998, and the VaporMax series.<br><br>The Nike VaporMax Plus Triple Black has an upper construction of neoprene, true to the iconic look of the Nike Air Max Plus. The length of the Air Max sole extends through the entire sneaker. The tongue displays the Air Vapor Max Plus branding, and the VM logo is seen on the heel. The VM logo provides contrast through its yellow, white, and red colors. The heel is reminiscent of the Tuned Air Logo from 1998. Short white stripes run through the upper part of the Nike VaporMax complete the design. <br><br>The Nike Air VaporMax Plus Triple Black released in January of 2018 and retailed for $190.', 'men', 'https://images.stockx.com/images/Nike-Air-VaporMax-Plus-Triple-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1607005366', 'Triple Black', 1, '2018-01-25', 190, 'Nike Air VaporMax Plus', 'Nike-Air-VaporMax-Plus-Triple-Black', 'Nike Air VaporMax Plus Triple Black', 'sneakers+nike+air max+vapormax+black/black-dark grey+2018-01-25+190+924453-004');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('b216b11d-fc64-4f41-8864-42097c4c2f87', 'Jordan', 'Air Jordan Five', 'Black/Cool Grey-White', 'New', 'CN', 'The Air Jordan 5 Moonlight arrives looking identical to the original 2013 Jordan 5 Oreo. It features a black Durabuck upper with translucent netted inserts and grey embroidered Jumpman logos on the tongue. From there, a white midsole with black speckled shark teeth and an icy translucent sole brings a contrast to the monotone upper.<br><br>The Air Jordan 5 Moonlight released in September of 2021 and retailed for $190.', 'men', 'https://images.stockx.com/images/Air-Jordan-5-Retro-Oreo-2021-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1633023998', 'Moonlight (2021)', 1, '2021-09-25', 190, 'Jordan 5 Retro', 'Air-Jordan-5-Retro-Oreo-2021', 'Jordan 5 Retro Moonlight (2021)', 'sneakers+jordan+air jordan+five+black/cool grey-white+2021-09-25+190+ct4838-011');
