INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('b2feb769-ee47-4201-af23-e0fc6406c7b8', 'Jordan', 'Air Jordan Six', 'White/Black-Carmine', 'New', 'CN', 'The Air Jordan 6 Retro Carmine 2020 for Grade School (GS) uses a White/Carmine/Black colorway in this grade school–sized shoe. A black mudguard threads through the white midsole and edges the carmine nubuck upper and white leather overlays and collar. A carmine lace lock features black Jumpman icons. A carmine Jumpman and Air logo enhance the collar. The white Nike Air logo and Swoosh appear on the black insole. A denser white rubber and a carmine Jumpman amplify the translucent white outsole. White laces and a black tongue and sock lining complete the look.<br><br>The Air Jordan 6 Retro Carmine 2020 GS was released on February 13, 2021, at a retail price of $150.', 'child', 'https://images.stockx.com/images/Air-Jordan-6-Retro-Carmine-2020-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1613411817', 'Carmine (2021) (GS)', 1, '2021-02-13', 150, 'Jordan 6 Retro', 'Air-Jordan-6-Retro-Carmine-2020-GS', 'Jordan 6 Retro Carmine (2021) (GS)', 'sneakers+jordan+air jordan+six+kids+white/black-carmine+2021-02-13+150+384665-106');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('b3162162-99ff-4e29-a494-933e04bd7b97', 'Nike', 'Nike Dunk', 'White/Light Smoke Grey-Black', 'New', 'VN', 'The Nike Dunk Low Light Smoke Grey (Women''s) is part of Nike’s large collection of Dunk sneakers and is designed in the DD1503-117 style.<br><br>The sneaker is decorated in the White/Light Smoke Grey/Black colorway, with the upper fully constructed of leather. The Light Smoke Grey highlighting on the overlays pairs nicely with the shoe’s white base. The Nike''s Swooshes, heel tabs, and laces are all black, while the heels have gray embroidery. The sneaker’s white midsoles provide contrast to the gray rubber outsoles.<br><br>The Nike Dunk Low Light Smoke Grey (Women''s) debuted in May of 2022 at a retail price of $100.', 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Light-Smoke-Grey-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1653401043', 'Light Smoke Grey (W)', 1, '2022-05-01', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Light-Smoke-Grey-W', 'Nike Dunk Low Light Smoke Grey (W)', 'sneakers+nike+nike+dunk+low+white/light smoke grey-black+2022-05-01+100+dd1503-117');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('b42cdd0d-d1ea-4c91-9f72-0d1655535022', 'Jordan', 'Air Jordan Twelve', 'White/Black-Metallic Gold', 'New', 'CN', 'Drawing a strong resemblance to the original Air Jordan 12 Taxi, the Air Jordan 12 Royalty Taxi elevates the classic design with minor alterations in its detailing.<br><br>The design features a white tumbled leather upper with a black toe wrap and gold hook eyelets. A new feature is on the toe wrap, where a gold plaquet is prominent on the lateral side. From there, a woven heel tag and matching sole completes the design.<br><br>The Air Jordan 12 Royalty Taxi releases in November of 2021 and retails for $190.', 'men', 'https://images.stockx.com/images/Air-Jordan-12-Retro-Royalty-Taxi-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1635280285', 'Royalty Taxi', 1, '2021-11-13', 190, 'Jordan 12 Retro', 'Air-Jordan-12-Retro-Royalty-Taxi', 'Jordan 12 Retro Royalty Taxi', 'sneakers+jordan+air jordan+twelve+white/black-metallic gold+2021-11-13+190+ct8013-170');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('b4482a7c-581c-4f2d-9320-ef436eea3a37', 'Nike', 'Nike Basketball Dunk', 'Arctic Orange/Sanded Gold-Vivid Green', 'New', 'VN', 'The Nike Dunk Low Next Nature Arctic Orange features a unique, tonal construction of warm woven fabrics and light green tumbled leather overlays. At the heel, a "Nike Sun Club" embroidery adds to the shoes warm-weather theme. A white and speckled light green Air sole adds the finishing touch.<br><br>The Nike Dunk Low Next Nature Arctic Orange released in May of 2022 and retailed for $110.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Sun-Club-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1656520314', 'Next Nature Sun Club Arctic Orange', 1, '2022-05-20', 110, 'Nike Dunk Low', 'Nike-Dunk-Low-Sun-Club', 'Nike Dunk Low Next Nature Sun Club Arctic Orange', 'sneakers+nike+nike basketball+dunk+low+arctic orange/sanded gold-vivid green+2022-05-20+110+dm0583-800');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('b460e68b-8639-4555-8c60-7fc51bec7e13', 'adidas', 'adidas Yeezy', 'Grey/Grey/Grey', 'New', 'CN', 'Try not to dress like a hypebeast after copping the adidas Yeezy Boost 350 V2 Hyperspace. This Yeezy Boost 350 comes with a grey upper, grey translucent stripe, grey midsole, and a Grey sole. These sneakers released in March 2019 and retailed $220. Make some space for some new Yeezys and Buy these now on StockX.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Boost-350-V2-Hyperspace-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606323100', 'Hyperspace', 1, '2019-03-16', 220, 'adidas Yeezy Boost 350 V2', 'adidas-Yeezy-Boost-350-V2-Hyperspace', 'adidas Yeezy Boost 350 V2 Hyperspace', 'sneakers+adidas+adidas+yeezy+350+v2+grey/grey/grey+2019-03-16+220+eg7491');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('b48c489c-6bf7-49a9-87be-25fa1117a0b5', 'Jordan', 'Air Jordan Four', 'White/Tech Grey-Black-Fire Red', 'New', 'CN', 'The Air Jordan 4 Retro White Oreo features a white leather and mesh upper with hits of Tech Grey on its eyelets and midsole. From there, a red Jumpman logo is embroidered on the tongue, adding a pop of color to the neutral-toned design.<br><br>The Air Jordan 4 Retro White Oreo released on Saturday, July 3rd and retailed for $190.', 'men', 'https://images.stockx.com/images/Air-Jordan-4-Retro-White-Oreo-2021-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1620919867', 'White Oreo (2021)', 1, '2021-07-03', 190, 'Jordan 4 Retro', 'Air-Jordan-4-Retro-White-Oreo-2021', 'Jordan 4 Retro White Oreo (2021)', 'sneakers+jordan+air jordan+four+white/tech grey-black-fire red+2021-07-03+190+ct8527-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('b49318a0-9f5c-4e01-9de1-5ca5b9ee0ebb', 'Jordan', 'Air Jordan One', 'Stealth/White', 'New', 'CN', null, 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-OG-Stealth-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1660201619', 'Stealth', 1, '2022-08-30', 180, 'Jordan 1 Retro High OG', 'Air-Jordan-1-Retro-High-OG-Stealth', 'Jordan 1 Retro High OG Stealth', 'sneakers+jordan+air jordan+one+mxscavengerhunt+stealth/white+2022-08-30+180+555088-037');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('b4b8ef60-97f0-4545-9e71-63e3a1577027', 'New Balance', 'New Balance 2002R', 'Mirage Grey/Trooper', 'New', 'VN', 'The New Balance 2002R Protection Pack Mirage Grey is a fresh take on this brand’s classic sneaker. <br><br>The sides feature a brownish-grey fabric, with blue mesh underneath. The tongue is a clean white, along with the laces. On the side of each shoe, you will see the iconic New Balance logo that the brand has become famous for. With a cushioned and supportive sole, the New Balance 2002R Protection Pack Mirage Grey can be used for working out, playing a game of basketball, or even just walking around town. The shoe has a classic rugged and modern design that looks effortlessly broken in.<br><br>First released in May of 2022 for $150.', 'men', 'https://images.stockx.com/images/New-Balance-2002R-Protection-Pack-Mirage-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1650653906', 'Protection Pack Mirage Grey', 1, '2022-04-01', 150, 'New Balance 2002R', 'New-Balance-2002R-Protection-Pack-Mirage-Grey', 'New Balance 2002R Protection Pack Mirage Grey', 'sneakers+new balance+new balance+2002r+mirage grey/trooper+2022-04-01+150+m2002rdd');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('b53f85c1-beed-47c9-9ef4-ee9e5cf6234e', 'adidas', 'adidas Yeezy', 'Cinder/Cinder/Cinder', 'New', 'CN', 'In a dark brown, monochromatic styling, the adidas Yeezy 450 Cinder utilizes a minimalist two-piece construction to achieve the futurist aesthetic Yeezy has displayed in their most recent silhouettes. A foam sole encompasses a matching sock-like Primeknit upper in a claw-like fashion. Thick rope laces and sock-like collars provide a secure fit.<br><br>The adidas Yeezy 450 Cinder released in March of 2022 and retailed for $200.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-450-Cinder-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1647545952', 'Cinder', 1, '2022-03-24', 210, 'adidas Yeezy 450', 'adidas-Yeezy-450-Cinder', 'adidas Yeezy 450 Cinder', 'sneakers+adidas+adidas+yeezy+cinder/cinder/cinder+2022-03-24+210+gx9662');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('b5997425-391e-430d-b755-13ecbd136b15', 'Nike', 'Dunk Low', 'Peach Cream/White/Peach Cream', 'New', 'VN', null, 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Peach-Cream-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1665556609', 'Peach Cream (W)', 1, '2022-09-17', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Peach-Cream-W', 'Nike Dunk Low Peach Cream (W)', 'sneakers+nike+dunk+low+peach cream/white/peach cream+2022-09-17+100+dd1503-801');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('b5c56f04-a074-4d5c-8229-82e8179b318f', 'adidas', 'adidas Samba', 'Cloud White/Core Black/Clear Granite', 'New', 'CN', 'Originally designed to protect soccer players’ feet during winter, the adidas Samba OG Cloud White Core Black has transcended its sports function but still maintains its aesthetic appeal.<br><br>The adidas Samba OG Cloud White Core Black upper is built from full-grain leather with a light brown suede and dark brown heel tab providing contrast. Serrated 3-Stripes appear in deep brown on the lateral and medial sides, a Bluebird tongue label, and a foil logotype mark the shoe’s DNA. Underfoot, a brown gum rubber outsole provides traction and durability.<br><br>The adidas Samba OG Cloud White Core Black was released in January 2018 and retailed for $100.', 'men', 'https://images.stockx.com/images/adidas-Samba-OG-Cloud-White-Core-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1613410732', 'Cloud White Core Black', 1, '2018-01-01', 100, 'adidas Samba OG', 'adidas-Samba-OG-Cloud-White-Core-Black', 'adidas Samba OG Cloud White Core Black', 'sneakers+adidas+adidas+samba+cloud white/core black/clear granite+2018-01-01+100+bz0057/b75806');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('b6123b4f-c68e-401a-8d1f-50d91132825d', 'New Balance', 'New Balance 550', 'White/Silver Birch/Beige', 'New', 'VN', 'The 550 New Balance Silver Birch (Women''s) shoes feature an all-over white and cream palette with perforations on their laterals. <br><br>The shoe has cream detailing rolling over the "N" logo, and the mesh heel tab found above the embossed vintage logo. The 550 New Balance Silver Birch (Women''s) shoes have a cream heel clip that sits above a thick white midsole and a cream rubber outsole. You will find the New Balance Logo on both the insole and outsole, on the sides of the shoe, and at the shoe''s back end.<br>    <br>  The 550 New Balance Silver Birch (Women''s) shoe was released on the 25th May 2022 and retailed for $110.', 'women', 'https://images.stockx.com/images/New-Balance-550-Silver-Birch-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1663957390', 'Silver Birch (W)', 1, '2022-05-25', 110, 'New Balance 550', 'New-Balance-550-Silver-Birch-W', 'New Balance 550 Silver Birch (W)', 'sneakers+new balance+new balance+550+white/silver birch/beige+2022-05-25+110+bbw550ws');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('b6ad86bb-aec8-4b13-9296-5733d57aa786', 'Jordan', 'Air Jordan Eleven', 'White/Varsity Red/Black', 'New', 'CN', 'The Air Jordan 11 Cherry brings a Chicago colorway to the iconic patent leather sneaker. Cherry red patent leather mudguards surround the majority of the upper, alongside white leather and a matching Cherry red Jumpman. The lining features Cherry red cotton and with the signature 23 debossed on the heel tab. An icy blue outsole and Cherry red carbon fiber plate complete 2022’s Jordan 11 iteration.<br><br>The Air Jordan 11 Cherry was released on December 10, 2022 with a retail price of $225. ', 'men', 'https://images.stockx.com/images/Air-Jordan-11-Retro-Cherry-2022-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1669100668', 'Cherry (2022)', 1, '2022-12-10', 225, 'Jordan 11 Retro', 'Air-Jordan-11-Retro-Cherry-2022', 'Jordan 11 Retro Cherry (2022)', 'sneakers+jordan+air jordan+eleven+white/varsity red/black+2022-12-10+225+ct8012-116');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('b7e6632c-ed69-4e74-a37e-311c8dde96aa', 'Jordan', 'Air Jordan Three', 'White/Light Curry-Cardinal Red-Cement Grey', 'New', 'CN', 'Jordan Brand brought an OG Air Jordan 7 colorway to the Air Jordan 3 for the Air Jordan 3 Cardinal Red.<br><br>Constructed with white tumbled leather and signature Elephant Print overlays, the Air Jordan 3 Cardinal Red takes a traditional approach in its color blocking and fabrication, similar to the iconic Black Cement 3s. Spicing up the design, sharp Cardinal Red midsoles and detailing pop against the neutral toned upper. Bright orange Jumpman logo embroidery on the tongue adds the finishing touch.<br><br>The Air Jordan 3 Cardinal Red released in February of 2022 and retailed for $200.', 'men', 'https://images.stockx.com/images/Air-Jordan-3-Retro-Cardinal-Red-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1643992778', 'Cardinal Red', 1, '2022-02-19', 200, 'Jordan 3 Retro', 'Air-Jordan-3-Retro-Cardinal-Red', 'Jordan 3 Retro Cardinal Red', 'sneakers+jordan+air jordan+three+white/light curry-cardinal red-cement grey+2022-02-19+200+ct8532-126');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('b80e3a0b-1a16-48ae-af4a-fdd5f8a6a977', 'Jordan', 'Air Jordan One', 'Black/Gym Red-Black-White', 'New', 'CN', 'With an official Black/Gym Red-Black-White colorway, the darker tones dominate the overall silhouette of the Jordan 1 Retro High Black Satin Gym Red sneaker. An all white midsole creates contrast to the other shades, and the sneaker is constructed with leather and satin.<br><br>The Air Jordan 1 Retro High Black Satin Gym Red released in January 2018 and retailed for $170.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-Black-Gym-Red-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606321149', 'Black Satin Gym Red', 1, '2020-01-18', 170, 'Jordan 1 Retro High', 'Air-Jordan-1-Retro-High-Black-Gym-Red-Black', 'Jordan 1 Retro High Black Satin Gym Red', 'sneakers+jordan+air jordan+one+black/gym red-black-white+2020-01-18+170+555088-060');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('b80ff5b5-98ab-40ff-a58c-83f6962fe8aa', 'Nike', 'Air Force One', 'White/White', 'New', 'VN', 'The Nike Air Force 1 Low White ‘07 features an all-white leather upper with a perforated toe box and Swoosh overlays. A Nike heel embroidery and white sole completes the design.<br><br>The Nike Air Force 1 Low White ‘07 originally released in 2007, but since it is an essential colorway to the brand, it consistently restocks.<br><br>To shop all Nike Air Force 1 shoes, <a href="https://stockx.com/nike/air-force/1">click here.</a> ', 'men', 'https://images.stockx.com/images/Nike-Air-Force-1-Low-White-07_V2-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1631122839', 'White', 1, '2007-11-24', 110, 'Nike Air Force 1 Low ''07', 'Nike-Air-Force-1-Low-White-07', 'Nike Air Force 1 Low ''07 White', 'sneakers+nike+air force+one+low+white/white+2007-11-24+110+315122-111/cw2288-111');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('b8974db1-261e-44cc-a2ce-914077ff833c', 'Jordan', 'Air Jordan One', 'Light Olive/Black-Sail-White', 'New', 'VN', null, 'women', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Olive-Toe-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1664865349', 'Olive Toe (W)', 1, '2022-09-02', 135, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Olive-Toe-W', 'Jordan 1 Mid Olive Toe (W)', 'sneakers+jordan+air jordan+one+light olive/black-sail-white+2022-09-02+135+dv0427-301');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('b8c8398d-f0ee-47f8-8c47-75b70fac9190', 'Jordan', 'Air Jordan Six', 'Varsity Red/Black-White', 'New', 'CN', 'The Air Jordan 5 Retro Raging Bulls Red 2021 GS features a Varsity Red suede upper with quarter panel netting on the side wall. A red-on-red embroidered number 23, black leather molded eyelets, red laces, and a silver tongue edged with black complete the look. The outer sole is gray, black, and white. The midsole is black with jagged splashes of white and red and visible air cushioning. Iconic Jumpman logos appear on the tongue, heel, and outer sole.<br><br> This grade-school-sized Air Jordan 5 Retro Raging Bulls Red 2021 GS was released on April 10, 2021 at a retail price of $140.', 'child', 'https://images.stockx.com/images/Air-Jordan-5-Retro-Raging-Bulls-Red-2021-GS.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1612835480', 'Raging Bull Red (2021) (GS)', 1, '2021-04-10', 140, 'Jordan 5 Retro', 'Air-Jordan-5-Retro-Raging-Bulls-Red-2021-GS', 'Jordan 5 Retro Raging Bull Red (2021) (GS)', 'sneakers+jordan+air jordan+six+varsity red/black-white+2021-04-10+140+440888-600');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('b95e2009-e2c8-4d7f-9faa-c1100c64fae7', 'Jordan', 'Air Jordan Five', 'Varsity Maize/Court Purple-Ghost Green-Solar Orange', 'New', 'CN', 'To honor the 30th Anniversary of the Jordan 5, Jordan Brand added a "What The?" treatment to its catalog with the Jordan 5 What The. This design boasts a mix of materials and details from Jumpman’s best Non-OG Jordan 5 colorways, including the Tokyo, Shanghai, Raging Bull, Bel-Air, Laser, Green Bean, Olive, and Quai 54 colorways.<br><br>In true mismatched fashion, each foot of the Jordan 5 What The showcases a different look. On the right, yellow suede from the Tokyo 5 smothers the upper atop a purple and blue speckled Belair 5 midsole with a patterned interior pulled from the Jordan 5 Olive. On the left, red suede tributing the Raging Bull Jordan 5 covers the upper atop a black, grey, and lime green sole that references the Quai 54 iteration. Heel embroidery nodding to the Shanghai and Tokyo models, icy translucent outsoles, and 3M reflective tongues complete this scrambled iteration. <br><br>The Jordan 5 What The released in November of 2020 and retailed for $220.', 'men', 'https://images.stockx.com/images/Air-Jordan-5-Retro-What-The-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1609768847', 'What The', 1, '2020-11-12', 220, 'Jordan 5 Retro', 'Air-Jordan-5-Retro-What-The', 'Jordan 5 Retro What The', 'sneakers+jordan+air jordan+five+varsity maize/court purple-ghost green-solar orange+2020-11-12+220+cz5725-700+headwear');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('b9aad426-4c2b-40d9-8acb-98b06ebc9782', 'Jordan', 'Air Jordan Thirteen', 'Black/Court Purple-White', 'New', 'CN', 'The Air Jordan 13 Court Purple could serve as a dark variation of the 2019 Air Jordan 13 Lakers. In a similar styling, it features a black reflective textile and Court Purple Durabuck upper with a tumbled leather toe wrap and classic Jumpman hologram. A matching midsole and sculptural outsole complete the retro design.<br><br>The Air Jordan 13 Court Purple released in January of 2021 and retailed for $190.', 'men', 'https://images.stockx.com/images/Air-Jordan-13-Retro-Court-Purple_V2-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1653595011', 'Court Purple', 1, '2022-01-08', 190, 'Jordan 13 Retro', 'Air-Jordan-13-Retro-Court-Purple', 'Jordan 13 Retro Court Purple', 'sneakers+jordan+air jordan+thirteen+black/court purple-white+2022-01-08+190+dj5982-015');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('ba0b9280-23b5-46b3-9855-1b0fa3d7f659', 'Jordan', 'Air Jordan One', 'White/Linen-Linen', 'New', 'ID', 'The Jordan 1 Mid Linen features a white leather upper with College Grey overlays and Swooshes. At the collar, hits of linen add a slight contrast. From there, matching woven tongue labels and soles complete the design.<br><br>The Jordan 1 Mid Linen released in November of 2021 and retailed for $120.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Linen-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1631115416', 'Linen', 1, '2021-11-24', 115, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Linen', 'Jordan 1 Mid Linen', 'sneakers+jordan+air jordan+one+white/linen-linen+2021-11-24+115+554724-082');
