INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('bb48b0f1-531c-4ac0-8157-6831b4b595ea', 'Jordan', 'Air Jordan One', 'White/University Blue-Varsity Red-Black', 'New', 'CN', 'Please Note: Extra laces are not guaranteed. Jordan Brand sheds light on Michael’s transition from the college hoops scene to the NBA with the Jordan 1 Retro High Fearless UNC Chicago, now available on StockX.  1984 marked the year MJ entered the league and changed the game as we know it. This shoe is an embodiment of staying true to your roots as you face adversity and adapt to perform at the highest level.<br>This AJ 1 is composed of a white patent leather upper with red and university blue overlays, black Nike "Swoosh", white midsole, and a red outsole. These sneakers released in November of 2019 and retailed for $160.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-Fearless-UNC-Chicago-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606322396', 'Fearless UNC Chicago', 1, '2019-11-02', 160, 'Jordan 1 Retro High', 'Air-Jordan-1-Retro-High-Fearless-UNC-Chicago', 'Jordan 1 Retro High Fearless UNC Chicago', 'sneakers+jordan+air jordan+one+white/university blue-varsity red-black+2019-11-02+160+ck5666-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('bb699c05-e286-4a1f-83e1-cc4a083fd840', 'Converse', 'Converse Chuck Taylor', 'Black/White-High Risk Red', 'New', 'CN', 'Converse Chuck Taylor All Star 70s Ox Comme des Garcons PLAY Black is a model of the iconic collaboration between Comme des Garcons, a Japanese Brand, and Converse. Converse Chuck Taylor All Star 70s Ox Comme des Garcons PLAY Black features a canvas upper. It also features contrasting lace colorways and white seams. On the side, it features the famous red heart and a silhouette that ends on the cream-colored sole.<br><br>Converse Chuck Taylor All Star 70s Ox Comme des Garcons PLAY Black was released in July 2017 and had a retail price of $120.', 'men', 'https://images.stockx.com/images/Converse-Chuck-Taylor-All-Star-70s-Ox-Comme-Des-Garcons-Play-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1607648065', 'Comme des Garcons PLAY Black', 1, '2019-07-03', 120, 'Converse Chuck Taylor All-Star 70 Ox', 'Converse-Chuck-Taylor-All-Star-70s-Ox-Comme-des-Garcons-PLAY-Black', 'Converse Chuck Taylor All-Star 70 Ox Comme des Garcons PLAY Black', 'sneakers+converse+converse+chuck taylor+comme des garcons+black/white-high risk red+2019-07-03+120+150206c');
