INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('bc83fbef-6a77-4095-ad0a-9043bbc86273', 'adidas', 'adidas Yeezy', 'Slate Red/Slate Red/Slate Red', 'New', 'CN', 'The adidas Yeezy 350 V2 CMPCT Slate Red brings out major Red October vibes with its vibrant Slate Red Primeknit upper. Brown undertones throughout the forefoot add a subtle contrast, emphasizing the design''s knit structure. At the base, a red, semi-translucent Boost sole provides the model''s renowned cushioning and support.<br><br>The adidas Yeezy 350 V2 CMPCT Slate Red released in February of 2022 and retailed for $220.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-350-V2-CMPCT-Slate-Red-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1645036438', 'Slate Red', 1, '2022-02-17', 220, 'adidas Yeezy 350 V2 CMPCT', 'adidas-Yeezy-350-V2-CMPCT-Slate-Red', 'adidas Yeezy 350 V2 CMPCT Slate Red', 'sneakers+adidas+adidas+yeezy+350+v2+slate red/slate red/slate red+2022-02-17+220+gw6945');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('bc8af8de-2ae1-4db3-95f3-585ad83def6e', 'Jordan', 'Air Jordan One', 'Black/White Onyx/White/Sail', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Air-Jordan-1-Low-SE-Wear-Away-Yellow.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1665516047', 'Wear Away Yellow', 1, '2022-10-07', 130, 'Jordan 1 Low SE', 'Air-Jordan-1-Low-SE-Wear-Away-Yellow', 'Jordan 1 Low SE Wear Away Yellow', 'sneakers+jordan+air jordan+one+black/white onyx/white/sail+2022-10-07+130+dq8422-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('bd0ab2c1-1775-4b39-996a-1c40309251a2', 'adidas', 'adidas Yeezy', 'Onyx/Onyx/Onyx', 'New', 'CN', 'With a triple black Primeknit upper, the adidas Yeezy 350 V2 Onyx takes it back to the basics, using its muted palette to emphasize the intricacies of its construction. A sheer mesh side stripe and canvas heel loop offer a subtle contrast in texture. At the base, a matching signature Boost sole provides comfort and support.<br><br>The adidas Yeezy 350 V2 Onyx released in the Spring of 2022 and retailed for $220.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Boost-350-V2-Onyx-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1656420652', 'Onyx', 1, '2022-03-05', 230, 'adidas Yeezy Boost 350 V2', 'adidas-Yeezy-Boost-350-V2-Onyx', 'adidas Yeezy Boost 350 V2 Onyx', 'sneakers+adidas+adidas+yeezy+350+v2+onyx/onyx/onyx+2022-03-05+230+hq4540');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('bd156db8-e1db-4310-a5ae-5f7b0fdae1a4', 'Jordan', 'Air Jordan One', 'Starfish/White-Black', 'New', 'CN', 'The Air Jordan 1 Low Starfish features a smooth white leather upper with black Swooshes and sharp Starfish overlays, similar to the color uniform Michael Jordan wore when he famously broke the backboard in a 1985 exhibition game in Italy. A matching woven tongue label adds to the design''s retro appeal.<br><br>The Air Jordan 1 Low Starfish released in August of 2021 and retailed for $130.', 'men', 'https://images.stockx.com/images/Air-Air-Jordan-1-Low-OG-Shattered-Backboard-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1630615309', 'Starfish', 1, '2021-08-26', 130, 'Jordan 1 Low', 'Air-Air-Jordan-1-Low-OG-Shattered-Backboard', 'Jordan 1 Low Starfish', 'sneakers+jordan+air jordan+one+starfish/white-black+2021-08-26+130+cz0790-801+headwear');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('bdbb01e4-e019-4597-9ab7-22221c6ececa', 'Nike', 'Nike Basketball Dunk', 'White/Light Thistle/Lapis', 'New', 'CN', null, 'child', 'https://images.stockx.com/images/Nike-Dunk-Low-Blueberry-GS.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1659534625', 'Blueberry (GS)', 1, '2022-08-03', 85, 'Nike Dunk Low', 'Nike-Dunk-Low-Blueberry-GS', 'Nike Dunk Low Blueberry (GS)', 'sneakers+nike+nike basketball+dunk+white/light thistle/lapis+2022-08-03+85+dz4456-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('bdc35251-e23c-491f-a1a7-d94f46e326c0', 'Nike', 'Nike SB SB Dunk Low', 'Coastal Blue/Coastal Blue-Light Current Blue', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Nike-SB-Dunk-Low-Pro-Why-So-Sad-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1667893192', 'Why So Sad?', 1, '2022-11-04', 120, 'Nike SB Dunk Low Pro', 'Nike-SB-Dunk-Low-Pro-Why-So-Sad', 'Nike SB Dunk Low Pro Why So Sad?', 'sneakers+nike+nike sb+sb dunk low+coastal blue/coastal blue-light current blue+2022-11-04+120+dx5549-400');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('be29470c-0c43-4444-a1a1-5fc8a014c618', 'UGG', 'UGG Boots', 'Black', 'New', 'CN', 'The UGG Neumel Boot Black features a black suede upper, a single velcro strap over the forefoot and heel, a matching embossed logo on the rear pull tab, and moc-stitch detailing along the shaft.<br><br>The upper is fashioned from high-quality leather and features cinch tie laces that can be adjusted down. The UGG Neumel Boot is made with a premium upcycled black wool upper, featuring a rib knit cuff and heel for durability. It also has a lyocell lining to provide cushioned comfort.<br><br>The UGG Neumel Boot Black was launched on November 16th, 2021, at a retail price of $130.', 'men', 'https://images.stockx.com/images/UGG-Neumel-Boot-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1648234831', 'Black', 1, '2022-02-01', 130, 'UGG Neumel Boot', 'UGG-Neumel-Boot-Black', 'UGG Neumel Boot Black', 'sneakers+ugg+ugg+boots+black+2022-02-01+130+3236-blk');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('be3ddbe4-1f58-43f9-a539-0ecbf357b36e', 'Jordan', 'Air Jordan Three', 'Black/Rush Orange/Fossil Stone/Sail', 'New', 'CN', 'The Air Jordan 3 Retro Desert Elephant is one of the most anticipated colorways of the Jordan 3 catalog.<br><br>The Air Jordan 3 Retro Desert Elephant (2022) is a re-release of the iconic Air Jordan 3 that first dropped back in 1988. This time around, the shoe comes dressed in a Desert Elephant print upper with Black and Cement Grey accents. In addition to the Desert Elephant print Durabuck upper, the shoe has a leather overlay and the usual Jumpman embroidery on the collar.<br><br>The Air Jordan 3 Retro Desert Elephant (2022) was released back in, 2022 and retailed for $225.', 'men', 'https://images.stockx.com/images/Air-Jordan-3-Retro-Desert-Elephant-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1657197668', 'Desert Elephant', 1, '2022-07-30', 200, 'Jordan 3 Retro', 'Air-Jordan-3-Retro-Desert-Elephant', 'Jordan 3 Retro Desert Elephant', 'sneakers+jordan+air jordan+three+black/rush orange/fossil stone/sail+2022-07-30+200+ct8532-008');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('bea98a5a-ba94-4413-9008-083587d48a10', 'adidas', 'adidas Yeezy', 'Flax/Flax/Flax', 'New', 'CN', 'Yeezy provided a new colorway of its most popular design with the adidas Yeezy 350 Flax, now available on StockX. This release shows slight resemblance to the 350 V2 Marsh in colorway, displaying warm tones to embody the arrival of spring. This model was released as a regional exclusive specific to the Asia Pacific and Africa.<br><br>This Yeezy 350 V2 Flax is composed of a light brown Primeknit upper with a translucent outer side stripe. A translucent Boost cushioned sole and light brown interior completes the design. These sneakers released in February of 2020 and retailed for $220.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Boost-350-V2-Flax-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1657197541', 'Flax', 1, '2020-02-22', 220, 'adidas Yeezy Boost 350 V2', 'adidas-Yeezy-Boost-350-V2-Flax', 'adidas Yeezy Boost 350 V2 Flax', 'sneakers+adidas+adidas+yeezy+v2+350+flax/flax/flax+2020-02-22+220+fx9028');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('bf47fda4-bb43-4d56-b392-5ffc095661e7', 'Nike', 'Nike Basketball Dunk', 'Pink/Pink', 'New', 'CN', 'The Nike Dunk Low Triple Pink has a full leather build, which makes use of three distinct shades of pink to complete the look. The base has a light shade of pink, with a slightly contrasting pink overlay.<br><br>The look is completed by the Nike Swoosh in a bold pink that provides a strong contrast and stands out noticeably on the shoe. In addition to the Swoosh on both sides, the Nike Dunk Low Triple Pink (Grade School) features Nike branding on the sole, heel, tongue, and inner sole. This shoe comes in Grade School (GS) sizing.<br><br>The Nike Dunk Low Triple Pink (Grade School) was released in early June, 2022, at the retail price of $85.', 'child', 'https://images.stockx.com/images/Nike-Dunk-Low-Triple-Pink-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1661523004', 'Triple Pink (GS)', 1, '2022-06-01', 85, 'Nike Dunk Low', 'Nike-Dunk-Low-Triple-Pink-GS', 'Nike Dunk Low Triple Pink (GS)', 'sneakers+nike+nike basketball+dunk+pink/pink+2022-06-01+85+dh9765-600');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('bf50227b-5ad1-4ad0-aa05-a2b8187482de', 'adidas', 'adidas Ultra Boost', 'Cloud White/Cloud White/Cloud White', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/adidas-Ultra-Boost-DNA-50-Cloud-White-Black-Sole-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1659725853', 'Cloud White Black Sole', 1, '2022-06-16', 190, 'adidas Ultra Boost DNA 5.0', 'adidas-Ultra-Boost-DNA-50-Cloud-White-Black-Sole', 'adidas Ultra Boost DNA 5.0 Cloud White Black Sole', 'sneakers+adidas+adidas+ultra boost+cloud white/cloud white/cloud white+2022-06-16+190+gv8740');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('bf540991-f770-4ef9-a089-68a9b28a347b', 'Nike', 'Nike Dunk', 'Noble Green/White/University Gold/Noble Green', 'New', 'VN', 'The Nike Dunk High Australia arrives with a white and dark green smooth leather upper in a traditional two-tone color blocking style. Hits of yellow on the heel tab and woven tongue label add slight contrast. From there, a white and dark green Air Sole provides support and durability.<br><br>The Nike Dunk High Australia released in 2022 and retailed for $110.', 'men', 'https://images.stockx.com/images/Nike-Dunk-High-Australia-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1659621596', 'Australia', 1, '2022-07-19', 115, 'Nike Dunk High', 'Nike-Dunk-High-Australia', 'Nike Dunk High Australia', 'sneakers+nike+nike+dunk+high+noble green/white/university gold/noble green+2022-07-19+115+dd1399-300');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('bf565162-dd7d-4673-b42e-22dd3919f7af', 'Nike', 'Nike Other Running', 'White/Glacier Blue/Copa/Black', 'New', 'VN', 'Since its debut, the sales of Nike React Phantom Run Flyknit White Glacier Blue remain high in the Nike catalog.<br><br>The Nike React Phantom Run Flyknit White Glacier Blue features a laceless design with its top made of responsive lightweight foam. It has an elongated tongue that is made of soft foam with a mark of "NIKE" embroidered on its top. Nike React Phantom Run Flyknit White Glacier Blue’s pull-tab is made of breathable materials. All these are atop blue rubber midsole and outsole.<br><br>Nike React Phantom Run Flyknit White Glacier Blue was first released on March 1, 2022, at a price of $140.', 'men', 'https://images.stockx.com/images/Nike-React-Phantom-Run-Flyknit-White-Glacier-Blue-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1653595253', 'White Glacier Blue', 1, '2022-03-01', 140, 'Nike React Phantom Run Flyknit 2', 'Nike-React-Phantom-Run-Flyknit-White-Glacier-Blue', 'Nike React Phantom Run Flyknit 2 White Glacier Blue', 'sneakers+nike+nike other+running+white/glacier blue/copa/black+2022-03-01+140+dd9662-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('bf9de8ac-4056-4134-a89a-3b59f8421522', 'Nike', 'Nike Dunk', 'White/Orange Blaze', 'New', 'CN', 'Nike continues to revive their famed Be True To Your School pack with the retro release of the Nike Dunk High Syracuse. The Nike Dunk High Syracuse first retroed in 2016 as a women’s exclusive, alongside other pack-mates, like the Villanovas, Kentuckys, and Michigans. Following the Syracuse-themed colorway releasing in Dunk Low form in 2020, the orange hue returns again in its original Dunk High form. <br><br>The Nike Dunk High Syracuse is constructed in familiar Dunk High color blocking. Hits of orange leather add a bright contrast to white leather panels. From there, a white tongue tag with orange Nike branding and a vibrant orange outsole completes the design, making it a true OG return. <br><br>The Nike Dunk High Syracuse released in March of 2021 for $120. ', 'men', 'https://images.stockx.com/images/Nike-Dunk-High-Syracuse-2021-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1616520900', 'Syracuse (2021)', 1, '2021-03-10', 110, 'Nike Dunk High', 'Nike-Dunk-High-Syracuse-2021', 'Nike Dunk High Syracuse (2021)', 'sneakers+nike+nike+dunk+high+white/orange blaze+2021-03-10+110+dd1399-101');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('bfe00cfb-dfe7-496b-9627-0bd55368b4db', 'New Balance', 'New Balance 990v5', 'Grey/Castle Rock', 'New', 'US', 'Now sporting fewer but larger mesh breathable zones, the New Balance 990 v5 Grey (GS) arrives in grade school sizing.<br><br>The New Balance 990 v5 Grey (GS) upper is crafted from pig suede with breathable mesh in targeted areas and 360 reflective accents for added safety in low-light running conditions. The shoe maintains the clean silhouette from previous generations but adds a plastic power strap component on the sides near the ankle area. Additionally, the encap midsole support area gets a PU Ring for a sleeker design.<br><br>The New Balance 990 v5 Grey (GS) was released in May 2019 and retailed for $110.', 'child', 'https://images.stockx.com/images/New-Balance-990-v5-Grey-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1617133800', 'Grey (GS)', 1, '2019-05-04', 110, 'New Balance 990v5', 'New-Balance-990-v5-Grey-GS', 'New Balance 990v5 Grey (GS)', 'sneakers+new balance+new balance+990v5+grey/castle rock+2019-05-04+110+gc990gl5');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c04af60e-992a-41e6-9b34-65ac8ace29cf', 'Nike', 'Air Jordan One', 'Black/Black/Black', 'New', 'CN', 'With simple details, the Air Jordan 1 Low Triple Black is known for offering plenty of comfort and support, making it a convenient shoe to wear on the basketball court, or during everyday life.<br><br>This model is a fresh take on an original style that first debuted in 1985. It is made out of smooth and pebbled black leather, featuring the iconic perforated toe box. There is subtle stitching outlining the Nike swoosh symbol on the side. <br><br>The Air Jordan 1 Low Triple Black was first released in January of 2021. This pair of shoes had a starting retail price of $100.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Low-Triple-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1609350979', 'Triple Black', 1, '2020-08-17', 90, 'Jordan 1 Low', 'Air-Jordan-1-Low-Triple-Black', 'Jordan 1 Low Triple Black', 'sneakers+nike+air jordan+one+low+black/black/black+2020-08-17+90+553558-091');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c07b2c5e-7a20-42c8-99ed-bfff0202e97c', 'Nike', 'Air Force One', 'Black/Black-Black', 'New', 'CN', '<b> Supreme and Nike paid homage to an NYC classic with the release of the Nike Air Force 1 Low Supreme Black, now available on StockX. This collaboration adds Supreme’s world-renowned Box Logo to the side of a traditional all-black Air Force 1 design.<br><br>This Air Force 1 Low is comprised of an all-black leather upper with matching soles and detailing. A red Supreme Box Logo placed on the outside heel completes the design. These sneakers released in March of 2020 and retailed for $96.', 'men', 'https://images.stockx.com/images/Nike-Air-Force-1-Low-Supreme-Box-Logo-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606325289', 'Supreme Black', 1, '2020-03-05', 96, 'Nike Air Force 1 Low', 'Nike-Air-Force-1-Low-Supreme-Box-Logo-Black', 'Nike Air Force 1 Low Supreme Black', 'sneakers+nike+air force+one+ss20+low+black/black-black+2020-03-05+96+cu9225-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c09c5c49-35be-47ab-9351-4f1c9de37c4e', 'Nike', 'Air Force One', 'White/Gum', 'New', 'CN', 'The Nike Air Force 1 Low White Gum is a reworked version of the classic Nike Air Force 1 Low. Like the classic Nike Air Force 1 Low, this shoe has a white upper made out of tumbled leather with white laces, Nike swooshes, and tongues. Unlike the original Nike Air Force 1 Low which has a white midsole and outsole, this redefined colorway has a solid gum midsole and outsole.<br><br>The Nike Air Force 1 Low White Gum was released on 31st March 2021. During its release, this sneaker commanded a retail price of $120.', 'men', 'https://images.stockx.com/images/Nike-Air-Force-1-Low-White-Gum-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1646687729', 'White Gum', 1, '2021-03-31', 120, 'Nike Air Force 1 Low', 'Nike-Air-Force-1-Low-White-Gum', 'Nike Air Force 1 Low White Gum', 'sneakers+nike+air force+one+low+white/gum+2021-03-31+120+dj2739-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c0b2dbb0-d47e-451f-b013-94290b75e372', 'adidas', 'adidas Other', 'Chalk Purple/Footwear White', 'New', 'CN', 'South Park and adidas joined forces to celebrate 4/20 in 2021 with the release of the adidas Campus 80s South Park Towelie. This release references Towelie, a laboratory-made, cannabis-consuming towel character who has made appearances in more than a dozen episodes and three South Park games.<br><br>The adidas Campus 80s South Park Towelie features a purple terry cloth upper with white leather overlays and purple leather lining. Towelie’s eyes appear on the tongue and when exposed to sunlight, they transition from white to bright red. A hidden stash pocket in the tongue is big enough to fit the Towelie keychains that are included with the shoes. Quotes from Towelie that read "Don’t Forget To Bring A Towel" and "I Have No Idea What’s Going On" also show up on the tongue’s interior. A white sole and adidas branding on the heel tab complete this South Park release.<br><br>The adidas Campus 80s South Park Towelie released in April of 2021 and retailed for $100.', 'men', 'https://images.stockx.com/images/adidas-Campus-80s-South-Park-Towelie-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1619198945', 'South Park Towelie', 1, '2021-04-20', 100, 'adidas Campus 80s', 'adidas-Campus-80s-South-Park-Towelie', 'adidas Campus 80s South Park Towelie', 'sneakers+adidas+adidas+other+mxscavengerhunt+chalk purple/footwear white+2021-04-20+100+gz9177');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c0e19190-387e-4945-9af7-cb38b95bd779', 'Jordan', 'Air Jordan One', 'White/White Onyx/University Blue', 'New', 'VN', 'The Air Jordan 1 Elevate Low SE University Blue (W) for women sports a two-tone white and university blue makeup nodding to Michael Jordan’s 1982 NCAA Championship.<br><br>The Air Jordan 1 Elevate Low SE University Blue (W) features a white leather base with university blue overlays and Swooshes. The white leather extends to the tongue and liner, while underfoot, a modified chunky platform sole in white atop a uni blue rubber outsole with the outline of the Win(GS) for grade schoolers logo in the rear and cork insoles completes the design.<br><br>The Air Jordan 1 Elevate Low SE University Blue (W) was released in April 2022 and retailed for $145.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-Elevate-Low-SE-University-Blue-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1650983528', 'University Blue (W)', 1, '2022-04-15', 145, 'Jordan 1 Elevate Low SE', 'Air-Jordan-1-Elevate-Low-SE-University-Blue-W', 'Jordan 1 Elevate Low SE University Blue (W)', 'sneakers+jordan+air jordan+one+white/white onyx/university blue+2022-04-15+145+dq3698-141');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c135548e-4e6b-4362-9afa-b07ca9008ba4', 'Nike', 'Nike Other Running', 'Hyper Turquoise/White-Black-Oracle Aqua', 'New', 'CN', null, 'men', 'https://images.stockx.com/images/Nike-Air-Zoom-Alphafly-Next-Hyper-Turquoise-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1647360057', 'Hyper Turquoise', 1, '2018-08-13', 275, 'Nike Air Zoom Alphafly Next%', 'Nike-Air-Zoom-Alphafly-Next-Hyper-Turquoise', 'Nike Air Zoom Alphafly Next% Hyper Turquoise', 'sneakers+nike+nike other+running+hyper turquoise/white-black-oracle aqua+2018-08-13+275+ci9925-300');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c14cab28-ad7e-41db-b76f-1c8f02043b09', 'Crocs', 'Crocs Collaborations', 'White/Light Blue', 'New', 'CN', 'The Grade school''s Crocs Classic Clog Cinnamon Toast Crunch GS is one of the variants of the all-terrain catalog for kids. <br><br>Honey nut cereal is used to create the unique marble designs on these Crocs classic clogs. The shoe''s outsole is lugged for excellent off-road traction. The breathable characteristic is introduced by the ventilation on the upper half, making the Crocs comfy. Cinnamon Toast Crunch served as the main design inspiration for footwear. These Crocs appear in the white or light blue colorway. <br><br>The Crocs Classic Clog Cinnamon Toast Crunch GS was first released on April 28, 2022, at a retail price of $70.', 'child', 'https://images.stockx.com/images/Crocs-Classic-Clog-Cinnamon-Toast-Crunch-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1652711996', 'Cinnamon Toast Crunch (GS)', 1, '2022-04-28', 50, 'Crocs Classic Clog', 'Crocs-Classic-Clog-Cinnamon-Toast-Crunch-GS', 'Crocs Classic Clog Cinnamon Toast Crunch (GS)', 'sneakers+crocs+crocs+collaborations+white/light blue+2022-04-28+50+207925-2e9');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c151080d-fe72-46f0-88d1-138dbc226e2a', 'Jordan', 'Air Jordan One', 'Gym Red/White-Black', 'New', 'ID', 'The grade school Air Jordan 1 Low Bred Toe GS mimics the color scheme of its predecessor, the Air Jordan 1 Bred Toe. It features amazing details like a puffy black nylon tongue, a large Air Jordan Wings logo embroidered on the heel, and a white Jumpman logo. Additionally, it features an enhanced red outsole and a cushioned white midsole.<br><br>The grade school Air Jordan 1 Low Bred Toe GS was released on 8th December 2021. It retailed at $75.', 'child', 'https://images.stockx.com/images/Air-Jordan-1-Low-Bred-Toe-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1642595320', 'Bred Toe (GS)', 1, '2021-12-08', 75, 'Jordan 1 Low', 'Air-Jordan-1-Low-Bred-Toe-GS', 'Jordan 1 Low Bred Toe (GS)', 'sneakers+jordan+air jordan+one+gym red/white-black+2021-12-08+75+553560-612');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c1a3f95e-9578-4d16-bb15-537fbfe3e826', 'Nike', 'Nike SB SB Dunk Low', 'Multi-Color/Pink Gaze/Sail', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Nike-SB-Dunk-Low-Pro-Be-True-Xavier-Schipani.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1668611272', 'Be True Xavier Schipani', 1, '2022-11-18', 115, 'Nike SB Dunk Low Pro', 'Nike-SB-Dunk-Low-Pro-Be-True-Xavier-Schipani', 'Nike SB Dunk Low Pro Be True Xavier Schipani', 'sneakers+nike+nike sb+sb dunk low+multi-color/pink gaze/sail+2022-11-18+115+dx5933-900');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c1b26a10-37c0-48f4-b150-ca79136db120', 'adidas', 'adidas Yeezy', 'Geode/Black', 'New', 'CN', 'The adidas Yeezy Boost 700 MNVN Geode is a collaboration product between adidas and music icon Kanye West’s Yeezy brand. Initially released as a Yeezy supply exclusive in 2021, this colorway had a wider launch in Spring 2022.<br><br>Unique in appearance, this colorway features a lilac nylon upper, with the 700 branding on the lateral side. It also features tongues, laces, and a collar done in a charcoal hue. These highlights lie atop an enclosed Boost Black Sole Unit. <br><br>The adidas Yeezy Boost 700 MNVN Geode was widely launched on the 19th of April, 2022. At the time of its release, this shoe commanded a retail price of $220.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Boost-700-MNVN-Geode-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1650653021', 'Geode', 1, '2022-04-19', 220, 'adidas Yeezy Boost 700 MNVN', 'adidas-Yeezy-Boost-700-MNVN-Geode', 'adidas Yeezy Boost 700 MNVN Geode', 'sneakers+adidas+adidas+yeezy+700+v1+geode/black+2022-04-19+220+gw9526');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c20f9bde-ff6d-4846-aaf7-375008747d6d', 'New Balance', 'New Balance 550', 'White/Pastel Blue', 'New', 'CN', 'The classic styling of the New Balance 550 UNC White University Blue offers a retro look with traditional basketball oxford styling elements. They feature the classic "N" styling on the sides of the sneaker plus traditional New Balance branding on the tongue of the shoes. These predominantly white shoes have subtle yet distinct touches of North Carolina baby blue on the soles, tongue, and logo to give them an understated yet vibrant look.<br><br>With a release date of January 2022, the New Balance 550 UNC White University Blue retailed for $110.', 'men', 'https://images.stockx.com/images/New-Balance-550-UNC-White-University-Blue-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1638903675', 'UNC White University Blue', 1, '2022-01-25', 110, 'New Balance 550', 'New-Balance-550-UNC-White-University-Blue', 'New Balance 550 UNC White University Blue', 'sneakers+new balance+new balance+550+white/pastel blue+2022-01-25+110+bb550hl1');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c276a2cf-a5b0-4675-ac41-9c196b264f97', 'Nike', 'Nike Dunk', 'Pink/Pink', 'New', 'ID', 'From the time of its first release, the toddler Nike Dunk Low Triple Pink remains one of the top-selling Nike Dunk Low variations.<br><br>Dark and light pink components combine across the upper of Nike Dunk Low Triple Pink, which is made purely of leather, with a pink Nike Swoosh. The perforated toe box and heel counter are all white, constructed with synthetic leather that is made from recycled polyester. The outsole and midsole of Nike Dunk Low Triple Pink (Toddler) are made of rubber, appearing in light shades of pink.<br><br>Nike Dunk Low Triple Pink (Toddler) debuted on January 1, 2022. At the time of its first release, the price of the shoe was $55.', 'toddler', 'https://images.stockx.com/images/Nike-Dunk-Low-Triple-Pink-TD-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1662705109', 'Triple Pink (TD)', 1, '2022-09-13', 55, 'Nike Dunk Low', 'Nike-Dunk-Low-Triple-Pink-TD', 'Nike Dunk Low Triple Pink (TD)', 'sneakers+nike+nike+dunk+low+pink/pink+2022-09-13+55+dh9761-600');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c28a0a86-ded6-41b2-8adf-6bf89ffe32f4', 'Nike', 'Nike Basketball Blazer', 'White/Pine Green', 'New', 'CN', 'The Nike Blazer Mid 77 Vintage Pine Green returns with its heritage b-ball looks, featuring suede details, a retro Swoosh design, and a soft collar. <br><br>The Nike Blazer Mid 77 Vintage Pine Green features white leather on the upper with soft suede and synthetic details for added durability and throwback styling. The ultra-clean colors continue underfoot, where the construction fuses the outsole to the midsole for a streamlined look. The solid rubber outsole with herringbone pattern adds traction, durability, and heritage styling.<br><br>The Nike Blazer Mid 77 Vintage Pine Green was released in January 2021 and retailed for $100.', 'men', 'https://images.stockx.com/images/Nike-Blazer-Mid-77-Vintage-Pine-Green-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1614264199', 'Pine Green', 1, '2021-01-22', 100, 'Nike Blazer Mid 77 Vintage', 'Nike-Blazer-Mid-77-Vintage-Pine-Green', 'Nike Blazer Mid 77 Vintage Pine Green', 'sneakers+nike+nike basketball+blazer+white/pine green+2021-01-22+100+bq6806-115');
