INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c316a4e6-b89b-467b-9faa-c83b6444bb7f', 'Nike', 'Nike SB SB Dunk Low', 'Summit White/Barely Rose/University Red/Coconut Milk/Black', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Nike-SB-Dunk-Low-Skate-Like-a-Girl-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1666162522', 'Skate Like a Girl', 1, '2022-10-17', 130, 'Nike SB Dunk Low', 'Nike-SB-Dunk-Low-Skate-Like-a-Girl', 'Nike SB Dunk Low Skate Like a Girl', 'sneakers+nike+nike sb+sb dunk low+summit white/barely rose/university red/coconut milk/black+2022-10-17+130+dx4589-600');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c318bbcc-312a-4396-9252-698c203d1dea', 'Nike', 'Air Max 1', 'Saturn Gold/Tea Tree Mist/Tent', 'New', 'VN', 'In collaboration with Travis Scott''s record label Cactus Jack, the Nike Air Max 1 Travis Scott Cactus Jack Saturn Gold pays homage to outdoor exploration and the Nike ACG Pocket Knife hiking shoe. It boasts a light yellow layered mesh upper with matching Durabuck overlays and reversed Swoosh logos. A drawstring Gillie lacing system nods to common features on trail runners. At the base, a yellowed sole with a cloudy Air unit adds the finishing touch.<br><br>The Nike Air Max 1 Travis Scott Cactus Jack Saturn Gold released in May of 2022 and retailed for $150.', 'men', 'https://images.stockx.com/images/Nike-Air-Max-1-Travis-Scott-Wheat-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1648066078', 'Travis Scott Cactus Jack Saturn Gold', 1, '2022-05-27', 150, 'Nike Air Max 1', 'Nike-Air-Max-1-Travis-Scott-Wheat', 'Nike Air Max 1 Travis Scott Cactus Jack Saturn Gold', 'sneakers+nike+air max+1+am1+cactus jack+collections-filter+nike-travis-scott+saturn gold/tea tree mist/tent+2022-05-27+150+do9392-700');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c331eb82-3cb8-4cf6-b726-b24d6a254d31', 'Jordan', 'Air Jordan One', 'White/Black-Red', 'New', 'VN', 'The Air Jordan 1 Low Bulls is a low-top variation of the Air Jordan 1 and features the traditional Chicago Bulls'' red and white colors with a hint of black on the laces and around the ankles.<br><br>They are low-top sneakers and feature both the Jumpman and Air Jordan logos on the tongue and on the heel, respectively. Both the sole and the Swoosh on the Air Jordan 1 Low Bulls are red; the red Swoosh atop a white background looks particularly stylish.<br><br>The Air Jordan 1 Low Bulls were first made available for retail in April of 2022 at the price of $100.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Low-Bulls-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1655474867', 'Bulls', 1, '2022-04-01', 100, 'Jordan 1 Low', 'Air-Jordan-1-Low-Bulls', 'Jordan 1 Low Bulls', 'sneakers+jordan+air jordan+one+white/black-red+2022-04-01+100+553558-163');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c360368a-c837-4207-9b5e-146990ab7eea', 'Jordan', 'Air Jordan Three', 'White/Fire Red/Cement Grey/Black', 'New', 'ID', null, 'toddler', 'https://images.stockx.com/images/Air-Jordan-3-Retro-Fire-Red-2022-TD.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1662860653', 'Fire Red (2022) (TD)', 1, '2022-09-10', 80, 'Jordan 3 Retro', 'Air-Jordan-3-Retro-Fire-Red-2022-TD', 'Jordan 3 Retro Fire Red (2022) (TD)', 'sneakers+jordan+air jordan+three+white/fire red/cement grey/black+2022-09-10+80+dm0968-160');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c36e1037-7fc5-4002-9451-75dd0cd79fe4', 'Nike', 'Nike Basketball Blazer', 'White/Black-White-Sail', 'New', 'CN', 'The Nike Blazer Mid 77 Jumbo White Black is a remodeled edition of the classic Nike Blazer, which was styled in the 70s, a staple shoe in the 80s, and a classic in the 90s.<br><br>Although it harnesses the old-school look of the original sneaker, this rethought sneaker features an elastic heel with large pull tabs. It also features oversized Nike swooshes on its sides, jumbo laces, raised herringbone pattern on the rubber outsole, a soft suede accent on the toe, and red stitching around its toe and heel.<br><br>The Nike Blazer Mid 77 Jumbo White Black was released on 4th November 2021. During its release, this sneaker had a retail price of $110.', 'men', 'https://images.stockx.com/images/Nike-Blazer-Mid-77-Jumbo-White-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1637338343', 'White Black', 1, '2021-11-04', 110, 'Nike Blazer Mid 77 Jumbo', 'Nike-Blazer-Mid-77-Jumbo-White-Black', 'Nike Blazer Mid 77 Jumbo White Black', 'sneakers+nike+nike basketball+blazer+white/black-white-sail+2021-11-04+110+dd3111-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c39d0ff2-4d40-4354-83dc-2ee4f5843523', 'Nike', 'Nike Basketball Dunk', 'White/Washed Teal/Electro Purple', 'New', 'VN', 'The women''s Nike Dunk Low Safari Mix (W) explores exotic patterns and textures with its one-of-a-kind construction. Atop a white leather base, the upper features vibrant overlays constructed of leopard-pattern Durabuck, safari print, faux-horsehair, suede, and smooth leather. Vintage-style Nike woven tongue labels add the finishing touch.<br><br>The women''s Nike Dunk Low Safari Mix (W) released in March of 2022 and retailed for $120.', 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Safari-Mix-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1650480982', 'Safari Mix (W)', 1, '2022-05-05', 120, 'Nike Dunk Low', 'Nike-Dunk-Low-Safari-Mix-W', 'Nike Dunk Low Safari Mix (W)', 'sneakers+nike+nike basketball+dunk+low+white/washed teal/electro purple+2022-05-05+120+dn3866-100');
