INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c4bd9f58-4a25-4203-ac4a-0bc827b3181d', 'Jordan', 'Air Jordan Four', 'Tour Yellow/White-Dark Blue Grey', 'New', 'CN', 'Similar to the original Air Jordan 4 Retro Lightning, the 2021 Grade School edition features a mid-top with a bright yellow nubuck upper. The yellow nubuck upper boasts black molded eyelets and matching black netting. In addition to its impressive mid-top, the Air Jordan 4 Retro Lightning 2021 GS also features a molded Jumpman logo as well as dark grey accents on its wings, a white foam midsole, and a grey rubber outsole.<br><br>This magnificent colorway, which was released in August 2021, currently retails at $150.', 'child', 'https://images.stockx.com/images/Air-Jordan-4-Retro-Lightning-2021-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1629383880', 'Lightning (2021) (GS)', 1, '2021-08-28', 150, 'Jordan 4 Retro', 'Air-Jordan-4-Retro-Lightning-2021-GS', 'Jordan 4 Retro Lightning (2021) (GS)', 'sneakers+jordan+air jordan+four+tour yellow/white-dark blue grey+2021-08-28+150+408452-700');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c4cb20fb-476a-4e02-b38d-2679ea1b1dd9', 'Nike', 'Nike SB SB Dunk Low', 'Coconut Milk/Seafoam-Yellow Strike', 'New', 'VN', 'The Nike SB Dunk Low Mummy draws inspiration from the Ancient Egyptian mummification process. It features a layered textile upper with cross-stitched detailing and a suede Swoosh overlay. At the heel, eye graphics peek out from underneath the layered textile. A glow-in-the-dark sole and Eye of Horus woven tongue tag completes this Halloween design.<br><br>The Nike SB Dunk Low Mummy released in October of 2021 and retailed for $110.', 'men', 'https://images.stockx.com/images/Nike-Dunk-SB-Low-Mummy-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1634318374', 'Mummy', 1, '2021-10-28', 110, 'Nike SB Dunk Low', 'Nike-Dunk-SB-Low-Mummy', 'Nike SB Dunk Low Mummy', 'sneakers+nike+nike sb+sb dunk low+mxscavengerhunt+coconut milk/seafoam-yellow strike+2021-10-28+110+dm0774-111');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c4cb5c25-c0b5-42c5-8671-5671080c6b4c', 'New Balance', 'New Balance 550', 'Sea Salt/Yellow/Cream/White/Surf', 'New', 'ID', 'Since its debut in 1982, New Balance 550 Sea Salt Yellow continues to record high sales within the New Balance catalog.<br><br>New Balance 550 Sea Salt Yellow is a product made of animal-free leather at the upper part and a rubber sole. The New Balance 550 Sea Salt Yellow is dressed in a sea-salty yellow, cream, white, and surf colorway under the BB550SSC style code. It features an "N" branding at the quarter panels, a New Balance logo at the tongue, and 550 figures resting at the eyestay.<br><br> The New Balance 550 Sea Salt Yellow became available at a retail price of $120 during its release on July 24, 2022.', 'men', 'https://images.stockx.com/images/New-Balance-550-Sea-Salt-Yellow.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1656058829', 'Sea Salt Yellow', 1, '2022-06-24', 120, 'New Balance 550', 'New-Balance-550-Sea-Salt-Yellow', 'New Balance 550 Sea Salt Yellow', 'sneakers+new balance+new balance+550+sea salt/yellow/cream/white/surf+2022-06-24+120+bb550ssc');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c51a0344-151a-42c5-a6b8-a3e7138a6fae', 'Nike', 'Air Max Plus', 'Black/Black-Black', 'New', 'CN', 'The Nike Air Max Plus Triple Black is an all-black rendition of the Nike Air Max Plus. Released ahead of the 20th anniversary of the Nike Air Max Plus, this shoe features a breathable synthetic upper with closed mesh inserts as well as edgy TPU ribbing, an external toe cap, a textured ankle strip, and a low mudguard. It also features a lightweight midsole with Tuned Air technology and a Max Air sole unit.<br><br>The Nike Air Max Plus Triple Black was released on December 20, 2017. At the time of its release, it retailed for $150.', 'men', 'https://images.stockx.com/images/Nike-Air-Max-Plus-Triple-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1607664784', 'Triple Black', 1, '2017-12-20', 150, 'Nike Air Max Plus', 'Nike-Air-Max-Plus-Triple-Black', 'Nike Air Max Plus Triple Black', 'sneakers+nike+air max+plus+black/black-black+2017-12-20+150+604133-050');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c52941ab-9a34-48c0-a1ee-dc786d5cb69e', 'Jordan', 'Air Jordan Five', 'Regal Pink/Ghost-Copa', 'New', 'CN', 'The Air Jordan 5 Easter (2022) features a Regal Pink Durabuck upper with light purple semi translucent TPU inserts and a puffed, metallic tongue. Jumpman logos on the tongue and heel nod to Jordan Brand''s retro styling of Air Jordan 5s from the mid-2000s. From there, a light purple and white speckled midsole with a bright blue semi translucent outsole completes the design.<br><br>The Air Jordan 5 Easter (2022) released in May of 2022 and retailed for $210.', 'men', 'https://images.stockx.com/images/Air-Jordan-5-Retro-Regal-Pink-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1653982557', 'Easter (2022)', 1, '2022-05-27', 210, 'Jordan 5 Retro', 'Air-Jordan-5-Retro-Regal-Pink', 'Jordan 5 Retro Easter (2022)', 'sneakers+jordan+air jordan+five+regal pink/ghost-copa+2022-05-27+210+dv0562-600');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c545064b-da68-49bf-a9fb-0892f7a676cd', 'Jordan', 'Air Jordan One', 'Varsity Red/Black-Sail-Muslin', 'New', 'ID', null, 'toddler', 'https://images.stockx.com/images/air-jordan-1-retro-high-og-lost-and-found-td.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1666124876', 'Chicago Lost and Found (TD)', 1, '2022-11-19', 70, 'Jordan 1 Retro High OG', 'Air-Jordan-1-Retro-High-OG-Lost-and-Found-TD', 'Jordan 1 Retro High OG Chicago Lost and Found (TD)', 'sneakers+jordan+air jordan+one+chicago+chicago 1+varsity red/black-sail-muslin+2022-11-19+70+fd1413-612');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c58d89d2-fd4b-4473-9e6b-3d6e8d2b3b93', 'Crocs', 'Crocs Collaborations', 'Mauve Mist', 'New', 'CN', 'The Crocs Pollex Clog Salehe Bembury Urchin arrives in a light purple, exo-skeletal look with dramatic, fingerprint-like concave ridges throughout its foam construction. While there aren''t as many ventilation holes in this design compared to traditional Crocs Clogs, the remaining holes are located on high-heat areas of the foot for increased breathability. A removable canvas strap at the ankle provides wearers with an option for a more-secure fit.<br><br>The Crocs Pollex Clog Salehe Bembury Urchin released in May of 2022 and retailed for $85.', 'men', 'https://images.stockx.com/images/Crocs-Pollex-Clog-by-Salehe-Bembury-Urchin-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1653400554', 'by Salehe Bembury Urchin', 1, '2022-05-24', 85, 'Crocs Pollex Clog', 'Crocs-Pollex-Clog-by-Salehe-Bembury-Urchin', 'Crocs Pollex Clog by Salehe Bembury Urchin', 'sneakers+crocs+crocs+collaborations+crocs collaborations+mauve mist+2022-05-24+85+207393-5ps');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c5cc8e01-e9c9-48cd-a4bf-cbd4260f7a8d', 'Nike', 'Nike Dunk', 'White/Black', 'New', 'VN', 'A collaborative design of Nike and Mathew M. Williams, the Nike Dunk Low World Champs Black White model boasts an all-too-familiar black and white colorway on a textured leather base.<br><br>Like the Air Force 1’s, the Nike Dunk Low World Champs Black White silhouette features a gold stitched brand on the shoe tongue and the heel tab, including a black and gold pair of lace dubraes. To complete the look are black leather panels on the mudguard, lace eyelets, heel panel, and a Swoosh detailing extending to the heel tab.<br><br>The Nike Dunk Low World Champs Black White sneaker was released in May 2022, retailing at $120.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-World-Champs-Black-White-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1658500691', 'World Champs Black White', 1, '2022-05-21', 100, 'Nike Dunk Low SE', 'Nike-Dunk-Low-World-Champs-Black-White', 'Nike Dunk Low SE World Champs Black White', 'sneakers+nike+nike+dunk+low+white/black+2022-05-21+100+dr9511-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c62d7b0d-9733-4e37-b3cb-91d11471c6a3', 'adidas', 'adidas Yeezy', 'Glow Green/Glow Green/Glow Green', 'New', 'CN', 'DISCLAIMER: US and UK sizing is the same and does not require any conversion.<br>The Yeezy Slide Glow (2022 Restock) arrives as a more vibrant variation of the 2021 Yeezy Slide Glow. It is constructed with a Glow EVA foam for comfort and responsiveness. A grooved outsole adds proper traction for daily wear.<br><br>The Yeezy Slide Glow (2022 Restock) released in May of 2022 and retailed for $60.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Slide-Glow-Green-2022-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1653034864', 'Glow Green (2022) (Restock)', 1, '2022-05-31', 60, 'adidas Yeezy Slide', 'adidas-Yeezy-Slide-Glow-Green-2022', 'adidas Yeezy Slide Glow Green (2022) (Restock)', 'sneakers+adidas+adidas+yeezy+slides+glow green/glow green/glow green+2022-05-31+60+hq6447');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c62e99ef-f7a6-4b58-83d2-4037200c6e5e', 'Jordan', 'Air Jordan One', 'Sail/Rattan-White-Black-University Red', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Air-Jordan-1-Low-SE-Sail-Rattan-University-Red.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1667855246', 'Sail Rattan University Red', 1, null, 120, 'Jordan 1 Low SE', 'Air-Jordan-1-Low-SE-Sail-Rattan-University-Red', 'Jordan 1 Low SE Sail Rattan University Red', 'sneakers+jordan+air jordan+one+sail/rattan-white-black-university red+120+fb7168-121');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c660234d-bdda-4ab1-928c-9166f77b71df', 'Nike', 'Nike Dunk', 'Sail/Wheat Grass/Orange/Sanded Gold', 'New', 'VN', 'The Nike Dunk Low Sun Club Wheat Grass Orange features an off-white textile upper with light orange leather overlays a stylized Swoosh that depicts an ocean wave. At the collar, hits of Wheat Grass add subtle contrast. From there, a woven tongue label and matching Air Sole add the finishing touch.<br><br>The Nike Dunk Low Sun Club Wheat Grass Orange released in May of 2022 and retailed for $100.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Retro-Sun-Club-Wheat-Grass-Orange-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1651610594', 'Sun Club Wheat Grass Orange', 1, '2022-05-01', 100, 'Nike Dunk Low Retro', 'Nike-Dunk-Low-Retro-Sun-Club-Wheat-Grass-Orange', 'Nike Dunk Low Retro Sun Club Wheat Grass Orange', 'sneakers+nike+nike+dunk+low+sail/wheat grass/orange/sanded gold+2022-05-01+100+dv1681-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c6afc4fc-a39f-4618-8e53-16440e62c9b3', 'Nike', 'Nike Dunk', 'Chlorophyll/White-Vivid Green', 'New', 'VN', 'The Nike Dunk Low Chlorophyll features a light green smooth leather upper with darker green overlays and white Swooshes. Woven tongue labels and Nike embroideries on the heel tabs add a retro look. At the base, a white and green foam sole completes the design.<br><br>The Nike Dunk Low Chlorophyll released in 2022 and retailed for $100.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Chlorophyll-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1653041272', 'Chlorophyll', 1, '2022-07-08', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Chlorophyll', 'Nike Dunk Low Chlorophyll', 'sneakers+nike+nike+dunk+low+chlorophyll/white-vivid green+2022-07-08+100+dj6188-300');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c736189e-5f55-4e9d-911f-19bd7ad54d45', 'Jordan', 'Air Jordan Six', 'Black/Metallic Silver-Chrome', 'New', 'CN', null, 'men', 'https://images.stockx.com/images/Air-Jordan-6-Retro-Metallic-Silver.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1661882057', 'Chrome Metallic Silver', 1, '2022-11-26', 200, 'Jordan 6 Retro', 'Air-Jordan-6-Retro-Metallic-Silver', 'Jordan 6 Retro Chrome Metallic Silver', 'sneakers+jordan+air jordan+six+black/metallic silver-chrome+2022-11-26+200+dx2836-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c7503c62-79bb-4018-bc8b-dc1380ff3993', 'Jordan', 'Air Jordan One', 'Dark Marina Blue/Black-White', 'New', 'VN', 'The kid-sized Air Jordan 1 Retro High OG Dark Marina Blue (GS) for grade school sizes uses the colorway Dark Marina Blue/Black/White with heritage styling. The black leather upper features blue overlays and Swooshes. A black Wings logo appears on the blue collar overlay. The Nike Air logo and Swoosh is white on a blue tongue patch and blue on a white insole. Perforations on the black toebox, blue laces, a black tongue, a white midsole, and a blue outsole complete the look of this shoe.<br><br>The kid-sized Air Jordan 1 Retro High OG Dark Marina Blue GS was released on February 16, 2022, at a retail price of $130.', 'child', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-OG-Dark-Marina-Blue-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1653594952', 'Dark Marina Blue (GS)', 1, '2022-02-16', 130, 'Jordan 1 Retro High OG', 'Air-Jordan-1-Retro-High-OG-Dark-Marina-Blue-GS', 'Jordan 1 Retro High OG Dark Marina Blue (GS)', 'sneakers+jordan+air jordan+one+dark marina blue/black-white+2022-02-16+130+575441-404');
