INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c799f568-3963-4cae-8558-47ff3d564671', 'Nike', 'Nike Basketball Dunk', 'Laser Blue/White/Laser Blue', 'New', 'VN', 'Arriving in a simple, two-tone leather construction, the Nike Dunk High Laser Blue pays homage to the original look of Nike Dunks in the mid-1980s. It features a white and Laser Blue colorway with matching Air soles and woven tongue tags. From there, flat woven laces complete the design.<br><br>The Nike Dunk High Laser Blue released in 2022 and retailed for $110.', 'men', 'https://images.stockx.com/images/Nike-Dunk-High-Retro-Laser-Blue-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1652120946', 'Laser Blue', 1, '2022-04-01', 115, 'Nike Dunk High Retro', 'Nike-Dunk-High-Retro-Laser-Blue', 'Nike Dunk High Retro Laser Blue', 'sneakers+nike+nike basketball+dunk+high+laser blue/white/laser blue+2022-04-01+115+dd1399-400');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c7b19cb9-d8e3-4d21-a7b1-b6608ecf4640', 'Jordan', 'Air Jordan One', 'Black/White-Varsity Red', 'New', 'CN', 'The Air Jordan 1 High Bred Patent features black and red patent leather upper with signature weaved Nike Air tongue labels. From there, a classic Wings logo on the collar and a white with red Air sole complete the retro design.<br><br>The Air Jordan 1 High Bred Patent releases in December of 2021 and retails for $170.<br><br>To shop all Air Jordan 1 shoes, <a href="https://stockx.com/retro-jordans/air-jordan-1">click here.</a> ', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-OG-Bred-Patent-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1633542046', 'Patent Bred', 1, '2021-12-30', 170, 'Jordan 1 Retro High OG', 'Air-Jordan-1-Retro-High-OG-Bred-Patent', 'Jordan 1 Retro High OG Patent Bred', 'sneakers+jordan+air jordan+one+black/white-varsity red+2021-12-30+170+555088-063');
