INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c7e4e698-7580-421c-9e23-0bd546348bc2', 'Nike', 'Nike Dunk', 'University Red/White-Total Orange', 'New', 'CN', 'The Nike Dunk Low Championship Red features a University Red leather upper with white leather overlays and Swooshes. A matching sole and woven tongue label adds the finishing touches to this retro design.<br><br>The Nike Dunk Low Championship Red released in September of 2021 and retailed for $100.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-University-Red-2021-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1633027530', 'Championship Red (2021)', 1, '2021-09-28', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-University-Red-2021', 'Nike Dunk Low Championship Red (2021)', 'sneakers+nike+nike+dunk+low+university red/white-total orange+2021-09-28+100+dd1391-600');
