INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c95e7559-be40-4627-887f-9829442df2ad', 'Nike', 'Air Force One', 'Court Blue/White-Goldtone', 'New', 'VN', 'With a perforated mesh, croc-print, smooth leather, and patent leather construction, the Nike Air Force 1 Undefeated 5 On It Blue Yellow Croc presents rich fabrication throughout the upper. Undefeated’s tally mark insignia on the heel and woven tongue labels nods to custom AF1s of the early-2000s. From there, exposed foam on the edges of the tongue and a yellowed Air sole adds a vintage appeal.<br><br>The Nike Air Force 1 Undefeated 5 On It Blue Yellow Croc released in October of 2021 and retailed for $120.', 'men', 'https://images.stockx.com/images/Nike-Air-Force-1-Low-Undefeated-Dunk-Vs-AF1-Croc-Blue-Yellow-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1632510078', 'Undefeated 5 On It Blue Yellow Croc', 1, '2021-09-08', 120, 'Nike Air Force 1 Low SP', 'Nike-Air-Force-1-Low-Undefeated-Dunk-Vs-AF1-Croc-Blue-Yellow', 'Nike Air Force 1 Low SP Undefeated 5 On It Blue Yellow Croc', 'sneakers+nike+air force+one+low+court blue/white-goldtone+2021-09-08+120+dm8462-400');
