INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c98e2c71-be78-4814-a4a0-12c233098dcf', 'Nike', 'Nike Basketball Dunk', 'Judge Grey/Brown/White', 'New', 'VN', 'The Swoosh on the Nike Dunk Low Judge Grey is white, as are the laces and the Nike logo on the tongue.<br><br>This low-top sneaker has a full leather construction with a mocha-brown base color that’s complemented by a lighter overlay around the heel, where the laces go through and around the toe. The Nike Dunk Low Judge Grey’s sole matches the lighter hue on the overlays, but it also has a white highlight between the base of the sole and the shoe itself.<br><br>The Nike Dunk Low Judge Grey sneaker was made available for retail at a price of $100 in June, 2022.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Judge-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1659678821', 'Judge Grey', 1, '2022-08-30', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Judge-Grey', 'Nike Dunk Low Judge Grey', 'sneakers+nike+nike basketball+dunk+judge grey/brown/white+2022-08-30+100+dj6188-200');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('c9f9e814-ad1d-486d-9617-ba175d8a3899', 'New Balance', 'New Balance 550', 'Sea Salt/Cream/Black', 'New', 'VN', 'The New Balance 550 Cream Black features a smooth white leather upper with perforated overlays, black piping, mesh collars, and cracked leather New Balance logos. At the tongue, a New Balance Basketball woven label adds a vintage feel. From there, a matching sole with court grip completes the design.<br><br>The New Balance 550 Cream Black released in March of 2022 and retailed for $100.', 'men', 'https://images.stockx.com/images/New-Balance-550-Cream-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1651781130', 'Cream Black', 1, '2022-03-05', 100, 'New Balance 550', 'New-Balance-550-Cream-Black', 'New Balance 550 Cream Black', 'sneakers+new balance+new balance+550+sea salt/cream/black+2022-03-05+100+bb550lwt');
