INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('cb10dd60-d03a-48a4-b9d7-fd1c5d410ce3', 'Jordan', 'Air Jordan Four', 'Canyon Purple/Anthracite/Alligator/Safety Orange', 'New', 'CN', null, 'women', 'https://images.stockx.com/images/Air-Jordan-4-Retro-Canyon-Purple-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1660285854', 'Canyon Purple (W)', 1, '2022-10-15', 200, 'Jordan 4 Retro', 'Air-Jordan-4-Retro-Canyon-Purple-W', 'Jordan 4 Retro Canyon Purple (W)', 'sneakers+jordan+air jordan+four+canyon purple/anthracite/alligator/safety orange+2022-10-15+200+aq9129-500');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('cbea2218-3dc4-4a04-b83f-dbba08e05125', 'Jordan', 'Air Jordan Twelve', 'Black/Varsity Red-White', 'New', 'CN', 'The grade-school-sized Air Jordan 12 Retro Playoffs 2022 for grade schoolers (GS) uses the colorway Black/Varsity Red/White. White textured leather overlays the black tumbled leather upper. A light gray leather hit just above the white midsole says, "Jumpman." Jumpman icons appear throughout the shoe on the tongue, insole, outsole, silver metal tabs on the collar, and Jordan Team patch stitched onto the heel. A black and gray checked carbon fiber shank plate is visible through the white rubber of the white, black, and red outsole. <br><br>The kid-sized Air Jordan 12 Retro Playoffs 2022 GS was released on March 11, 2022, at a retail price of $150.', 'child', 'https://images.stockx.com/images/Air-Jordan-12-Retro-Playoffs-2022-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1654198882', 'Playoffs (2022) (GS)', 1, '2022-03-11', 150, 'Jordan 12 Retro', 'Air-Jordan-12-Retro-Playoffs-2022-GS', 'Jordan 12 Retro Playoffs (2022) (GS)', 'sneakers+jordan+air jordan+twelve+black/varsity red-white+2022-03-11+150+153265-006');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('cc2235c9-a9c4-4f02-b050-2d0e54db468a', 'adidas', 'adidas Ultra Boost', 'Core Black/Core Black/Active Red', 'New', 'CN', 'The adidas Ultraboost 4.0 DNA Triple Black is the fourth iteration of the adidas Ultraboost DNA running shoe, offering comfort and cushioning. It offers a full-length BOOST midsole that generates springy, responsive energy. adidas Ultraboost 4.0 DNA Triple Black features a core black colorway designed into a stretchy but snug recycled PRIMEKNIT upper. The shoe also has a floating arch to accommodate an ample range of motion. The water-repellent upper is an innovative complement to the shoe’s widely appreciated sticky traction and lug layout.<br><br>The adidas Ultraboost 4.0 DNA Triple Black was released on December 12, 2020, for $200.', 'men', 'https://images.stockx.com/images/adidas-Ultra-Boost-40-DNA-Triple-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1643885439', 'Triple Black', 1, '2020-12-12', 200, 'adidas Ultra Boost 4.0 DNA', 'adidas-Ultra-Boost-40-DNA-Triple-Black', 'adidas Ultra Boost 4.0 DNA Triple Black', 'sneakers+adidas+adidas+ultra boost+core black/core black/active red+2020-12-12+200+fy9121');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('cc913e2b-9228-4f48-b768-4d7d74671381', 'adidas', 'adidas Yeezy', 'Blush/Blush/Blush', 'New', 'CN', 'With a pale pink monochromatic palette, the adidas Yeezy 500 Blush features a hiking-inspired suede and mesh construction are durable enough for the trails and also versatile enough for daily wear. From there, a sculptural adiPRENE sole adds the finishing touch.<br><br>The adidas Yeezy 500 Blush debuted in February of 2018, and restocked in January of 2022 for a retail price of $200.', 'men', 'https://images.stockx.com/images/Adidas-Yeezy-500-Blush-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606320491', 'Blush', 1, '2018-02-16', 200, 'adidas Yeezy 500', 'adidas-Yeezy-500-Blush', 'adidas Yeezy 500 Blush', 'sneakers+adidas+adidas+yeezy+500+blush/blush/blush+2018-02-16+200+db2908');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('ccb04f32-1a53-460c-bef3-fd378a81ca3f', 'Jordan', 'Air Jordan Three', 'White/Light Curry/Cardinal Red/Cement Grey', 'New', 'CN', 'The grade-school-sized (GS) Air Jordan 3 Retro Cardinal GS uses the colorway White/Light Curry/Cardinal Red/Cement Grey. The laces, tongue, and tumbled leather upper with small perforations on the collar are white. Light curry shows up on lower eyestays and the Jumpman on the tongue. The mudguard, eyestays, sock lining, and Jumpman on the heel are red. Hits on the toe, heel, and eyestays are iconic cement gray. The red insole features a white Jumpman, the white midsole has visible Air, and the grey, white, and red outsole says "Jordan" in red.<br><br>The kid-sized Air Jordan 3 Retro Cardinal GS was released on February 19, 2022, at a retail price of $150.', 'child', 'https://images.stockx.com/images/Air-Jordan-3-Retro-Cardinal-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1646233977', 'Cardinal (GS)', 1, '2022-02-19', 150, 'Jordan 3 Retro', 'Air-Jordan-3-Retro-Cardinal-GS', 'Jordan 3 Retro Cardinal (GS)', 'sneakers+jordan+air jordan+three+white/light curry/cardinal red/cement grey+2022-02-19+150+398614-126');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('ccc77727-c82d-48f8-8c61-9eb5b183a950', 'adidas', 'adidas Yeezy', 'Onyx/Onyx/Onyx', 'New', 'CN', 'First revealed in February 2022 at the Donda 2 listening event in Miami, the adidas Yeezy Slide Onyx features an all-black foam construction with a soft footbed for comfort. At the base, a grooved outsole adds stability and responsiveness.<br><br>The adidas Yeezy Slide Onyx released in March of 2022 and retailed for $60.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Slide-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1646687426', 'Onyx', 1, '2022-03-07', 60, 'adidas Yeezy Slide', 'adidas-Yeezy-Slide-Black', 'adidas Yeezy Slide Onyx', 'sneakers+adidas+adidas+yeezy+slides+onyx/onyx/onyx+2022-03-07+60+hq6448');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('ccde9173-05fd-4fa5-b40d-aec51830b425', 'Jordan', 'Air Jordan Five', 'White/Court Purple-Racer Pink-Ghost Green', 'New', 'CN', 'Jumpman paid tribute to Will Smith’s electrifying 90s outfits in The Fresh Prince of Bel-Air with the Jordan 5 Alternate Bel-Air, now available on StockX. Drawing inspiration from the 2013 Jordan 5 Bel-Air, the Alternate Bel-Air arrives with a brighter take on Smith’s favorite Jordans.<br><br>Also known as the Jordan 5 Poison Green, the Alternate Bel-Air consists of the same 90s style colors and patterns as its predecessor, only this time the grey upper is replaced with white leather. A multi-color midsole, icy translucent outsole, and mismatched green and pink Jumpman logos on the tongues complete this retro-style masterpiece. These sneakers released in August of 2020 and retailed for $200.', 'men', 'https://images.stockx.com/images/Air-Jordan-5-Retro-Alternate-Bel-Air-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606316558', 'Alternate Bel-Air', 1, '2020-08-15', 200, 'Jordan 5 Retro', 'Air-Jordan-5-Retro-Alternate-Bel-Air', 'Jordan 5 Retro Alternate Bel-Air', 'sneakers+jordan+air jordan+five+white/court purple-racer pink-ghost green+2020-08-15+200+db3335-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('cd541468-6566-4fef-985b-12d293502f94', 'Jordan', 'Air Jordan One', 'Light Smoke Grey/Black-White', 'New', 'VN', 'The Air Jordan 1 Low Shadow Toe (2021) is a sleek and stylish take on the classic Jordan 1 silhouette.<br><br>The highlight of this shoe is the Shadow Toe box, which gives the shoe a unique look. Featuring a black and gray upper with a white midsole and translucent, light-blue outsole, this shoe has a simple but refined look. It is distinct from other shoes thanks in part to the Jumpman embroidery on the collar and the patent leather overlays.<br><br>The Air Jordan 1 Low Shadow Toe (2021) released in June of 2021. At the time of its release and beyond, the shoe has a retail cost of $100.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Low-Shadow-Toe-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1649865016', 'Shadow Toe', 1, '2022-03-01', 100, 'Jordan 1 Low', 'Air-Jordan-1-Low-Shadow-Toe', 'Jordan 1 Low Shadow Toe', 'sneakers+jordan+air jordan+one+light smoke grey/black-white+2022-03-01+100+553558-052');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('cd5e9c73-b5ae-46c3-8270-d9d919d8e01d', 'Nike', 'Nike Dunk', 'Summit White/Black-Oil Green-Rattan', 'New', 'CN', 'The women’s exclusive Nike Dunk High Next Nature Summit White (W) features a multicolor quilted upper with fleece lining and suede eyestays. From there, a black Swoosh and brown speckled outsole completes the design. This product is waste-conscious, as 20% of the design by weight is made of recycled material.<br><br>The women''s Nike Dunk High Next Nature Summit White (W) released in November of 2021 and retailed for $120.', 'women', 'https://images.stockx.com/images/Nike-Dunk-High-Next-Nature-Summit-White-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1636047129', 'Next Nature Summit White (W)', 1, '2021-11-03', 130, 'Nike Dunk High', 'Nike-Dunk-High-Next-Nature-Summit-White-W', 'Nike Dunk High Next Nature Summit White (W)', 'sneakers+nike+nike+dunk+high+summit white/black-oil green-rattan+2021-11-03+130+dn9909-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('cdd31f12-69b1-48d5-8fa4-9902c66c19c0', 'Nike', 'Nike Dunk', 'Sail/Sanded Gold-Light Madder Root', 'New', 'VN', 'The Nike Dunk Low Retro Sun Club Multi W has white laces and a white tongue.<br><br>This model has a tan sole and a white midsole. The body features a white base with patches of many different colors, including pink, orange, blue, and green. An abstract drawing is included on the heel in black. The Nike swoosh symbol appears in bright burnt orange color. Around the laces, there is also orange detailing, which loops back to the heel.<br><br>The Nike Dunk Low Retro Sun Club Multi W was first put on the market in July of 2022. It had a starting retail value of $110.', 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Retro-Sun-Club-Multi-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1653401068', 'Sun Club Multi (W)', 1, '2022-07-07', 110, 'Nike Dunk Low Retro', 'Nike-Dunk-Low-Retro-Sun-Club-Multi-W', 'Nike Dunk Low Retro Sun Club Multi (W)', 'sneakers+nike+nike+dunk+low+sail/sanded gold-light madder root+2022-07-07+110+dq0265-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('ceaf429d-7cb5-4101-9841-2718be1f3cb0', 'Jordan', 'Air Jordan One', 'Black/Metallic Silver-White-Black', 'New', 'CN', 'Jordan Brand continued its "Black Toe" theme with the Air Jordan 1 Silver Toe (W). Arriving in women’s sizing, the Silver Toe added a new look to Jordan’s ever-growing women’s collection.The women''s Jordan 1 Silver Toe (W) is a spinoff of the 2018 Jordan 1 High Gold Toe, replacing metallic gold patent leather construction with metallic silver crinkled leather. White and black leather comprise the mid-panel, toe guard, and Swoosh as a nod to other classic Black Toe designs. Nike Air branding on the tongue, an Air Jordan Wings logo on the ankle, and a white/black sole complete the design.The women''s Air Jordan 1 Silver Toe (W) released in February of 2021 and retailed for $170.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-Silver-Toe-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1611952888', 'Silver Toe (W)', 1, '2021-02-19', 170, 'Jordan 1 Retro High', 'Air-Jordan-1-Retro-High-Silver-Toe-W', 'Jordan 1 Retro High Silver Toe (W)', 'sneakers+jordan+air jordan+one+high+black/metallic silver-white-black+2021-02-19+170+cd0461-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('ceb0d74d-4b3c-4a94-bb30-73298f6e821a', 'Jordan', 'Air Jordan One', 'Black/White-Varsity Red', 'New', 'CN', 'A modified version of Michael Jordan’s first signature sneaker, the grade school Air Jordan 1 Retro High OG Bred Patent GS is an outstanding colorway.<br><br>Since its release, the Air Jordan 1 Retro High OG Bred Patent GS has earned a lot of market success primarily because it boasts accented details, including an upper constructed from patent leather, a woven tongue tag, a debossed Air Jordan Wings logo on the ankle, an encapsulated Air-sole cushioning, and an enhanced red rubber outsole.<br><br>The gradeschool Air Jordan 1 Retro High OG Bred Patent GS released in December 2021. It retailed at $130.', 'child', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-OG-Bred-Patent-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1638996968', 'Patent Bred (GS)', 1, '2021-12-30', 130, 'Jordan 1 Retro High OG', 'Air-Jordan-1-Retro-High-OG-Bred-Patent-GS', 'Jordan 1 Retro High OG Patent Bred (GS)', 'sneakers+jordan+air jordan+one+black/white-varsity red+2021-12-30+130+575441-063');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('cf4f6bf9-ad2a-4cde-a357-b4e7913a097b', 'Nike', 'Nike Basketball Dunk', 'White/Barley-White', 'New', 'VN', 'The Nike Dunk Low Essential Paisley Pack Barley also has a white tongue and white shoelaces. The shoe’s logo is printed on the tongue in a barley color.<br><br>This stylish take on a classic model has a barley-colored sole with a white midsole and a white base. The upper part of the shoe has patches of barley-colored leather, with the swoosh symbol featuring a barley paisley pattern. The model has the iconic Nike perforated toebox.<br><br>The Nike Dunk Low Essential Paisley Pack Barley was first introduced in July of 2022. This shoe model had a starting price of $120.', 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Essential-Paisley-Pack-Barley-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1651610568', 'Paisley Pack Barley (W)', 1, '2022-05-01', 120, 'Nike Dunk Low Essential', 'Nike-Dunk-Low-Essential-Paisley-Pack-Barley', 'Nike Dunk Low Essential Paisley Pack Barley (W)', 'sneakers+nike+nike basketball+dunk+low+white/barley-white+2022-05-01+120+dh4401-104');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('d0233acf-7fad-4f56-be9c-bb5b787a4dd0', 'Jordan', 'Air Jordan One', 'French Blue/White/Light Steel Gray/Fire Red', 'New', 'ID', null, 'child', 'https://images.stockx.com/images/Air-Jordan-1-Mid-SE-French-Blue-Light-Steel-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1664347699', 'French Blue Light Steel (GS)', 1, '2022-09-20', 120, 'Jordan 1 Mid SE', 'Air-Jordan-1-Mid-SE-French-Blue-Light-Steel-GS', 'Jordan 1 Mid SE French Blue Light Steel (GS)', 'sneakers+jordan+air jordan+one+french blue/white/light steel gray/fire red+2022-09-20+120+dr6235-401');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('d0303346-4103-44c0-9384-aefd69fab273', 'Nike', 'Nike Dunk', 'Pecan/Sail/Worn Blue/Off Noir', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Nike-Dunk-High-PRM-Certified-Fresh-Brown.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1659687765', 'Vintage Pecan Sail', 1, '2022-09-09', 135, 'Nike Dunk High PRM', 'Nike-Dunk-High-PRM-Certified-Fresh-Brown', 'Nike Dunk High PRM Vintage Pecan Sail', 'sneakers+nike+nike+dunk+high+pecan/sail/worn blue/off noir+2022-09-09+135+dq8800-200');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('d0a19f59-1f0d-41b4-83a6-08b920f22b45', 'adidas', 'adidas Yeezy', 'Blue Tint/Grey Three/High Risk Red', 'New', 'CN', 'In a similar pattern to the renowned adidas Yeezy Boost 350 V2 Zebra, the adidas Yeezy Boost 350 V2 Blue Tint features a marbled grey Primeknit upper with a light grey side stripe that is decorated with bright red SPLY-350 text. At the base, a Blue Tint semi-translucent Boost sole adds cushioning and support. <br><br>The adidas Yeezy Boost 350 V2 Blue Tint originally released in December of 2017, and restocked in January of 2022 at a retail price of $220.', 'men', 'https://images.stockx.com/images/Adidas-Yeezy-Boost-350-V2-Blue-Tint-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606322199', 'Blue Tint', 1, '2017-12-16', 220, 'adidas Yeezy Boost 350 V2', 'adidas-Yeezy-Boost-350-V2-Blue-Tint', 'adidas Yeezy Boost 350 V2 Blue Tint', 'sneakers+adidas+adidas+yeezy+350+v2+blue tint/grey three/high risk red+2017-12-16+220+b37571');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('d0e5b7e4-9503-4128-9f98-48c3ce64147b', 'Jordan', 'Air Jordan Six', 'White/Black-Carmine', 'New', 'CN', 'The Air Jordan 6 Carmine returned in its original form in 2021. The nearly 20-year-old colorway first made its appearance in 1991 during Michael Jordan’s ’91-’92 season and brought in a new form of color blocking to the signature silhouette.<br><br>The Air Jordan 6 Carmine combines red, white, and black colors to represent the Chicago Bulls’ signature colors. The upper features bold red and white colors that help the model pop while on foot. From there, the upper is met with a white and black midsole, with hits of an icy blue outsole appear as well. The final touch to this OG’s return is the signature "Nike Air" on the heel, replacing 2008 and 2012 retros’ "Jumpman" logo.<br><br>The Air Jordan 6 Carmine released in February of 2021 for $200. ', 'men', 'https://images.stockx.com/images/Air-Jordan-6-Retro-Carmine-2020-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1612286105', 'Carmine (2021)', 1, '2021-02-13', 200, 'Jordan 6 Retro', 'Air-Jordan-6-Retro-Carmine-2020', 'Jordan 6 Retro Carmine (2021)', 'sneakers+jordan+air jordan+six+white/black-carmine+2021-02-13+200+ct8529-106');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('d1a8e132-fb5e-42f3-a892-442ba4555bc4', 'Nike', 'Nike Other Running', 'Light Smoke Grey/White-Black', 'New', 'CN', 'The Nike LDWaffle sacai Fragment Grey features a grey mesh upper with layered suede overlays and white leather doubled Swooshes. On the side of the doubled sole, both sacai and Fragment branding is printed in black. From there, a doubled tongue with woven labels completes the design.<br><br>The Nike LDWaffle sacai Fragment Grey released in August of 2021 and retailed for $170.', 'men', 'https://images.stockx.com/images/Nike-LD-Waffle-SF-Sacai-fragment-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1629131187', 'sacai Fragment Grey', 1, '2021-09-15', 170, 'Nike LD Waffle SF', 'Nike-LD-Waffle-SF-Sacai-fragment-Grey', 'Nike LD Waffle SF sacai Fragment Grey', 'sneakers+nike+nike other+running+light smoke grey/white-black+2021-09-15+170+dh2684-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('d2057bfa-01c6-45be-b041-7c7344490112', 'Nike', 'LeBron Eight', 'Retro/Pink Flash-Filament Green-Black', 'New', 'CN', 'In 2021, Nike brought back the classic 2010 Nike LeBron 8 South Beach. The upper consists of a mix of Filament Green leather and carbon fiber. From there, hits of Pink Flash appear on the laces and inner lining. Lastly, a lion head is embossed on the tongue to symbolize LeBron’s status as king of the court. <br><br>The Nike LeBron 8 South Beach (2021) releases July of 2021 for $200.', 'men', 'https://images.stockx.com/images/Nike-LeBron-8-South-Beach-2021-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1622045972', 'South Beach (2021)', 1, '2021-07-21', 200, 'Nike LeBron 8', 'Nike-LeBron-8-South-Beach-2021', 'Nike LeBron 8 South Beach (2021)', 'sneakers+nike+lebron+eight+retro/pink flash-filament green-black+2021-07-21+200+cz0328-400');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('d208a249-5b14-4fb9-9899-73b9888b6747', 'Birkenstock', 'Birkenstock Clogs', 'Taupe', 'New', 'DE', null, 'unisex', 'https://images.stockx.com/images/Birkenstock-Boston-Soft-Footbed-Suede-Taupe-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1664518831', 'Suede Taupe', 1, '2021-08-31', 155, 'Birkenstock Boston Soft Footbed', 'Birkenstock-Boston-Soft-Footbed-Suede-Taupe', 'Birkenstock Boston Soft Footbed Suede Taupe', 'sneakers+birkenstock+birkenstock+clogs+taupe+2021-08-31+155+0560771/0560773');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('d20a0726-94b8-483b-a81c-6293b2ca6b22', 'Nike', 'Nike Dunk', 'White/Washed Teal-Beach Coral-Black', 'New', 'VN', 'The Nike Dunk Low Snakeskin is a retro-release Snakeskin look, honoring the South Beach color scheme. The low collar shoe has infused summery Washed Teal.<br><br>The Nike Dunk Low Snakeskin has a white leather base in the upper with a perforated toe box. The overlays and heels have a Green Teal snakeskin. The green Teal extends to the tongue tags, laces, and sock liner. There’s a pink Swoosh on the panels. The midsole is white and made of rubber. The treaded outsole is also rubber but pink in color.<br><br>This Nike Dunk Low Snakeskin debuted on 27th July 2022. It retailed at $120.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Snakeskin-Washed-Teal-Bleached-Coral-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1658500669', 'Snakeskin Washed Teal Bleached Coral', 1, '2022-07-27', 120, 'Nike Dunk Low', 'Nike-Dunk-Low-Snakeskin-Washed-Teal-Bleached-Coral', 'Nike Dunk Low Snakeskin Washed Teal Bleached Coral', 'sneakers+nike+nike+dunk+low+white/washed teal-beach coral-black+2022-07-27+120+dr8577-300');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('d290e592-2552-4a00-a705-3102caecc473', 'Jordan', 'Air Jordan One', 'Pollen/Black-White', 'New', 'CN', 'In a simple two-tone format, the upper of the Air Jordan 1 High Pollen is constructed of black tumbled leather with Pollen Yellow overlays and Swooshes. Matching woven tongue tags and a Jordan Wings logo on the collar add authentic 1980s detailing.<br><br>The Air Jordan 1 High Pollen released in August of 2021 and retailed for $170.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-Pollen-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1626802470', 'Pollen', 1, '2021-08-14', 170, 'Jordan 1 Retro High', 'Air-Jordan-1-Retro-High-Pollen', 'Jordan 1 Retro High Pollen', 'sneakers+jordan+air jordan+one+pollen/black-white+2021-08-14+170+555088-701');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('d337a8ab-e505-4044-96eb-87d610a52a93', 'Jordan', 'Air Jordan One', 'Gym Red/Black-White', 'New', 'VN', 'The Air Jordan 1 Mid Reverse Bred 2021 is back, this time remixing another popular colorway, centered on the familiar mix of Gym Red, Black, and White.<br><br>The Air Jordan 1 Mid Reverse Bred 2021 features a red leather base accented by contrasting black overlays. The sneaker gets the iconic Nike Swooshes, and additional branding comes in the form of Jumpman tongues, Win(GS) for grade schoolers motifs at the collar, and printed insoles. The sneaker is rounded off with pure white midsoles paired with red rubber outsoles.<br><br>The Air Jordan 1 Mid Reverse Bred 2021 was released in February 2020 and retailed for $120.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Reverse-Bred-2021-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1649427468', 'Reverse Bred (2021)', 1, '2022-02-01', 120, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Reverse-Bred-2021', 'Jordan 1 Mid Reverse Bred (2021)', 'sneakers+jordan+air jordan+one+gym red/black-white+2022-02-01+120+554724-660');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('d371dd76-bd1f-472d-ae34-e972ff72e571', 'Jordan', 'Air Jordan One', 'Varsity Red/Black-Sail-Muslin', 'New', 'CN', null, 'child', 'https://images.stockx.com/images/air-jordan-1-retro-high-og-chicago-reimagined-lost-and-found-gs.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1666124815', 'Chicago Lost and Found (GS)', 1, '2022-11-19', 140, 'Jordan 1 Retro High OG', 'Air-Jordan-1-Retro-High-OG-Chicago-Reimagined-GS', 'Jordan 1 Retro High OG Chicago Lost and Found (GS)', 'sneakers+jordan+air jordan+one+chicago+chicago 1+varsity red/black-sail-muslin+2022-11-19+140+fd1437-612');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('d42230da-5ab1-4700-be78-09c43d957582', 'Jordan', 'Air Jordan One', 'White/Neutral Grey-Phantom-Sail', 'New', 'VN', 'Boasting a deconstructed look, the Jordan 1 Low Inside Out Cream White Light Grey features a light grey smooth leather upper with tonal grey Durabuck overlays and Swooshes. Orange sashiko style stitching on the Swoosh adds a pop of color against a neutral backdrop. At the base, a white and grey Air sole adds the finishing touch.<br><br>The Jordan 1 Low Inside Out Cream White Light Grey released in April of 2022 and retailed for $110.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Low-Inside-Out-Cream-White-Light-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1661194938', 'Inside Out White Phantom', 1, '2022-04-01', 110, 'Jordan 1 Low', 'Air-Jordan-1-Low-Inside-Out-Cream-White-Light-Grey', 'Jordan 1 Low Inside Out White Phantom', 'sneakers+jordan+air jordan+one+white/neutral grey-phantom-sail+2022-04-01+110+dn1635-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('d4278f19-a307-4277-afc6-e1de343fbb71', 'Nike', 'Nike Other Other', 'Light Cream/White-Light Bone', 'New', 'VN', 'After a brief hiatus following the renowned Mars Yard series, Nike and Tom Sachs joined forces once again in 2022 for the NikeCraft General Purpose Shoe.<br><br>The NikeCraft General Purpose Shoe (GPS) is a minimalist, do-everything shoe that will thrive in any possible scenario thrown your way. In a clean styling, the GPS boasts a three-piece molded cup sole, suede mudguards, microfiber collar, and an ultra-breathable knit that is open enough to breathe but tight enough to fend off rain and snow. Touching on Sachs'' previous designs, a waffle tread outsole similar to that of the first Nike Moon Shoe and a tongue with exposed foam edges adds a vintage appeal.<br><br>The NikeCraft General Purpose Shoe released in June of 2022 and retailed for $110.', 'unisex', 'https://images.stockx.com/images/NikeCraft-General-Purpose-Shoe-Tom-Sachs-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1655990902', 'Tom Sachs', 1, '2022-06-10', 110, 'NikeCraft General Purpose Shoe', 'NikeCraft-General-Purpose-Shoe-Tom-Sachs', 'NikeCraft General Purpose Shoe Tom Sachs', 'sneakers+nike+nike other+other+light cream/white-light bone+2022-06-10+110+da6672-200');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('d45f2407-68ff-4e1f-b65e-cd5d54f8784b', 'Nike', 'Dunk High', 'Grey Fog/Light Crimson', 'New', 'ID', null, 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-SE-Jackpot-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1661437314', 'Lottery Pack Grey Fog', 1, '2022-08-31', 120, 'Nike Dunk Low SE', 'Nike-Dunk-Low-SE-Jackpot', 'Nike Dunk Low SE Lottery Pack Grey Fog', 'sneakers+nike+dunk+high+grey fog/light crimson+2022-08-31+120+dr9654-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('d4b27fca-6245-4609-9e1b-e78d29ad9209', 'Nike', 'Nike Other Training', 'Light Chocolate/Rust Pink', 'New', 'CN', 'Drawing inspiration from hiking culture and gear, the Nike Air Trainer 1 SP Travis Scott Grey Wheat arrives in a dark brown canvas construction with matching mesh overlays and single stitch Swoosh logos. Canvas shrouds on the upper give wearers options for styling. At the heel and inside of the tongue, concealed zipper pockets provide extra storage. From there, "Cactus Corporation" insignias at the heel and forefoot velcro strap complete the design.<br><br>The Nike Air Trainer 1 SP Travis Scott Wheat released in May of 2022 and retailed for $160.', 'men', 'https://images.stockx.com/images/Nike-Air-Trainer-1-SP-Travis-Scott-Wheat-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1652713854', 'Travis Scott Wheat', 1, '2022-05-27', 140, 'Nike Air Trainer 1 SP', 'Nike-Air-Trainer-1-SP-Travis-Scott-Wheat', 'Nike Air Trainer 1 SP Travis Scott Wheat', 'sneakers+nike+nike other+training+cactus jack+collections-filter+nike-travis-scott+light chocolate/rust pink+2022-05-27+140+dr7515-200');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('d5069760-f955-404d-8f27-f484b22e07b4', 'Jordan', 'Air Jordan Eleven', 'White/White-Black-Legend Blue', 'New', 'CN', 'Michael Jordan debuted the Legend Blue 11 in the 1996 All-Star Game after returning from his first retirement, securing the sneaker’s immortality, but that heritage got an update in 2021 with the Air Jordan 11 Low Legend Blue.<br><br>The Air Jordan 11 Low Legend Blue features an all-white upper constructed of smooth leather and patent leather. Jumpman and "23" insignias are displayed on the back of the ankle. A white midsole, and an "icy" translucent outsole completes the design.<br><br>The Jordan 11 Low Legend Blue released in May of 2021 and retailed for $185.', 'men', 'https://images.stockx.com/images/Air-Jordan-11-Retro-Low-Legend-Blue-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1618932440', 'Legend Blue', 1, '2021-05-07', 185, 'Jordan 11 Retro Low', 'Air-Jordan-11-Retro-Low-Legend-Blue', 'Jordan 11 Retro Low Legend Blue', 'sneakers+jordan+air jordan+eleven+low+white/white-black-legend blue+2021-05-07+185+av2187-117');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('d5072c76-4502-4267-b1cb-dd41a4265559', 'Jordan', 'Air Jordan Three', 'White/Black-Cement Grey-Racer Blue', 'New', 'CN', 'The Air Jordan 3 Racer Blue features a white tumbled leather upper with grey perforated leather eyestays and Cement overlays. From there, hits of Racer Blue on the Jumpman logos and midsole add vibrance to the classic model. <br><br>The Air Jordan 3 Racer Blue released in July of 2021 and retailed for $190.', 'men', 'https://images.stockx.com/images/Air-Jordan-3-Retro-Racer-Blue-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1626802534', 'Racer Blue', 1, '2021-07-10', 190, 'Jordan 3 Retro', 'Air-Jordan-3-Retro-Racer-Blue', 'Jordan 3 Retro Racer Blue', 'sneakers+jordan+air jordan+three+white/black-cement grey-racer blue+2021-07-10+190+ct8532-145');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('d514a683-46e2-4bc7-9027-fbcdaaaa9005', 'Jordan', 'Air Jordan Four', 'White/Black-Tech Grey-Fire Red', 'New', 'CN', 'Jordan Brand revisited an iconic colorway with the Air Jordan 4 Fire Red (2020), now available on StockX. This release returns in its original form with "Nike Air" branded heels, making it the first time this colorway has retroed in this variation since its debut in 1989.<br><br>This Jordan 4 consists of a white leather upper with black and Fire Red detailing. Rubber netted underlays, black heel tabs with "Nike Air" branding, and black with fire red midsoles completes this design. These sneakers released in November of 2020 and retailed for $200.', 'men', 'https://images.stockx.com/images/Air-Jordan-4-Retro-Fire-Red-2020-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606762588', 'Fire Red (2020)', 1, '2020-11-28', 200, 'Jordan 4 Retro', 'Air-Jordan-4-Retro-Fire-Red-2020', 'Jordan 4 Retro Fire Red (2020)', 'sneakers+jordan+air jordan+four+white/black-tech grey-fire red+2020-11-28+200+dc7770-160');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('d5893095-e5a2-4175-b516-a0790a341ecd', 'Jordan', 'Air Jordan One', 'Taxi/White-Black', 'New', 'ID', null, 'child', 'https://images.stockx.com/images/Air-Air-Jordan-1-Mid-Taxi-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1661435933', 'Taxi (GS)', 1, '2022-08-20', 100, 'Air Jordan 1 Mid', 'Air-Air-Jordan-1-Mid-Taxi-GS', 'Air Jordan 1 Mid Taxi (GS)', 'sneakers+jordan+air jordan+one+taxi/white-black+2022-08-20+100+554725-701');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('d62fe47c-223e-4e8a-af69-6c1633783495', 'Jordan', 'Air Jordan Three', 'Midnight Navy/Cement Grey-White', 'New', 'CN', 'Jordan Brand embraced the spirit of the NCAA March Madness basketball tournament with the Air Jordan 3 Retro Midnight Navy. The colorway pays homage to the school colors of the Georgetown Hoyas, one of the most renowned college basketball programs in the NCAA. <br><br>The upper of the Air Jordan 3 Retro Midnight Navy is composed mostly of a Midnight Navy tumbled leather while smooth perforated grey leather appears at the ankle and on the lacing system. In traditional Jordan 3 Cement styling, grey Elephant Print mudguards are located on the toe and heel. Jumpman logos on the tongue and heel tab, a grey Air Unit, and a white and grey sole completes this retro design. <br><br>The Air Jordan 3 Retro Midnight Navy released in March of 2021 and retailed for $190.', 'men', 'https://images.stockx.com/images/Air-Jordan-3-Retro-Georgetown-2021-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1616603723', 'Georgetown (2021)', 1, '2021-03-20', 190, 'Jordan 3 Retro', 'Air-Jordan-3-Retro-Georgetown-2021', 'Jordan 3 Retro Georgetown (2021)', 'sneakers+jordan+air jordan+three+midnight navy/cement grey-white+2021-03-20+190+ct8532-401');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('d6780341-ea0f-48a6-ab13-c9561372936f', 'Jordan', 'Air Jordan One', 'Lucky Green/White-Sail-Black', 'New', 'CN', 'The Jordan 1 Lucky Green takes inspiration from Michael Jordan’s 63-point game against the Boston Celtics in 1986. Although its purpose is to draw attention towards MJ’s iconic scoring performance, the sneakers are known colloquially as the Heineken for its resemblance to the 2003 Nike SB Dunk Low. A mix of Lucky Green, white, and black tumbled leathers are featured on the upper. Hits of red come through on the wings logo, heel, and tongue tab.The women''s Air Jordan 1 Lucky Green released October of 2020 and retailed for $170.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-Lucky-Green-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606761742', 'Lucky Green (W)', 1, '2020-10-14', 170, 'Jordan 1 Retro High', 'Air-Jordan-1-Retro-High-Lucky-Green-W', 'Jordan 1 Retro High Lucky Green (W)', 'sneakers+jordan+air jordan+one+women+high+lucky green/white-sail-black+2020-10-14+170+db4612-300');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('d77321d2-d60e-4bf1-aa78-0df8a8581ac3', 'Nike', 'Dunk Low', 'Honeydew/Phantom/Alligator/Honeydew', 'New', 'ID', null, 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-SE-Fleece-Pack-Honeydew-W.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1667282033', 'Fleece Pack Honeydew (W)', 1, '2022-11-16', 120, 'Nike Dunk Low SE', 'Nike-Dunk-Low-SE-Fleece-Pack-Honeydew-W', 'Nike Dunk Low SE Fleece Pack Honeydew (W)', 'sneakers+nike+dunk+low+honeydew/phantom/alligator/honeydew+2022-11-16+120+dq7579-300');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('d7a70a20-f0fa-4ed7-a5f3-de8893baf1c9', 'Jordan', 'Air Jordan Four', 'Shimmer/Bronze Eclipse-Orange Quartz-Metallic Silver', 'New', 'CN', 'The Air Jordan 4 Shimmer (W) arrives with a buttery beige Durabuck upper with semi-translucent "Wings" and a monotone Orange Bronze heel tab. In place of the classic Jordan Flight tongue patch, a metallic Jumpman logo adds contrast to the softer tones in the design.<br><br>The women’s-exclusive Air Jordan 4 Shimmer (W) released in September of 2021 and retailed for $190.', 'women', 'https://images.stockx.com/images/Air-Jordan-4-Retro-Shimmer-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1633023973', 'Shimmer (W)', 1, '2021-09-03', 190, 'Jordan 4 Retro', 'Air-Jordan-4-Retro-Shimmer-W', 'Jordan 4 Retro Shimmer (W)', 'sneakers+jordan+air jordan+four+shimmer/bronze eclipse-orange quartz-metallic silver+2021-09-03+190+dj0675-200');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('d8e4af3f-7451-4db4-bf8e-d90ac76d2860', 'Nike', 'Nike Basketball Dunk', 'White/Orange-White', 'New', 'VN', 'As part of the 2022 Nike Dunk Low Paisley Pack, the Nike Dunk Low Paisley Pack Orange features a white leather upper with orange leather overlays and paisley textile Swooshes. From there, a paisley heel tab, woven Nike tongue label, and matching Air sole complete the design.<br><br>The Nike Dunk Low Paisley Pack Orange released in May of 2022 and retailed for $120.', 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Essential-Paisley-Pack-Orange-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1651513357', 'Paisley Pack Orange (W)', 1, '2022-05-01', 120, 'Nike Dunk Low Essential', 'Nike-Dunk-Low-Essential-Paisley-Pack-Orange', 'Nike Dunk Low Essential Paisley Pack Orange (W)', 'sneakers+nike+nike basketball+dunk+low+white/orange-white+2022-05-01+120+dh4401-103');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('d8eee114-ad25-4817-afee-f01ea3cdef4b', 'Nike', 'Nike Basketball Other', 'Black/Green/Blue', 'New', 'VN', 'The lower half of the Nike Zoom Freak 3 Uno Wild Card features a Wild cards print on a mesh base. The upper part of the sneaker is black and also has a midfoot strap.<br><br>On the side of the Nike Zoom Freak 3 Uno Wild Card, there is the iconic Nike Swoosh in reverse in the colors blue and white. On the left-hand side of the tongue, there is Uno’s branding, while on the right-hand side of the tongue, there is Giannis’ logo.<br><br>Released in March of 2022, the ​​Nike Zoom Freak 3 Uno Wild Card is a unique spin on a classic sneaker and had a starting retail price of $120.', 'men', 'https://images.stockx.com/images/Nike-Zoom-Freak-3-Uno-Wild-Card-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1647617518', 'Uno Face It', 1, '2022-03-10', 125, 'Nike Zoom Freak 3 NRG', 'Nike-Zoom-Freak-3-Uno-Wild-Card', 'Nike Zoom Freak 3 NRG Uno Face It', 'sneakers+nike+nike basketball+other+giannis+giannis antetokounmpo+black/green/blue+2022-03-10+125+dc9363-001/dc9364-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('d9c74afd-9d45-4547-8d04-cf11a46ad866', 'Jordan', 'Air Jordan Eleven', 'Black/Gym Red/White/Sail', 'New', 'CN', 'Jordan Brand honored Michael Jordan and the Chicago Bulls'' historic 72 win 1995-1996 season with the Air Jordan 11 Low 72-10.<br><br>The Air Jordan 11 Low 72-10 boasts a black tumbled leather upper with a signature patent leather mudguard and woven lace loops. On the interior, an embroidered tongue tag that reads "Inspired by the most historic season led by the greatest player ever" tributes MJ''s monumental accolade. From there, a semi-translucent sole with red and black carbon fiber detailing completes the design.<br><br>The Air Jordan 11 Low 72-10 released in May of 2022 and retailed for $190.', 'men', 'https://images.stockx.com/images/Air-Jordan-11-Retro-Low-72-10-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1651856525', '72-10', 1, '2022-05-14', 190, 'Jordan 11 Retro Low', 'Air-Jordan-11-Retro-Low-72-10', 'Jordan 11 Retro Low 72-10', 'sneakers+jordan+air jordan+eleven+black/gym red/white/sail+2022-05-14+190+av2187-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('da36823e-0d43-4ca4-a334-ce485c582948', 'Nike', 'Nike Dunk', 'Black/Black', 'New', 'VN', 'The Nike Dunk Low Undefeated 5 On It Black, arrives with a black perforated Durabuck upper with matching suede overlays and Swooshes. Undefeated''s signature tally mark insignia appears at the heel and on each woven tongue label. A dark blue, semi-translucent outsole adds a slight coloration to the triple-black design.<br><br>The Nike Dunk Low Undefeated 5 On It Triple Black released in October of 2021 and retailed for $120.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-SP-UNDEFEATED-Black-Dunk-vs-AF1-Pack-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1632232171', 'Undefeated 5 On It Black', 1, '2021-09-08', 120, 'Nike Dunk Low SP', 'Nike-Dunk-Low-SP-UNDEFEATED-Black-Dunk-vs-AF1-Pack', 'Nike Dunk Low SP Undefeated 5 On It Black', 'sneakers+nike+nike+dunk+low+black/black+2021-09-08+120+do9329-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('da3d76cb-a7bc-4177-ad46-cca43f77de19', 'Jordan', 'Air Jordan One', 'White/Starfish-Cacao Wow-Sail', 'New', 'ID', null, 'preschool', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-OG-Starfish-PS.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1665603031', 'Starfish (PS)', 1, '2022-10-27', 80, 'Jordan 1 Retro High OG', 'Air-Jordan-1-Retro-High-OG-Starfish-PS', 'Jordan 1 Retro High OG Starfish (PS)', 'sneakers+jordan+air jordan+one+white/starfish-cacao wow-sail+2022-10-27+80+cu0449-101');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('da6d1a1b-b1ec-4ede-bd2a-489bc39e43f5', 'Jordan', 'Air Jordan One', 'Dark Marina Blue/Black-White', 'New', 'ID', 'The Air Jordan 1 High Dark Marina Blue arrives with a smooth black leather upper with Dark Marina Blue overlays and Swooshes. On the ankle wrap, a black Jordan Wings logo pays homage to the origins of the Air Jordan 1. From there, a contrasting white and blue Air sole completes the design.<br><br>The Air Jordan 1 High Dark Marina Blue releases in February of 2022 and retails for $170.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-OG-Dark-Marina-Blue-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1642023273', 'Dark Marina Blue', 1, '2022-02-16', 170, 'Jordan 1 Retro High OG', 'Air-Jordan-1-Retro-High-OG-Dark-Marina-Blue', 'Jordan 1 Retro High OG Dark Marina Blue', 'sneakers+jordan+air jordan+one+dark marina blue/black-white+2022-02-16+170+555088-404');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('da89d625-db6d-4ac1-be8e-702828ef1009', 'Jordan', 'Air Jordan Nine', 'Chile Red/Black', 'New', 'CN', 'The Air Jordan 9 Retro Chile Red (GS) for grade schoolers for grade schoolers delivers a fiery colorway of the vintage 1993 silhouette in big kid sizing.<br><br>The Air Jordan 9 Retro Chile Red (GS) for grade schoolers upper dons the silhouette’s signature quilted panels along the profiles, with mudguards boasting a shiny patent leather finish. Lace loops and tongue labels interrupt the near-uniform ruby-colored ensemble with black contrast. Pull tabs at the heel also indulge in the pitch-dark contrast, as does the tread underfoot. Lightweight cushioning arrives via a color-matched foam midsole. <br><br>The Air Jordan 9 Retro Chile Red (GS) for grade schoolers was released in May 2022 and retailed for $140.', 'child', 'https://images.stockx.com/images/Air-Jordan-9-Retro-Chile-Red-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1652711327', 'Chile Red (GS)', 1, '2022-05-07', 140, 'Jordan 9 Retro', 'Air-Jordan-9-Retro-Chile-Red-GS', 'Jordan 9 Retro Chile Red (GS)', 'sneakers+jordan+air jordan+nine+chile red/black+2022-05-07+140+302359-600');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('da9bbeb1-c944-4618-bade-ab08841d2375', 'Nike', 'Nike Dunk', 'White/Varsity Royal', 'New', 'CN', 'Nike celebrated the 35th Anniversary of the Nike Dunk by releasing the Nike Dunk Low SP Syracuse (2020), now available on StockX. The Nike Dunk debuted as part of the 1985 Nike College Color’s program, a program that delivered footwear in the school colors of 12 popular basketball programs allowing fans to support their favorite teams from head to toe. This Kentucky colorway was among the first collegiate colorways Nike released, breaking the mold for colorways used on basketball shoes.<br><br>This Nike Dunk Low SP is composed of a white leather upper with varsity royal leather overlays. A white midsole, royal outsole, and classic Nike branding on the tongue completes the design. These sneakers released in March of 2020 and retailed for $100.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-SP-Kentucky_Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606322330', 'Kentucky (2020/2022)', 1, '2020-03-14', 100, 'Nike Dunk Low SP', 'Nike-Dunk-Low-SP-Kentucky', 'Nike Dunk Low SP Kentucky (2020/2022)', 'sneakers+nike+nike+dunk+low+white/varsity royal+2020-03-14+100+cu1726-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('dad801b3-0fbd-4221-8351-bb54c48cdd76', 'adidas', 'adidas Yeezy', 'Israfil/Israfil/Israfil', 'New', 'CN', '<b>Please note: Extra laces required<b> Yeezy added to their already extensive catalog with the Yeezy Boost 350 V2 Israfil, now available on StockX. <br><br>The Yeezy Boost 350 V2 Israfil features the same elements that fans of the sneaker love. The upper features multi-colored threads that add a variety of looks to the wearer’s feet from different angles. From there, the upper is matched with a translucent midsole that showcases the sneaker’s BOOST cushioned tech.<br><br>The Yeezy Boost 350 V2 Israfil released in August of 2020 for $220.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Boost-350-V2-Israfil-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1609432732', 'Israfil', 1, '2020-08-22', 220, 'adidas Yeezy Boost 350 V2', 'adidas-Yeezy-Boost-350-V2-Israfil', 'adidas Yeezy Boost 350 V2 Israfil', 'sneakers+adidas+adidas+yeezy+350+v2+israfil/israfil/israfil+2020-08-22+220+fz5421');
