INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('db62ecec-938c-4ffd-9e86-fa2ccca75ad8', 'Jordan', 'Air Jordan One', 'White/Dark Powder Blue-White', 'New', 'CN', 'The Air Jordan 1 Mid UNC for women (W) is a rendition of Jordan’s beloved Air Jordan 1 Mid. Inspired by MJ’s alma mater, this colorway features a leather upper with a white base, perforated toe box, wing flaps, and Air Jordan wings logos. The white base of the upper is contrasted by powder blue overlays and Nike swoosh logos. For comfortability, this shoe has white cushioned midsoles, and for durability, it has a strengthened blue outsole.<br><br>The Air Jordan 1 Mid UNC W was released on 1st January 2020. Then, it had a retail price of $115.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-Mid-UNC-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1607655608', 'UNC (W)', 1, '2020-01-01', 115, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-UNC-W', 'Jordan 1 Mid UNC (W)', 'sneakers+jordan+air jordan+one+women+mid+white/dark powder blue-white+2020-01-01+115+bq6472-114');
