INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('dca81be1-1460-46f7-aefa-780d9e51edc6', 'Converse', 'Converse Chuck Taylor', 'Milk/White-High Risk Red', 'New', 'CN', 'With a look inspired by the Converse Chuck Taylors of the ‘70s, the Converse Chuck Taylor All Star 70s Hi Comme des Garcons PLAY White has a high-top that blends the collab branding and collaboration. Converse Chuck Taylor All Star 70s Hi Comme des Garcons PLAY White has a white canvas upper with double stitching and shiny metal eyelets. It also features heart icons on the sidewall. The lower part of the shoe mostly features a vulcanized rubber midsole and outsole.<br><br>Converse Chuck Taylor All-Star 70s Hi Commes des Garcons PLAY White was released in January 2019 and retailed at a price of $125.', 'men', 'https://images.stockx.com/images/Converse-Chuck-Taylor-All-Star-70s-Hi-Comme-des-Garcons-PLAY-White-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1607647598', 'Comme des Garcons PLAY White', 1, '2019-01-27', 125, 'Converse Chuck Taylor All-Star 70 Hi', 'Converse-Chuck-Taylor-All-Star-70s-Hi-Comme-des-Garcons-PLAY-White', 'Converse Chuck Taylor All-Star 70 Hi Comme des Garcons PLAY White', 'sneakers+converse+converse+chuck taylor+comme des garcons+milk/white-high risk red+2019-01-27+125+150205c');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('dd3344f7-94d8-402d-ab1b-03e01d373be5', 'adidas', 'adidas Adilette', 'Black/Black/Black', 'New', 'CN', 'The adidas Adilette 22 Slides Black are open-toe sandals that feature a rubber outsole with synthetic inner and outer lining. The sandals have a 3D topographical design on the outside and a contoured footbed.<br><br>Unlike other adidas sandals and shoes that typically display the adidas trefoil logo prominently, the adidas Adilette 22 Slides Black sport only a small branding on the outside of the foot bed with the words "THE BRAND WITH THE THREE STRIPES" in all caps, as well as a tiny adidas trefoil logo to the immediate left of the statement.<br><br>The adidas Adilette 22 Slides Black were released at a retail price of $55 in June, 2022, as part of the adidas Adilette 22 series release.', 'unisex', 'https://images.stockx.com/images/adidas-Adilette-22-Slides-Black_Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1666945956', 'Black', 1, '2022-09-13', 55, 'adidas Adilette 22 Slides', 'adidas-Adilette-22-Slides-Black', 'adidas Adilette 22 Slides Black', 'sneakers+adidas+adidas+adilette+black/black/black+2022-09-13+55+gx6949');
