INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('dd830775-6cb7-40f4-8ef3-4d944c897fce', 'Jordan', 'Air Jordan One', 'White/University Blue-Black', 'New', 'CN', 'Jordan Brand paid homage to MJ’s alma mater with the Air Jordan 1 High University Blue. The University Blue colorway is prominent in the Jordan 1’s history. The first UNC-inspired Jordan 1 dates back to 1985 when the Jordan 1 debuted. Since then, there have been numerous iterations of the UNC 1, most recently the Jordan 1 Retro High Fearless UNC To Chicago. Jumpman is building off of its past and switching it up this week with a new iteration.<br><br>The upper of the Air Jordan 1 High University Blue is composed of a white and black tumbled leather upper with University Blue Durabuck overlays. Following traditional Jordan 1 detailing, a Nike Air woven label is located on the tongue and an Air Jordan Wings Logo is printed on the ankle. A white midsole and University Blue outsole complete rejuvenated classic.<br><br>The Air Jordan 1 High University Blue released in March of 2021 and retailed for $170.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-White-University-Blue-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1611777406', 'White University Blue Black', 1, '2021-03-06', 170, 'Jordan 1 Retro High', 'Air-Jordan-1-Retro-High-White-University-Blue-Black', 'Jordan 1 Retro High White University Blue Black', 'sneakers+jordan+air jordan+one+white/university blue-black+2021-03-06+170+555088-134');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('dda4b14a-5d97-41ce-9e4f-8dfea7d33944', 'Jordan', 'Air Jordan Three', 'White/Black/Dark Iris/Cement Grey', 'New', 'VN', 'The Air Jordan 3 Retro Dark Iris is a high-top sneaker and comes in a white/black/Cement Grey/purple colorway.<br><br>The leather base is primarily white with purple highlights around the heel and on the ankle. The shoe also has a black interior, plus a black-and-gray elephant print overlay. The Air Jordan 3 Retro Dark Iris is completed with a white midsole and Cement Grey outsole. The shoe features the Jumpman logo on the tongue and heel, with the ''AIR'' brand logo below the Jumpman.<br><br>The Air Jordan 3 Retro Dark Iris is set for release in August, 2022, at the retail price of $200.', 'men', 'https://images.stockx.com/images/Air-Jordan-3-Retro-Dark-Iris-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1662666801', 'Dark Iris', 1, '2022-08-24', 200, 'Jordan 3 Retro', 'Air-Jordan-3-Retro-Dark-Iris', 'Jordan 3 Retro Dark Iris', 'sneakers+jordan+air jordan+three+aj3+white/black/dark iris/cement grey+2022-08-24+200+ct8532-105');
