INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('ddece2ad-58bb-4701-bb93-6f0c8c750032', 'Nike', 'Air Max 97', 'Black/Black/Black', 'New', 'CN', 'Crafted from recycled materials, the Nike Air Max 97 Triple Black is covered in a black mesh and leather combination for a monochromatic look. The Nike Air Max 97 Triple Black is back, this time crafted from a combination of mesh and leather on a water ripple–inspired silhouette. Everything on the shoe gets the black-on-black treatment, including the laces, tongue, and Swoosh. 3M Scotchlite strips supply reflective flair to the monochromatic upper. A multi-window Nike Air midsole and scuff-resistant outsole round off the design. <br><br>The Nike Air Max 97 Triple Black was released in December of 2018 and retailed for $160.', 'men', 'https://images.stockx.com/images/Nike-Air-Max-97-Triple-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1608516508', 'Triple Black', 1, '2018-12-14', 160, 'Nike Air Max 97', 'Nike-Air-Max-97-Triple-Black', 'Nike Air Max 97 Triple Black', 'sneakers+nike+air max+97+black/black/black+2018-12-14+160+bq4567-001');
