INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('dfdf53df-4325-48c9-8ae8-86283ddcfe3f', 'Nike', 'Nike Basketball Blazer', 'White/Sail-Black', 'New', 'CN', 'Drawing inspiration from the original 1973 Nike Blazer, the Nike Blazer Mid 77 White Black (Women''s) utilizes simple color blocking to deliver a throwback look. It features a white leather upper with black Swoosh overlays and grey suede mudguards. At the base, a white Sole completes the design.<br><br>The Nike Blazer Mid 77 White Black (Women''s) was released in April of 2020 for $100.<br><br>To shop all Nike Blazer shoes, <a href="https://stockx.com/nike/blazer">click here.</a> ', 'women', 'https://images.stockx.com/images/Nike-Blazer-Mid-77-White-Black-W.png?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1608521629', 'White Black (W)', 1, '2020-04-01', 100, 'Nike Blazer Mid 77', 'Nike-Blazer-Mid-77-White-Black-W', 'Nike Blazer Mid 77 White Black (W)', 'sneakers+nike+nike basketball+blazer+white/sail-black+2020-04-01+100+cz1055-100');
