INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('e04495da-a5cd-42db-ae41-6c4d56492911', 'Nike', 'Nike Other Other', 'White/Chrome', 'New', 'VN', 'First teased in Drake''s "Laugh Now Cry Later" music video, the Nike Hot Step Air Terra Drake NOCTA White is crafted with white perforated tumbled leather similar to that of Air Jordan 14. Metallic mini Swoosh emblems at the toe and heel pop against a clean background. In addition to Air Max cushioning, G-TEK is also present in the sole, a technology found in the 1999 ACG Air Terra Humara. Subtle NOCTA branding moments on the tongue and insole nod to Drake''s Nike sublabel.<br><br>The Nike Hot Step Air Terra Drake NOCTA White released in March of 2022 and retailed for $180.', 'men', 'https://images.stockx.com/images/Nike-Hot-Step-Air-Terra-Drake-Nocta-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1646233479', 'Drake NOCTA White', 1, '2022-03-03', 180, 'Nike Hot Step Air Terra', 'Nike-Hot-Step-Air-Terra-Drake-Nocta', 'Nike Hot Step Air Terra Drake NOCTA White', 'sneakers+nike+nike other+other+white/chrome+2022-03-03+180+dh4692-100');
