INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('e1424b2a-b44b-4cf1-bbc9-9c3de5c430d2', 'Puma', 'Puma Puma', 'Green Gecko/Red Blast', 'New', 'VN', 'In a similar fashion to Nike basketball shoes that carry the renowned "What The?" moniker, the Puma MB.01 LaMelo Ball Be You boasts a vibrant, asymmetrical look that borrows elements from colorways in the MB.01 collection. Galaxy-print areas of the upper nod to the MB.01 Galaxy, while hits of lime green and hot pink celebrate the popular MB.01 Rock & Morty. LaMelo''s signature "1 of 1" insignia on the tongue and insole adds the finishing touch.<br><br>The Puma MB.01 LaMelo Ball Be You released in July of 2022 and retailed for $120.', 'men', 'https://images.stockx.com/images/Puma-LaMelo-Ball-MB01-Be-You-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1659621825', 'Be You', 1, '2022-07-29', 120, 'Puma LaMelo Ball MB.01', 'Puma-LaMelo-Ball-MB01-Be-You', 'Puma LaMelo Ball MB.01 Be You', 'sneakers+puma+puma+puma+green gecko/red blast+2022-07-29+120+376813-01');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('e158a310-414c-40fd-b267-6e45536ed9b2', 'Jordan', 'Air Jordan Four', 'Black/Black-Light Graphite', 'New', 'CN', 'Jordan Brand brings back a mid-2000’s classic with the Jordan 4 Black Cat (2020), now available on StockX. Originally debuting in 2006, this is the first time the Black Cat colorway has seen a retro. The fourteen year Black Cat drought has officially ended.<br><br>This Jordan 4 is composed of a black nubuck suede upper with matching detailing. Black hardware, netting, and outsoles complete the design. These sneakers released in January of 2020 and retailed for $190.', 'men', 'https://images.stockx.com/images/Air-Jordan-4-Retro-Black-Cat-2020-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606315877', 'Black Cat (2020)', 1, '2020-01-22', 190, 'Jordan 4 Retro', 'Air-Jordan-4-Retro-Black-Cat-2020', 'Jordan 4 Retro Black Cat (2020)', 'sneakers+jordan+air jordan+four+black/black-light graphite+2020-01-22+190+cu1110-010');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('e175c189-cf87-4007-bc94-e5b919c4c75c', 'Nike', 'Nike Dunk', 'White/Black', 'New', 'CN', 'The Nike Dunk Low White Black 2021 women’s sneaker features a white and black leather upper with perforations on the toe box.  The base of the upper starts with white leather, and black leather wraps around it in an even pattern. A black Nike Swoosh logo adorns either side of the upper and wraps around the ankle to complete the design. <br><br>The Nike Dunk Low White Black 2021 women’s sneaker released in March of 2021 and retailed for $100.<br><br>To shop all Nike Dunks, <a href="https://stockx.com/nike/dunk">click here.</a> ', 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-White-Black-2021-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1611766850', 'White Black Panda (2021) (W)', 1, '2021-03-10', 100, 'Nike Dunk Low Retro', 'Nike-Dunk-Low-White-Black-2021-W', 'Nike Dunk Low Retro White Black Panda (2021) (W)', 'sneakers+nike+nike+dunk+low+mxscavengerhunt+white/black+2021-03-10+100+dd1503-101');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('e1857955-ec16-4979-a629-4c2097cd3145', 'Nike', 'Nike Basketball Blazer', 'White/Black-Multi-Color', 'New', 'VN', 'Similar to the Nike Air Force 1 Pixel colorway, the digital-inspired detailing and global gaming logo on its translucent heel tag give the Nike Blazer Mid Have a Good Game (W) a futuristic look.<br><br>The Nike Blazer Mid Have a Good Game sneaker features a smooth, white leather base with "Have A Good Game" embossed onto its lateral side as well as a neutral-toned tongue label reading "Game On/Team Up." It also has gray suede overlays on the forefoot and a white midsole over a green rubber outsole.<br><br>The Nike Blazer Mid Have a Good Game (W) silhouette was released in September 2021, retailing at $100.', 'women', 'https://images.stockx.com/images/Nike-Blazer-Mid-Have-a-Good-Game-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1654199151', 'Have a Good Game (W)', 1, '2021-09-01', 100, 'Nike Blazer Mid', 'Nike-Blazer-Mid-Have-a-Good-Game-W', 'Nike Blazer Mid Have a Good Game (W)', 'sneakers+nike+nike basketball+blazer+white/black-multi-color+2021-09-01+100+do2331-101');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('e358ceff-9838-4700-b293-171b0bccab20', 'Nike', 'Nike Dunk', 'White/University Red', 'New', 'VN', 'Similar to classic Dunks from the mid-1980''s, the Nike Dunk High Championship White Red carries a more traditional look with a two-tone color blocked leather upper. At the base, a matching Air sole completes the design.<br><br>The Nike Dunk High Championship White Red released in May of 2022 and retailed for $115.', 'men', 'https://images.stockx.com/images/Nike-Dunk-High-University-Red-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1645116295', 'Championship White Red', 1, '2022-05-17', 115, 'Nike Dunk High', 'Nike-Dunk-High-University-Red', 'Nike Dunk High Championship White Red', 'sneakers+nike+nike+dunk+high+white/university red+2022-05-17+115+dd1399-106');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('e39dda6c-4e77-402a-82b5-fe87eaf39b76', 'Nike', 'Nike Other Running', 'Black/Black-White-Gunsmoke-Anthracite', 'New', 'CN', 'The Nike Epic React Flyknit 2 Black Anthracite running shoes have a new aesthetic that is inspired by the nostalgic style of 8-bit video games from the 1990s.<br><br>These minimalist, lightweight black white gun smoke Nike Epic React Flyknit 2 Black Anthracite running shoes have great cushioning with an outsoles graphic pattern. Along with a novel bootie-like shape, anatomical lace closure, specially crafted eyelets and molded heal counter give the shoes their style. Featuring a simple design, the upper portion with Flyknit construction conforms to the foot.<br><br>The Nike Epic React Flyknit 2 Black Anthracite debuted on 31st January 2019 and retailed at $150.', 'men', 'https://images.stockx.com/images/Nike-Epic-React-Flyknit-2-Black-Anthracite-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1614788597', 'Black Anthracite', 1, '2019-01-31', 150, 'Nike Epic React Flyknit 2', 'Nike-Epic-React-Flyknit-2-Black-Anthracite', 'Nike Epic React Flyknit 2 Black Anthracite', 'sneakers+nike+nike other+running+black/black-white-gunsmoke-anthracite+2019-01-31+150+bq8928-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('e40d8a1d-b11e-457d-ac11-49ebb29e1868', 'Jordan', 'Air Jordan One', 'Black/Multi-Color-Sesame-Fire Red-White', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Air-Air-Jordan-1-Mid-Tartan-Swoosh-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1668754099', 'Tartan Swoosh', 1, null, 135, 'Air Jordan 1 Mid', 'Air-Air-Jordan-1-Mid-Tartan-Swoosh', 'Air Jordan 1 Mid Tartan Swoosh', 'sneakers+jordan+air jordan+one+black/multi-color-sesame-fire red-white+135+dz5329-001');
