INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('e429f7ee-82bc-43f0-a6fa-088643b8a8fa', 'Nike', 'Nike Dunk', 'Chlorophyll/White/Vivid Green', 'New', 'ID', 'The Nike Dunk Low Chlorophyll (GS) for grade schoolers for grade schoolers arrives in an all-over vivid green make-up and in grade school sizing. <br><br>The Nike Dunk Low Chlorophyll (GS) for grade schoolers features a light green leather base complemented by chlorophyll green leather overlays. White provides contrast on the sneaker, and the laces and side Swoosh are done in white to soften the look. A perforated toe box offers breathability, while Nike branding appears embroidered in chlorophyll green on the heel tab and tongue tag. Underfoot a white midsole sits atop a green outsole to round off the design.<br><br>The Nike Dunk Low Chlorophyll (GS) for grade schoolers was released in January 2022 and retailed for $85.', 'child', 'https://images.stockx.com/images/Nike-Dunk-Low-Chlorophyll-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1652712336', 'Chlorophyll (GS)', 1, '2022-01-15', 85, 'Nike Dunk Low', 'Nike-Dunk-Low-Chlorophyll-GS', 'Nike Dunk Low Chlorophyll (GS)', 'sneakers+nike+nike+dunk+low+chlorophyll/white/vivid green+2022-01-15+85+dh9765-301');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('e495f41e-336f-4584-b5bf-077d7b02fa82', 'Nike', 'Air Max 90', 'Sail/Sea Glass/Black', 'New', 'VN', 'The Nike Air Max 90 Terrascape Sail Sea Glass features a Sail ripstop nylon upper with matching suede mudguards and black canvas Swooshes. At the base, a semi-translucent Air Max sole with recycled Nike Grind treads completes the design.<br><br>The Nike Air Max 90 Terrascape Sail Sea Glass released in October of 2021 and retailed for $140.', 'men', 'https://images.stockx.com/images/Nike-Air-Max-90-Terrascape-Sail-Sea-Glass-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1639678454', 'Sail Sea Glass', 1, '2021-10-28', 140, 'Nike Air Max 90 Terrascape', 'Nike-Air-Max-90-Terrascape-Sail-Sea-Glass', 'Nike Air Max 90 Terrascape Sail Sea Glass', 'sneakers+nike+air max+90+sail/sea glass/black+2021-10-28+140+dh2973-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('e4b11157-0d0f-4fec-aa15-6e51603307ba', 'adidas', 'adidas Yeezy', 'Bone/Bone/Bone', 'New', 'CN', 'The adidas Yeezy Boost 350 V2 Bone features a triple white Primeknit upper with mesh side stripes and canvas heel tabs. At the base, a semi-translucent sole with Boost technology completes the design.<br><br>The adidas Yeezy Boost 350 V2 Bone released in March of 2022 and retailed for $230.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Boost-350-V2-Pure-Oat-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1648503664', 'Bone', 1, '2022-03-21', 230, 'adidas Yeezy Boost 350 V2', 'adidas-Yeezy-Boost-350-V2-Pure-Oat', 'adidas Yeezy Boost 350 V2 Bone', 'sneakers+adidas+adidas+yeezy+350+v2+bone/bone/bone+2022-03-21+230+hq6316');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('e5352103-71dc-4b8a-bdca-b561aa924143', 'Jordan', 'Air Jordan One', 'White/Worn Blue-Metallic Gold', 'New', 'CN', 'Since its first release, Air Jordan 1 High OG Denim (Women) remains variants of Nike’s Air Jordan recording the highest number of sales.<br><br>The shoe features a retro design comprising of rubber midsole and outsole and full leather uppers, which have a lace-up closure style. The uppers are a mix of won-blue metallic gold while its sole comes in white color. The shoe has a noticeable weight, which is a feature that increases its durability and strength.<br><br>Air Jordan 1 High OG Denim (Women) was released on September 23, 2022. At the time of its debut, the price of the shoe was $170.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-High-OG-Denim-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1657605968', 'Denim (W)', 1, '2022-09-23', 170, 'Jordan 1 High OG', 'Air-Jordan-1-High-OG-Denim-W', 'Jordan 1 High OG Denim (W)', 'sneakers+jordan+air jordan+one+white/worn blue-metallic gold+2022-09-23+170+dm9036-104');
