INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('e624a855-9d60-493a-862a-11346f0d78a1', 'Jordan', 'Air Jordan One', 'Black/White/Light Smoke Gray/University Red', 'New', 'ID', 'The Jordan 1 Mid Elephant Print features the same design language as the Black Cement Air Jordan 3.<br><br>The Jordan 1 MidElephant Print ’s upper section is made of suede/nubuck, which is accented by a gray elephant pattern on the toe overlay and textured leather on the heel. The leather Swooshes and rubber midsoles on the Elephant Print Jordan 1 Mid are white, while the shoe’s outsoles are made of gray leather. The characteristic Jumpman emblem is featured on the shoe’s tongue in striking red.<br><br>The Jordan 1 Mid Elephant Print  made its global debut on May 1, 2022, at a retail price of $115.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Elephant-Print-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1654776012', 'Elephant Print', 1, '2022-05-01', 115, 'Jordan 1 Mid SE', 'Air-Jordan-1-Mid-Elephant-Print', 'Jordan 1 Mid SE Elephant Print', 'sneakers+jordan+air jordan+one+black/white/light smoke gray/university red+2022-05-01+115+dm1200-016');
