INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('e727876c-6d84-440f-976e-e971d8662529', 'Jordan', 'Air Jordan One', 'Ice Blue/Black/Sail/White', 'New', 'CN', null, 'preschool', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Ice-Blue-PS.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1667398406', 'Ice Blue (PS)', 1, '2022-09-19', 75, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Ice-Blue-PS', 'Jordan 1 Mid Ice Blue (PS)', 'sneakers+jordan+air jordan+one+ice blue/black/sail/white+2022-09-19+75+640737-401');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('e774d3b7-66bb-440b-9b10-c6803ea4905b', 'Jordan', 'Air Jordan Five', 'Jade Horizon/Light Silver-Anthracite-Pink Glaze', 'New', 'CN', 'The Air Jordan 5 Jade Horizon features a Jade Horizon leather upper with seemingly oxidized TPU netted inserts, eyestays, and lace-locks for a broken-in look. A black midsole with Cement shark-teeth detailing pays homage to the original Air Jordan 5 Metallic. Although this Jordan 5 is brand new, it ditches the icy, semi-translucent outsole most new Jordan 5s come equipped with for a yellowed one, emphasizing the aged aesthetic.<br><br>The Air Jordan 5 Jade Horizon released in April of 2022 and retailed for $190.', 'men', 'https://images.stockx.com/images/Air-Jordan-5-Retro-Jade-Horizon-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1649685026', 'Jade Horizon', 1, '2022-04-09', 190, 'Jordan 5 Retro', 'Air-Jordan-5-Retro-Jade-Horizon', 'Jordan 5 Retro Jade Horizon', 'sneakers+jordan+air jordan+five+jade horizon/light silver-anthracite-pink glaze+2022-04-09+190+dc7501-300');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('e78070d8-9cab-4b73-9019-c60d574d4e1b', 'Jordan', 'Air Jordan One', 'University Blue/White-Black-University Blue', 'New', 'CN', 'The preschool-sized (PS) Air Jordan 1 Retro High OG University Blue PS has a White/University Blue/Black colorway to honor Michael Jordan''s alma mater, UNC. The tumbled leather upper with perforations in the toe box, the tongue, and the midsole are white. The suede overlays, rubber outsole, and Nike Air logo and Swoosh on the tongue and insole are University Blue. Black accents appear on the tumbled leather Swoosh and collar, the Wings on the collar''s overlay, the laces, the logo patch on the tongue, and on the insole.<br><br>The Air Jordan 1 Retro High OG University Blue PS was released on March 6, 2021, at a retail price of $80.', 'preschool', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-OG-University-Blue-PS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1616520504', 'University Blue (PS)', 1, '2021-03-06', 80, 'Jordan 1 Retro High OG', 'Air-Jordan-1-Retro-High-OG-University-Blue-PS', 'Jordan 1 Retro High OG University Blue (PS)', 'sneakers+jordan+air jordan+one+university blue/white-black-university blue+2021-03-06+80+aq2664-134');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('e7b344ee-f120-4b3e-8bb1-006fa35dc345', 'Nike', 'Nike Basketball Kyrie', 'Beige/Pink/Blue', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Nike-Kyrie-8-Infinity-Mother-Nature-Father-Time-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1667459447', 'Mother Nature & Father Time', 1, '2022-05-01', 130, 'Nike Kyrie Infinity', 'Nike-Kyrie-8-Infinity-Mother-Nature-Father-Time', 'Nike Kyrie Infinity Mother Nature & Father Time', 'sneakers+nike+nike basketball+kyrie+beige/pink/blue+2022-05-01+130+dc9134-200/cz0204-200');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('e83e3ce3-5cfe-473a-b562-d151545f6e22', 'Jordan', 'Air Jordan Four', 'University Blue/Tech Grey/White/Black', 'New', 'CN', 'Made in pre-school sizing, the Air Jordan 4 Retro University Blue (PS) updates the silhouette with a UNC-inspired palette and a smooth suede build.<br><br>The Air Jordan 4 Retro University Blue (PS) has suede throughout the upper, accenting in complement to the laces, netting, and lining. Black-speckled cement-hued overlays provide contrast in tandem with the black that polishes the midsole as well as the eyelets. Jumpman embroideries on the heel patch and tongue complete the design appearing in black and white, respectively.<br><br>The Air Jordan 4 Retro University Blue (PS) was released in April 2021 and retailed for $85.', 'preschool', 'https://images.stockx.com/images/Air-Jordan-4-Retro-University-Blue-PS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1628003409', 'University Blue (PS)', 1, '2021-04-28', 85, 'Jordan 4 Retro', 'Air-Jordan-4-Retro-University-Blue-PS', 'Jordan 4 Retro University Blue (PS)', 'sneakers+jordan+air jordan+four+university blue/tech grey/white/black+2021-04-28+85+bq7669-400');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('e85803e9-2987-46a8-bb78-568bc18933ee', 'Jordan', 'Air Jordan Nine', 'Black/Black-Gum Light Brown', 'New', 'CN', 'First appearing in 2017, the Jordan 9 Boot Gum made its return as part of the Jordan Brand Holiday 2021 collection.<br><br>The Jordan 9 Boot Black Gum features a thick suede and mesh upper with metal loop eyelets drawing inspiration from traditional work boots. Finally, a rugged gum outsole with deep grooves enhances traction and support.<br><br>The Jordan 9 Boot Black Gum released in November of 2021 and retailed for $225.', 'men', 'https://images.stockx.com/images/Air-Jordan-9-Retro-Boot-Black-Gum-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1651684830', 'Black Light Gum', 1, '2021-11-24', 225, 'Jordan 9 Retro Boot NRG', 'Air-Jordan-9-Retro-Boot-Black-Gum', 'Jordan 9 Retro Boot NRG Black Light Gum', 'sneakers+jordan+air jordan+nine+black/black-gum light brown+2021-11-24+225+ar4491-025');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('e8bdd812-5bed-4952-ac3e-4a51a7468421', 'Puma', 'Puma Puma', 'Puma Black/Puma White', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Puma-LaMelo-Ball-MB01-Lo-Black-White-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1668096879', 'Black White', 1, null, 120, 'Puma LaMelo Ball MB.01 Lo', 'Puma-LaMelo-Ball-MB01-Lo-Black-White', 'Puma LaMelo Ball MB.01 Lo Black White', 'sneakers+puma+puma+puma+puma black/puma white+120+376941-12');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('e9059a95-e55d-4886-a592-06ab1581f3f6', 'adidas', 'adidas Yeezy', 'Mono Clay/Mono Clay/Mono Clay', 'New', 'CN', 'The adidas Yeezy 350 V2 Mono Clay is apart of 2021''s Mono pack. The upper of the sneaker introduces a new monofilament mesh to the signature 350 V2 model. A pull tab is stitched to the heel, bringing back the fan-favorite design addition. Lastly, a Boost sole is added to the sole for comfort.<br><br>The adidas Yeezy 350 V2 Mono Clay released in June of 2021 for $220, exclusively in Asia.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Boost-350-V2-Mono-Clay-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1645802628', 'Mono Clay', 1, '2021-06-18', 220, 'adidas Yeezy Boost 350 V2', 'adidas-Yeezy-Boost-350-V2-Mono-Clay', 'adidas Yeezy Boost 350 V2 Mono Clay', 'sneakers+adidas+adidas+yeezy+350+v2+mono clay/mono clay/mono clay+2021-06-18+220+gw2870');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('e90e1888-61f0-4681-8379-a4706e491235', 'adidas', 'adidas Yeezy', 'White/Core Black/Red', 'New', 'CN', 'Debuted in 2017, the adidas Yeezy Boost 350 V2 Zebra is known as one of the most renowned colorways in the Yeezy line. It features a white and black marbled Primeknit upper with a white side-stripe and red "SPLY-350" text. At the base, a cushioned Boost sole provides comfort and support.<br><br>The adidas Yeezy Boost 350 V2 Zebra released in February of 2017 and retailed for $220.', 'men', 'https://images.stockx.com/images/Adidas-Yeezy-Boost-350-V2-Zebra-Product-1.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606321670', 'Zebra (2017/2022)', 1, '2017-02-25', 220, 'adidas Yeezy Boost 350 V2', 'adidas-Yeezy-Boost-350-V2-Zebra', 'adidas Yeezy Boost 350 V2 Zebra', 'sneakers+adidas+adidas+yeezy+350,v2+white/core black/red+2017-02-25+220+cp9654');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('e958e7fb-3cfe-4868-9ef4-336f7ba147a5', 'Nike', 'LeBron Other', 'Racer Blue/Baltic Blue-University Gold-White', 'New', 'VN', 'The LeBron 18 Low Wile E. vs. Roadrunner pays homage to the iconic Looney Tunes characters Wile E. Coyote and Bugs Bunny. The right shoe features a tonal upper with "ACME" contraptions placed throughout the upper. The other shoe nods to Roadrunner with its tonal blue upper and dust cloud graphics. <br><br>The Nike LeBron 18 Low Wile E. vs. Roadrunner released in July of 2021 and retailed for $160.', 'men', 'https://images.stockx.com/images/Nike-Lebron-18-Low-Wile-E-vs-Roadrunner-Space-Jam-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1626704253', 'Wile E. vs Roadrunner Space Jam', 1, '2021-07-16', 160, 'Nike LeBron 18 Low', 'Nike-Lebron-18-Low-Wile-E-vs-Roadrunner-Space-Jam', 'Nike LeBron 18 Low Wile E. vs Roadrunner Space Jam', 'sneakers+nike+lebron+other+racer blue/baltic blue-university gold-white+2021-07-16+160+cv7562-401/cv7564-401 ');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('e981f354-d5e2-4290-8607-6c178efbca71', 'Nike', 'Nike Basketball Blazer', 'White/Sail', 'New', 'VN', 'The Nike Blazer Low sacai White Patent Leather refreshes sacai''s signature Blazer Low with a glossy white patent leather construction. Doubled tongues, eyestays, and laces emphasize sacai''s focus on reconstruction and abstract design. Finally, a stacked midsole provides an avant garde flair.<br><br>The Nike Blazer Low sacai White Patent Leather released in April of 2022 and retailed for $120.', 'men', 'https://images.stockx.com/images/Nike-Blazer-Low-Sacai-White-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1649685149', 'sacai White Patent Leather', 1, '2022-03-31', 120, 'Nike Blazer Low', 'Nike-Blazer-Low-Sacai-White-Grey', 'Nike Blazer Low sacai White Patent Leather', 'sneakers+nike+nike basketball+blazer+white/sail+2022-03-31+120+dm6443-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('e9b7e6be-d44b-43fb-87af-c9d378bc240f', 'Nike', 'Nike Basketball Dunk', 'White/Malachite-White-Malachite', 'New', 'VN', 'The Nike Dunk Low Essential Paisley Pack Green W is part of the Dunk Low Paisley Pack released by Nike Sportswear for 2022.<br><br> This version of the Nike Dunk Low features a white leather base with green leather overlays, laces, insoles, rubber outsole, and nylon tongues. Its most notable features are its bandana print swoosh logos and heel tabs. For increased grip, this sneaker features designed patterns beneath its outsole, whereas it features a perforated toe box to increase its breathability.<br><br>The Nike Dunk Low Essential Paisley Pack Green W was released on 10th March 2022 at a retail price of $120.', 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Essential-Paisley-Pack-Green-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1652464086', 'Paisley Pack Green (W)', 1, '2022-03-10', 120, 'Nike Dunk Low Essential', 'Nike-Dunk-Low-Essential-Paisley-Pack-Green-W', 'Nike Dunk Low Essential Paisley Pack Green (W)', 'sneakers+nike+nike basketball+dunk+low+white/malachite-white-malachite+2022-03-10+120+dh4401-102');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('e9baf4d3-6ece-4bd5-8ef2-764f3952969d', 'adidas', 'adidas Yeezy', 'Onyx/Onyx/Onyx', 'New', 'CN', 'Yeezy expanded their 380 line with a new colorway in the Yeezy Boost 380 Onyx. Unlike 2020’s earlier releases like the Yeezy 380 Mist and Pepper, the Onyx colorway is the first 380 to feature primarily black and dark brown uppers.<br><br>The Yeezy 380 Onyx features a black and dark brown camo-print Primeknit upper with a flat black side spot. Similar to past colorways, a dark translucent BOOST sole delivers the ultimate cushioning experience that is primed to keep your feet fresh with style. <br><br>The Yeezy Boost 380 Onyx released in November of 2020 for $230.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Boost-380-Onyx-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1655988278', 'Onyx', 1, '2020-11-28', 230, 'adidas Yeezy Boost 380', 'adidas-Yeezy-Boost-380-Onyx', 'adidas Yeezy Boost 380 Onyx', 'sneakers+adidas+adidas+yeezy+380+onyx/onyx/onyx+2020-11-28+230+fz1270');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('ea1f7421-4e32-45af-967a-507f8cc54636', 'adidas', 'adidas Yeezy', 'Fade Salt/Fade Salt/Fade Salt', 'New', 'CN', null, 'men', 'https://images.stockx.com/images/adidas-Yeezy-700-V3-Fade-Salt-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1665556054', 'Fade Salt', 1, '2022-09-22', 210, 'adidas Yeezy 700 V3', 'adidas-Yeezy-700-V3-Fade-Salt', 'adidas Yeezy 700 V3 Fade Salt', 'sneakers+adidas+adidas+yeezy+700+v3+fade salt/fade salt/fade salt+2022-09-22+210+id1674');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('ea2a6baf-3292-420c-94f1-6d05ccf54b5a', 'Nike', 'Nike Dunk', 'White/Light Pink-Grey', 'New', 'VN', 'Constructed of 50% recycled materials, the women''s Nike Dunk Low Next Nature Pale Coral (W) features a white Flyleather upper with Pale Coral overlays and Swooshes. From there, matching soles and woven tongue labels complete the design.<br><br>The women''s Nike Dunk Low Next Nature Pale Coral (W) released in November of 2021 and retailed for $100.', 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Move-To-Zero-Pale-Coral-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1636482340', 'Next Nature Pale Coral (W)', 1, '2021-11-03', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Move-To-Zero-Pale-Coral-W', 'Nike Dunk Low Next Nature Pale Coral (W)', 'sneakers+nike+nike+dunk+#vegan+low+white/light pink-grey+2021-11-03+100+dd1873-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('ea4a2e72-8df9-442d-8ad1-ce3233d76f87', 'Jordan', 'Air Jordan One', 'White/Black-Light Smoke Grey-Varsity Red', 'New', 'CN', 'Jordan delivered another new colorway of their most popular silhouette with the Jordan 1 Retro High Light Smoke Grey, now available on StockX. Following a similar reconstructed design language as the Jordan 1 Union LA from 2018, this Jordan 1 utilizes color blocking and different materials to present familiar colors in a unique format.<br><br>The Jordan 1 High Light Smoke Grey is composed of a white leather upper with grey suede overlays and a red leather ankle panel. Black suede on the heel paneling and Swoosh, a white midsole, and black outsole completes the design. This Jordan 1 released in July of 2020 and retailed for $170 USD.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-Light-Smoke-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606320039', 'Light Smoke Grey', 1, '2020-07-11', 170, 'Jordan 1 Retro High', 'Air-Jordan-1-Retro-High-Light-Smoke-Grey', 'Jordan 1 Retro High Light Smoke Grey', 'sneakers+jordan+air jordan+one+white/black-light smoke grey-varsity red+2020-07-11+170+555088-126');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('ea80faa9-3264-41e9-b404-233974bb3c42', 'Nike', 'Nike Basketball Blazer', 'Sail/Enamel Green-Coconut Milk-Off Noir', 'New', 'CN', null, 'men', 'https://images.stockx.com/images/Nike-Blazer-Mid-77-Premium-Certified-Fresh-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1658815732', 'Certified Fresh', 1, '2022-08-11', 100, 'Nike Blazer Mid 77 Premium', 'Nike-Blazer-Mid-77-Premium-Certified-Fresh', 'Nike Blazer Mid 77 Premium Certified Fresh', 'sneakers+nike+nike basketball+blazer+sail/enamel green-coconut milk-off noir+2022-08-11+100+do9787-100');
