INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('eb72fa59-6eaa-4343-b38e-5a12e0ce4a12', 'New Balance', 'New Balance 550', 'Grey/White/Blue', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/New-Balance-550-Aime-Leon-Dore-Grey-Suede.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1667334473', 'Aime Leon Dore Grey Suede', 1, '2022-11-02', 130, 'New Balance 550', 'New-Balance-550-Aime-Leon-Dore-Grey-Suede', 'New Balance 550 Aime Leon Dore Grey Suede', 'sneakers+new balance+new balance+550+grey/white/blue+2022-11-02+130+bb550ac1');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('ebf07127-7afe-4493-b289-968ce00f3c07', 'Nike', 'Air Force One', 'White/Black', 'New', 'CN', 'The Nike Air Force 1 Low ''07 White Black Pebbled Leather features a white pebbled leather upper with black Swooshes and heel panels. Woven Nike labels on the tongue offer a retro feel. At the base, a white Air sole adds the finishing touch.<br><br>The Nike Air Force 1 Low ''07 White Black Pebbled Leather released in January of 2021 and retailed for $90.', 'men', 'https://images.stockx.com/images/Nike-Air-Force-1-07-White-Black-Pebbled-Leather-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1620064850', 'White Black Pebbled Leather', 1, '2021-01-14', 90, 'Nike Air Force 1 Low ''07', 'Nike-Air-Force-1-07-White-Black-Pebbled-Leather', 'Nike Air Force 1 Low ''07 White Black Pebbled Leather', 'sneakers+nike+air force+one+low+white/black+2021-01-14+90+ct2302-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('ec2d9a72-b5d8-472f-ac46-b675b166104b', 'Nike', 'Air Max Plus', 'White/White-Black-Cool Grey', 'New', 'CN', 'The Nike Air Max Plus White is a versatile shoe, ideal for everyday use and an active lifestyle. There is air cushioning on the heels and forefront, allowing for full-length cushion and support. The ankles are also well-supported. The wavy design lines are complemented with the plastic accents and breathable mesh on the upper of the shoe. The shoe also features colored air pods to provide a touch of contrast, and the all-white color of the Nike Air Plus White gives it a clean look.<br><br>The Nike Air Max Plus White was released in January of 2019 for $150.', 'men', 'https://images.stockx.com/images/Nike-Air-Max-Plus-White-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1611597071', 'White', 1, '2019-01-01', 150, 'Nike Air Max Plus', 'Nike-Air-Max-Plus-White', 'Nike Air Max Plus White', 'sneakers+nike+air max+plus+white/white-black-cool grey+2019-01-01+150+604133-139');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('ec78e0d4-c955-496c-945a-bac2fba3dcfb', 'Jordan', 'Air Jordan Six', 'White/Midnight Navy', 'New', 'CN', 'For the first time in over 20 years, Jordan Brand brought back the Air Jordan 6 Midnight Navy in its original form.<br><br>The Air Jordan 6 Midnight Navy arrives in a white tumbled leather construction with perforated panels and a mesh and black rubber tongue. Being that this colorway debuted as a retro, a Jumpman logo embroidery is featured on the heel instead of the OG Nike Air logo. At the base, a Midnight Navy and white Air midsole atop an icy semi-translucent outsole complete the design.<br><br>The Air Jordan 6 Midnight Navy released in May of 2022 and retailed for $200.', 'men', 'https://images.stockx.com/images/Air-Jordan-6-Retro-Midnight-Navy-2022-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1651610342', 'Midnight Navy (2022)', 1, '2022-05-11', 190, 'Jordan 6 Retro', 'Air-Jordan-6-Retro-Midnight-Navy-2022', 'Jordan 6 Retro Midnight Navy (2022)', 'sneakers+jordan+air jordan+six+white/midnight navy+2022-05-11+190+ct8529-141');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('ec8a3bd9-8b68-4832-83a8-c1acf2f95afb', 'Jordan', 'Air Jordan One', 'White/Grey Heather-Olive Aura-Khaki', 'New', 'CN', 'The Air Jordan 1 Zoom CMFT Easter (W) updates the 1985 original with a reconstructed build and an assortment of pastel hues. <br><br>The Air Jordan 1 Zoom CMFT Easter (W) tumbled leather upper comes dressed in a mixture of pastel hues. Introducing a huge contrast is the Nike Swoosh that comes cut out in a mesh material that matches the black laces. The black continues around the heel area with the iconic Win(GS) for grade schoolers logo also dressed in black. The sneaker is rounded off with a Zoom Air-cushioned sole.<br><br>The Air Jordan 1 Zoom CMFT Easter (W) was released in August 2021 and retailed for $140.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-Zoom-CMFT-Easter-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1621454185', 'Easter (W)', 1, '2021-08-19', 140, 'Jordan 1 High Zoom Air CMFT', 'Air-Jordan-1-Zoom-CMFT-Easter-W', 'Jordan 1 High Zoom Air CMFT Easter (W)', 'sneakers+jordan+air jordan+one+white/grey heather-olive aura-khaki+2021-08-19+140+ct0979-101');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('ecafb5fe-389c-4575-9ec1-80a015757043', 'Nike', 'Nike Dunk', 'Obsidian/Obsidian-Summit White-Sport Grey-Red Orbit', 'New', 'VN', 'Created by Peter Moore, the Nike Dunk Low Graffiti Navy sneaker model is another rendition of the Barbershop, Sun Club, Valerian Blue, and Teal Zeal graffiti colorways.<br><br>The Nike Dunk Low Graffiti Navy low-cut style sneakers embrace classic detailing that gives them an artistic appearance, such as canvas underlays decorated with ''90s multicolor spray paint graffiti effect. Like the other design versions, the silhouette features the usual midfoot Swooshes, graffiti-themed printed insoles, and white midsoles, including branded tongue tags and "NIKE" embroidered on the heels in gray and light-gray rubber outsoles.<br><br>The Nike Dunk Low Graffiti Navy model was released in April 2020, retailing at $110.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Graffiti-Navy.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1649445192', 'Graffiti Navy', 1, '2022-07-28', 110, 'Nike Dunk Low', 'Nike-Dunk-Low-Graffiti-Navy', 'Nike Dunk Low Graffiti Navy', 'sneakers+nike+nike+dunk+low+obsidian/obsidian-summit white-sport grey-red orbit+2022-07-28+110+dm0108-400');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('ecf19885-ac5f-4faa-89f4-60fe6f867eb2', 'Jordan', 'Air Jordan One', 'White/Grey-True Blue-Black', 'New', 'VN', 'This Air Jordan 1 Low SE True Blue pays tribute to the original Air Jordan 3 "True Blue" and introduces elephant print to the silhouette.<br><br>The Air Jordan 1 Low SE True Blue upper is built on a white leather base with grey textured leather wrapping around the toe. The sneaker introduces an elephant print on the heel and eye stays, and blue suede adorns the collar. Black is introduced on the Swooshes, and the blue trim continues to the liner, Wings motif, and rubber outsole.<br><br>The Air Jordan 1 Low SE True Blue was released in June 2022 and retailed for $110.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Low-SE-True-Blue-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1651844368', 'True Blue', 1, '2022-06-22', 110, 'Jordan 1 Low SE', 'Air-Jordan-1-Low-SE-True-Blue', 'Jordan 1 Low SE True Blue', 'sneakers+jordan+air jordan+one+white/grey-true blue-black+2022-06-22+110+dm1199-140');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('ed703574-dbba-4166-b333-795397e2a656', 'Jordan', 'Air Jordan One', 'White/Dark Powder Blue/Black', 'New', 'CN', null, 'child', 'https://images.stockx.com/images/air-jordan-1-retro-low-og-black-dark-powder-blue-gs.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1667335427', 'Black Dark Powder Blue (GS)', 1, '2022-07-29', 110, 'Jordan 1 Retro Low OG', 'Air-Jordan-1-Retro-Low-OG-Black-Dark-Powder-Blue-GS', 'Jordan 1 Retro Low OG Black Dark Powder Blue (GS)', 'sneakers+jordan+air jordan+one+white/dark powder blue/black+2022-07-29+110+cz0858-104');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('ed9139db-a07f-4d34-831a-008837829366', 'Jordan', 'Air Jordan Three', 'Black/Silver/White/Pine Green', 'New', 'ID', 'The Air Jordan 3 Pine Green features a black Durabuck upper with signature elephant print overlays and green perforated collars. Hits of Pine Green on the midsole and Jumpman tongue embroidery stand out against their neutral backdrops. From there, a Jumpman heel tab and Air sole adds the finishing touches to this retro design.<br><br>The Air Jordan 3 Pine Green released in October of 2021 and retailed for $190.', 'men', 'https://images.stockx.com/images/Air-Jordan-3-Retro-Pine-Green-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1634917350', 'Pine Green', 1, '2021-10-30', 190, 'Jordan 3 Retro', 'Air-Jordan-3-Retro-Pine-Green', 'Jordan 3 Retro Pine Green', 'sneakers+jordan+air jordan+three+black/silver/white/pine green+2021-10-30+190+ct8532-030');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('ed9a2f73-2653-4fdb-b072-99a561f5ec45', 'Nike', 'Nike Dunk', 'White/Cashmere-Light Lemon Twist', 'New', 'VN', 'The Nike Dunk High Cashmere (W) hosts a trifecta of pastel hues on its overlays. Set in a traditional color-blocked format, hits of purple, pink, and yellow add a vibrant touch to the design''s smooth white leather upper. <br><br>The Nike Dunk High Cashmere (W) released in October of 2021 and retailed for $110.', 'women', 'https://images.stockx.com/images/Nike-Dunk-High-Lemon-Twist-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1633114827', 'Cashmere (W)', 1, '2021-10-20', 110, 'Nike Dunk High', 'Nike-Dunk-High-Lemon-Twist-W', 'Nike Dunk High Cashmere (W)', 'sneakers+nike+nike+dunk+high+white/cashmere-light lemon twist+2021-10-20+110+dd1869-108');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('ee003da7-108f-432a-b7df-bb5b702270a0', 'Nike', 'Nike Other Running', 'Black/Team Orange/Electric Green/White', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Nike-React-Phantom-Run-Flyknit-2-Black-Team-Orange-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1660675092', 'Black Team Orange', 1, '2022-04-09', 140, 'Nike React Phantom Run Flyknit 2', 'Nike-React-Phantom-Run-Flyknit-2-Black-Team-Orange', 'Nike React Phantom Run Flyknit 2 Black Team Orange', 'sneakers+nike+nike other+running+black/team orange/electric green/white+2022-04-09+140+dq7647-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('eeaac0df-a10a-4611-9d18-13e27ab14c7e', 'Jordan', 'Air Jordan Twelve', 'White/French Blue-Metallic Silver', 'New', 'ID', null, 'men', 'https://images.stockx.com/images/Air-Jordan-12-Retro-Low-Golf-French-Blue.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1661340265', 'French Blue', 1, '2022-08-22', 220, 'Jordan 12 Retro Low Golf', 'Air-Jordan-12-Retro-Low-Golf-French-Blue', 'Jordan 12 Retro Low Golf French Blue', 'sneakers+jordan+air jordan+twelve+white/french blue-metallic silver+2022-08-22+220+dh4120-101');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('eeb0dd3a-4ece-4952-8770-5ffdfc75acf0', 'adidas', 'adidas Forum', 'Off White/Brown/Cream White', 'New', 'VN', 'The adidas Forum 84 Low Off White Brown''s color scheme gives the sneaker a neutral vibe that is nimble and infinitely versatile.<br><br>adidas continues to add footwear designs to its lineup around the world. adidas introduced the three-stripe basketball shoe in an off-white/brown color that gives a nod to the past while introducing something new to the company''s catalog. The shoe is made of 100% leather. It has black accents on the ankle collar, heel, and adidas logo, which look crisp against the shoe’s off-white base color.<br><br>The shoe was released in early 2022, costing around $100 in most online stores.', 'men', 'https://images.stockx.com/images/adidas-Forum-84-Low-Off-White-Brown-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1657780646', 'Off White Brown', 1, '2022-06-01', 100, 'adidas Forum 84 Low', 'adidas-Forum-84-Low-Off-White-Brown', 'adidas Forum 84 Low Off White Brown', 'sneakers+adidas+adidas+forum+forum+off white/brown/cream white+2022-06-01+100+gx4567');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('eeb4f558-094a-42e8-9486-322a23617d3b', 'Jordan', 'Air Jordan One', 'White/Court Purple', 'New', 'CN', 'The women''s Air Jordan 1 Court Purple (W) features a white leather upper with hits of Court Purple on the Swoosh and collar. From there, a Court Purple Wings logo is prominent at the ankle, similar to other classic Jordan 1s.The women''s Air Jordan 1 Court Purple (W) released in June of 2021 and retailed for $170.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-Court-Purple-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1622142796', 'Court Purple (W)', 1, '2021-06-03', 170, 'Jordan 1 Retro High', 'Air-Jordan-1-Retro-High-Court-Purple-W', 'Jordan 1 Retro High Court Purple (W)', 'sneakers+jordan+air jordan+one+women+high+white/court purple+2021-06-03+170+cd0461-151');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('eef65a78-1b91-4203-a05e-3ade3bfee5fd', 'Jordan', 'Air Jordan One', 'Gym Red/Black-Gym Red-White', 'New', 'CN', 'The Air Jordan 1 Low Reverse Bred for Grade Schoolers (GS) showcases a clean Chicago Bulls–inspired design. The Air Jordan 1 Low Reverse Bred GS features a black upper with red overlays, a red Swoosh logo running across both lateral and medial sides, and a black embroidered Jumpman and Wings on the tongue and heel, respectively. On the shoe''s solel, you''ll find a classic white rubber midsole to keep you comfortable and a red outsole to give you optimum traction.<br><br>The Air Jordan 1 Low Reverse Bred GS is a Grade School–sized sneaker, released in July, 2020, at a retail price of $75.', 'child', 'https://images.stockx.com/images/Air-Jordan-1-Low-Reverse-Bred-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1607056976', 'Reverse Bred (GS)', 1, '2020-07-01', 75, 'Jordan 1 Low', 'Air-Jordan-1-Low-Reverse-Bred-GS', 'Jordan 1 Low Reverse Bred (GS)', 'sneakers+jordan+air jordan+one+low+kids+gym red/black-gym red-white+2020-07-01+75+553560-606');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('ef1c30a1-9c7f-48a4-89da-d99e2cfcf572', 'Jordan', 'Air Jordan Three', 'White/Black/Dark Iris/Cement Grey', 'New', 'CN', 'The retro-designed Air Jordan 3 Retro Dark Iris (Gradeschool), is part of the Nike’s Air Jordan 3 collection.<br><br>The black "elephant print" strips on the toe and heel are part of the shoe’s upper, which is primarily made of white tumbled leather. The aforementioned "dark iris" elements, visible on the midsole, ankle collar, and bottom lacing eyelets, complete the Air Jordan 3 Retro Dark Iris '' retro design.<br><br>Air Jordan 3 Retro Dark (Gradeschool) Iris debuted on the market on July 9, 2022. At time of its first release, the price of the shoe was $200.', 'child', 'https://images.stockx.com/images/Air-Jordan-3-Retro-Dark-Iris-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1657781101', 'Dark Iris (GS)', 1, '2022-07-09', 150, 'Jordan 3 Retro', 'Air-Jordan-3-Retro-Dark-Iris-GS', 'Jordan 3 Retro Dark Iris (GS)', 'sneakers+jordan+air jordan+three+white/black/dark iris/cement grey+2022-07-09+150+dm0967-105');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('ef206ef1-7fbc-41b7-ac0a-83d8776c2ea8', 'Nike', 'Nike Basketball Air Uptempo', 'Phantom/White/Sand Drift/Light Iron Ore', 'New', 'ID', 'The upper of the Nike Air More Uptempo Phantom GS is made up of leather overlays that enhance its durability. The color-way of Grade school’s Nike Air More Uptempo Phantom is made of ‘White’, ‘Sanddrift’, and ‘Light Iron Ore.’ The sole of this sneaker is made of a two-tone rubber that enhances comfort when running in a basketball court.<br><br>The two-tone rubber on the Nike Air More Uptempo Phantom GS also provides waterproof qualities and offers a better grip when running on treacherous surfaces. This sneaker debuted at a retail price of $125.', 'child', 'https://images.stockx.com/images/Nike-Air-More-Uptempo-Phantom-GS.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1649101422', 'Phantom (GS)', 1, '2022-03-21', 125, 'Nike Air More Uptempo', 'Nike-Air-More-Uptempo-Phantom-GS', 'Nike Air More Uptempo Phantom (GS)', 'sneakers+nike+nike basketball+air uptempo+phantom/white/sand drift/light iron ore+2022-03-21+125+dm1023-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('ef51eb82-438e-40e8-b156-9cbb1635a114', 'Jordan', 'Air Jordan One', 'Black/University Blue-White', 'New', 'VN', 'The women''s Jordan 1 Low Black University Blue White (W) features a smooth white leather upper with black overlays and University Blue Swooshes. At the heel, an embroidered Air Jordan Wings logo nods to the origins of the Air Jordan 1. From there, a nylon tongue with a University Blue Jumpman logo completes the design.<br><br>The women''s Jordan 1 Low Black University Blue White (W) released in March of 2022 and retailed for $100.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-Low-Black-University-Blue-White-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1641573443', 'Black University Blue White (W)', 1, '2021-12-14', 100, 'Jordan 1 Low', 'Air-Jordan-1-Low-Black-University-Blue-White-W', 'Jordan 1 Low Black University Blue White (W)', 'sneakers+jordan+air jordan+one+black/university blue-white+2021-12-14+100+dc0774-041');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('ef63b9c9-6102-4d4b-bce5-1b1a8b4cbce1', 'adidas', 'adidas Yeezy', 'Core Black/Red/Core Black', 'New', 'CN', 'If anyone is discussing what''s hotter than the earth''s core, then the adidas Yeezy Boost 350 V2 Core Red must be a part of the discussion. Bringing hot lava vibes, these come with a core black upper and sole. There''s also a core black "SPLY-350" branding across a scorching hot core red stripe on both sides. These dropped in November 2016 and retailed at $220. Add more sauce to your sneaker collection and buy now on StockX.', 'men', 'https://images.stockx.com/images/Adidas-Yeezy-Boost-350-V2-Core-Black-Red-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606319240', 'Core Black Red (2016/2022)', 1, '2016-11-23', 220, 'adidas Yeezy Boost 350 V2', 'adidas-Yeezy-Boost-350-V2-Core-Black-Red', 'adidas Yeezy Boost 350 V2 Core Black Red (2016/2022)', 'sneakers+adidas+adidas+yeezy+350+v2+core black/red/core black+2016-11-23+220+by9612');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('ef7cf753-b6f2-46cb-a3a7-c8d577497ac2', 'Puma', 'Puma Puma', 'Puma Black', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Puma-LaMelo-Ball-MB01-Iridescent-Dreams-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1663957998', 'Iridescent Dreams', 1, '2022-08-22', 125, 'Puma LaMelo Ball MB.01', 'Puma-LaMelo-Ball-MB01-Iridescent-Dreams', 'Puma LaMelo Ball MB.01 Iridescent Dreams', 'sneakers+puma+puma+puma+puma black+2022-08-22+125+376678-02');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('eff3a6c4-e271-40a9-9cb8-392af2e79195', 'Jordan', 'Air Jordan One', 'Black/Dark Powder Blue-Gym Red', 'New', 'CN', 'Jordan Brand revisits the silhouette that started it all with the women''s Jordan 1 Retro High NC to Chi Leather (W), now available on StockX. This shoe pays homage to MJ’s journey to the NBA, starting as a phenom at UNC to becoming one of the greatest of all time and winning 6 championships as a Chicago Bull.This women''s Jordan 1 is composed of a black tumbled leather upper with red and university blue overlays. A white midsole, red outsole, and classic Nike branding on the tongue complete the design. These sneakers released in February of 2020 and retailed for $170.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-UNC-Chicago-Leather-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606322288', 'NC to Chi Leather (W)', 1, '2020-02-13', 170, 'Jordan 1 Retro High', 'Air-Jordan-1-Retro-High-UNC-Chicago-Leather-W', 'Jordan 1 Retro High NC to Chi Leather (W)', 'sneakers+jordan+air jordan+one+women+black/dark powder blue-gym red+2020-02-13+170+cd0461-046');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('f0c597fc-0b65-487a-a29b-47cfb6411dd0', 'Nike', 'Air Max Other', 'Fossil/Fossil/Black', 'New', 'VN', 'The Nike Air Max 2013 Stüssy Fossil boasts a netted mesh upper with woven overlays, frayed textile side Swooshes, and Stüssy branding at the forefoot - - nodding to past Air Zoom Spiridon and Air Force 1 collaborations. Taking a vintage approach, aged-looking, clouded Air units at the base complete the design.<br><br>The Nike Air Max 2013 Stüssy Fossil released in August of 2022 and retailed for $210.', 'men', 'https://images.stockx.com/images/Nike-Air-Max-2015-Stussy-Fossil-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1660285982', 'Stussy Fossil', 1, '2022-08-12', 210, 'Nike Air Max 2013', 'Nike-Air-Max-2015-Stussy-Fossil', 'Nike Air Max 2013 Stussy Fossil', 'sneakers+nike+air max+other+fossil/fossil/black+2022-08-12+210+dm6447-200');
