INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('f1a10bfe-e9be-4e11-b47f-625f3610dcd5', 'Jordan', 'Air Jordan One', 'Light Madder Root/Dark Teal Green/White', 'New', 'VN', 'The Air Jordan 1 Low Light Madder Root W has the classic Nike swoosh symbol on the side in black, paired with the Air Jordan symbol at the top of the tongue.<br><br>The Air Jordan 1 Low Light Madder Root W has a crisp white sole that features a thin strip of bright pink. The upper part of the show features a few different colors, including pink, black, and light tan. The body of the show is composed of different fabrics and textures, including both leather and suede.<br><br>The Air Jordan 1 Low Light Madder Root (W) for women was first released in April of 2022. It had a starting retail price of $100 for women’s sizes.', 'women', 'https://images.stockx.com/images/Air-Jordan-1-Low-Light-Madder-Root-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1643885867', 'Light Madder Root (W)', 1, '2021-03-01', 100, 'Jordan 1 Low', 'Air-Jordan-1-Low-Light-Madder-Root-W', 'Jordan 1 Low Light Madder Root (W)', 'sneakers+jordan+air jordan+one+light madder root/dark teal green/white+2021-03-01+100+dc0774-800');
