INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('f2233bcb-407e-43cc-8b4f-30f19b4cc50f', 'Jordan', 'Air Jordan One', 'Sail/Black-Military Blue-Shy Pink', 'New', 'CN', 'The Air Jordan 1 High OG SP Fragment Design x Travis Scott fragment draws inspiration from a Jordan 1 Royal press sample from 1985 with its white and blue tumbled leather upper. Similar to previous Travis Scott Jordan 1s, signature reverse Swooshes and hidden stash pockets in the collar add on to the classic design. From there, both Travis Scott''s Cactus Jack and Fragment logos are debossed in black on the heel wrap.<br><br>The Air Jordan 1 High OG SP Fragment Design x Travis Scott released in July of 2021 and retailed for $200.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-High-OG-SP-fragment-design-x-Travis-Scott-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1628097985', 'Fragment x Travis Scott', 1, '2021-07-29', 200, 'Jordan 1 High OG SP', 'Air-Jordan-1-High-OG-SP-fragment-design-x-Travis-Scott', 'Jordan 1 High OG SP Fragment x Travis Scott', 'sneakers+jordan+air jordan+one+sail/black-military blue-shy pink+2021-07-29+200+dh3227-105');
