INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('f39a2b70-fa73-4161-8f2e-1e6a562eee37', 'Jordan', 'Air Jordan One', 'Gym Red/White/Black', 'New', 'VN', 'The Air Jordan 1 Mid Reverse Bred 2021 (GS) for grade schoolers is back, this time remixing another beloved colorway, centered on the familiar mix of "Gym Red/Black/White.<br><br>The Air Jordan 1 Mid Reverse Bred 2021 (GS) for grade schoolers features a red leather base accented by contrasting black overlays. The sneaker gets the iconic Nike Swooshes, and additional branding comes in the form of Jumpman tongues, Win(GS) for grade schoolers motifs at the collar, and printed insoles. The sneaker is rounded off with pure white midsoles paired with red rubber outsoles.<br><br>The Air Jordan 1 Mid Reverse Bred 2021 (GS) for grade schoolers was released in February 2022 and retailed for $85.', 'child', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Reverse-Bred-2021-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1643886176', 'Reverse Bred (2021) (GS)', 1, '2022-02-08', 95, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Reverse-Bred-2021-GS', 'Jordan 1 Mid Reverse Bred (2021) (GS)', 'sneakers+jordan+air jordan+one+gym red/white/black+2022-02-08+95+554725-660');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('f3a160e2-16c0-4c3e-8da0-4cab0dc170c1', 'Jordan', 'Air Jordan Five', 'White/Dark Concord-Black', 'New', 'CN', 'The Air Jordan 5 Retro Dark Concord (Gradeschool) is Jordan Brand’s new colorway that was released as part of its Fall 2022 lineup.<br><br>The new Air Jordan 5 Retro Dark Concord (Gradeschool) is features a dark concord, white, and black color scheme. The offering features a smooth, white leather top that is contrasted by bright purple hits. The white leather top is then paired with the concord contrasted accents and a sock-liner. The design is completed by reflective tongues and a black midsole on top of an icy translucent outsole.<br><br>During its release in August 2022, Air Jordan 5 Retro Dark Concord (Gradeschool) retailed at $150.', 'child', 'https://images.stockx.com/images/Air-Jordan-5-Retro-Dark-Concord-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1660253292', 'Dark Concord (GS)', 1, '2022-08-06', 150, 'Jordan 5 Retro', 'Air-Jordan-5-Retro-Dark-Concord-GS', 'Jordan 5 Retro Dark Concord (GS)', 'sneakers+jordan+air jordan+five+white/dark concord-black+2022-08-06+150+440888-141');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('f3f603f0-e1c0-48d1-9aad-206b00351e1b', 'adidas', 'adidas Yeezy', 'Core Black/Core White/Core Black', 'New', 'CN', 'The adidas Yeezy 350 V2 Core Black White features a simple black Primeknit upper with "SPLY-350" text on a cream side stripe. From there, responsive Boost technology in the sole offers comfort and support.<br><br>The adidas Yeezy 350 V2 Core Black White released in December of 2016, and restocked in March of 2022 for $220.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Boost-350-V2-Core-Black-White-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1648065370', 'Core Black White (2016/2022)', 1, '2016-12-17', 220, 'adidas Yeezy Boost 350 V2', 'adidas-Yeezy-Boost-350-V2-Core-Black-White', 'adidas Yeezy Boost 350 V2 Core Black White (2016/2022)', 'sneakers+adidas+adidas+yeezy+350+v2+core black/core white/core black+2016-12-17+220+by1604');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('f3f899b0-6571-4f75-9207-f61190e17794', 'Jordan', 'Air Jordan Four', 'University Blue/Tech Grey-White-Black', 'New', 'CN', 'Jordan Brand paid homage to MJ’s alma mater with the Air Jordan 4 University Blue. The University Blue colorway draws a close resemblance to the extremely rare Air Jordan 4 UNC PE that was given to Tarheel student-athletes in 2019.<br><br>The Air Jordan 4 University Blue features a University Blue suede upper with mesh netting on the quarter panel and tongue. Similar to OG Jordan 4 colorways of the past, the eyelets, heel tab, and sections of the midsole are a speckled Cement Grey. Hits of black appear on the wing eyelets, sole, and Jumpman logo on the heel tab. Two woven labels are stitched to the tongue; one being the classic Jumpman woven label; the other being a Team Jordan jock tag. A black, white, and Tech Grey sole with a clear Air unit completes the design.<br><br>The Air Jordan 4 University Blue released in April of 2021 and retailed for $200.', 'men', 'https://images.stockx.com/images/Air-Jordan-4-Retro-University-Blue-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1616520672', 'University Blue', 1, '2021-04-28', 200, 'Jordan 4 Retro', 'Air-Jordan-4-Retro-University-Blue', 'Jordan 4 Retro University Blue', 'sneakers+jordan+air jordan+four+university blue/tech grey-white-black+2021-04-28+200+ct8527-400');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('f45957f9-8500-4882-b417-37a83e1c4db7', 'Jordan', 'Air Jordan One', 'White/Black', 'New', 'VN', 'The Jordan 1 Mid Diamond Shorts arrives with a smooth white leather upper with black Durabuck overlays and Swooshes. At the ankle, a traditional Wings logo nods to the origins of the Air Jordan collection. A Jumpman woven tongue label and semi-translucent outsole add the finishing touch.<br><br>The Jordan 1 Mid Diamond Shorts released in February of 2022 and retailed for $120.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Diamond-Shorts-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1645637189', 'Diamond Shorts', 1, '2022-02-09', 120, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Diamond-Shorts', 'Jordan 1 Mid Diamond Shorts', 'sneakers+jordan+air jordan+one+white/black+2022-02-09+120+dh6933-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('f4817529-a854-4f28-a16d-f2902e2c0326', 'Nike', 'Air Max Other', 'Black/Black-Black', 'New', 'CN', 'The Nike Air Max 2017 Triple Black was created for individuals that are active. This model can be worn for everyday walking and more intense exercise.<br><br>This model has a cushioned, supportive sole that was designed with support and comfort in mind. The upper body of the shoe, like the sole, is completely black, and made out of a mixture of leather and mesh. The Nike swoosh symbol can be subtly found in the lower part of the shoe near the heel.<br><br>The Nike Air Max 2017 Triple Black had a starting release date of August 2017. This model was released with a starting retail price of $160.', 'men', 'https://images.stockx.com/images/Nike-Air-Max-2017-Triple-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1607665961', 'Triple Black', 1, '2017-01-01', 190, 'Nike Air Max 2017', 'Nike-Air-Max-2017-Triple-Black', 'Nike Air Max 2017 Triple Black', 'sneakers+nike+air max+other+black/black-black+2017-01-01+190+849559-004');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('f4aa41a4-fd9b-4491-9d83-1c9981473ee0', 'Jordan', 'Air Jordan One', 'Black/Bleached Coral-White', 'New', 'VN', 'The Air Jordan 1 Mid SE Zen Master was released in 2022 as part of Nike’s Air Jordan 1 collection.<br><br>The Air Jordan 1 Mid SE Zen Maste comes with a Black/Bleached Coral/White/Amethyst Wave colorway and mid-top design that features ankle padding. The color scheme unfolds in layers, the base being white leather and the overlays contrasting in black. The Bleached Coral can be found around the shoe''s heel. This model is designed for stability and durability, as evidenced by the inclusion of a cupsole and Nike Air cushioning at the base of the heel.<br><br>The Air Jordan 1 Mid SE Zen Master first became available in July of 2022 at a retail price of $125.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Mid-SE-Zen-Master-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1659725886', 'Zen Master', 1, '2022-06-23', 125, 'Jordan 1 Mid SE', 'Air-Jordan-1-Mid-SE-Zen-Master', 'Jordan 1 Mid SE Zen Master', 'sneakers+jordan+air jordan+one+black/bleached coral-white+2022-06-23+125+dm1200-001');
