INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('f525a88c-e2e9-4427-9d4f-f1e4ca7cd023', 'Nike', 'Nike Dunk', 'White/Lilac', 'New', 'VN', 'Next Nature Lilac is a Dunk Low retro release. It is made of 20% recycled materials. <br><br>The women’s Nike Dunk Low has a white leather upper with a perforated toe box. It also has lilac overlays, Swooshes, and laces. A purple Nike label appears on its white tongue. It also features a volt insole with a black Nike pinwheel logo. The purple heel cap includes an embroidered white Nike logo. A white rubber midsole matching its purple Grind rubber outsole completes the design.<br><br>The women’s Next Nature Lilac Dunk Low was released on July 1, 2022, retailing at $100.', 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Next-Nature-Lilac-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1659075259', 'Next Nature Lilac (W)', 1, '2022-07-16', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Next-Nature-Lilac-W', 'Nike Dunk Low Next Nature Lilac (W)', 'sneakers+nike+nike+dunk+low+white/lilac+2022-07-16+100+dn1431-103');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('f5712f8a-a2e2-497c-8ab7-299365c2a754', 'Jordan', 'Air Jordan Four', 'Black/Fire Red-Cement Grey-Summit White', 'New', 'CN', 'Looking for a classic sneaker to add to your collection? Then you need to buy the latest and greatest Jordan 4 Retro Bred (2019). This AJ 4, also known as "Black Cement 4," comes with a black upper plus grey accents, white midsole plus black, white and grey accents, and a red sole. These sneakers released in May 2019 and retailed for $200. Thrive in one of Jordan’s most iconic sneakers ever, so make sure you have a pair of your own. Buy them today on StockX.', 'men', 'https://images.stockx.com/images/Air-Jordan-4-Retro-Black-Cement-2019-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606316608', 'Bred (2019)', 1, '2019-05-04', 200, 'Jordan 4 Retro', 'Air-Jordan-4-Retro-Bred-2019', 'Jordan 4 Retro Bred (2019)', 'sneakers+jordan+air jordan+four+black/fire red-cement grey-summit white+2019-05-04+200+308497-060');
