INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('f6321f35-312d-44b2-9b18-27ca8b13dc02', 'Jordan', 'Air Jordan Six', 'Black/Light Graphite-Dark Grey-Bordeaux', 'New', 'CN', 'The Air Jordan 6 Bordeaux features a two-tone black and grey Durabuck upper just like the original Jordan 7 Bordeaux. From there, the signature Bordeaux geometric pattern is prominent on the inner-facing tongue and sock liner. Jumpman embroidery on the heel and a semi-translucent outsole complete the retro look.<br><br>The Air Jordan 6 Bordeaux released in September of 2021 and retailed for $190.', 'men', 'https://images.stockx.com/images/Air-Jordan-6-Retro-Bordeaux-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1633620980', 'Bordeaux', 1, '2021-09-04', 190, 'Jordan 6 Retro', 'Air-Jordan-6-Retro-Bordeaux', 'Jordan 6 Retro Bordeaux', 'sneakers+jordan+air jordan+six+black/light graphite-dark grey-bordeaux+2021-09-04+190+ct8529-063');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('f6e0d0ac-af79-449a-907d-f3d64c1397b2', 'adidas', 'adidas Yeezy', 'Bone/Bone/Bone', 'New', 'CN', null, 'child', 'https://images.stockx.com/images/adidas-Yeezy-Slide-Bone-2022-Kids-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1666080823', 'Bone (2022) (Kids)', 1, '2022-05-31', 60, 'adidas Yeezy Slide', 'adidas-Yeezy-Slide-Bone-2022-Kids', 'adidas Yeezy Slide Bone (2022) (Kids)', 'sneakers+adidas+adidas+yeezy+slides+kids+bone/bone/bone+2022-05-31+60+fz5902');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('f75fabbb-2bb9-4fbc-a0ee-ff7ce34be745', 'Jordan', 'Air Jordan Six', 'British Khaki/Sail-Bright Crimson', 'New', 'CN', 'Travis Scott and Jordan Brand teamed up to deliver the Air Jordan 6 Retro Travis Scott British Khaki. The British Khaki marks the second time that Travis has added his touch to the Jordan 6 silhouette, the first being the 2019 Air Jordan 6 Travis Scott.<br><br>The upper of the Air Jordan 6 Retro Travis Scott British Khaki is made of British Khaki suede. From there, hits of Bright Crimson appear on the heel and tongue embroidered logos. The upper also has two cargo pockets: one with a snap enclosure on the lateral ankle and one with a zip enclosure on the medial ankle. A translucent tongue, heel tab, and outsole that glows in the dark adds the finishing touches to this latest Travis Scott Jordan. <br><br>The Air Jordan 6 Retro Travis Scott British Khaki released in April of 2021 and retailed for $250.', 'men', 'https://images.stockx.com/images/Air-Jordan-6-Retro-Travis-Scott-British-Khaki-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1620406101', 'Travis Scott British Khaki', 1, '2021-04-30', 250, 'Jordan 6 Retro', 'Air-Jordan-6-Retro-Travis-Scott-British-Khaki', 'Jordan 6 Retro Travis Scott British Khaki', 'sneakers+jordan+air jordan+six+collections-filter+nike-travis-scott+british khaki/sail-bright crimson+2021-04-30+250+dh0690-200');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('f7dcb00f-d0a0-4d47-b419-5022b1b84411', 'Jordan', 'Air Jordan One', 'Sail/Dark Mocha-Black-Black', 'New', 'CN', 'Jordan Brand continued their Black Toe design theme in 2020 and released the Jordan 1 High Dark Mocha, now available on StockX. The Dark Mocha 1 was one of the most anticipated releases in 2020 due to its familiar colorblocking that referenced two of the greatest Jordan 1s of all-time, the Jordan 1 Travis Scott and the Jordan 1 Black Toe.<br><br>The upper of the Jordan 1 High Dark Mocha features a Sail leather base with black leather surrounding the toe box and Mocha suede on the heel and ankle. A black leather Swoosh, Jordan Wings logo on the ankle, and Nike Air branding on the tongue pays homage to branding that can be found on the original 1985 Jordan 1. A Sail midsole and black outsole complete this Black Toe design.<br><br>The Jordan 1 High Dark Mocha released in October of 2020 and retailed for $175.<br><br>To shop all Air Jordan 1 shoes, <a href="https://stockx.com/retro-jordans/air-jordan-1">click here.</a> ', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Retro-High-Dark-Mocha-2-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1616187367', 'Dark Mocha', 1, '2020-10-31', 170, 'Jordan 1 Retro High', 'Air-Jordan-1-Retro-High-Dark-Mocha', 'Jordan 1 Retro High Dark Mocha', 'sneakers+jordan+air jordan+one+high+sail/dark mocha-black-black+2020-10-31+170+555088-105');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('f8b28796-6694-4bed-add6-08c7ac4af7b1', 'adidas', 'adidas Yeezy', 'MX Carbon/MX Carbon/MX Carbon', 'New', 'CN', 'The adidas Yeezy Foam RNR MX Carbon features a pink, yellow, purple, and dark grey marbled EVA foam and recycled algae construction with ventilation holes throughout the design. At the base, a sculptural sole adds cushioning and support. Please note that the pattern may vary.<br><br>The adidas Yeezy Foam RNR MX Carbon released in August of 2022 and retailed for $90.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-Foam-RNR-MX-Carbon-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1660201531', 'MX Carbon', 1, '2022-08-02', 90, 'adidas Yeezy Foam RNR', 'adidas-Yeezy-Foam-RNR-MX-Carbon', 'adidas Yeezy Foam RNR MX Carbon', 'sneakers+adidas+adidas+yeezy+foam rnnr+mx carbon/mx carbon/mx carbon+2022-08-02+90+ig9562');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('f8da50d8-4d7f-464f-ad52-1eb05c80d2d6', 'Nike', 'Air Max 90', 'White/White-White', 'New', 'CN', null, 'men', 'https://images.stockx.com/images/Nike-Air-Max-90-Leather-Triple-White-2020-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1617908962', 'Leather Triple White (2020)', 1, '2020-07-28', 130, 'Nike Air Max 90', 'Nike-Air-Max-90-Leather-Triple-White-2020', 'Nike Air Max 90 Leather Triple White (2020)', 'sneakers+nike+air max+90+white/white-white+2020-07-28+130+cz5594-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('f9602d3e-2ebc-41c9-881d-af50d0a1897f', 'Jordan', 'Air Jordan One', 'Black/University Red-Black-White', 'New', 'CN', 'The Air Jordan 1 Mid Banned (2020) takes the classic Banned colorway of the high-top Jordan 1 and applies it to the mid-cut sneaker. <br> <br>The Air Jordan 1 Mid Banned (2020) features full-grain black and red leather uppers. Similar to the original Air Jordan 1 Banned, hits of red leather on the toe, collar, heel, and Swoosh. The only difference from the original Banned colorway is the red leather around the eyelets. <br> <br>The Air Jordan 1 Mid Banned (2020) released in November 2021 for $110.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Banned-2020-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1606326136', 'Banned (2020)', 1, '2020-11-12', 115, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Banned-2020', 'Jordan 1 Mid Banned (2020)', 'sneakers+jordan+air jordan+one+mid+black/university red-black-white+2020-11-12+115+554724-074');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('f9ab8869-f5fe-4315-94ee-5cc3c9a1960d', 'Jordan', 'Air Jordan One', 'White/Gym Red/Black', 'New', 'CN', 'The Air Jordan 1 Low White Gym Red (Gradeschool) has the Air Jordan logo at the back and the Nike Swoosh on the side of the shoe, with the Jumpman logo on the upper front part of the shoe. <br> <br> The Air Jordan 1 Low White Gym Red (Gradeschool) has a combination of colors, including white, black, and gym red. The sneaker is white, with only sections of the sole and upper shoe being red. The Nike Swoosh is the only black bit of the shoe. <br> <br> The Air Jordan 1 Low White Gym Red (Gradeschool) was released on the 10th of May, 2021 at a retail price of $75.', 'child', 'https://images.stockx.com/images/Air-Jordan-1-Low-White-Gym-Red-GS.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1620850457', 'White Gym Red (GS)', 1, '2021-05-10', 75, 'Jordan 1 Low', 'Air-Jordan-1-Low-White-Gym-Red-GS', 'Jordan 1 Low White Gym Red (GS)', 'sneakers+jordan+air jordan+one+white/gym red/black+2021-05-10+75+553560-118');
