INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('fb4d029b-a2ef-4aca-911b-f9394055278c', 'Nike', 'Nike Dunk', 'White/Archeo Pink', 'New', 'ID', 'The women''s Nike Dunk Low Archeo Pink (W) features a white leather upper with Archeo Pink overlays and Swooshes. From there, a matching woven tongue label and sole completes the design.<br><br>The women''s Nike Dunk Low Archeo Pink (W) released in October of 2021 and retailed for $100.', 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Archeo-Pink-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1634921107', 'Archeo Pink (W)', 1, '2021-10-23', 100, 'Nike Dunk Low', 'Nike-Dunk-Low-Archeo-Pink-W', 'Nike Dunk Low Archeo Pink (W)', 'sneakers+nike+nike+dunk+low+white/archeo pink+2021-10-23+100+dd1503-111');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('fb84fe5b-cbc3-4ae2-b6fe-f024cf21263f', 'adidas', 'adidas Yeezy', 'Utility Black/Utility Black-Utility Black', 'New', 'VN', 'The adidas Yeezy 450 Utility Black is made of synthetic fibers, a product of a combination of petroleum-based ethylene-vinyl acetate and foam from algae.<br><br>The design of adidas Yeez 450 Utility Black is renowned for its comfortable, tight, sock-like fit as well as its fashionable mesh style. The shoe has a semitranslucent rubber outsole and thermoplastic polyurethane (TPU) for performance and flexibility. The design of adidas Yeezy 450 comes in Utility Black.<br><br>adidas Yeezy 450 Utility Black was released on February 8, 2022 at a retail price of $200.', 'men', 'https://images.stockx.com/images/adidas-Yeezy-450-Utility-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1665986952', 'Utility Black', 1, '2022-08-02', 200, 'adidas Yeezy 450', 'adidas-Yeezy-450-Utility-Black', 'adidas Yeezy 450 Utility Black', 'sneakers+adidas+adidas+yeezy+utility black/utility black-utility black+2022-08-02+200+h03665');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('fbf97967-1326-4bc5-b70a-b75a47190486', 'Nike', 'Air Force One', 'White/White-Cobalt Tint-White', 'New', 'CN', null, 'men', 'https://images.stockx.com/images/Nike-Air-Force-1-Low-Drake-Certified-Lover-Boy-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1667486313', 'Drake NOCTA Certified Lover Boy', 1, '2022-12-02', 160, 'Nike Air Force 1 Low', 'Nike-Air-Force-1-Low-Drake-Certified-Lover-Boy', 'Nike Air Force 1 Low Drake NOCTA Certified Lover Boy', 'sneakers+nike+air force+one+low+white/white-cobalt tint-white+2022-12-02+160+cz8065-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('fbfce2ba-eb7a-44cd-a0da-7932e3cd132f', 'Nike', 'Nike Dunk', 'Pale Ivory/Light Madder Root/Sail/Venice', 'New', 'CN', 'The Nike Dunk Low Disrupt 2 Pale Ivory (W) for women puts a twist on the usual monochromatic look with its signature Dunk Low Disrupt 2 layered design. <br><br>The Nike Dunk Low Disrupt 2 Pale Ivory (W) features a white canvas upper with beige suede overlays, featuring double eye stays and multiple lacing options. On the lateral side, Blue and brown stitching takes the form of the Swoosh, which wraps around the panels of the silhouette. Underfoot, a white midsole and a beige outsole crafted from recycled materials complete the silhouette. <br><br>The Nike Dunk Low Disrupt 2 Pale Ivory (W) was released in March 2022 and retailed for $110.', 'women', 'https://images.stockx.com/images/Nike-Dunk-Low-Disrupt-2-Pale-Ivory-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1645432145', 'Pale Ivory (W)', 1, '2022-03-30', 110, 'Nike Dunk Low Disrupt 2', 'Nike-Dunk-Low-Disrupt-2-Pale-Ivory-W', 'Nike Dunk Low Disrupt 2 Pale Ivory (W)', 'sneakers+nike+nike+dunk+low+pale ivory/light madder root/sail/venice+2022-03-30+110+dh4402-100');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('fc66ddfa-20c6-4cb9-ab85-6a9c89943388', 'Jordan', 'Air Jordan One', 'White/Black-Red', 'New', 'ID', 'The Air Jordan 1 Mid White Black Red 2022 is a Jordan Brand’s launch that looks like the 2018’s Air Jordan 1 Bred Toe.<br><br>The Air Jordan 1 Mid White Black Red 2022 has a white leather upper. Red accents are present in the collars, tongue, toe perforated toe box, and Swooshes. It also features black overlays, insole, lining, laces, rubber outsole, and Jumpman logo on the tongue. A winged logo on the collar and a white midsole complete the look.<br><br>This Air Jordan 1 Mid White Black Red 2022 debuted on 1st June 2022, retailing at $120.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Mid-White-Black-Red-2022-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1658500383', 'White Black Red (2022)', 1, '2022-06-01', 120, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-White-Black-Red-2022', 'Jordan 1 Mid White Black Red (2022)', 'sneakers+jordan+air jordan+one+white/black-red+2022-06-01+120+554724-079');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('fcfc0ab6-ecaf-4bfd-9af6-1a6cbb9addac', 'Jordan', 'Air Jordan One', 'Black/Bleached Coral-White-Grey Fog', 'New', 'CN', 'The Air Jordan 1 Low OG Bleached Coral features a white smooth leather and black cracked leather upper with vibrant Bleached Coral suede vamps and heel wraps. At the heel. A signature Jordan Wings logo nods to the very first Air Jordan logo that predates the Jumpman. From there, a white Air sole completes the design.<br><br>The Air Jordan 1 Low OG Bleached Coral Pack released in July of 2022 and retailed for $130.', 'men', 'https://images.stockx.com/images/Air-Jordan-1-Low-OG-Bleached-Coral-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1655965913', 'Bleached Coral', 1, '2022-07-02', 130, 'Jordan 1 Low OG', 'Air-Jordan-1-Low-OG-Bleached-Coral', 'Jordan 1 Low OG Bleached Coral', 'sneakers+jordan+air jordan+one+black/bleached coral-white-grey fog+2022-07-02+130+cz0790-061');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('fd0a9c99-cedf-430b-ab5d-1c9d0823fe7d', 'Jordan', 'Air Jordan One', 'Light Smoke Grey/Black-White', 'New', 'ID', 'The Air Jordan 1 Low Shadow Toe (GS) for grade schoolers has the classic Nike tread that is ideal for both casual walking and light exercise.<br><br>The Air Jordan 1 Low Shadow Toe (GS) for grade schoolers has a color scheme composed of different shades of black, white, and grey. The sole is a bright white with a thin stripe of grey at the very bottom. The upper part of the shoe is made of different pieces of leather, and the Nike swoosh symbol appears in black on the side.<br><br>The Air Jordan 1 Low Shadow Toe (GS) for grade schoolers for grade schoolers was first released in December 2021. The starting retail value at the time was $100.', 'child', 'https://images.stockx.com/images/Air-Jordan-1-Low-Shadow-Toe-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1654198757', 'Shadow Toe (GS)', 1, '2022-03-01', 90, 'Jordan 1 Low', 'Air-Jordan-1-Low-Shadow-Toe-GS', 'Jordan 1 Low Shadow Toe (GS)', 'sneakers+jordan+air jordan+one+light smoke grey/black-white+2022-03-01+90+553560-052');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('fd3959c2-23b3-44ba-bbe8-c6618b480a71', 'Nike', 'Nike Dunk', 'Sail/Neutral Grey-Black', 'New', 'VN', 'The Nike Dunk Low Certified Fresh is categorized under sporting sneakers in Nike’s broader range of shoes. A mixture of suede and canvas makes up the upper part of this sneaker.<br><br>The Nike Dunk Low Certified Fresh features a set of white laces. These laces run from the sneaker’s white mesh tongue towards the Nike tongue tag. The Nike tag on this sneaker comprises of two colors; orange and black colors.<br><br>Nike Dunk Low Certified Fresh features a white midsole and its outsole is made of grey rubber. This sneaker is expected to debut in the market in the Fall season of 2022 at a retail price of $120.', 'men', 'https://images.stockx.com/images/Nike-Dunk-Low-Certified-Fresh-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1659075235', 'Certified Fresh', 1, '2022-09-03', 120, 'Nike Dunk Low', 'Nike-Dunk-Low-Certified-Fresh', 'Nike Dunk Low Certified Fresh', 'sneakers+nike+nike+dunk+low+sail/neutral grey-black+2022-09-03+120+do9776-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('fee15e54-9fa5-4bf1-bc03-a5fb5bcab746', 'Nike', 'Air Max 98', 'Black/Black', 'New', 'VN', null, 'men', 'https://images.stockx.com/images/Nike-Air-Max-98-TL-Supreme-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1668408818', 'Supreme Black', 1, '2022-11-03', 168, 'Nike Air Max 98 TL', 'Nike-Air-Max-98-TL-Supreme-Black', 'Nike Air Max 98 TL Supreme Black', 'sneakers+nike+air max+98+black/black+2022-11-03+168+dr1033-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('ffa8a89b-f828-4994-a8b0-331add48c0e5', 'Nike', 'Air Max VaporMax', 'Black/Black-Black', 'New', 'CN', null, 'women', 'https://images.stockx.com/images/Nike-Air-VaporMax-Plus-SE-Black-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1622046038', 'Black (W)', 1, '2020-11-12', 200, 'Nike Air VaporMax Plus SE', 'Nike-Air-VaporMax-Plus-SE-Black-W', 'Nike Air VaporMax Plus SE Black (W)', 'sneakers+nike+air max+vapormax+black/black-black+2020-11-12+200+dh1063-001');
INSERT INTO projet.articles (shoeId, brand, category, colorway, `condition`, countryOfManufacture, description, gender, imageUrl, name, productCategory, releaseDate, retailPrice, shoe, shortDescription, title, tags) VALUES ('fffad50a-e8ff-4c14-a3d7-0f48ba65b869', 'Jordan', 'Air Jordan One', 'Metallic Gold/Black-White-Black', 'New', 'CN', 'Released in 2020, the Jordan 1 Mid Metallic Gold Black White offers a metallic gold look similar to the Air Jordan 1 High Pass The Torch. <br><br>The Jordan 1 Mid Metallic Gold Black features white leather vamp and quarter panels with patent leather metallic gold on the heels, ankle collar, toes, and eyestay overlays. A black iconic Nike Swoosh and the Jumpman on the white tongue add further branding. Black laces round out the overall look in this iteration of the Air Jordan 1. Another detail featured is a set of wing insignias that are located on each of the ankle overlays. <br><br>The Jordan 1 Mid Metallic Gold Black White released in November of 2020 for $100. ', 'child', 'https://images.stockx.com/images/Air-Jordan-1-Mid-Metallic-Gold-Black-White-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1609439352', 'Metallic Gold Black White (GS)', 1, '2020-11-30', 100, 'Jordan 1 Mid', 'Air-Jordan-1-Mid-Metallic-Gold-Black-White-GS', 'Jordan 1 Mid Metallic Gold Black White (GS)', 'sneakers+jordan+air jordan+one+metallic gold/black-white-black+2020-11-30+100+dc1420-700');
